(72784, 'itIT', 'Aiutare l\'Adunanza di Cobalto', 'Parla con Venthi nell\'Adunanza di Cobalto.', '$n, tempismo perfetto.\n\nHai sentito dell\'Adunanza di Cobalto? Una volta era un luogo magnifico in cui viveva la maggior parte dei miei simili.\n\nLa Fiamma Frammentata ci ha cacciati via e se ne è appropriata.\n\nAvevamo qualche speranza di riprendercela, ma le ultime notizie mostrano che stiamo combattendo una battaglia persa.\n\nPotresti prestarci il tuo aiuto? Incontrati con Venthi nell\'Adunanza di Cobalto, se puoi.', '', '', '', '', '', 'Parla con Venthi nell\'Adunanza di Cobalto', 47187),
(72783, 'itIT', 'Ordini d\'Artigianato', 'Parla con la Capa Cancelliera Mimzy Spruzzaroccia per saperne di più sugli Ordini d\'Artigianato.', 'Aggeggio interessante quello che hai ottenuto dal dispositivo dei Titani. Ora dammelo!\n\nScherzo! Non saprei cosa farci, tu hai qualche idea?\n\nVai a parlare con Mimzy Spruzzaroccia, ha tutto un complesso di gente che si occupa di cose chiamate \"Ordini d\'Artigianato\".\n\nTu porti i materiali, qualcuno li prende e ti ci crea qualcosa.\n\nSemplice, no? Vai a parlare con Mimzy per provare! Non dirle che ti mando io.', '', '', '', '', '', '', 47187),
(72773, 'itIT', 'Apprendere l\'ingegno', 'Incontra Greyzik Ditanere dentro a Valdrakken.', 'Ci sono alcuni Goblin dentro a Valdrakken che stanno investigando un dispositivo titanico abbandonato.\n\nSinceramente, stanno causando un certo disturbo. Alcuni temono che la loro investigazione causi più danni che altro.\n\nGli abitanti di Valdrakken ti sarebbero grati se potessi incontrarti con questi Goblin per trovare una soluzione alla loro investigazione.\n\nSenza distruggere parte della nostra città.', '', '', '', '', '', 'Incontra Greyzik Ditanere dentro a Valdrakken.', 47187),
