(72729, 'itIT', 'Il Grande Drospus', 'Porta la Moneta Arrugginita delle Isole al Grande Drospus nelle Pianure di Ohn\'ahra.', 'Una moneta particolare pescata nelle Isole dei Draghi.\n\nGirano voci tra gli altri pescatori di una creatura nelle Pianure di Ohn\'ahra che colleziona oggetti simili.', '', '', '', '', '', '', 47187),
(72728, 'itIT', 'Il mondo attende', 'Completa 10 missioni mondiali delle Isole dei Draghi.', 'Sai cos\'è segno di forza? Aiutare la comunità delle Isole dei Draghi!\n\nCi sono molti problemi da risolvere qui. Dimostrami quanto sei forte aiutando!', '', '', '', '', '', '', 47187),
(72709, 'itIT', 'Investire in una Caccia del Tesoro.', 'Acquista gli Appunti sul Manufatto dell\'Archeologo dalla Catalogatrice Jakes.', '<La Catalogatrice Jakes fruga rapidamente nella sua borsa di rifornimenti e tira fuori una mappa appena disegnata.>\n\nUno dei nostri archeologi ha appena comunicato delle scoperte riguardanti un manufatto perduto, dovrebbe trovarsi in questa zona.\n\nSe donerai quelle risorse alla prossima spedizione degli archeologi, potrai avere questa mappa per trovare un tesoro qui vicino.', '', '', '', '', '', '', 47187),
(72708, 'itIT', 'Rifornimenti delle Isole dei Draghi', 'Consegna la Borsa di Rifornimenti delle Isole dei Draghi alla Catalogatrice Jakes nel Ambasciata Riposo Alato.', '<Quel proto-drago deve aver rubato questa borsa di rifornimenti da qualche sfortunato membro della Spedizione delle Scaglie di Drago.>\n\n<La Catalogatrice Jakes all\'Ambasciata Riposo Alato saprà cosa farne.>', '', '', '', '', '', 'Consegna la Borsa di Rifornimenti delle Isole dei Draghi alla Catalogatrice Jakes nel Ambasciata Riposo Alato.', 47187),
