(72686, 'itIT', 'Eruzione della Tempesta', 'Sconfiggi le creature infuse elementalmente per ottenere Sovraccarico Elementale, mentre ti trovi in una Tempesta Elementale.', 'I Primalisti sono riusciti a evocare terribili Tempeste Elementali ovunque nelle Isole dei Draghi, $n.\n\nQuando una tempesta è attiva, raggiungila e uccidi le creature che ha infuso.\n\nDopodiché, recupera il Sovraccarico Elementale dai loro corpi. Ricorda, nemici più forti ti permetteranno di recuperare più Sovraccarico Elementale.\n\nNon possiamo permettere alla corruzione elementale dei Primalisti di diffondersi.', '', '', '', '', '', '', 47187),
