(72648, 'itIT', 'Scintille di vita: Vastità Azzurra', 'Ottieni $1oa Scintille di vita nelle Vastità Azzurra in modalità Guerra.', 'Le maree sono tornate, portando con loro una gran quantità di vita per la Vastità Azzurra.\n\nÈ tempo per gli amici, la famiglia, per il buon cibo e per creare nuove storie.', '', '', '', '', '', 'Parla con il Comandante sul Campo Bracith a Valdrakken.', 47187),
