(72585, 'itIT', 'Orientamento aperto', 'Completa la missione di Orientamento in ciascuno dei centri delle Fazioni Principali: Campo delle Scaglie di Drago, Maruukai, Iskaara e Valdrakken.', 'Hai fatto così tanto per le Isole dei Draghi, $geroe:eroina;.\n\nMolti sono grati per il tuo contributo e desiderano darti un vero benvenuto nelle loro comunità. Vai da loro, orientati con ciascun gruppo e scopri le loro specialità.\n\nScoprirai, ritengo, che le Isole dei Draghi hanno molto da offrirti come ricompensa per le tue gesta!', '', '', '', '', '', '', 47187),
(72584, 'itIT', 'Posizionare la propria rete', 'Posiziona una rete da pesca nella Zona di Pesca della Foce del Fiume.', 'Vuoi mettere alla prova la tua nuova rete? Dirigiti alla foce del fiume, a sud delle Sponde del Risveglio, e trova un luogo abbondante di pesce. Dovrebbe esserci un buon punto in cui posizionare una rete.', '', '', '', '', '', '', 47187),
