(72525, 'itIT', 'Equipaggiamento base da catalogazione', 'Usa il Kit di Forniture per la Spedizione in cerca di Equipaggiamento da Catalogazione.', 'Tutti i catalogatori della spedizione meritano una fotocamera personale!\n\nNon devi per forza darle un nome, ma te lo consiglio vivamente perché rende il tutto più divertente.\n\nA ogni modo, il Ricognitore Jeb dovrebbe poterti fornire tutto il necessario.\n\nNon ho ancora trovato una sola cosa che lui non si sia portato dietro, è incredibile!', '', '', '', '', '', '', 47187),
(72524, 'itIT', 'Equipaggiamento base da arrampicata', 'Usa il Kit di Forniture per la Spedizione in cerca di Equipaggiamento da Arrampicata.', '<Il Ricognitore Jeb fa un gesto in direzione del kit di forniture vicino a lui.>\n\nTi serviranno rifornimenti per sopravvivere là fuori.\n\nVediamo di procurarti qualcosa per l\'arrampicata.', '', '', '', '', '', '', 47187),
(72519, 'itIT', 'Sinduonia temporale', 'Usa il Cronocristallo su Eternus e Cromie ad Azmerloth per impedire che cadano attraverso il tempo.', 'Capisco, non stanno cadendo solamente attraverso il tempo, ma anche attraverso le possibilità.\n\nPresto, ho identificato un altro punto nella linea temporale in cui potremo fermarle. È... insolito, ma non lasciare che la stranezza di questo mondo ti rallenti. Il destino di Cronormu è nelle tue mani.', '', '', '', '', '', 'Torna da Nozdormu nel presente.', 47187),
(72512, 'itIT', 'Il sussurro della brezza', 'Avvicinati a Ohn\'ahra nel Nido di Ohn\'ahra.', '<Godoloto piega la testa con fare interrogativo, annuisce e ti guarda negli occhi. Dopo un lungo momento, alza gli occhi al cielo... e alla montagna a fianco di Maruukai. Senti che ti sta chiedendo di viaggiare sino al Nido di Ohn\'ahra.>', '', '', '', '', '', 'Avvicinati a Ohn\'ahra nel Nido di Ohn\'ahra.', 47187),
(72488, 'itIT', 'Giro avanzato di Thaldraszus', 'Affronta tutti i percorsi avanzati a Thaldraszus.', 'Torniamo nuovamente a Thaldraszus, con le sue vette e valli, e i suoi percorsi che aspettano solo di essere affrontati!\n\nRecati dai miei colleghi di bronzo per affrontare i percorsi avanzati e concludere il tuo giro delle Isole dei Draghi!', '', '', '', '', '', '', 47187),
(72487, 'itIT', 'Giro di Thaldraszus', 'Affronta tutti i percorsi di gara a Thaldraszus.', 'Thaldraszus ospita il Seggio degli Aspetti e molta della storia dei draghi.\n\nOspita anche altissime vette e profonde valli scoscese che attendono di essere sorvolate!\n\nCome sempre, i miei colleghi di bronzo hanno preparato dei percorsi di gara a Thaldraszus, da affrontare durante la tua esplorazione.\n\nPerché non ti metti alla prova e completi il tuo giro delle Isole dei Draghi?', '', '', '', '', '', '', 47187),
(72486, 'itIT', 'Giro avanzato della Vastità Azzurra', 'Affronta tutti i percorsi avanzati nella Vastità Azzurra.', 'I percorsi avanzati nella Vastità Azzurra sono disegnati per elevare le tue abilità di Volo Draconico a nuovi livelli!\n\nFai attenzione a non cadere però!\n\nQuando vuoi, trova i miei colleghi di bronzo e affronta quei percorsi!', '', '', '', '', '', '', 47187),
(72485, 'itIT', 'Giro della Vastità Azzurra', 'Affronta tutti i percorsi di gara nella Vastità Azzurra.', 'I percorsi della Vastità Azzurra offrono un\'esperienza unica. Le alte vette, il terreno innevato e le dense foreste presentano molti ostacoli interessanti, e molte sfide!\n\nMentre sei là, trova i miei colleghi di bronzo e fai una prova sui loro percorsi!', '', '', '', '', '', '', 47187),
(72484, 'itIT', 'Giro avanzato delle Pianure di Ohn\'ahra', 'Affronta tutti i percorsi avanzati nelle Pianure di Ohn\'ahra.', 'I percorsi avanzati sono più difficili, ma sicuramente nulla che tu non possa gestire!\n\nI miei colleghi di bronzo hanno preparato dei percorsi avanzati nelle Pianure di Ohn\'ahra, hanno qualche ostacolo e qualche sorpresa qua e là. Potrai persino battere il tuo miglior tempo!\n\nBuona fortuna!', '', '', '', '', '', '', 47187),
(72483, 'itIT', 'Giro delle Pianure di Ohn\'ahra', 'Affronta tutti i percorsi di gara nelle Pianure di Ohn\'ahra.', 'Ah, le Pianure di Ohn\'ahra. Grandi spazi aperti, forti venti, paesaggi infiniti... e altri percorsi di gara!\n\nCosì come nelle Sponde del Risveglio, se trovi i miei colleghi di bronzo, chiedigli dei loro percorsi di gara!', '', '', '', '', '', '', 47187),
(72482, 'itIT', 'Giro delle Sponde del Risveglio', 'Affronta tutti i percorsi avanzati nelle Sponde del Risveglio.', 'Ora che hai affrontato i percorsi di base nelle Isole dei Draghi, e dimostrato la tua abilità, che ne dici di una sfida?\n\nI percorsi di gara avanzati sono simili a quelli normali che hai affrontato, ma molti hanno tracciati di volo modificati e ostacoli aggiuntivi per metterti alla prova.\n\nIniziamo con i percorsi nelle Sponde del Risveglio!', '', '', '', '', '', '', 47187),
(72481, 'itIT', 'Il Giro delle Sponde del Risveglio', 'Affronta tutti i percorsi di gara nelle Sponde del Risveglio.', 'Qual è la parte più divertente del Volo Draconico? Le gare!\n\nI miei colleghi di bronzo hanno tracciato tutti i percorsi di gara nelle Isole dei Draghi. Il panorama e talmente vario e dinamico, che sembra fatto per essere esplorato a tutta velocità.\n\nSe dovessi trovarti nei paraggi di un percorso di gara nelle Sponde del Risveglio, perché non fare una prova?', '', '', '', '', '', '', 47187),
(72456, 'itIT', 'Tomi della fiducia', 'Recupera i volumi della Genealogia d\'Ossidiana e consegnali ai quartiermastri di Irathion e Sabellian.', 'Nonostante i bastioni superiori della Cittadella d\'Ossidiana siano in sicurezza, le forze dei Djaradin continuano a devastare il cortile. Ci sono dei registri storici inestimabili laggiù! Dobbiamo agire rapidamente per recuperare tutti i documenti riguardo la stirpe dello Stormo dei Draghi Neri.\n\nSia Irathion che Sabellian bramano queste informazioni, potresti ottenere il loro favore procurandogli un tomo ciascuno.\n\nRecati presso la torre crollata della cittadella, dovresti trovare qualcosa da recuperare.', '', '', '', '', '', '', 47187),
(72448, 'itIT', 'Garantire il nostro retaggio', 'Elimina due nemici rari nella Cittadella d\'Ossidiana o nell\'Acquitrino delle Scorie.', 'Non ho lavorato duramente per arrivare dove sono, solo per perdere la cittadella ora!\n\nSfortunatamente, sono emerse nuove minacce, posso contare sul tuo aiuto?\n\nAiuta a mettere in sicurezza questa zona. Trova ed elimina due dei nostri più potenti nemici.', '', '', '', '', '', '', 47187),
(72447, 'itIT', 'Il pericolo più grande', 'Elimina due nemici rari nella Cittadella d\'Ossidiana o nell\'Acquitrino delle Scorie.', 'Potenti Djaradin e altre creature minacciano sia la Cittadella d\'Ossidiana, che la sicurezza del mio stormo.\n\nNon può continuare così.\n\nAiuta a mettere in sicurezza l\'area. Cerca ed elimina due dei nostri più potenti nemici.', '', '', '', '', '', '', 47187),
(72435, 'itIT', 'Orientamento: Iskaara', 'Familiarizza con alcuni venditori di merci pregiate.', 'Ti do il benvenuto a Iskaara, $gamico:amica;.\n\nSi sono già diffuse voci tra la nostra gente delle tue gesta alla conca. Hai già incontrato molti di noi, e molti altri vorrebbero scambiare qualche conoscenza e merce con te.\n\nTi prego, prenditi un attimo per familiarizzare con i visi amici di Iskaara. Siamo una comunità basata sul supporto reciproco. Tu hai molto da offrirci, ma anche noi abbiamo molto da offrire a te in cambio.', '', '', '', '', '', '', 47187),
(72434, 'itIT', 'Anello del Tempio della Vita di Rubino', 'Completa la corsa Anello del Tempio della Vita di Rubino.', 'Dicono che non sono abbastanza grande per volare in alcune di queste corse.\n\nPerò posso guardare gli altri. Dovresti correre! Così potrò guardare te!', '', '', '', '', '', 'Completa la corsa Anello del Tempio della Vita di Rubino.', 47187),
(72429, 'itIT', 'Orientamento: Maruukai', 'Incontra il Custode della Fama e il Quartiermastro della Fama a Maruukai.', '<Okir traduce i segni della Khan Sansok in voce.>\n\nI Maruuk non sono gente che detesta gli stranieri, ma chiediamo ai potenziali alleati di mostrare il proprio valore. Incontrando i clan e aiutandoci nelle nostre imprese, si diffonderanno le voci sul tuo sostegno.\n\nAl livello più basso del krutal sulla collina, troverai una delle figlie del Khanam Matra, lei può aiutarti a comprendere la tua posizione con la nostra gente. Assicurati di presentarti.', '', '', '', '', '', '', 47187),
(72428, 'itIT', 'Drospo Cornuto: l\'accumulatore seriale', 'Raccogli 20 Gemme Acri dai drospi cornuti delle Isole dei Draghi per Gnoklin Spirastrana della Spedizione delle Scaglie di Drago.', 'Non è un segreto che i drospi cornuti di queste terre siano affascinati dalle gemme, dai gioielli e da tutto ciò che luccica. Giusto l\'altro giorno ho trovato un gioiello molto raro in alcuni escrementi di drospo cornuto!\n\nBeh, potrà non essere un lavoro piacevole, ma sembra che i drospi cornuti non solo collezionino oggetti di valore, ma li mangino.', '', '', '', '', '', '', 47187),
(72427, 'itIT', 'Infusione vivace', 'Raccogli 13 Foglie Spinose dalle Piante Sferzanti delle Isole dei Draghi per Dhurrel del Clan Centauro Maruuk.', 'Ho una semplice richiesta da farti oggi.\n\nGli alchimisti sono a corto di un ingrediente usato in un intruglio particolarmente complicato. Si tratta di un\'erba semplice da reperire, dovrai solamente trovare delle piante aggressive e prendere dei campioni. Pensi di farcela?', '', '', '', '', '', '', 47187),
(72423, 'itIT', 'Affrontare la tempesta', 'Recupera 12 Armamenti della Tempesta dai Centauri Nokhud delle Isole dei Draghi per Temnaayu dei Tuskarr di Iskaara.', 'Ah, eccoti qui, appena in tempo! Abbiamo scoperto che i Centauri Nokhud hanno delle armi molto potenti, infuse con incantamenti della tempesta. Vorremmo portarne alcuni esempi ai nostri incantatori, per poterli studiare.\n\nSe non altro, potremmo disattivare le armi e farne un uso migliore.', '', '', '', '', '', '', 47187),
(72410, 'itIT', 'Aghi e chele', 'Ottieni 10 Chele Appuntite dalle Falcidi delle Isole dei Draghi per Gnoklin Spirastrana della Spedizione delle Scaglie di Drago.', 'Ultimamente, siamo a corto di aghi per la sartoria. Quei maledetti continuano a spezzarsi!\n\nPotrebbero essere sostituiti da alcune parti appuntite prese dalle Falcidi che si trovano in quest\'area.', '', '', '', '', '', '', 47187),
(72406, 'itIT', 'Orientamento: Valdrakken', 'Incontra gli importanti fornitori dell\'Accordo a Valdrakken.', 'Ti do il benvenuto a Valdrakken, $p. Io sono Unatos, Custode della Fama per l\'Accordo di Valdrakken.\n\nCome riconoscimento del tuo aiuto verso gli Stormi dei Draghi, diversi fornitori di questa città sono stati autorizzati a renderti disponibili le loro merci migliori.\n\nPerché non ti prendi del tempo per familiarizzare con la loro posizione e le loro merci?', '', '', '', '', '', '', 47187),
(72399, 'itIT', 'Il giardino dell\'eremita', 'Parla con Szareth alla Cresta dell\'Ombra.', 'I nostri genitori dicono sempre che non dobbiamo visitare i giardini sopra Gelikyr, pensano sia pericoloso parlare con l\'eremita che se ne prende cura.\n\nNon è vero però! Sarà anche irritabile, ma non fa paura!\n\nNessuno di noi è andato lassù da quando sono arrivati i Primalisti, è troppo pericoloso. Ad ogni modo, spero che l\'eremita stia bene, potresti andare a controllare dal momento che noi non possiamo?', '', '', '', '', '', '', 47187),
(72397, 'itIT', 'Orientamento: Campo delle Scaglie di Drago', 'Incontra gli importanti fornitori al Campo delle Scaglie di Drago.', 'Ti do il benvenuto al campo, $p.\n\nCi è voluto un po\' sia per me che per Toddy, ma abbiamo deciso il luogo perfetto per stabilire il campo. Non potevamo scegliere di meglio.\n\nFacile accesso alle rovine, zona di riproduzione dei proto-draghi, e poi gli Stormi dei Draghi...\n\nPerché non ti prendi qualche minuto per guardarti attorno e incontrare alcuni dei fornitori che danno una mano alla spedizione?', '', '', '', '', '', 'Incontra Toddy Baffetta nella tenda al Campo delle Scaglie di Drago.', 47187),
