(72380, 'itIT', 'Insieme siamo imbattibili', 'Torna al Seggio degli Aspetti e informa Alexstrasza di ciò che è successo dopo la sconfitta di Raszageth nelle Segrete delle Incarnazioni.', '$n, devi informare Alexstrasza e Nozdormu di ciò che è successo qui.\n\nKhadgar e io ti rivedremo per un attimo al Seggio degli Aspetti.', '', '', '', '', '', 'Torna da Alexstrasza la Protettrice della Vita al Seggio degli Aspetti presso Valdrakken.', 47187),
(72374, 'itIT', 'Aiutare l\'Accordo: Forte del Flagello dei Draghi', 'Viaggia verso le Sponde del Risveglio e assedia il Forte del Flagello dei Draghi. Continua a impegnarti nell\'aiutare l\'Accordo di Valdrakken e i loro alleati nelle Isole dei Draghi.', 'I nostri alleati richiedono nuovamente la tua assistenza mentre aiutiamo le isole. A Valdrakken, gira voce che le tue gesta portano conforto e il tuo impegno ha aiutato a formare il nostro futuro.\n\nOra, passiamo al dovere.\n\nLa minaccia dei Djaradin si muove verso le Sponde del Risveglio, nelle ardenti profondità infernali del Forte del Flagello dei Draghi. Dobbiamo muoverci per bloccare la loro avanzata.\n\nAttendiamo il tuo ritorno, $n.', '', '', '', '', '', '', 47187),
(72373, 'itIT', 'Aiutare l\'Accordo: la caccia è aperta', 'Aiuta i Maruuk in una caccia nelle Isole dei Draghi. Continua a impegnarti nell\'aiutare l\'Accordo di Valdrakken e i loro alleati nelle Isole dei Draghi.', 'I nostri alleati nelle Pianure di Ohn\'ahra hanno inviato una richiesta di aiuto a tutti coloro che cacciano in queste terre.\n\nMentre continui ad aiutare queste isole, fai visita ai nostri alleati presso uno dei loro accampamenti di caccia e assistili con i loro problemi.\n\nC\'è molto da fare, meglio non perdere tempo.', '', '', '', '', '', '', 47187),
