(72354, 'itIT', 'La Gran Banca', 'Ottieni un pezzo di bottino dalla Gran Banca.', 'Nel corso degli anni, gli Aspetti e i loro simili hanno acquisito molti manufatti e armamenti degni di nota. Gli Aspetti hanno ordinato la costruzione di una cripta incantata in cui contenere e proteggere questi oggetti, fino al giorno in cui un\'anima degna verrà a cercarli.\n\nTroverai questa Gran Banca tra le mura della banca. Forse, se dimostrerai il tuo valore, potrai avere un pezzo dell\'antico tesoro degli Aspetti.', '', '', '', '', '', '', 47187),
