(72293, 'itIT', 'All\'avventura sulle Isole dei Draghi.', 'Osserva la Mappa d\'Esplorazione per scegliere un\'area da aiutare nelle Isole dei Draghi.', 'Oh, so cosa puoi fare!\n\nLa Spedizione delle Scaglie di Drago ha affisso una gran bella mappa delle Isole dei Draghi qui vicino.\n\nI loro disegni sono molto accurati e dettagliati, se posso dire la mia. Scusa, non sei qui per le mie opinioni sull\'arte.\n\nDovresti dare un\'occhiata per vedere quali aree delle Isole dei Draghi hanno bisogno del tuo aiuto!', '', '', '', '', '', '', 47187),
(72292, 'itIT', 'Storia di una Vittoria Spettacolare', 'Racconta la storia della tua vittoria all\'Anziana Poa a Iskaara.', 'Che scontro maestoso!\n\nAll\'Anziana Poa a Iskaara piacerebbe ascoltare la storia di quella vittoria impressionante.', '', '', '', '', '', '', 47187),
(72291, 'itIT', 'Storia di una Vittoria Memorabile', 'Racconta la storia della tua vittoria all\'Anziana Poa a Iskaara.', 'Che bello scontro!\n\nL\'Anziana Poa a Iskaara sarebbe interessata ad ascoltare la storia di quella vittoria.', '', '', '', '', '', '', 47187),
