(72269, 'itIT', 'Thaldraszus', 'Raggiungi Valdrakken e incontrati con Alexstrasza la Protettrice della Vita.', 'Alexstrasza la Protettrice della Vita sta organizzando un incontro con il Seggio degli Aspetti per discutere della minaccia Primalista.\n\nHa lanciato un appello a tutti gli avventurieri desiderosi di aiutare.', '', '', '', '', '', 'Raggiungi Valdrakken e incontrati con Alexstrasza la Protettrice della Vita.', 47187),
(72268, 'itIT', 'Vastità Azzurra', 'Parla con Masud il Saggio nelle Pianure di Ohn\'ahra.', 'Il Kirin Tor ha bisogno di tutto l\'aiuto possibile per trovare la Pietra del Giuramento dei Draghi Blu.\n\nAlcuni dei loro maghi sono stati visti nelle Pianure di Ohn\'ahra in cerca di aiuto.', '', '', '', '', '', '', 47187),
(72267, 'itIT', 'Pianure di Ohn\'ahra', 'Incontra l\'Ambasciatore Taurasza all\'Avamposto delle Scaglie di Rubino.', 'Lo Stormo dei Draghi Verdi ha bisogno di aiuto dagli avventurieri. Per fare ciò, dovrai allearti con i Centauri delle pianure.\n\nL\'Ambasciatore Taurasza può aiutarti.', '', '', '', '', '', '', 47187),
(72266, 'itIT', 'Le Sponde del Risveglio', 'Incontra Sendrax alle Sponde del Risveglio.', 'Il draconide Sendrax sta cercando aiuto per assistere i nuovi arrivati alle Sponde del Risveglio.', '', '', '', '', '', '', 47187),
(72263, 'itIT', 'La cavalleria ha il suo posto', 'Impara a cavalcare il tuo Vorquin personale.', '$gEvocatore:Evocatrice;! Qui ci sono ancora mandrie intere di Vorquin!\n\nNe ho radunati alcuni, potrebbero esserti utili come cavalcatura quando avrai le ali stanche. Ti ricordi come si cavalca?\n\nQuesto è per te, dato che il Comandante delle Scaglie ti sta inviando un po\' ovunque. Prenditene cura.', '', '', '', '', '', '', 47187),
(72261, 'itIT', 'Più che una semplice prigione?', 'Porta il Manufatto delle Segrete Antico a Lillian Chiaraluna.', '<L\'antico manufatto sembra di natura elementale. Lillian Chiaraluna a Valdrakken potrebbe dirti di più.>', '', '', '', '', '', '', 47187),
