(72256, 'itIT', 'Gli Artigli Oscuri', 'Consegna gli ordini del Comandante delle Scaglie a Kodethi e agli Artigli Oscuri.', 'Naleidea è entusiasta, ma è una storica, non un soldato. Non sa niente dei pericoli che affronteremo nelle Isole dei Draghi.\n\nNon che ci sia da preoccuparsi. Dopotutto, la spedizione è protetta dagli Artigli Oscuri.\n\nDiscuterò della logistica con Ebissian e i vostri capi dell\'Orda.\n\nKodethi, il mio luogotenente, sta esplorando la città con gli altri Dracthyr. Sii un buon soldato e informalo che ci incontreremo alla Torre degli Zeppelin. Lui comunicherà i miei ordini agli altri.', '', '', '', '', '', 'Incontra Naleidea alla Torre degli Zeppelin fuori Orgrimmar.', 47187),
(72254, 'itIT', 'Il fantasma del Pescatore Tinnak', '', '', '', '', '', '', '', '', 47187),
(72253, 'itIT', 'Pesca delle Isole dei Draghi', '', '', '', '', '', '', '', '', 47187),
(72252, 'itIT', 'Pesca delle Isole dei Draghi', '', '', '', '', '', '', '', '', 47187),
(72251, 'itIT', 'Cucina delle Isole dei Draghi', '', '', '', '', '', '', '', '', 47187),
(72250, 'itIT', 'Cucina delle Isole dei Draghi', '', '', '', '', '', '', '', '', 47187),
(72249, 'itIT', 'Sartoria delle Isole dei Draghi', '', '', '', '', '', '', '', '', 47187),
(72247, 'itIT', 'Oreficeria delle Isole dei Draghi', '', '', '', '', '', '', '', '', 47187),
(72246, 'itIT', 'Sogni sereni', 'Parla con il Gestore della Spa.', 'Ti do il benvenuto alla Spa Sogni Sereni!\n\nDevo scusarmi, non possiamo accettare nuovi ospiti in questo momento a causa di circostanze fuori dal nostro controllo!\n\nLascia che ti indirizzi verso il Gestore della Spa, Xijan Zampa Spina. Lui è qualificato per rispondere a qualsiasi tua domanda.', '', '', '', '', '', '', 47187),
(72245, 'itIT', 'Alchimia delle Isole dei Draghi', '', '', '', '', '', '', '', '', 47187),
(72244, 'itIT', 'Runografia delle Isole dei Draghi', '', '', '', '', '', '', '', 'Parla con Jessamine Spitz all\'Ambasciata Riposo Alato.', 47187),
(72243, 'itIT', 'Erbalismo delle Isole dei Draghi', '', '', '', '', '', '', '', '', 47187),
(72242, 'itIT', 'Ingegneria delle Isole dei Draghi', '', '', '', '', '', '', '', '', 47187),
(72241, 'itIT', 'Una lezione dal nostro passato', 'Parla con la Comandante delle Scaglie Bracithal.', 'Io sono Bracithal, una Comandante delle Scaglie dei Dracthyr. Irathion ci ha aiutati dopo il nostro risveglio dalla stasi e ora è il mio turno di aiutarlo.\n\nSenza dubbio avrai delle domande sulla mia gente e sulla nostra storia. Fino a poco tempo fa, le avevo anche io.\n\nMa Nozdormu, l\'Eterno, ha rivelato molte verità perdute sui Dracthyr. Mi ha concesso una visione sulle nostre origini e sul motivo del nostro confinamento.\n\nLascia che te ne parli.', '', '', '', '', '', '', 47187),
(72240, 'itIT', 'I Custodi d\'Ossidiana', 'Consegna gli ordini del Comandante delle Scaglie a Dervishian e ai Custodi d\'Ossidiana.', 'L\'entusiasmo di Toddy è ammirevole. Ma spero non le impedisca di vedere i pericoli che ci attendono nelle Isole dei Draghi.\n\nAd ogni modo, i Custodi d\'Ossidiana hanno giurato di proteggere la spedizione.\n\nDevo parlare con Irathion e il Ser Comandante della missione che ci aspetta.\n\nGli altri Dracthyr stanno esplorando la città. Trova Dervishian, la mia fidata luogotenente, e informala che ci incontreremo al porto. Lei lo comunicherà agli altri.', '', '', '', '', '', 'Riferisci la notizia del tuo successo a Toddy Baffetta presso il Porto di Roccavento.', 47187),
(72193, 'itIT', 'L\'Accademia di Algeth\'ar', 'Fai un giro dell\'Accademia di Algeth\'ar.', 'Ho saputo che l\'Accademia di Algeth\'ar è nuovamente aperta al mondo.\n\nMolto tempo fa, le sacre sale ospitavano solo i draghi, ma negli ultimi anni, la Preside ha saggiamente deciso di aprire le porte a tutti coloro che desiderano imparare. Mi ha chiesto di raccomandarle qualsiasi studente promettente.\n\nCome grande $galleato:alleata; dei dragoidi, sarebbe un onore se volessi frequentare la nostra grande accademia. Lascio a te la decisione di iscriverti, ma sicuramente Doragosa sarebbe felice di farti fare un giro guidato.', '', '', '', '', '', '', 47187),
(72192, 'itIT', 'Sale dell\'Infusione: Entropia su ordinazione', 'Entra nelle Sale dell\'Infusione e sconfiggi lo Tsunami Primordiale.', 'I Primalisti desiderano riportare il caos elementale in questo mondo e non sono disposti a fermarsi davanti a nulla.\n\nHo ricevuto notizie inquietanti: pare si siano infiltrati nelle Sale dell\'Infusione, in profondità sotto al Forte di Tyr. Stanno tentando di distruggere le creazioni del Guardiano Tyr per i loro malvagi scopi.\n\nPer favore, devi porre fine a qualsiasi minaccia primalista all\'interno delle sacre sale, $n.', '', '', '', '', '', '', 47187),
(72191, 'itIT', 'Ricompense per scarse provviste', '', '', '', '', '', '', '', '', 47187),
(72190, 'itIT', 'Riserve del bacino', 'Trova Zuttiki.', '$C! Conosco qualcuno che ha un terribile bisogno delle tue abilità.\n\nIl Bacino del Forte di Tyr è stato attaccato dai Primalisti. Io ho avuto la possibilità di fuggire, ma temo che gli altri non siano stati altrettanto fortunati.\n\nSi trova a nord. Trova Zuttiki, lei sarà in grado di spiegarti i dettagli.\n\nSempre che sia ancora viva.', '', '', '', '', '', '', 47187),
(72189, 'itIT', 'Varietà di giardino', 'Parla con Gryrmpech.', 'Ti stai godendo il giardino delle farfalle?\n\nSai, c\'è un giardino molto più grande a sud. Un vecchio draconide di nome Gryrmpech se ne prende cura.\n\nPotrebbero fargli comodo un altro paio di braccia. Ha un \"assistente\", ma non l\'ho mai visto, non penso sia di grande aiuto.\n\nSe ti capita di passarci, fagli sapere che è stata Xina a mandarti.', '', '', '', '', '', '', 47187);
