(72175, 'itIT', 'Un passatempo scettr-acolare', 'Crea $1oa Scettro dello Spettacolo: Fuoco e $2oa Scettro dello Spettacolo: Aria per Soragosa a Valdrakken.', 'Ci sono ordini interessanti questa settimana! Gli studenti dell\'Accademia di Algeth\'ar darebbero un corno della testa per questi divertenti scettri.\n\nPerché non aiuti a crearne alcuni?', '', '', '', '', '', '', 47187),
(72172, 'itIT', 'Essenza, frammenti e Polvere Cromatica', 'Crea $1oa Polvere Cromatica per Soragosa a Valdrakken.', 'Abbiamo costante bisogno di componenti di base. Essenza, frammenti... le nostre scorte di Polvere Cromatica sono quasi sempre esaurite.\n\nSe potessi aiutarci a fare rifornimento, forse potremmo finalmente far passare più di un giorno tra un rifornimento e l\'altro.', '', '', '', '', '', '', 47187),
(72171, 'itIT', 'Dimostrazione di forza in solitaria', 'Completa 12 round in Mischia Solitaria.', 'La tua smania di trovare conflitti senza il mio aiuto mi piace. Se sei $gcerto:certa; delle tue abilità, me ne starò qui a guardare, per divertimento.\n\nVediamo cos\'hai da dimostrare. Poi torna da me.', '', '', '', '', '', '', 47187),
(72168, 'itIT', 'Dimostrazione di forza nelle schermaglie', 'Ottieni Punti Onore dalle Schermaglie in arena.', 'Sei $gcerto:certa; delle tue abilità tattiche, eh? Mi hanno detto che voi mortali tenete delle piccole schermaglie tra di voi. Vai e affronta qualche rivale.\n\nVediamo cos\'hai da dimostrare. Poi torna da me.', '', '', '', '', '', '', 47187),
(72167, 'itIT', 'Dimostrazione di forza in guerra', 'Ottieni Punti Onore nei Campi di battaglia epici.', 'Vuoi una \"vera sfida\", non è così? E sia. So di alcuni conflitti su larga scala che potrebbero rivelarsi una sfida persino per me.\n\nNon aspetto altro che vederti fallire... provare, intendo. Vediamo cos\'hai da dimostrarmi.', '', '', '', '', '', '', 47187),
(72166, 'itIT', 'Dimostrazione di forza in battaglia', 'Ottieni Punti Onore nei Campi di battaglia casuali.', 'Voi mortali amate litigare per qualsiasi territorio troviate. Sarete accontentati-\n\nIn un modo o nell\'altro, sarà ugualmente interessante. Per me, s\'intende. Vediamo quanto sei $gbravo:brava; a \"dimostrare il tuo valore\".', '', '', '', '', '', '', 47187),
(72159, 'itIT', 'Chi le scende e chi le scaglie', 'Raccogli $1oa Pelli di Scaglie Lucide per Ralathor il Robusto a Valdrakken.', 'Le scaglie hanno una miriade di usi, offrono protezione, ma in alcuni casi forniscono anche una superficie riflettente. Molti dei nostri migliori specchi sono scaglie.\n\nQuegli specchi sono anche molto richiesti. Raccogli alcune pelli di scaglie per me e condividerò con te alcune delle mie tecniche segrete.', '', '', '', '', '', '', 47187),
(72157, 'itIT', 'Il peso della terra', 'Raccogli $1oa Terra Stimolante per Sekita lo Scavaterra a Valdrakken.', 'Ho un ordine per svariate centinaia di tonnellate di Lega Fusa Primordiale, ma ho finito la Terra Stimolante. So che si tratta di un lavoro faticoso, ma ti pagherò di conseguenza!', '', '', '', '', '', '', 47187),
(72154, 'itIT', 'Skag il Lanciatore', '', '', '', '', '', '', '', '', 47187),
(72137, 'itIT', 'Questione di cuccioli', '', '', '', '', '', '', '', '', 47187),
(72135, 'itIT', 'Neltharus: segreti nascosti', 'Vai a Neltharus e recupera $1oa Appunti di Neltharion, $2oa Diari di Ossidiana e un Tomo della Ricerca.', 'Abbiamo un problema. I Djaradin sono emersi per la prima volta da Neltharus, il che significa che stavano saccheggiando le sale!\n\nNeltharus contiene molti tesori, ma soprattutto contiene conoscenze inestimabili. La storia della nostra fuga, la caduta in disgrazia... Sia Sabellian che Irathion si sono dedicati a cercare ulteriori informazioni sulla vita e sul lavoro di Neltharion.\n\nOra vai e vedi cosa puoi recuperare, prima che i Djaradin saccheggino tutto!', '', '', '', '', '', '', 47187),
(72134, 'itIT', 'All\'avventura sulle isole', 'Usa la Mappa d\'Esplorazione per scegliere la tua prima zona.', 'Abbiamo scoperto che ci sono molti problemi nelle terre su cui fluttuiamo, le Isole Disperse.\n\nNoi faremo il possibile da qui, ma voglio che tu dia un\'occhiata alla mappa delle zone circostanti per scoprire chi puoi aiutare per primo.', '', '', '', '', '', '', 47187),
(72131, 'itIT', 'Eccesso di scorte', '', '', '', '', '', '', '', '', 47187),
(72130, 'itIT', 'Grifone dimenticato', '', '', '', '', '', '', '', '', 47187),
(72129, 'itIT', 'Aiutare Khadgar', 'Incontra Khadgar nella Cittadella Violacea a Dalaran.', 'Ti do il benvenuto a Dalaran, $n. Sono felice che tu ce l\'abbia fatta.\n\nVieni a parlarmi alla Cittadella Violacea. C\'è molto da fare.', '', '', '', '', '', 'Incontra Khadgar nella Cittadella Violacea a Dalaran.', 47187),
(72128, 'itIT', 'Enkine il Vorace', '', '', '', '', '', '', '', '', 47187),
(72127, 'itIT', 'Capitana Lanciera', '', '', '', '', '', '', '', '', 47187),
(72126, 'itIT', 'Slurpo, l\'Incredibile Lumaca', '', '', '', '', '', '', '', '', 47187),
(72122, 'itIT', 'Un paio di ecologi in meno', 'Cerca gli ecologi ribelli.', 'I feriti sono stabili, ma c\'è qualcosa che mi turba,$n.\n\nUn paio di ecologi draghibestia erano venuti all\'avamposto per studiare le paludi. Da quando c\'è stato l\'attacco non li ho più visti, e la cosa mi preoccupa.\n\nSe ti stai avventurando là fuori, ti dispiacerebbe cercarli e assicurarti che stiano bene?\n\nE fai attenzione: si dice che le paludi siano infestate dai Gorloc.', '', '', '', '', '', '', 47187),
(72121, 'itIT', 'Il Grande Shellkhan', '', '', '', '', '', '', '', '', 47187),
(72117, 'itIT', 'Scambio culturale', '', '', '', '', '', '', '', '', 47187),
(72116, 'itIT', 'Liskron l\'Abbagliante', '', '', '', '', '', '', '', '', 47187),
(72114, 'itIT', 'Acrosoth', '', '', '', '', '', '', '', '', 47187),
(72113, 'itIT', 'Forme oltre il velo', '', '', '', '', '', '', '', '', 47187),
(72090, 'itIT', 'Sventare il piano dei Primalisti', '', '', '', '', '', '', '', '', 47187),
(72089, 'itIT', 'Si va all\'Osservatorio della Vetta', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(72083, 'itIT', 'La mia esca fortunata', 'Recupera l\'Esca Fortunata del Capitano Haab.', 'Mi trovi giù di morale, $R, e non è perché sono morto.\n\nSono morto durante la caccia, assicurandomi che la bestia che mi ha ucciso non potesse uccidere più nessuno. Va bene così, è ciò che avrebbe voluto mio babbo.\n\nNo, il problema è che il combattimento è finito in un pareggio!\n\nLo spirito della bestia è ancora là fuori, proprio come me. Ma, essendo un fantasma, non posso nemmeno rivendicare la mia esca fortunata dalle creature che mi hanno mangiucchiato!\n\nTi dispiacerebbe aiutarmi? Così potremmo fare un altro tentativo.', '', '', '', '', '', '', 47187),
(72079, 'itIT', 'Banchetto della Comunità', '', '', '', '', '', '', '', '', 47187),
(72075, 'itIT', 'Scorta bollente', 'Raccogli dei pesci per rifornire la zona di pesca e sali sul draco per farli cadere dall\'alto.', 'Dovrebbero abboccare più pesci, non credi?\n\nEhi, mi è venuta un\'idea. La leggenda dice che questi laghi di lava non sono sempre stati pieni di pesci amanti del caldo. Si racconta che questi buchi si siano riempiti di pesci quando i draghi hanno deciso di alzarsi in volo e farceli cadere dentro! Riesci a crederci?\n\nForse tu e il tuo draco potreste provare?', '', '', '', '', '', '', 47187),
(72072, 'itIT', 'Rifornimenti di pesce nelle Fonti dei Draghi', 'Raccogli dei pesci per rifornire la zona di pesca e sali sul draco per farli cadere dall\'alto.', 'Dovrebbero abboccare più pesci, non credi?\n\nEhi, mi è venuta un\'idea. La leggenda dice che questi laghi e questi fiumi non sono sempre stati pescosi. Si racconta che questi buchi si sono riempiti di pesci quando i draghi hanno deciso di alzarsi in volo e farceli cadere dentro! Riesci a crederci?\n\nForse tu e il tuo draco potreste provare?', '', '', '', '', '', '', 47187),
(72071, 'itIT', 'Secondo round, si pesca!', 'Uccidi Mochoby.', 'Che ne dici di pescare un po\', $n?\n\nQuella stupida bestia viene attirata da un banco di pesci al largo. Succede ogni volta che il banco si riunisce... Vorrebbe mangiarseli tutti, peccato che sia morta!\n\nNuota là fuori e agita un po\' l\'esca. Magari fai finta di essere una foca ferita! La bestia non saprà resistere.', '', 'Un terrore delle profondità.\n\nLa caccia del Capitano Haab li ha visti perire entrambi, ma neanche la morte ha raffreddato la sua sete di vendetta.', 'Mochoby', '', '', '', 47187),
(72068, 'itIT', 'Aiutare l\'Accordo: un banchetto per tutti', 'Viaggia verso Iskaara nella Vastità Azzurra e partecipa al Banchetto della Comunità. Prosegui nei tuoi sforzi per aiutare l\'Accordo di Valdrakken e i loro alleati nelle Isole dei Draghi.', 'I nostri alleati hanno bisogno del tuo aiuto, $n!\n\nI tuoi sforzi nelle isole non sono passati inosservati. I nostri fidati alleati a sud, i Tuskarr di Iskaara, vogliono celebrare i tuoi traguardi con un enorme banchetto!\n\nIntraprendi il viaggio verso le terre di Iskaara, continuando il tuo lavoro al fianco degli alleati dell\'Accordo. Una volta raggiunte le brillanti acque delle terre a sud, non esitare a partecipare alle celebrazioni!', '', '', '', '', '', '', 47187),
(72067, 'itIT', 'Tempo di rilassarsi!', 'Dirigiti alla Spa Sogni Sereni.', 'Ehi, tu!\n\nHai l\'aria stanca. Esausta. Hai un estremo bisogno di riposo e relax! La Spa Sogni Sereni è il posto per te!\n\nGoditi le nostre nuove classi di yoga, sono FANTASTICHE! O forse una maschera facciale di fango è più nel tuo stile? Le consiglio vivamente entrambe!\n\nPer raggiungere la spa, dirigiti a nord, appena fuori dalla città!', '', '', '', '', '', '', 47187),
(72063, 'itIT', 'Riporta la Barca Giocattolo a Yennu', 'Riporta la Barca Giocattolo a Yennu, che si trova nei paraggi.', 'È la Barca Giocattolo di Yennu. Sarà felice di riaverla...', '', '', '', '', '', '', 47187),
(72061, 'itIT', 'Invocatempeste Veldra', '', '', '', '', '', '', '', '', 47187),
(72060, 'itIT', 'Trattamento speciale', 'Riporta gli occhiali da sole a Zeldis. Di nuovo.', '<La maschera di fango sembra incuriosita dalle tue intenzioni, ma non ha modo di fuggire dal ramo!>', '', '', '', '', '', '', 47187),
(72058, 'itIT', 'Cosa abbiamo qui: Tarolekk', '', '', '', '', '', '', '', '', 47187),
