(72008, 'itIT', 'Conquistare la montagna: Krolkoth', '', '', '', '', '', '', '', '', 47187),
(71242, 'itIT', 'Sostenere i ricercatori delle tempeste', 'Porta l\'Aggregato di Sovraccarico Elementale a un ricercatore a Valdrakken.', 'Questo sembra un grosso ammasso di potere traboccante proveniente dalle creature all\'interno della Tempesta Primalista.\n\nCi sarà sicuramente un ricercatore a Valdrakken che lo vorrà.', '', '', '', '', '', '', 47187),
(71241, 'itIT', 'Qui, quo, trappola', 'Prepara le trappole del Clan Aylaag nella Valle Primordiale.', 'Il bosco chiamato Valle Primordiale è ricco di magia dei draghi antichi. Là si trova un tipo di vivolpe la cui pelliccia è considerata pregiata dai miei simili, ma sono creature sfuggenti e difficili da trovare.\n\nAnziché cercarle a caso, puoi utilizzare alcune delle nostre trappole che si trovano in quella zona. Procurati della carne dagli uccelli marini vicini per preparare le trappole e invierò alcuni membri del clan per recuperare ciò che viene catturato.', '', '', '', '', '', '', 47187),
(71239, 'itIT', 'Persa nel blu', 'Trova Harleen Cinguetti nelle Alture dei Piumablu.', 'Mi serve un favore e tu sembri $gil tipo:la tipa; che fa al caso mio.\n\nDovevo incontrarmi in città con una mia vecchia amica, Harleen Cinguetti, qualche giorno fa. Stavamo pensando di farci una scorpacciata al Banchetto di Rubino, una spuntatina dal barbiere e poi fare visita a quella sciccosa Casa d\'Aste che hanno qui.\n\nMa non si è presentata. Si perde spesso nel lavoro, ma mi sentirei molto più a mio agio sapendo dove si trova.\n\nProva alle montagne a sud, aveva detto che ci sarebbe passata lungo la strada per venire qui.', '', '', '', '', '', '', 47187),
(71238, 'itIT', 'Banchetto di Rubino!', 'Parla con gli Chef Rumiastrasza e Bocconacciuolo al Banchetto di Rubino.', 'Attenzione! A tutti gli aspiranti gastronomi!\n\nIl vostro cuore brama i sapori più intensi di questo mondo? Desiderate intraprendere un\'esplorazione grandiosa? Siete disposti a rischiare la vita e gli arti per dei perfetti estranei?\n\nSe vi ritrovate in questa descrizione, venite a parlare con l\'eminente e illustre duo di chef noti in tutto il mondo, Rumiastrasza e Bocconacciuolo! Al momento, stiamo organizzando il Banchetto di Rubino nella città di Valdrakken.', '', '', '', '', '', '', 47187),
(71235, 'itIT', 'Maghi da campo', 'Controlla come stanno i Maghi del Kirin Tor vicino al Fosso delle Vivolpi nella Vastità Azzurra.', 'Lok\'tar, $R.\n\nSe hai tempo, qui vicino ci sono due maghi che stanno lavorando sul campo. Penso gli serva una mano!\n\nViviamo in una terra pericolosa...\n\nOra in particolare.', '', '', '', '', '', '', 47187),
(71234, 'itIT', 'Interessi di nicchia', 'Visita la Nicchia del Baleniere nella Vastità Azzurra.', 'Ehi tu, $R.\n\nHai l\'aria di una persona che ha viaggiato molto.\n\nMio cugino Wayun stava tornando con il pescato dalla Nicchia del Baleniere e ha detto di aver notato degli strani tizi che hanno messo su un accampamento.\n\nSembra che si stiano comportando bene, ma... ti dispiacerebbe controllare come sta Wayun?\n\nSa essere un po\' scorbutico.', '', '', '', '', '', '', 47187),
(71233, 'itIT', 'Cascata d\'acqua', 'Parla con Willa presso la Vedetta Tre Cascate nella Vastità Azzurra.', 'Adoro le cascate.\n\nSai cosa c\'è meglio di una cascata?\n\nDue cascate!\n\nE l\'unica cosa meglio di quella è... Be\', dai un\'occhiata alle Tre Cascate a ovest e vedrai!\n\nIl locandiere lì è piuttosto gentile.', '', '', '', '', '', '', 47187),
(71232, 'itIT', 'Fama delle Isole dei Draghi', 'Parla con Therazal a Valdrakken.', 'C\'è ancora molto da fare per aiutare le Isole dei Draghi.\n\nTi chiedo di parlare con Therazal, lui possiede molte informazioni riguardanti coloro che hanno bisogno di aiuto in queste terre.', '', '', '', '', '', 'Parla con Therazal a Valdrakken.', 47187),
(71231, 'itIT', 'Chiamata alla caccia', 'Parla con l\'Istruttore Frodrum nelle Pianure di Ohn\'ahra.', '<Roki ti consegna un messaggio.>\n\n$n, il Clan Shikaar ti invita a partecipare alla Grande Caccia. Incontra l\'Istruttore Frodrum nelle Pianure di Ohn\'ahra.', '', '', '', '', '', '', 47187),
(71230, 'itIT', 'Equipaggiamento da Pesca dei Tuskarr', 'Parla con Tavio a Iskaara nella Vastità Azzurra.', 'Salve di nuovo, $n.\n\n<Rowie si guarda attorno canticchiando.>\n\nAh, giusto! Tavio mi stava creando una nuova rete e ha detto che può farne una anche per te. Può creare anche altri attrezzi da pesca, se le porti i materiali.\n\nDovresti andare a parlarle.', '', '', '', '', '', '', 47187),
(71229, 'itIT', 'Chiamata delle pianure', 'Parla con la Khan Hadari nelle Pianure di Ohn\'ahra.', '<Roki ti consegna un messaggio.>\n\n$n, il Clan Aylaag ha sentito storie delle tue grandi gesta. Ti invitiamo a incontrarci per apprendere le nostre usanze.\n\nKhan Hadari', '', '', '', '', '', '', 47187),
(71227, 'itIT', 'Sfide Aeree', 'Parla con un Custode del Tempo Bronzeo per conoscere le Sfide Aeree.', '<Planalino sbatte le ali con entusiasmo, facendo cadere un roditore bruciacchiato ai tuoi piedi.>\n\nCavalcadraghi! La tua abilità nel volo è ormai ben nota. Vieni a metterla alla prova nelle Sfide Aeree in tutte le Isole dei Draghi.\n\nParla con qualsiasi Custode del Tempo Bronzeo per iniziare.', '', '', '', '', '', '', 47187),
(71226, 'itIT', 'Uccidi lumache delle rocce', 'Uccidi $1oa Conigli della Rovina nella Piazza d\'Addestramento.', 'Aiuto! Questi coniglietti mi stanno divorando! Ti prego, uccidili prima che ci uccidano tutti!', '', '', '', '', '', '', 47187),
(71225, 'itIT', 'Portato dal vento: Rhuzast', '', '', '', '', '', '', '', '', 47187),
(71219, 'itIT', 'Vigilante ribelle', 'Trova la Vigilante Alvi.', 'Sembra che ultimamente alcuni dei nostri Vigilanti più giovani si siano impigriti e abbiano trascurato i loro compiti.\n\nLa Vigilante Nori mi ha chiesto di controllare la sua sorellina Alvi, che si trova all\'ingresso del Passaggio del Tempo. A quanto pare, le sue recenti prestazioni sono state ben poco soddisfacenti.\n\nSe dirigendoti a est dovessi incappare nella Vigilante Alvi, ricordale l\'importanza del suo ruolo e falle sapere che sua sorella è piuttosto preoccupata per lei.', '', '', '', '', '', '', 47187),
(71212, 'itIT', 'Attaccare i Felcepelle', '', '', '', '', '', '', '', '', 47187),
(71210, 'itIT', 'Al Forte del Flagello dei Draghi!', 'Raggiungi le Sponde del Risveglio e unisciti agli Esiliati d\'Ossidiana nell\'Assedio al Forte del Flagello dei Draghi.', '<Planalino fa cadere una nota leggermente bruciacchiata nella tua mano.>\n\n$n, gli Esiliati d\'Ossidiana hanno sentito parlare del tuo coraggio. La nostra vecchia dimora, il Forte del Flagello dei Draghi, è caduto nelle mani dei Djaradin. Non possiamo restare a guardare. Unisciti a noi e aiutaci a riconquistare il nostro territorio.\n\n- Boss', '', '', '', '', '', '', 47187),
(71209, 'itIT', 'Bestia delle pianure', 'Accetta le Redini di Lizi.', 'Credo che Lizi sia pronta a tornare una bestia delle pianure. È così amichevole con noi adesso, ma è chiaro che voglia tornare nel suo ambiente.\n\nUn giorno, quando farò parte dei Saggi del Vento, esplorerò tutto il mondo oltre queste fonti. Ma prima, il mio esame per iniziati! Come passa il tempo.\n\nHo creato una sella e delle redini dalla lana che hai raccolto. Lizi sarà felice di rispondere alla tua chiamata.\n\nTi prego, portala con te durante le tue avventure, $p.', '', '', '', '', '', '', 47187),
(71206, 'itIT', 'Occhio della Prole Tempestosa', 'Sconfiggi Buferamu in uno scontro tra mascotte.', '', '', '', '', '', '', '', 47187),
(71205, 'itIT', 'Idrotuskarr', '', '', '', '', '', '', '', '', 47187),
(71202, 'itIT', 'Mini mischia del Demone del Mana', 'Sconfiggi Arcantus in uno scontro tra mascotte.', '', '', '', '', '', '', '', 47187),
(71199, 'itIT', 'Domare uno spinatonante', '', '', '', '', '', '', '', '', 47187),
(71198, 'itIT', 'Domare uno spinatonante', '', '', '', '', '', '', '', '', 47187),
(71197, 'itIT', 'Domare uno spinatonante', '', '', '', '', '', '', '', '', 47187),
(71196, 'itIT', 'Domare uno spinatonante', 'Ottieni $1oa Fluido Fluorescente dagli insetti delle Isole dei Draghi e $2oa Rifornimenti delle Isole dei Draghi.', 'Sono così felice che Lizi sia al sicuro con noi!\n\nTuttavia, le sue ferite guariscono più lentamente del previsto. Spero che la magia che le è stata inflitta non abbia causato danni permanenti...\n\nPotresti aiutarmi a raccogliere un po\' di icore dagli insetti? Lo so, sembra disgustoso! In realtà è un ingrediente base in molti unguenti curativi.', '', '', '', '', '', '', 47187),
(71195, 'itIT', 'Domare uno spinatonante', 'Ottieni il Curry Verde di Meluun alle Sorgenti degli Ohn\'ir e $2oa Rifornimenti delle Isole dei Draghi.', 'Direi che questo è il nuovo posto preferito di Lizi. Non sembra più interessata a tornare a casa. Dopotutto, è una creatura selvaggia.\n\nDevo dirtelo... non ho parlato con Meluun da quando abbiamo salvato Lizi. So che aveva ragione, ma non so come avvicinarla. Non sembra approvare ciò che faccio. So che devo concentrarmi di più sul mio addestramento.\n\nMeluun fa un ottimo curry che Lizi amerebbe alla follia! Potresti chiederle di prepararlo? Di solito lavora alla casa dell\'Ohn a ovest delle sorgenti.', '', '', '', '', '', '', 47187),
(71194, 'itIT', 'Rane di fuoco', 'Insegna ai puntacorno che la Birra di Ghiaccio va evitata.', 'Ho trovato il punto perfetto per una rete da pesca, c\'è un problema però... i puntacorno. Sicuramente distruggeranno le reti non appena ci allontaneremo. Cosa possiamo fare?\n\nHo un\'idea: trattiamo le nostre reti da pesca nella lava con la Birra di Ghiaccio per renderle resistenti al calore; una volta fatto ciò, sarà sufficiente convincere quei puntacorno a stare lontani dall\'odore.\n\nLancia una fiasca di Birra di Ghiaccio a un puntacorno e poi feriscilo. Assicurati di non ucciderlo, altrimenti non imparerà nulla.', '', '', '', '', '', '', 47187),
(71193, 'itIT', 'Minaccia subacquea', 'Usa 5 Conchiglie Inquietanti nella Zona di Pesca del Forte di Tyr per evocare l\'enorme bestia marina e riporta una prova della sua sconfitta.', 'L\'hai visto? Sott\'acqua! Un enorme bestia corazzata e affamata! Non ci penso nemmeno ad avvicinarmi all\'acqua con la mia rete, finché quel mostro si nasconde lì sotto. Se vuoi, credo che potresti facilmente attirarlo fuori con una manciata di Conchiglie Inquietanti. Dovrebbero essere facili da pescare.', '', '', '', '', '', '', 47187),
(71192, 'itIT', 'Controllo dei predatori', 'Posiziona le effigi spaventose.', 'Salve, $gamico mio:amica mia;!\n\nSono in cerca di un buon posto nei paraggi dove poter piazzare delle reti da pesca, ma sembra che ci siano troppi vagabondi qui attorno che si stanno mangiando quasi tutti i pesciolini prima che possano crescere.\n\nHo creato alcune effigi per spaventare alcuni di quei famelici pennuti, così si potrà mantenere un\'abbondanza di pesce nelle Fonti dei Draghi.\n\nPotresti aiutarmi a posizionarle?', '', '', '', '', '', '', 47187),
(71191, 'itIT', 'Rete di valore', 'Recupera la Rete del Pescatore Burbero dai buchi nel ghiaccio nella Vastità Azzurra.', 'Purtroppo, la mia rete da pesca è stata portata via dalla corrente. <Sospira.> Non sono molto interessato a usare le canne da pesca come i miei amici...\nSe ti capitasse di trovare la mia rete da pesca in giro, riportamela.', '', '', '', '', '', '', 47187),
(71182, 'itIT', 'Archivisti ribelli', 'Incontra Sindragosa nell\'archivio superiore degli Archivi Azzurri.', 'Tu, Dracthyr.\n\nDue dei tuoi simili stanno setacciando gli archivi a sud di qui. Devo ancora presentarmi e apprezzerei molto la compagnia.\n\nSe hai tempo, posso incontrarti nell\'archivio superiore.', '', '', '', '', '', '', 47187),
(71179, 'itIT', 'Posa lo sguardo al promontorio', 'Parla con il Comandante Thadezus al Promontorio di Gelikyr.', '$n, ho un altro compito per te.\n\nCi sono stati rapporti sulla presenza dei Primalisti, vicino all\'Avamposto di Gelikyr, che minacciano il nostro controllo sul Forte di Tyr.\n\nParla con il Comandante Thadezus e scopri come puoi aiutare.', '', '', '', '', '', 'Parla con il Comandante Thadezus al Promontorio di Gelikyr.', 47187),
(71178, 'itIT', 'Portale: Santuario Ombroso', 'Trova il Portale Dormiente al Santuario Ombroso nelle Pianure di Ohn\'ahra.', 'Dalla spedizione ci segnalano la presenza di una pietra dormiente sulle lussureggianti colline a sud-ovest. È un po\' lontano, ma vale la pena mandare qualcuno con le tue conoscenze a indagare.', '', '', '', '', '', '', 47187),
(71166, 'itIT', 'La più antica libellula', 'Sconfiggi Drospo in uno scontro tra mascotte', '', '', '', '', '', '', '', 47187),
(71165, 'itIT', 'Portale: Frangia di Eon', 'Trova il Portale Dormiente alla Frangia di Eon, a Thaldraszus.', 'Molto lontano da qui, nella regione montuosa di Thaldraszus, si trova una piccola locanda annidata nel fianco della montagna. Appena oltre l\'ingresso, si trova una pietra dormiente.\n\nCosa ne dici? $gPronto:Pronta; per un\'avventura, $n?', '', '', '', '', '', '', 47187),
(71162, 'itIT', 'Portale: Algeth\'era', 'Trova il Portale Dormiente in cima alla guglia ad Algeth\'era, a Thaldraszus.', 'Un\'altra pietra, un\'altra guglia.\n\nSarà meglio che ti avvii, questa è bella lontana. Anche il viaggio è pericoloso! Almeno così dicono quelli che l\'hanno trovata.\n\nPensi di farcela?', '', '', '', '', '', '', 47187),
(71161, 'itIT', 'Portale: Vakthros', 'Trova il Portale Dormiente in cima alla guglia a Vakthros, nella Vastità Azzurra.', 'È arrivato un rapporto riguardante un\'altra di quelle pietre dormienti nella regione fredda a sud-est.\n\nOra, prima che ti faccia prendere dall\'emozione, sappi che non si trova in un luogo in cui la gente va di solito, ma se hai voglia d\'avventura, e forse di morire, questo fa per te!\n\nTi ho $gconvinto:convinta;? Bene.\n\nMetti degli indumenti caldi, dirigiti a est finché il vento gelato non ti solletica le narici, poi continua oltre. Saprai di esserci quando respirare si sarà fatto difficile e ti geleranno persino le ossa.', '', '', '', '', '', '', 47187),
(71160, 'itIT', 'Carica di profondità', '', '', '', '', '', '', '', '', 47187),
(71157, 'itIT', 'Portale: Osservatorio della Vetta', 'Trova il Portale Dormiente all\'Osservatorio della Vetta nelle Sponde del Risveglio.', 'Le voci tra i nostri esploratori a nord dicono ci sia un\'altra di quelle pietre in alto sulla cima a nord-est.\n\nHo sentito che è piuttosto difficile da raggiungere visto che sta così in alto, ma sicuramente troverai un modo!', '', '', '', '', '', '', 47187),
(71155, 'itIT', 'Le Cripte Azzurre', 'Ferma la Fiamma Frammentata nelle Cripte Azzurre.', 'Abbiamo un problema, $n.\n\nSotto gli Archivi Azzurri si trova la Cripta Azzurra, dove ho conservato molte cose importanti e pericolose durante tutto l\'arco della mia vita.\n\nUn gruppo della Fiamma Frammentata si è introdotto nel deposito: devono essere convinti che nasconda qualche segreto.\n\nTi prego, devi andare lì e fermare l\'intrusione, prima che quei tizi scatenino dei pericoli che non possono comprendere.\n\nNon hanno idea di cosa ci sia lì dentro!', '', '', '', '', '', '', 47187),
(71154, 'itIT', 'Lancio dell\'artiglio: fondamenti di tiro', '', '', '', '', '', '', '', '', 47187),
(71153, 'itIT', 'Missioni mondiali, Obiettivi bonus e Scenari, Santo cielo', 'Completa 3 missioni mondiali dei Tortolliani.', 'Aiuta i Tortolliani completando 3 missioni mondiali.', '', '', '', '', '', 'Torna da Kojo il Collezionista.', 47187),
(71152, 'itIT', 'Si torna nella Sala Principale', 'Incontra Toddy nella Sala Principale.', 'Ora che abbiamo accesso alle console, dovremmo riuscire a superare quella barriera.\n\nCi vediamo nella Sala Principale. Ce la faremo!', '', '', '', '', '', '', 47187),
(71151, 'itIT', 'Esplorazione prolungata dei portali', 'Incontra Thaelin Forgiacupa all\'Avamposto delle Scaglie di Rubino nelle Sponde del Risveglio.', '<La lettera è pulita, nitida e porta il sigillo della Spedizione delle Scaglie di Drago.>\n\n<Thaelin Forgiacupa richiede la tua presenza.>', '', '', '', '', '', '', 47187),
(71150, 'itIT', 'Esplorazione prolungata dei portali', 'Incontra Thaelin Forgiacupa all\'Avamposto delle Scaglie di Rubino nelle Sponde del Risveglio.', '<La pergamena emana uno sgradevole odore di muffa. Dopo aver cercato con difficoltà di ritrovare la concentrazione, ti rendi conto che Thaelin ha bisogno del tuoi aiuto per trovare risposte alle sue recenti scoperte.>\n\n<L\'unica domanda che resta è cosa fare di questa pergamena dall\'odore insopportabile.>', '', '', '', '', '', '', 47187),
(71149, 'itIT', 'Esplorazione prolungata dei portali', 'Incontra Thaelin Forgiacupa all\'Avamposto delle Scaglie di Rubino nelle Sponde del Risveglio.', '<Stranamente, il messaggero non ti ha lasciato un sacchetto o una nota stavolta, ma un singolo oggetto della collezione personale di Thaelin.>\n\n<Dopo averlo esaminato, ti accorgi che si tratta di un minuscolo messaggio di Thaelin, in cui chiede nuovamente il tuo aiuto.>', '', '', '', '', '', '', 47187),
(71148, 'itIT', 'Esplorazione prolungata dei portali', 'Incontra Thaelin Forgiacupa all\'Avamposto delle Scaglie di Rubino nelle Sponde del Risveglio.', '<La curiosa creatura davanti a te ti porge una nota, firmata e sigillata dalla Spedizione delle Scaglie di Drago.>\n\n<Sarà una richiesta d\'aiuto da un famoso esploratore, magari.>', '', '', '', '', '', '', 47187),
(71146, 'itIT', 'Esplorazione prolungata dei portali', 'Incontra Thaelin Forgiacupa all\'Avamposto delle Scaglie di Rubino nelle Sponde del Risveglio.', '<L\'apprendista esploratore ti consegna un biglietto arrotolato. Osservandolo, sembra inviato da un vecchio amico, Thaelin Forgiacupa, in cerca di aiuto.>\n\n<Prima di allontanarsi, la bestiolina allunga una zampa, come in attesa di un bocconcino. Poco dopo, lancia un grido, allontanandosi in fretta e furia a mani vuote.>', '', '', '', '', '', '', 47187),
(71145, 'itIT', 'Il Gran Maestro', 'Sconfiggi Patchu in uno scontro tra mascotte.', '', '', '', '', '', '', '', 47187),
(71144, 'itIT', 'Assassinare l\'Alleanza', 'Uccidi 10 membri dell\'Alleanza senza mai morire con una taglia sulla tua testa.', 'Sì! Così! Continua a uccidere quei cani dell\'Alleanza!\n\nUccidine ancora qualcuno e diventerai $gil:la; migliore, $C.\n\nNon sarà facile, però, perché l\'Alleanza ha messo una taglia sulla tua testa, quindi fai attenzione!\n\nPer l\'Orda!', '', '', '', '', '', '', 47187),
(71143, 'itIT', 'Assassinare l\'Orda', 'Uccidi 10 membri dell\'Orda senza mai morire con una taglia sulla tua testa.', 'Sì! Non mollare, $gsoldato:soldata;!\n\nUccidi ancora qualche membro dell\'Orda ed entrerai negli annali dell\'Alleanza.\n\nMa non sarà facile, perché l\'Orda ha messo una taglia sulla tua testa, quindi fai attenzione!\n\nPer l\'Alleanza!', '', '', '', '', '', '', 47187),
(71141, 'itIT', 'Branchie e faccia tosta', 'Uccidi Gurblbrblr, l\'Invasore all\'Accampamento Gocciapicco.', 'Kad\'irsza è sconsiderata, ma conosce i suoi granchi. I Gorloc hanno davvero esagerato!\n\nHo notato che andavano da Gurblbrblr, che sta ordinando loro di fare prigionieri i granchi. Non possiamo permettere vada avanti così, per l\'equilibrio della vita e per la sicurezza di coloro che se ne prendono cura.\n\nSconfiggi Gurblbrblr. Elimina i mezzi che vogliono impiegare per espandersi oltre questo fiume!', '', 'Gorloc di dimensioni ridicole? Esistono sicuramente.', 'Gurblbrblr, l\'Invasore', '', '', '', 47187),
(71140, 'itIT', 'Due più due', 'Sconfiggi Bakhushek in uno scontro tra mascotte.', '', '', '', '', '', '', '', 47187),
(71139, 'itIT', 'Gioiello Arcano Luminoso', 'Porta il Gioiello Arcano Luminoso a Noriko l\'Onnisciente all\'Accampamento Antonidas.', '<Questo gioiello sembra potente, ma ha un bagliore sinistro.>\n\n<Forse è meglio consegnarlo al Kirin Tor perché lo riponga in un posto sicuro.>', '', '', '', '', '', 'Porta il Gioiello Arcano Luminoso a Noriko l\'Onnisciente all\'Accampamento Antonidas.', 47187),
(71138, 'itIT', 'Portale: Approdo di Rusza\'thar', 'Trova il Portale Dormiente all\'Approdo di Rusza\'thar nelle Pianure di Ohn\'ahra.', 'Un membro della spedizione ha riferito di una pietra dormiente avvistata in cima a un belvedere nelle Pianure di Ohn\'ahra.\n\nTi va un\'avventura?', '', '', '', '', '', '', 47187),
(71135, 'itIT', 'Questioni in sospeso', 'Affronta Gelomorso nell\'Accampamento dei Mantonevoso nella Vastità Azzurra.', 'Se c\'è qualcosa che ho imparato dal tempo trascorso nella natura selvaggia, è che il male va affrontato quando lo si trova. Se non gli spezzi le ossa e se non lo sradichi alla radice, continuerà a crescere e sarà più difficile da uccidere.\n\nQueste montagne erano piagate dall\'esistenza di Gelomorso sin da quando ero un cucciolo come te, e diventerà peggio quando avrà preso il controllo della tribù Mantonevoso.\n\nAvrei dovuto fare qualcosa a riguardo molto tempo fa, ma siamo gli unici a poter rimediare a quell\'errore ora.', '', 'È ora di porre fine al crudele regno di Gelomorso.', 'Gelomorso', '', '', '', 47187),
(71097, 'itIT', 'Un artiglio di aiuto', 'Attiva il manufatto nella torre sopra l\'Adunanza di Cobalto e tieni d\'occhio il comportamento di Venderthvan.', 'Bene, hai caricato il manufatto. Attiviamolo!\n\nE smettila di guardarmi così. Non far finta di non voler vedere se funziona.\n\nScuotilo nuovamente, allontanati e lasciami finire il lavoro.', '', '', '', '', '', '', 47187),
(71096, 'itIT', 'È proprio un artiglio', 'Cerca di attivare il manufatto.', '<Venderthven si strofina gli occhi e geme per il dolore.>\n\nVa bene. Se non me lo dai, dovrai capire per conto tuo come funziona.\n\nTe lo prenderò appena avrai finito. Con la forza, se necessario.\n\nForza. Prova a scuoterlo.', '', '', '', '', '', '', 47187),
(71095, 'itIT', 'Un artiglio in difficoltà', 'Chiedi a Venderthvan come puoi aiutarlo e fai ciò che dice.', 'Vediamo cosa possiamo fare per aiutare questo poveretto!\n\n<Heleth si avvicina e sussurra.>\n\nNon preoccuparti, non lasceremo che rubi o che combini qualche guaio. Divertiamoci un po\'!\n\nÈ passato molto tempo da quando qualcuno è venuto qui a trovarci. Una noia MORTALE!\n\n<Heleth ti fa l\'occhiolino.>\n\nPerché non gli chiedi cosa vuole?', '', '', '', '', '', '', 47187),
(71094, 'itIT', 'Sempre pronti ad aiutare!', 'Trova delle bende nella torre sopra l\'Adunanza di Cobalto per curare Venderthvan.', 'Salve!\n\nAnche tu sei qui per aiutare? Hai un\'aria volenterosa!\n\n<Heleth indica il Dracthyr ferito.>\n\nSi è fatto male all\'ala cercando di volare fin quassù! Sembra uno di quei brutti ceffi di sotto, ma non ho paura di lui! Lo aiuterò comunque, perché è così che facciamo da queste parti!\n\n<Heleth gonfia il petto.> \n\nMi occuperò di lui mentre tu vai a cercare delle bende!', '', '', '', '', '', '', 47187),
(71093, 'itIT', 'Retaggio di Tyr: segreti del passato', 'Entra a Uldaman: Eredità di Tyr nelle Maleterre e recupera il disco.', 'Per impedire a Raszageth di liberare le altre Incarnazioni, il potere degli Aspetti deve essere ripristinato.\n\nPurtroppo, i Titani sono piuttosto occupati e il Guardiano Tyr è morto da tempo.\n\nLa regina Alexstrasza ha suggerito un piano: nel cuore delle Maleterre si trova una struttura titanica chiamata Uldaman. A quanto pare, gli alleati di Tyr potrebbero aver nascosto lì un disco contenente i suoi ricordi.\n\nSi dice che il posto sia stato invaso dai Trogg. Raduna i tuoi alleati e dirigiti verso Uldaman; recupera il disco nel nome della Regina dei Draghi!', '', '', '', '', '', '', 47187),
