(71029, 'itIT', 'Tattiche di caccia: addestramento del compagno', 'Seleziona un\'ulteriore abilità compagno da usare nella Grande Caccia.', 'La tua Fama con i Maruuk cresce nuovamente. Per il tuo impegno, ti insegnerò a comandare il tuo compagno di caccia più efficacemente durante il combattimento.', '', '', '', '', '', '', 47187),
(71028, 'itIT', 'Tattiche di caccia: Benedizione di Ohn\'ahra', 'Seleziona una Benedizione di Ohn\'ahra da usare nella Grande Caccia.', 'La tua Fama con i Maruuk cresce. Ascolta attentamente e ti insegnerò come invocare la Benedizione di Ohn\'ahra per proteggere te e i tuoi alleati.', '', '', '', '', '', '', 47187),
(71027, 'itIT', 'RICERCATO: Mara\'nar il Tonante', 'Uccidi Mara\'nar il Tonante nella Valle Primordiale e recupera una delle sue placche.', 'Serve un potente cacciatore per abbattere una bestia furiosa!\n\nUn sauro del tuono di nome Mara\'nar il Tonante si è fatto strada dal Bosco degli Spinatonante sino alla Valle Primordiale, stravolgendo la fauna locale. Ha elettrificato l\'acqua, abbattuto alberi e distrutto nidi di anatre.\n\nQuesta minaccia dev\'essere fermata. Uccidilo e porta una delle sue placche a Jebotai della Guardia del Khan come prova.\n\nChe Ohn\'ahra ti guidi.', '', 'Stravolgendo la fauna locale della Valle Primordiale, questa bestia ha distrutto un nido di anatre di troppo.', 'Mara\'nar il Tonante', '', '', '', 47187),
(71026, 'itIT', 'Contro ogni avversità', 'Uccidi 25 giocatori dell\'Orda di livello 70 nelle Isole dei Draghi.', 'Nonostante voi patetici mortali abbiate raggiunto una tregua, ho sentito che alcuni di voi covano ancora del risentimento.\n\nSe raggruppi qualche amico, so di un posto in cui puoi mostrare a quegli altri chi è che comanda.\n\nE, per renderla più interessante, se vinci avrai un premio.', '', '', '', '', '', '', 47187),
(71024, 'itIT', 'Caos e scompiglio', 'Aiuta Erima a indagare sull\'incidente al piano terra del Seggio degli Aspetti.', '$n! Hai sentito il baccano? C\'è stato un incidente al piano inferiore.\n\nUno dei miei fidati investigatori, Erima, è stato il primo sulla scena. Avrà bisogno del tuo aiuto per recuperare le prove, mentre tenta di interrogare la folla.', '', '', '', '', '', '', 47187),
(71023, 'itIT', 'Popolare con l\'Accordo di Valdrakken', 'Parla con Unatos a Valdrakken.', 'Le tue gesta sono riprova della tua leggendaria reputazione prima del tuo arrivo alle Isole dei Draghi.\n\nIntendo aiutarti, incontriamoci a Valdrakken e ti darò ulteriori rifornimenti.', '', '', '', '', '', '', 47187),
(71022, 'itIT', 'Regno del montone', 'Ordina a Taivan di affrontare il Montone Testardo del gregge.', 'Visto che le argali non sembrano avere molto rispetto per Taivan, dovremmo capire se è in grado di gestire il montone del gregge.\n\nÈ il capo di tutte le argali e un gran testardo. Se Taivan riuscisse a sottomettere il montone, il gregge inizierebbe a obbedirgli.\n\nLo puoi trovare laggiù, sulla collina. Buona fortuna, Taivan! Se non funziona, temo che non ci sia molta speranza per lui...', '', '', '', '', '', '', 47187),
(71020, 'itIT', 'Segrete delle Incarnazioni: rompere qualche uovo', 'Ottieni 3 Frammenti del Granbastone della Custode della Progenie Diurna nelle Segrete delle Incarnazioni in modalità Mitica.', 'La Custode della Progenie Diurna è da qualche parte in questa fortezza e sicuramente sta osservando le segrete dalle sue stanze. Se riuscirai a ottenere dei pezzi del suo granbastone, dovrebbero permetterci di attaccare direttamente il suo nascondiglio.\n\nTre dovrebbero essere sufficienti, quattro sembrano troppi.', '', '', '', '', '', '', 47187),
(71019, 'itIT', 'Segrete delle Incarnazioni: rompere qualche uovo', 'Ottieni 3 Frammenti del Granbastone della Custode della Progenie Diurna nelle Segrete delle Incarnazioni in modalità Eroica.', 'La Custode della Progenie Diurna è da qualche parte in questa fortezza e sicuramente sta osservando le segrete dalle sue stanze. Se riuscirai a ottenere dei pezzi del suo granbastone, dovrebbero permetterci di attaccare direttamente il suo nascondiglio.\n\nTre dovrebbero essere sufficienti, quattro sembrano troppi.', '', '', '', '', '', '', 47187),
(71018, 'itIT', 'Segrete delle Incarnazioni: rompere qualche uovo', 'Ottieni 3 Frammenti del Granbastone della Custode della Progenie Diurna nelle Segrete delle Incarnazioni in modalità Normale.', 'La Custode della Progenie Diurna è da qualche parte in questa fortezza e sicuramente sta osservando le segrete dalle sue stanze. Se riuscirai a ottenere dei pezzi del suo granbastone, dovrebbero permetterci di attaccare direttamente il suo nascondiglio.\n\nTre dovrebbero essere sufficienti, quattro sembrano troppi.', '', '', '', '', '', '', 47187),
(71017, 'itIT', 'La lettera di Naluki', 'Consegna la testa di pesce di Naluki al Vecchio Zannatetra.', 'Fammi indovinare, Zanna ti ha detto di non aprire la lettera, giusto?\n\nSembra che tu abbia mantenuto la parola. Non mi stupisce che si fidi così tanto di te!\n\nDagli questa testa di pesce. Lui saprà cosa significa.', '', '', '', '', '', 'Consegna la testa di pesce di Naluki a Zannatetra.', 47187),
(71016, 'itIT', 'Sorella di Zannatetra', 'Consegna la lettera di Zannatetra a sua sorella Naluki a Iskaara.', 'L\'ultima è mia sorella, Naluki. Ora lavora alla locanda di Iskaara.\n\nDalle questa lettera.\n\nMa non aprirla!', '', '', '', '', '', 'Consegna la lettera di Zannatetra a sua sorella Naluki a Iskaara.', 47187),
(71015, 'itIT', 'Tutto muscoli, niente cervello', 'Trova Varsek al Panorama Antico.', 'Varsek è uno dei più forti draconidi che ti capiterà di incontrare. È anche uno dei più stupidi, ma lui non lo ammetterà di certo.\n\nSi è spaventato dopo Gelomorso e ha cominciato a riconsiderare la sua vita. Ha detto che non è mai riuscito a studiare le rovine lasciate dai suoi antenati. È scappato per \"darsi agli studi\".\n\nRiportalo qui, quello non è il suo posto!', '', '', '', '', '', 'Trova Varsek al Panorama Antico.', 47187),
(71014, 'itIT', 'Un lontano amico Mezzorso', 'Trova Barst sull\'Isola dei Lungartiglio.', 'Barst era uno dei Mezzorsi più forti che abbia mai conosciuto. Il fatto che il branco di Gelomorso lo abbia sconfitto in combattimento dice molto su di lui!\n\nL\'ultima notizia che ho di Barst è che se n\'è andato su una qualche isola al largo della costa di Iskaara, l\'ha chiamato \"andare in pensione\" o qualche scemenza simile.\n\nDi\' a Barst che è ora di tornare in azione.\n\nOh, e non farti ingannare dal modo in cui parla: ti farà a pezzi se non gli vai a genio!', '', '', '', '', '', 'Trova Barst sull\'Isola dei Lungartiglio.', 47187),
(71013, 'itIT', 'Prima si mangia, poi ci si vendica', 'Pesca $2oa Guizzatori Codagelata nel Nascondiglio di Zannatetra.', 'Ora che siamo tornati a ciò che volevamo fare, dobbiamo fare una chiacchierata zanna a zanna. Quello Gnoll, Gelomorso, quello con cui hai parlato?\n\nAbbiamo dei precedenti con lui.\n\nPotrebbe volerci un po\' a spiegare. Vai a prendere del pesce mentre parlo, cucciolo. Dobbiamo riempire la pancia di tutti, hanno bisogno della loro forza per ciò che verrà dopo.', '', '', '', '', '', '', 47187),
(71012, 'itIT', 'Recluta Varsek', 'Fai sapere a Zannatetra che hai reclutato Varsek.', 'Penso che in futuro riuscirò a risolvere i misteri di questo posto senza problemi.\n\nMa non parliamone col Vecchio Zannatetra, OK?\n\nAndrò nel suo rifugio. Credo che sfogarmi su Gelomorso mi farà bene!', '', '', '', '', '', 'Ritorna da Zannatetra.', 47187),
(71011, 'itIT', 'Cercasi: Giglio Torrenziale', 'Trova il Giglio Torrenziale.', '<L\'insegna è scritta in bella grafia.>\n\nL\'archivio richiede umilmente che tutti i membri della spedizione cerchino il Giglio Torrenziale.\n\nChi lo trova è pregato di consegnarlo alla Catalogatrice Jakes, che provvederà a conferire la dovuta ricompensa.\n\nI membri della spedizione hanno riferito di aver visto una potente Primalista con un fiore magico appuntato sul colletto. Era al Promontorio di Gelikyr nel Thaldraszus. Non si sa se sia il leggendario Giglio Torrenziale, ma è un buon posto per iniziare la ricerca.', '', 'Una potente Primalista d\'Acqua a Thaldraszus porta un Giglio Torrenziale appuntato al suo cappuccio.', 'Alora Brezzabruma', '', '', 'Torna dalla Catalogatrice Jakes al Campo delle Scaglie di Drago.', 47187),
(71010, 'itIT', 'Cercasi: Cannocchiale Temporale', 'Trova il Cannocchiale Temporale.', '<L\'insegna è scritta in bella grafia.>\n\nL\'archivio richiede umilmente che tutti i membri della spedizione cerchino il Cannocchiale Temporale.\n\nChi lo trova è pregato di consegnarlo alla Catalogatrice Jakes, che provvederà a conferire la dovuta ricompensa.\n\nI membri della spedizione riferiscono di un Nano che si vantava del suo cannocchiale magico nelle locande del sud di Thaldraszus. Vi consigliamo di concentrare la ricerca in quella regione.', '', 'Una vedetta Primalista a Thaldraszus sta usando il Cannocchiale Temporale per pianificare il suo prossimo attacco.', 'Vedetta Mordren', '', '', 'Torna dalla Catalogatrice Jakes al Campo delle Scaglie di Drago.', 47187),
(71009, 'itIT', 'Elementare, mio caro draconide', 'Aiuta Varsek a risolvere il mistero del Panorama Antico.', 'Zannatetra vuole fare un altro tentativo con Gelomorso? Odio dirgli di no, ma ho chiuso con quella vita per dedicarmi agli studi.\n\nSto cercando di scoprire la storia, e di entrare nella storia. Ma questo enigma esoterico in queste antiche rovine sembra irrisolvibile.\n\nL\'enigma è questo: se tocchi un cristallo vicino, quello dice \"segui lo schema\". Ma non riesco a capire cosa significhi!\n\nSai che ti dico? Se mi aiuterai a risolvere questo indovinello, andrò ad aiutare Zannatetra a finire Gelomorso una volta per tutte.', '', '', '', '', '', '', 47187),
(71008, 'itIT', 'Cercasi: Cuore di Pietra di Cuordipietra', 'Trova il Cuore di Pietra di Cuordipietra.', '<L\'insegna è scritta in bella grafia.>\n\nL\'archivio richiede umilmente che tutti i membri della spedizione cerchino il Cuore di Pietra di Cuordipietra.\n\nChi lo trova è pregato di consegnarlo alla Catalogatrice Jakes, che provvederà a conferire la dovuta ricompensa.\n\nI membri della spedizione hanno riferito di aver visto Cuordipietra in una caverna della zona centrale della Vastità Azzurra.', '', 'Cuordipietra custodisce il suo cuore in... be\', probabilmente puoi arrivarci da $gsolo:sola;.', 'Cuordipietra', '', '', 'Torna dalla Catalogatrice Jakes al Campo delle Scaglie di Drago.', 47187),
(71004, 'itIT', 'Cercasi: Totem Vincolamasse di Ohuna', 'Trova il Totem Vincolamasse di Ohuna.', '<L\'insegna è scritta in bella grafia.>\n\nL\'archivio richiede umilmente che tutti i membri della spedizione cerchino il Totem Vincolamasse delle Ohuna.\n\nChi lo trova è pregato di consegnarlo alla Catalogatrice Jakes, che provvederà a conferire la dovuta ricompensa.\n\nI membri della spedizione hanno riferito di un potente Primalista sull\'Altura Cantavento nelle Pianure di Ohn\'ahra che si ritiene detenga i poteri leggendari del totem.', '', 'Un potente Primalista dell\'Aria nelle Pianure di Ohn\'ahra utilizza il Totem Vincolamasse delle Ohuna.', 'Prozela Sparavento', '', '', 'Torna dalla Catalogatrice Jakes al Campo delle Scaglie di Drago.', 47187),
(71002, 'itIT', 'Incantesimo strabello', 'Leggi \"Tempesta di Mana per Principianti\" e scopri l\'incantesimo segreto di Millhouse.', '<Questo libro incantato levita delicatamente ed emana una magia arcana. Contiene innumerevoli incantesimi creati dalla mente caotica ma bellissima di Millhouse Manalampo.>', '', '', '', '', '', '', 47187),
(71001, 'itIT', 'Cercasi: Nucleo Primordiale Tellurico', 'Trova il Nucleo Primordiale Tellurico a Neltharus.', '<L\'insegna è scritta in bella grafia.>\n\nL\'archivio richiede umilmente che tutti i membri della spedizione cerchino il Nucleo Primordiale Tellurico.\n\nChi lo trova è pregato di consegnarlo alla Catalogatrice Jakes, che provvederà a conferire la dovuta ricompensa.\n\nLe recenti scoperte ottenute dai registri della Cittadella d\'Ossidiana indicano che è stato conservato nel Tesoro dei Draghi di Neltharus, anche se la posizione attuale non è chiara.', '', 'Si dice che il nucleo sia andato perso nel Tesoro dei Draghi di Neltharus.', 'Nucleo Primordiale Tellurico', '', '', 'Torna dalla Catalogatrice Jakes al Campo delle Scaglie di Drago.', 47187),
(71000, 'itIT', 'Recluta Barst', 'Fai sapere a Zannatetra che hai reclutato Barst.', 'Un patto è un patto. Se Zannatetra ha bisogno di una mano per uccidere Gelomorso, io ci sto.\n\nIl poco odio che mi è rimasto in corpo è riservato a quello Gnoll! Zannatetra ti ha detto cos\'è successo?\n\nQuando cacciavamo insieme, ci credevamo invincibili... finché non abbiamo incontrato Gelomorso.\n\nNon ci ha semplicemente sconfitti: ci ha umiliati davanti a tutti nel rifugio!\n\nSiamo stati sconfitti, lasciati a terra feriti e inermi, e Gelomorso ci ha usati come esempio.\n\nOra è il momento di vendicarsi.', '', '', '', '', '', 'Ritorna dal Vecchio Zannatetra.', 47187),
(70996, 'itIT', 'Un po\' di alghe per i miei amici', 'Sconfiggi l\'Elementale delle Alghe Indomabile sull\'Isola dei Lungartiglio.', 'Accidenti, sembra che Zannatetra sia nei guai. Direi che non voglio avere nulla a che fare coi conflitti sul continente, ma...\n\nIo e Gelomorso abbiamo un trascorso, e un conto in sospeso.\n\nMaledizione! Non posso lasciare gli altri indifesi... c\'è un elementale che sta causando problemi giù alla spiaggia, sono l\'unico che può tenerlo a bada. È un tipo viscido, letteralmente.\n\nSai che ti dico? Uccidilo per me e io andrò all\'accampamento di Zannatetra.\n\nCosa ne dici, $gcampione:campionessa;?', '', 'Ora va\'!', 'Elementale delle Alghe', '', '', '', 47187),
(70995, 'itIT', 'Cercasi: Teschio di Fenistrasza', 'Trova il Teschio di Fenistrasza.', '<L\'insegna è scritta in bella calligrafia.>\n\nGli archivisti chiedono umilmente che tutti i membri della spedizione cerchino il Teschio di Fenistrasza per l\'archivio dei manufatti.\n\nDa consegnarsi alla Catalogatrice Jakes per archiviazione e compenso.\n\nAlcuni membri della spedizione hanno riferito di averlo visto in possesso di un Djaradin reietto nelle montagne occidentali, ma nessuno lo ha ancora convinto a privarsene.', '', 'Un Djaradin solitario ha il teschio incantato in bella mostra nella sua alcova.', 'Tarjin il Cieco', '', '', 'Torna dalla Catalogatrice Jakes al Campo delle Scaglie di Drago.', 47187),
(70994, 'itIT', 'Soluzioni di drenaggio', 'Aspira $1oa Ruscelli Scintillanti nella caverna ad est delle Rovine della Cripta della Vita.', 'Vuoi avere l\'onore di assistere il famosissimo Geologo Capo della Spedizione delle Scaglie di Drago? Esatto. Sono esattamente chi pensi che sia e sono in difficoltà!\n\nStavo setacciando questo fiume in cerca di nuovi campioni sedimentari, ma l\'acqua ha iniziato ad andarsene con i sedimenti più interessanti!\n\nHo qui il \"dispositivo intrappola acqua\" brevettato da me, ma ho un disperato bisogno di qualcuno che lo usi per aspirare gli elementali.\n\nCredi di essere all\'altezza?', '', '', '', '', '', '', 47187),
(70992, 'itIT', 'Cercasi: Aquilone dei Tuskarr Perduto', 'Trova l\'Aquilone dei Tuskarr Perduto.', '<L\'insegna è scritta in bella calligrafia.>\n\nGli archivisti chiedono umilmente che tutti i membri della spedizione cerchino l\'Aquilone dei Tuskarr Perduto per l\'archivio dei manufatti.\n\nDa consegnarsi alla Catalogatrice Jakes per archiviazione e compenso.\n\nAlcuni membri della spedizione hanno avvistato un aquilone simile attaccato ad un trasporto Tuskarr lungo la costa occidentale, ma non è stato possibile raggiungerlo poiché il trasporto in movimento lo mantiene in volo e fuori portata.', '', 'L\'aquilone vola fiero seguendo i movimenti dell\'Arvillo Perduto...', 'Aquilone dei Tuskarr Perduto', '', '', 'Torna dalla Catalogatrice Jakes al Campo delle Scaglie di Drago.', 47187),
(70990, 'itIT', 'Volere è tosare', 'Tosa la lana delle Argali Colle Lesto.', 'Nonostante la maggior parte della nostra lana provenga dalle nostre greggi di argali, quando il nostro gregge si fa misero talvolta è necessario ottenerla dalla natura.\n\nLe pianure vicine ospitano molte argali selvatiche, ma tendono ad essere più suscettibili delle nostre. Se potessi prendere questa lama e tentare di tosare della lana, saresti di grande aiuto agli Aylaag.', '', '', '', '', '', '', 47187),
(70989, 'itIT', 'Parte di un branco', 'Dai la caccia al Draco Vorace insieme a Taivan e al branco di bakar da caccia.', 'Forse al tuo bakar serve che qualcuno della sua stessa razza gli mostri come si caccia.\n\nPuoi prendere in prestito alcuni dei nostri bakar addestrati. Prendili e abbatti il draco che infesta la zona.\n\nVediamo come si comporta Taivan in un branco!', '', '', '', '', '', '', 47187),
(70988, 'itIT', 'Ruota tutto attorno alle uova', 'Parla con Ilana all\'Approdo di Rusza\'thar nelle Pianure di Ohn\'ahra.', '\"Tutto il mondo è un uovo.\" Si dice così, vero?\n\nUova! Sono alla base della pasticceria e sono uno dei grandi catalizzatori della creazione culinaria! Sono il grasso che mette su un piedistallo acido, calore e sale, facendogli esprimere il massimo del loro potenziale!\n\nLe nostre Isole brulicano di volatili dalla forza immensa, ma i cacciabrezza delle Pianure depongono uova dal sapore eccezionale!\n\nSpesso nidificano nella zona orientale delle Pianure. Chiedi informazioni all\'avamposto dell\'Approdo di Rusza\'thar.', '', '', '', '', '', '', 47187),
(70987, 'itIT', 'Cuori di amido', 'Parla con Meliane Enorath nelle Rovine della Cripta della Vita sulle Sponde del Risveglio.', 'Cosa c\'è di meglio di un pasto che puoi portarti dietro mentre esplori?\n\nIl cibo da strada è l\'essenza delle città caotiche di tutto il mondo, ma non tutti i piatti sono adatti a essere trasportati. Gli elementi principali del cibo da asporto sono le pietanze a base di amido, che si mantiene intatto anche in movimento. Pane, patate, riso e altro sono il cuore dei pasti che si possono consumare in piedi.\n\nMi piacerebbe far assaggiare ai miei colleghi Pandaren uno dei piatti più saporiti, il Granoturco Salterino. Bocconacciuolo me lo ha fatto scoprire quando ci siamo conosciuti vicino a delle rovine dei Titani sulle Sponde del Risveglio.', '', '', '', '', '', '', 47187),
(70986, 'itIT', 'Soldata Shikzar', '', '', '', '', '', '', '', '', 47187),
(70985, 'itIT', 'L\'esploratrice malinconica', 'Parla con le Driadi al Santuario Ombroso.', 'Lo so, lo so, è sciocco, un Centauro e una Driade, dico bene? Non potremmo essere più diversi.\n\nEppure, ho sempre voluto conoscerne meglio una, sin dalla prima volta in cui ho posato lo sguardo sui Giardini di Smeraldo. Ma nulla di ciò che faccio attrae il loro interesse.\n\nSi dice che siano interessate alle piante e ai piccoli animali. E forse ad uccidere bracconieri, ma non so neppure da dove cominciare.\n\nTi prego, tu puoi parlare con loro, vero? Puoi chiedere in giro e scoprire cosa gli piaccia? Forse allora avrò qualche speranza.', '', '', '', '', '', 'Fai rapporto all\'Esploratrice Santuun.', 47187),
(70984, 'itIT', 'Spezzare l\'impeto', '', '', '', '', '', '', '', '', 47187),
(70983, 'itIT', 'O\'nank Rovistalidi', '', '', '', '', '', '', '', '', 47187),
(70981, 'itIT', 'Mari appetitosi', 'Parla con Wayun nella Nicchia del Baleniere della Vastità Azzurra.', 'L\'odore del mare! Lo senti, $n? Senti la moltitudine di minerali, carica di sale marino? La senti?\n\nStranamente, tra le delizie di oggi manca una rara varietà di pesce, che ho assaggiato una volta vicino al territorio dei Tuskarr di Iskaara nella Vastità Azzurra. Due Tuskarr ne stavano arrostendo uno sul fuoco, inondando la tundra ghiacciata di un delizioso profumino!\n\nVedi se riesce a procurarcene uno. So che i nostri avventori rimarranno incantati dal sapore di mare quanto lo fui io quel giorno.', '', '', '', '', '', '', 47187),
(70979, 'itIT', 'Magmaton', '', '', '', '', '', '', '', '', 47187),
(70978, 'itIT', 'Racconti del Campione delle Isole dei Draghi', '', '', '', '', '', '', '', '', 47187),
(70977, 'itIT', 'Zaino di Zerbino', '', '', '', '', '', '', '', '', 47187),
(70976, 'itIT', 'Sbandare e slittare', 'Vai in cerca di Kiopo sull\'isola a sud-est.', 'Come forse saprai, i piccoli di Iskaara sono fortemente indipendenti e imparano a cavarsela da soli sin dalla tenera età.\n\nMolti dei cuccioli più grandi sgattaiolano sino all\'iceberg a sud-ovest di qui come rito di passaggio. Kiopo, il più grande dei nostri cuccioli, si sta recando là proprio ora. Digli che ti mando io, dovrebbe offrirti una delle nostre slitte!\n\nAh, mi riporta alla memoria la mia gioventù, là fuori con i miei amici...', '', '', '', '', '', '', 47187),
(70972, 'itIT', 'Le nostre fedeli, smilze cavalcature', '', '', '', '', '', '', '', '', 47187),
(70971, 'itIT', 'Armi per tutte le taglie', '', '', '', '', '', '', '', '', 47187),
(70970, 'itIT', 'Buone intenzioni', 'Ferma Alia Planasoli e distruggi il manufatto Valthrux.', 'Forse so dove si trova il manufatto. Alia si è messa a sussurrare freneticamente non appena ha visto le schegge che hai riportato...\n\nContinuava a dire qualcosa su una \"caverna\" e su come i ragni ne sembrassero attratti.\n\nNon c\'è alcuna caverna nell\'area di fronte a noi; ciò mi porta a credere che ci sia qualcosa nelle rovine.\n\nResteremo qui e terremo libera la via di fuga. $n, ti prego, salva Alia e distruggi quel manufatto maledetto.', '', 'Speriamo di arrivare in tempo prima che Alia venga consumata dal manufatto.', 'Valthrux', '', '', '', 47187),
