(70959, 'itIT', 'Carino e Tenero', '', '', '', '', '', '', '', '', 47187),
(70958, 'itIT', 'I migliori funghi del Banchetto', 'Parla con la Capitana dei Custodi Sinjoirmi presso la Confluenza Temporale a Thaldraszus.', 'Ovviamente, il segreto dell\'alta cucina sta tutto nell\'utilizzo delle tecniche più raffinate e degli ingredienti più pregiati. Questo tipo di pietanze ha spesso dei prezzi proibitivi, ma non potremmo mai permettere che sia così anche al Banchetto di Rubino!\n\nBocconacciuolo mi ha parlato di un ingrediente perfetto per il tema di oggi. È così raro e squisito che... non esiste ancora! Stuzzicante, non trovi?\n\nI Draghi di Bronzo hanno scoperto un portale verso un pericoloso futuro, in cui esiste un tartufo nero dal sapore sconosciuto!\n\nDevi andare a cercarlo!', '', '', '', '', '', '', 47187),
(70957, 'itIT', 'Il mare ad ovest', 'Parla con Boscodolce al Santuario Ombroso nelle Pianure di Ohn\'ahra.', 'Ti stai godendo il verde di questo bel paesaggio, $n?\n\nMi ricorda un piatto che una volta mi hanno fatto assaggiare due sorelle Driadi, insieme al loro gentile amico Treant. Si chiamava Boscodolce! Abitava nel Santuario Ombroso sulla costa occidentale delle Pianure.\n\nIl piatto era un misto di erbe fresche, verdure e spezie. Al centro del piatto c\'era uno strato di alghe marine, le più deliziose che io abbia mai assaggiato!\n\nCosa? Non hai mai provato le alghe marine? Beh, devi per forza cercarle. Portane un bel po\', così ce le dividiamo!', '', '', '', '', '', '', 47187),
(70956, 'itIT', 'Di scaglie azzurre', '', '', '', '', '', '', '', '', 47187),
(70955, 'itIT', 'Volatili affascinanti', '', '', '', '', '', '', '', '', 47187),
(70954, 'itIT', 'Curiosità in sella', '', '', '', '', '', '', '', '', 47187),
(70953, 'itIT', 'Copricapo Tuskarr', '', '', '', '', '', '', '', '', 47187),
(70952, 'itIT', 'Casse abbandonate... o nascoste', '', '', '', '', '', '', '', '', 47187),
(70950, 'itIT', 'Infilzare pesci ancora più grossi', '', '', '', '', '', '', '', '', 47187),
(70948, 'itIT', 'Amo, lenza e caldo torrido!', '', '', '', '', '', '', '', '', 47187),
(70947, 'itIT', 'Trambladd l\'Acchiappatesori', '', '', '', '', '', '', '', '', 47187),
(70946, 'itIT', 'Nessuno mi può maneggiare', 'Convinci Alia a distruggere Valthrux.', 'Ciò che hai trovato lascia intendere che il potere del manufatto abbia condannato chiunque l\'abbia usato finora.\n\nI draghibestia che vivono qui si sono uccisi a vicenda. Anche la Fiamma Frammentata sembra essere corrotta dalla sua influenza.\n\nQuesto non è un manufatto da recuperare: deve essere distrutto prima che possa danneggiare qualcun altro!\n\nDobbiamo convincere Alia e Kattigat.', '', '', '', '', '', '', 47187),
(70945, 'itIT', 'Reti migliorate', '', '', '', '', '', '', '', '', 47187),
(70944, 'itIT', 'Pesca nel ghiaccio', '', '', '', '', '', '', '', '', 47187),
(70943, 'itIT', 'Arpionaggio', '', '', '', '', '', '', '', '', 47187),
(70942, 'itIT', 'Pesca d\'altura', '', '', '', '', '', '', '', '', 47187),
(70941, 'itIT', 'Zone di pesca', 'Parla con Nunvuq a Iskaara nella Vastità Azzurra.', 'Salve di nuovo! Lo sapevi che diventerò il miglior pescatore del villaggio? Una volta ho pescato un piranha gigante e ha cercato di mangiarmi la faccia!\n\n<Rowie si guarda distrattamente attorno.>\n\nAh, sì! Ho un messaggio per te. Nunvuq, a Iskaara, vuole parlarti delle zone di pesca.', '', '', '', '', '', '', 47187),
(70940, 'itIT', 'Racconti del campione dei Tuskarr', '', '', '', '', '', '', '', '', 47187),
(70939, 'itIT', 'Utensili da cucina', '', '', '', '', '', '', '', '', 47187),
(70938, 'itIT', 'Banchetti della Comunità', 'Parla con Kinook il Grosso a Iskaara nella Vastità Azzurra.', 'Eccoti qua, $n! La zuppa è pronta! \n\nSarà meglio che ti sbrighi ad andare a Iskaara. Kinook il Grosso ti sta cercando.\n\nUna volta mi disse di procurargli un viscido, disgustoso pesce scorpione per la zuppa e io non volevo farlo. Così, gli urlai: \"No, chef!\"\n\nSi arrabbiò così tanto che pensai volesse gettare me nella zuppa!', '', '', '', '', '', '', 47187),
(70937, 'itIT', 'Ciò che fu Valthrux', 'Trova indizi su cosa sia veramente il manufatto chiamato Valthrux.', '<To\'tik ti sussurra qualcosa.>\n\nDei manufatti misteriosi che sussurrano promesse di grandezza... La cosa non mi piace affatto.\n\nMa non possiamo semplicemente andarcene. Altrimenti, la Fiamma Frammentata se ne impossesserà, qualunque cosa sia!\n\nConosco le rovine come questa. I Draghi Blu spesso ci hanno lasciato degli appunti sul loro lavoro. Tieni gli occhi aperti, potresti trovarne alcuni.\n\nPossiamo usare tutti gli indizi che trovi per avvertire Alia e Kattigat.', '', '', '', '', '', '', 47187),
(70936, 'itIT', 'Totem dei Tuskarr rubati', '', '', '', '', '', '', '', '', 47187),
(70935, 'itIT', 'Pesca e libera: Corifena delle Isole', '', '', '', '', '', '', '', '', 47187),
(70932, 'itIT', 'Una vita speziata', 'Parla con Griftah al Trono d\'Ossidiana.', 'Per molti, la carne è l\'elemento essenziale di ogni pasto. Ma qual è l\'ingrediente fondamentale per ogni piatto di carne degno di questo nome?\n\nLe spezie!\n\nIn queste Isole, c\'è una spezia che supera tutte le altre in termini di sapore e rarità. Purtroppo, si trova solo sugli elementali che vivono nelle profondità della Fortezza d\'Ossidiana. Si tratta di un\'area al momento occupata dai Djaradin.\n\nForse puoi chiedere consiglio a un bizzarro troll che ho incontrato mentre attraversavo quella zona. Credo che si chiamasse... Griftah.', '', '', '', '', '', '', 47187),
(70931, 'itIT', 'Frammenti Sussurranti', 'Recupera $1oa Frammenti Sussurranti dalla Fiamma Frammentata.', 'Credo che Valthrux stia cercando di comunicare con noi attraverso la scheggia che abbiamo recuperato.\n\nPossiamo sfruttarlo a nostro vantaggio, finché teniamo le nostre menti protette dalla sua influenza.\n\nMi sbagliavo sulla Fiamma Frammentata. Sfortunatamente, hanno già raccolto diversi frammenti di scheggia...\n\nI sussurri di Valthrux sostengono che siano prossimi a trovare la sua posizione.\n\nRecupera i frammenti dalla Fiamma Frammentata prima che raggiungano il manufatto!', '', '', '', '', '', '', 47187),
(70930, 'itIT', 'Solo te, niente Foglialosca', 'Parla con Lilial Scoppialbore nella Valle di Brivitela.', 'Oggi celebriamo il tè, infuso, freddo o preparato in altri modi! Abbiamo anche dei dolcetti e dei biscotti deliziosi.\n\nMa c\'è un raro ingrediente delle Isole che credo aggiungerebbe tutta un\'altra dimensione di sapore! Nelle profondità della Valle di Brivitela, infestata dai ragni, c\'è un cespuglio carico di foglie incredibilmente tonificanti: la Sagittata Freddogelo.\n\nDi recente, la Spedizione delle Scaglie di Drago stava esplorando proprio quell\'area. Forse uno di loro potrebbe aiutarci?', '', '', '', '', '', '', 47187),
