(70919, 'itIT', 'Dimmi quando, quando, quando', 'Riporta l\'Anatroccolo Imbollato all\'Accampamento degli Ecologi.', '<Questo anatroccolo è stato imbollato così a lungo da addormentarsi. Starnazza debolmente russando.>\n\n<Forse gli ecologi possono aiutarlo?>', '', '', '', '', '', 'Riporta l\'Anatroccolo Imbollato all\'Accampamento degli Ecologi.', 47187),
(70918, 'itIT', 'Qualma e sangue freddo', 'Riporta l\'Anatroccolo Imbollato all\'Accampamento degli Ecologi.', '<Questo anatroccolo starnazza nel panico. Se qualcuno non lo aiuta, i Gorloc sicuramente perderanno la pazienza!>\n\n<Forse gli ecologi possono aiutarlo?>', '', '', '', '', '', 'Riporta l\'Anatroccolo Imbollato all\'Accampamento degli Ecologi.', 47187),
(70917, 'itIT', 'È quaquasi ora', 'Riporta l\'Anatroccolo Imbollato all\'Accampamento degli Ecologi.', '<Questo anatroccolo è molto nervoso, sembra ansioso di sfuggire dal guaio in cui si trova.>\n\n<Forse gli ecologi possono aiutarlo?>', '', '', '', '', '', 'Riporta l\'Anatroccolo Imbollato all\'Accampamento degli Ecologi.', 47187),
(70916, 'itIT', 'Celebre e illustre', '', '', '', '', '', '', '', '', 47187),
(70915, 'itIT', 'Un\'impresa da incoronare', '', '', '', '', '', '', '', '', 47187);
