(70893, 'itIT', 'Banchetto della Comunità', 'Svolgi $1oa compiti nel Banchetto della Comunità.', 'Il Banchetto della Comunità si sta svolgendo PROPRIO ADESSO! Questo è il momento in cui tutti partecipano per cucinare la migliore zuppa possibile.\n\nDovresti unirti a noi!', '', '', '', '', '', '', 47187),
