(70884, 'itIT', 'Riconquista', '', '', '', '', '', '', '', '', 47187),
(70883, 'itIT', 'Una mano nell\'Erbalismo', 'Trova Gryrmpech nei Giardini dell\'Unità.', 'Saluti, mortale, ho ricevuto notizie dal nostro Capo Giardiniere Gryrmpech. A quanto pare i giardini sono in uno stato di caos, non so se la situazione sia inusuale.\n\nMi hanno assicurato che hanno la situazione in pugno, anzi, hanno detto \"in zappa\", non mi è chiaro cosa intendessero, ma sicuramente ti spiegheranno meglio. Ti prego, vai a cercarli, ti daranno tutto l\'equipaggiamento necessario per la situazione.', '', '', '', '', '', '', 47187),
(70882, 'itIT', 'La fama paga', '', '', '', '', '', '', '', '', 47187),
(70880, 'itIT', 'Cucinare con raffinatezza', '', '', '', '', '', '', '', '', 47187),
(70879, 'itIT', 'Fai rapporto sui ribelli', 'Incontra la Capitana Drine al piano superiore del Seggio degli Aspetti.', 'È impressionante ciò che siamo riusciti a fare oggi. Spero tu sia d\'accordo, $n.\n\nSiamo stati più che efficaci nell\'ostacolare le nefande azioni di questi ribelli alleati dei Primalisti. Almeno per ora. Terremo sotto stretta osservazione qualsiasi futuro dissenso.\n\nTorna dalla Capitana Drine appena possibile, vorrà un rapporto dettagliato.', '', '', '', '', '', '', 47187),
(70878, 'itIT', 'Cerchio di fuoco', 'Proteggi Maldra Ardilingua mentre sigilla il Portale dei Primalisti.', 'Nei recessi più profondi della Caverna Braceviva, i Primalisti hanno eretto un portale infuocato da cui sguinzagliano gli elementali.\n\nPosso sigillarlo, ma senza dubbio causerò l\'ira di qualsiasi cosa sia dall\'altra parte. Compreso lo spettro Magmaticus che i Primalisti stanno aiutando.\n\nMi servirà la tua protezione, se vogliamo fermarli.', '', 'Questi spettri del fuoco impazziti devono essere eliminati prima che i Primalisti possano sguinzagliarli sulle Isole dei Draghi.', 'Magmaticus', '', '', '', 47187),
(70877, 'itIT', 'Uno squaquarcio nel tempo', 'Riporta l\'Anatroccolo Imbollato all\'Accampamento degli Ecologi.', '<Questo anatroccolo è avvilito, starnazza piano tra sé e sé guardandosi attorno impaurito.>\n\n<Forse gli ecologi possono aiutarlo?>', '', '', '', '', '', 'Riporta l\'Anatroccolo Imbollato all\'Accampamento degli Ecologi.', 47187),
(70876, 'itIT', 'Distruggi i focus', 'Distruggi $1oa Focus dei Primalisti nella Caverna Braceviva.', 'Se Maldra dice la verità, i ribelli creano le pietre runiche vengono nella Caverna Braceviva.\n\nConsiderata la natura di questi dispositivi, sappiamo che devono esserci immischiati dei Focus dei Primalisti.\n\nDistruggi i focus. Li riconoscerai quando li vedrai. Non possiamo permettere che i ribelli creino altre armi di distruzione.', '', '', '', '', '', '', 47187),
(70875, 'itIT', 'Peggio del peggio', 'Uccidi $1oa ribelli e $2oa elementali nella Caverna Braceviva.', 'I ribelli nella Caverna Braceviva hanno una lealtà inamovibile verso i Primalisti e per questo rappresentano la più grande minaccia per Valdrakken.\n\nEliminali, e con loro ciascun elementale che hanno sguinzagliato.', '', '', '', '', '', '', 47187),
(70874, 'itIT', 'Superare il muro di fuoco', 'Ricevi la benedizione elementale di Maldra.', 'I ribelli nella caverna sono stati infusi con una benedizione elementale che ha permesso loro di attraversare in sicurezza il muro di fiamme. Ti fornirò questo stesso dono.\n\nNon preoccuparti, ho visto come garantire questa benedizione molte volte, non dovrebbero esserci problemi a replicarla con successo.', '', '', '', '', '', '', 47187),
(70873, 'itIT', 'Acqua da tutte le parti', 'Raccogli $1oa Granuli d\'Acqua Cadente.', 'La vera minaccia si trova nella Caverna Braceviva. È lì che le pietre runiche vengono intagliate e infuse di fuoco primordiale.\n\nSenza dubbio hai notato il muro di fiamme ardenti che blocca l\'entrata. Non mi è possibile rimuoverlo, ma potrei aiutare. Penso che, con la giusta applicazione di Acqua Cadente, potremo passare in sicurezza.\n\nRaccogli i granuli d\'acqua dagli elementali vicini.', '', '', '', '', '', '', 47187),
(70871, 'itIT', 'Rete da Pesca di Iskaara', 'Porta i materiali a Tavio per farle costruire una Rete da Pesca di Iskaara.', 'Vedo che vai d\'accordo con gli abitanti del villaggio.\n\nVuoi conoscere meglio le nostre usanze di pesca? Be\', per prima cosa, nessuno pesca a mani nude. Posso costruirti una bella rete resistente, degna di un abitante di Iskaara.', '', '', '', '', '', '', 47187),
(70867, 'itIT', 'Forte Malascaglia', '', '', '', '', '', '', '', '', 47187),
(70859, 'itIT', 'In pugno al guardiano', 'Recupera la Scheggia Sussurrante da Edavix, il Guardiano Corrotto.', 'Apprezzo il tuo aiuto, $C. Sono io il Mago del Kirin Tor che ha scoperto Valthrux e i piani della Fiamma Frammentata.\n\nRecuperare e studiare questo potentissimo oggetto senziente è della massima importanza. Ricorda le mie parole: sarò io a farlo.\n\nLa Fiamma Frammentata tira a indovinarne la posizione, ma io userò la mia magia.\n\nNelle vicinanze c\'è un guardiano corrotto che ha con sé una scheggia magica connessa a Valthrux. Posso usarla per trovare il resto del manufatto.', '', 'Un guardiano corrotto dal potere di Valthrux. Detiene il segreto per trovare il manufatto.', 'Edavix', '', '', '', 47187),
(70858, 'itIT', 'Si torna in azione', 'Usa l\'Antidoto Glaciale su Alia Planasoli.', 'D\'accordo, l\'antidoto è pronto. Io terrò ferma Alia. Tu versale in bocca il contenuto della fiala.\n\nSpero che sopravviva... Ci servirà la sua magia per rintracciare il manufatto.', '', '', '', '', '', 'Parla con Alia Planasoli.', 47187),
(70856, 'itIT', 'Fuoco purificatore', 'Distruggi $1oa cadaveri infetti con la Torcia Lanciafiamme.', 'Questi ragni schifosi depongono le uova nei cadaveri!\n\nE a volte pure nei vivi...\n\nAbbiamo visto dei corpi di membri della Fiamma Frammentata, rimasti vittime di quei mostri.\n\nNon possiamo lasciare che quelle uova si schiudano, se vogliamo sopravvivere e sconfiggere la Fiamma Frammentata.\n\nFai così: prendi questa torcia, infusa col potere dell\'aria e del fuoco. Puntala verso ciò che vuoi bruciare e lei farà il resto.\n\nI Tuskarr non scherzano con i ragni, quindi ci siamo premuniti!', '', '', '', '', '', '', 47187),
(70854, 'itIT', 'Allora? Com\'è andata?', 'Torna da Jyhanna all\'Asilo dei Draghetti a Valdrakken.', 'Ottimo lavoro, $n. Lubbins sta molto meglio ed è di ottimo umore.\n\nJyhanna vorrà saperlo, quindi torna indietro e dalle la buona notizia!', '', '', '', '', '', '', 47187),
(70853, 'itIT', 'Un\'amica per Lubbins', 'Cattura una Mosca Timida nella Riserva Selvaggia presso le Sponde del Risveglio.', 'Come ti ho detto, a Lubbins servono due cose: un amico e uno scontro.\n\nCredo che possiamo trovargli entrambi.\n\nIn quest\'area vengono ad accoppiarsi delle creature chiamate Mosche Timide. Dovrebbero essercene parecchie in zona!\n\nRicorda, devi indebolirle prima di poterle catturare con la tua trappola.\n\nTorna quando ne avrai presa una. Forse sarà un po\' malconcia dopo la battaglia, ma ho delle Pietre Evolutive che la faranno tornare come nuova!', '', '', '', '', '', '', 47187),
(70851, 'itIT', 'Vita ancora più spericolata', 'Scopri cosa Haniko possa fare per Lubbins.', 'C\'è molto che devi imparare. Parliamo e poi decideremo cosa fare per Lubbins.', '', '', '', '', '', '', 47187),
(70850, 'itIT', 'Maldra è nei guai', 'Salva Maldra da Orian Acquascura.', 'Ottimo lavoro. Mentre ti occupavi di causare problemi ai ribelli, io ho perlustrato il campo. Ma non mi aspettavo di incontrare la mia vecchia amica Maldra Ardilingua.\n\nSapevo che fosse dispersa, ma le voci dicevano che si era unita ai ribelli. Ma, per quel che ho potuto vedere, è loro ostaggio!\n\nNon possiamo lasciarla qui, salvala dai Draghibestia che la tengono prigioniera!', '', 'Questo capo dei ribelli ha incatenato la sua prigioniera, Maldra Ardilingua, con catene di acqua primale.', 'Orian Acquascura', '', '', '', 47187),
(70849, 'itIT', 'Serve uno specialista', 'Parla con Haniko nella Riserva Selvaggia presso le Sponde del Risveglio.', 'Lubbins sta molto meglio, ma credo abbia bisogno di altro aiuto.\n\nUn po\' di tempo fa ho incontrato una superba esploratrice della Spedizione delle Scaglie di Drago. Si chiama Haniko e lavora sempre con i proto-drachi. Anche lei è un\'allenatrice! Scommetto che potrebbe aiutare Lubbins.\n\nCredo stesse andando alle Sponde del Risveglio, scommetto che la troverai lì.\n\nSono così felice di essere stata utile!\n\n<Saluta, felice.>\n\nAddio! Buona fortuna, Lubbins!', '', '', '', '', '', '', 47187),
(70848, 'itIT', 'Cresta di Drago Dimenticata', 'Consegna l\'oggetto a Exadria.', '<A Exadria potrebbe interessare.>', '', '', '', '', '', '', 47187),
(70847, 'itIT', 'Talismano d\'Ossidiana Antico', 'Consegna l\'oggetto all\'Inseguitrice Artigliata Kavia.', '<All\'Inseguitrice Artigliata Kavia potrebbe interessare.>', '', '', '', '', '', '', 47187),
(70845, 'itIT', 'Sulle tracce di Tyr', 'Trova la Prima Sfida di Tyr presso la Vastità Azzurra.', 'Il Guardiano Tyr ha previsto ogni possibilità. Ha sospettato che un giorno sarebbe stato necessario potenziare gli artigiani del regno, così ha creato il Motore dell\'Innovazione. Possiede l\'abilità di creare un materiale unico che può aiutare un oggetto a raggiungere una raffinatezza superiore a quella delle capacità dei mortali.\n\nPer assicurarsi che il Motore non venga usato in modo improprio, ha creato me: il mio compito è valutare chiunque voglia utilizzarlo. Solamente coloro che sono considerati degni potranno usare il pieno potere del Motore.\n\nPensi di potercela fare?', '', '', '', '', '', 'Trova la Prima Sfida di Tyr presso la Vastità Azzurra.', 47187),
(70843, 'itIT', 'Rovina le pietre runiche', 'Distruggi le scorte di pietre runiche incendiarie.', '<Questa pietra runica è molto simile a quella che un ribelle ha tentato di piazzare a Valdrakken.>\n\n<Nonostante questa pietra non sia finita, noti delle scorte di pietre runiche finite in lontananza.>\n\n<Se distruggi le scorte, i ribelli non potranno usarle.>', '', '', '', '', '', '', 47187),
(70842, 'itIT', 'Punti di detonazione', 'Raccogli mappe della Valle Nebbiosa.', 'Sono certo che i ribelli stanno documentando i loro piani per attacchi futuri, dobbiamo scoprire cosa stanno cercando di fare prima che lo facciano.\n\nPerlustra il loro accampamento per trovare altre mappe annotate come quella trovata a Valdrakken.', '', '', '', '', '', '', 47187),
(70841, 'itIT', 'Altre Reliquie dei Titani', '', '', '', '', '', '', '', '', 47187),
(70840, 'itIT', 'Una Reliquia dei Titani', '', '', '', '', '', '', '', '', 47187),
(70839, 'itIT', 'Alla ricerca delle Reliquie dei Titani', '', '', '', '', '', '', '', '', 47187),
(70838, 'itIT', 'Ribelli per la causa', 'Uccidi $1oa ribelli e Primalisti.', 'La base dei ribelli... cercavamo proprio questo luogo. Che fortuna che la mancanza di attenzione del loro sabotatore ci abbia condotti qui.\n\nNon posso credere che i miei compagni si abbasserebbero a lavorare con i Primalisti. Non possiamo permetterlo. Elimina i ribelli e i loro amici Primalisti prima che possano causare ulteriore caos.', '', '', '', '', '', '', 47187),
(70837, 'itIT', 'Segui gli indizi', 'Incontra l\'Investigatore Erima nella Valle Nebbiosa.', '<L\'Investigatore Erima controlla la mappa.>\n\nÈ chiaro cosa rappresenti la X sul Seggio degli Aspetti.\n\nMa c\'è anche un cerchio attorno alla Valle Nebbiosa. Potrebbe essere il prossimo obiettivo dei ribelli? O la loro base operativa.\n\nC\'è solo un modo per scoprirlo; incontriamoci nella valle.', '', '', '', '', '', '', 47187),
