(70781, 'itIT', 'Di punto in blu', 'Trova Harleen Cinguetti nelle Alture dei Piumablu.', 'Hai visto?!?\n\nQuesta creatura alata è caduta dal cielo! Non so cosa sia, ma di certo non è nativa delle isole.\n\nAspetta, mi ricordo una piccola Goblin che chiedeva indicazioni per le Alture dei Piumablu appena sopra di noi. Credi che lei ne sappia forse qualcosa?', '', '', '', '', '', '', 47187),
(70780, 'itIT', 'Stendardi di Ohn\'ahra', '', '', '', '', '', '', '', '', 47187),
(70779, 'itIT', 'Racconti di Tarjin', 'Ottieni $1oa Teschi di Drago Notevole dai potenti draghi e proto-draghi sulle Isole dei Draghi.', '<Tarjin resta rivolto verso l\'isola in lontananza mentre ti parla.>\n\nTi credi meritevole delle incredibili leggende e storie dei Djaradin?\n\nTu, che non raggiungi neppure la taglia delle nostre armi? Tsk.\n\nDubito che tu abbia il fegato di farti carico del retaggio della mia gente.\n\nDimostrami che mi sbaglio, se ti riesce. Cerca i draghi, l\'unico degno rivale su queste isole.\n\nPortami i trofei delle tua vittorie contro i più forti tra loro.', '', '', '', '', '', '', 47187),
(70763, 'itIT', 'Tagliamondi A\'tir', '', '', '', '', '', '', '', '', 47187),
(70754, 'itIT', 'Estinguere i Primalisti del Fuoco', 'Porta il Nucleo Primordiale a Rethelshi.', 'Rethelshi a Valdrakken sarà felice di usarlo per la sua ricerca sui Primalisti.', '', '', '', '', '', '', 47187),
(70753, 'itIT', 'Disperdere i Primalisti dell\'Aria', 'Porta il Nucleo Primordiale a Rethelshi.', 'Rethelshi a Valdrakken sarà felice di usarlo per la sua ricerca sui Primalisti.', '', '', '', '', '', '', 47187),
(70752, 'itIT', 'Vaporizzare i Primalisti dell\'Acqua', 'Porta il Nucleo Primordiale a Rethelshi.', 'Rethelshi a Valdrakken sarà felice di usarlo per la sua ricerca sui Primalisti.', '', '', '', '', '', '', 47187),
(70751, 'itIT', 'Terillod il Devoto', '', '', '', '', '', '', '', '', 47187),
(70750, 'itIT', 'Aiutare l\'Accordo', 'Continua a impegnarti nell\'aiutare l\'Accordo di Valdrakken e i loro alleati nelle Isole dei Draghi.', 'Tu, laggiù! Sì, parlo con te, vedi qualcun altro qui attorno?\n\n<Therazal dà una rapida occhiata a dei passanti.>\n\nLasciali perdere, non c\'entrano niente, tu sei $gquello:quella; di cui ho sentito girare voce, è con te che voglio parlare!\n\nL\'Accordo di Valdrakken mi ha chiesto di rintracciare coloro che si sono fatti un nome nelle isole, e coloro che fanno della nostra salvezza, e quella dei nostri alleati, la loro priorità.\n\nFai ciò che sai fare meglio e riceverai una ricca ricompensa.', '', '', '', '', '', '', 47187),
(70748, 'itIT', 'Solo per occhi blu', 'Cerca gli appunti di Malygos negli Archivi Azzurri.', 'Non mi stupisce che i tuoi compagni non abbiano ancora trovato nulla.\n\nQuesti libri erano destinati solo agli occhi blu.\n\nTuttavia, la mia presenza dovrebbe bastare a permettere ad alcuni dei tomi di rivelare i loro segreti.', '', '', '', '', '', '', 47187),
(70747, 'itIT', 'Il mago azzurro', 'Parla con l\'Arcimago Khadgar all\'Accampamento Antonidas.', 'Non ho tempo per cavillare con degli incantatori.\n\nVa\' e occupati di questo \"Arcimago\" $p. Scopri quel che puoi e sii sempre vigile. Potrebbero essere ancora nostri alleati o futuri nemici...\n\nI nostri rapporti indicano che c\'è un grosso complesso di archivi a sud di qui.\n\nMi recherò là.', '', '', '', '', '', '', 47187),
(70746, 'itIT', 'Sfumature di blu', 'Accompagna Bracithal e Telash all\'Accampamento Antonidas.', 'Ehilà, $p!\n\nÈ bello vedere un volto amico da queste parti. Telash e io stavamo giusto discutendo dei resoconti che abbiamo sentito sui... nuovi arrivati nella zona.\n\n<Bracithal abbassa la voce.>\n\nDraghi blu.\n\nDati i nostri... trascorsi con i blu, Telash e io abbiamo pensato che fosse necessario valutare la situazione di persona.\nTi prego, unisciti a noi.', '', '', '', '', '', '', 47187),
(70745, 'itIT', 'Rilassamento Forzato', 'Uccidi l\'evocatrice degli elementali.', 'Quei Primalisti che hai visto non mi sembrano certo tipi da dare ordini. Chi avrebbe mai paura di un cagnolino? Ahahah!\n\nHanno menzionato Vadne, quindi a quanto pare è lei che comanda. Deve essere stata lei a portare qui gli elementali. Dobbiamo liberarci dell\'evocatrice, non può essere lontana se sta causando così tanti problemi. Controlla la caverna sotto di noi, so che alcuni dei dipendenti più negligenti la usano per prendersi una pausa.', '', 'Un\'evocatrice di fuoco e vapore, questa Primalista preferisce cuocere vivi i suoi nemici.', 'Vadne Cuorcupo', '', '', '', 47187),
(70744, 'itIT', 'Guarda le ossa!', 'Ripulisci $1oa cumuli di disordine.', '<Di sicuro il gestore della Spa preferirebbe non trovare sangue dappertutto...>', '', '', '', '', '', '', 47187),
(70743, 'itIT', 'Piccola Tesorina', 'Trova la Tesorina di Elzara.', 'Ehi tu, $PR! Sei in grado di fare qualcosa?\n\nHai le giuste priorità?\n\nBene!\n\nLa mia Tesorina si è smarrita. Salvala immediatamente. Fa\' in fretta, non può difendersi da sola in questa situazione orribile.', '', '', '', '', '', '', 47187),
(70742, 'itIT', 'Scorre nel sangue', 'Setaccia l\'Osservatorio d\'Ossidiana in cerca di indizi sul passato dei Dracthyr.', 'Dal cielo ho individuato uno dei manufatti scoperti da Edress all\'entrata delle rovine. Senza dubbio ce ne sono altri all\'interno.\n\nSono protetti in qualche modo, ma dovrò avvicinarmi di più prima di poterli esaminare. La magia qui è molto antica.\n\nL\'area sembra deserta, ma non credo lo resterà per molto quando inizieremo a interferire. Tieni gli occhi aperti. Scopriremo tutto ciò che possiamo.', '', '', '', '', '', '', 47187),
(70741, 'itIT', 'Alcune delle mie cose preferite', 'Raccogli $1oa oggetti smarriti.', '<Sembra che la classe di yoga sia stata interrotta, gli oggetti degli studenti sono sparsi ovunque.>\n\n<Raccogliere questi oggetti aiuterà sicuramente la Spa Sogni Sereni.>', '', '', '', '', '', '', 47187),
(70740, 'itIT', 'Pulizia al vapore', 'Uccidi $1oa elementali nell\'area inferiore della spa.', 'Xijan sembra pensare che l\'invasione della nostra bellissima spa da parte degli elementali non sia un grosso problema, ma questa ondata di fiamme e vapore deve essere messa sotto controllo immediatamente.\n\nAvevamo ingaggiato dei musicisti perché suonassero al piano inferiore, ma gli elementali hanno distrutto i loro strumenti. Essendo la prima volta che gli elementali causano così tanta distruzione in questa zona, sospetto ci siano di mezzo i Primalisti.\n\nSe vuoi aiutare, liberaci dagli elementali nella zona est del piano inferiore. È lì che sono previsti i primi eventi.', '', '', '', '', '', '', 47187),
(70739, 'itIT', 'Linee di sangue, dolci e Teerai', 'Aiuta il Cacciatore Narman a ricevere una benedizione tradizionale per la sua proposta di matrimonio.', 'Ho cacciato con i Khan, ho battuto il nostro bakar più veloce e ho lottato a mani nude con un bruffalo adulto. Come cacciatore, non ho più niente da dimostrare.\n\nTuttavia, come partner, ho ancora molto da imparare.\n\nIl Saggio del Vento Dawa del Clan Ohn\'ir è colui che fa cantare il mio cuore. Desidero dimostrarmi degno del suo amore, ma non so nulla di tradizioni e rituali. Mi serve la saggezza degli anziani a Maruukai.', '', '', '', '', '', 'Parla con il Cacciatore Narman all\'altura degli Shikaar a Maruukai.', 47187),
(70738, 'itIT', 'La lezione di yoga', 'Trova l\'istruttore e $1oa studenti di yoga.', 'Stava andando tutto così bene, ma ora? Gli elementali stanno causando alcuni, uhm, piccoli problemi.\n\nI nostri ospiti si stavano già godendo la loro permanenza quando sono comparsi gli elementali! Quei fastidiosi demoni hanno rovinato tutto. Immagino abbiano disturbato anche il nuovo istruttore di yoga.\n\nAh, già, lo yoga è un nuovo tipo di stretching che ti aiuta, al tempo stesso, a meditare. Sicuramente l\'istruttore e gli studenti saranno così rilassati da non aver neppure notato gli elementali.\n\nComunque, meglio esserne certi. Per favore, cercali.', '', '', '', '', '', '', 47187),
(70732, 'itIT', 'Uno scontro amichevole', 'Sconfiggi Gwosh in uno scontro tra mascotte.', 'Bene! Ora che hai usato la pietra su Lubbins, facciamo pratica per provare le sue abilità!\n\nC\'è un grosso drospo cornuto di nome Gwosh che vive sulla costa a nord. Gwosh ama combattere! Be\', diciamo giocare. È molto bravo con le altre mascotte!\n\nSarà un amico perfetto. Voglio dire, avversario... per Lubbins.', '', '', '', '', '', '', 47187),
(70730, 'itIT', 'Generosità degli Shikaar', 'Aiuta il Saggio del Vento Dawa a prepararsi per la proposta di matrimonio perfetta.', 'Oh, $p.\n\nIl sole ti è di conforto? La sua luminosa carezza ti dà sicurezza? Ogni nuovo giorno rappresenta una speranza per il futuro e la possibilità di vivere la tua vita come l\'hai sempre sognata?\n\nAllora conosci l\'amore quanto me.\n\nNarman del Clan Shikaar è il mio sole. Lui è il mio calore, la mia luce e la mia speranza.\n\nUn Centauro come lui merita una proposta degna della sua eccellenza.\n\nDobbiamo affidarci alla guida di un Ohn.', '', '', '', '', '', '', 47187),
(70723, 'itIT', 'Frantumare i Primalisti della Terra', 'Porta il Nucleo Primordiale a Rethelshi.', 'Rethelshi a Valdrakken sarà felice di usarlo per la sua ricerca sui Primalisti.', '', '', '', '', '', '', 47187),
(70722, 'itIT', 'Le necessità di Lubbins', 'Parla con Patchu a Iskaara.', 'Credo di sapere cosa dobbiamo fare, $n.\n\nPrima, però, parliamo!\n\nHo anche un regalo per te per quando avremo finito! Divertente, no?', '', '', '', '', '', '', 47187),
(70721, 'itIT', 'Proposta di matrimohnio', 'Aiuta il Saggio del Vento Dawa e il Cacciatore Narman con la loro proposta di matrimonio.', 'C\'è un piccolo stagno accanto allo Specchio del Cielo; io e Narman ci siamo incontrati lì la prima volta, durante il mio addestramento da iniziato.\n\nGli iniziati si recano lassù per essere più vicini a Ohn\'ahra, così da poter sentire il vento. Ho visto il suo riflesso nell\'acqua quando una brezza improvvisa mi ha fatto aprire gli occhi. È il panorama più bello dell\'intera pianura.\n\nSarà il posto perfetto per la proposta.', '', '', '', '', '', '', 47187),
(70720, 'itIT', 'Non sono per te', '', '', '', '', '', '', '', '', 47187),
