(70716, 'itIT', 'Stormo dei Draghi (70) E', '', '', '', '', '', '', '', '', 47187),
(70715, 'itIT', 'Stormo dei Draghi (70) E', '', '', '', '', '', '', '', '', 47187),
(70713, 'itIT', 'Pesca d\'altura', '', '', '', '', '', '', '', '', 47187),
(70711, 'itIT', 'Percorso per le Rapide - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(70710, 'itIT', 'Percorso per le Rapide', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(70708, 'itIT', 'Vuoto interiore', 'Bevi qualcosa con Kolgar.', 'Sembra che siano passati anni. Sembra anche che siano passati pochi minuti.\n\nSe hai tempo, mi piacerebbe parlare un po\'.\n\nCi prendi un giro di bevande? Prendi quello che vuoi, offro io.', '', '', '', '', '', '', 47187),
(70706, 'itIT', 'Portale: Santuario Ombroso', 'Trova il portale dormiente nel Santuario Ombroso presso le Pianure di Ohn\'ahra.', 'Dalla spedizione ci segnalano la presenza di una pietra dormiente sulle lussureggianti colline a sud-ovest. È un po\' lontano, ma vale la pena mandare una persona come te, con le tue conoscenze, a indagare.', '', '', '', '', '', '', 47187),
(70703, 'itIT', 'L\'eredità del Forte di Tyr', 'Esamina la Scaglia Argentea con Koranos al Forte di Tyr.', 'Certo, il Guardiano Tyr amava i suoi misteri. Chiaramente, c\'è un significato più profondo dietro al dono che ci ha fatto. Probabilmente ha forgiato questa scaglia nel suo forte, potrebbe essere la chiave per aiutarci a sbloccarne i segreti.\n\nVai al Forte di Tyr con Koranos, $n. In quanto fidato consigliere e guardiano di questa terra, certamente saprà qualcosa a riguardo.', '', '', '', '', '', 'Parla con Koranos al Forte di Tyr.', 47187),
(70702, 'itIT', 'Esplorazione prolungata dei portali', 'Incontra Thaelin Forgiacupa all\'Avamposto delle Scaglie di Rubino nelle Sponde del Risveglio.', '<Il forte e stridulo richiamo del messaggero attira la tua attenzione. Ti consegna una nota prima di allontanarsi di corsa.>\n\n<Si tratta di una richiesta da parte di Thaelin Forgiacupa, che ha bisogno del tuo aiuto.>', '', '', '', '', '', '', 47187),
(70701, 'itIT', 'Contare le argali', 'Raduna le Argali Perdute e riportale al Clan Aylaag.', 'Alcune argali del nostro clan si sono allontanate di nuovo dal gregge.\n\nIl crinale attorno a noi è troppo pericoloso per i nostri pastori, sarebbe un gesto importante per noi se prendessi uno dei nostri bakar e riportassi a casa le argali. I nostri pastori possono indicarti la giusta direzione.', '', '', '', '', '', '', 47187),
(70698, 'itIT', 'Ricercatrice Alafurba', '', '', '', '', '', '', '', '', 47187),
(70697, 'itIT', 'L\'opinione dell\'esperta', 'Parla con Patchu nella Vastità Azzurra.', 'Le ferite di Lubbins saranno anche guarite, ma temo che la sua fiducia sia ancora incrinata. Credo sia ora di chiedere aiuto.\n\nA sud-ovest, in una sezione remota della Vastità Azzurra, c\'è un\'istruttrice di mascotte di nome Patchu. È una tra gli esperti più autorevoli del mondo.\n\nRaggiungila, potrà sicuramente aiutare Lubbins!', '', '', '', '', '', '', 47187),
(70662, 'itIT', 'Osso per osso, piccone per piccone', '', '', '', '', '', '', '', '', 47187),
(70659, 'itIT', 'Catalogando le Pianure di Ohn\'ahra', '', '', '', '', '', '', '', '', 47187),
(70658, 'itIT', 'Manufatto o fatto di fantasia?', '', '', '', '', '', '', '', '', 47187),
(70655, 'itIT', 'Foglie di vite al massimo', '', '', '', '', '', '', '', '', 47187),
(70653, 'itIT', 'Con la scienza non si scherza', '', '', '', '', '', '', '', '', 47187),
(70652, 'itIT', 'Fuori uno!', '', '', '', '', '', '', '', '', 47187),
(70648, 'itIT', 'Firava il Riaccenditore', '', '', '', '', '', '', '', '', 47187),
(70647, 'itIT', 'Oh, dove, oh, dove mai sarà?', 'Salva Lubbins e riportalo da Jyhanna all\'Asilo Scagliette a Valdrakken.', '$n, sono così felice di vederti! La preoccupazione mi divora e mi farebbe comodo il tuo aiuto.\n\nDi recente ho salvato un cucciolo di proto-draco abbandonato che ho chiamato Lubbins. È adorabile! L\'ho portato qui, in modo da potermi prendere cura di lui e magari trovargli una bella casa come animaletto da compagnia.\n\nMa ora è scomparso e temo che si sia perso o sia ferito. Io devo tenere d\'occhio questi piccoletti, potresti andare tu al posto mio?', '', '', '', '', '', '', 47187),
(70646, 'itIT', 'Valvola della Pressione', '', '', '', '', '', '', '', '', 47187),
(70644, 'itIT', 'Domare la Capra Selvaggia', '', '', '', '', '', '', '', '', 47187),
(70643, 'itIT', 'Esplosivi arcani', '', '', '', '', '', '', '', '', 47187),
(70641, 'itIT', 'Un giuramento risvegliato', 'Parla con i membri dello Stormo dei Draghi Rossi vicino al Tempio della Vita di Rubino.', 'Aspetta un momento, $p. Desidero ringraziarti personalmente per il tuo aiuto nel ripristinare la nostra Pietra del Giuramento.\n\nNon ero a conoscenza dei Dracthyr fino al vostro risveglio sull\'Isola Proibita. Non era chiaro se il vostro ritorno tra noi fosse una benedizione per la vita... o la sua rovina.\n\nTi consiglio di scoprire di più sulla nostra Pietra del Giuramento. Parla con alcuni membri del mio stormo qui al Tempio della Vita di Rubino. Forse i loro racconti ti saranno familiari.', '', '', '', '', '', '', 47187),
(70640, 'itIT', 'RICERCATO: Boss', 'Uccidi Frigellus nei pressi dell\'Accampamento Antonidas.', '<Le iscrizioni della pagina brillano di una fioca luce blu.>\n\nIl Frigellus elementale, una sorta di trastullo un tempo molto apprezzato da Malygos, ha sofferto della noncuranza del suo padrone.\n\nAnche se questo insediamento un tempo sereno è ormai crollato, la rozza e giocosa creatura ha continuato a crescere, corrotta e deturpata dal male che affligge questa terra.\n\nFai in modo di eliminarla.\n\nInforma il Custode Cynegos del tuo successo.', '', '', 'Frigellus', '', '', '', 47187),
(70638, 'itIT', 'Il Demolitore del Vento', '', '', '', '', '', '', '', '', 47187),
(70634, 'itIT', 'Agitazione', '', '', '', '', '', '', '', '', 47187),
(70633, 'itIT', 'Alimentare il Motore', 'Usa l\'Essenza Imbottigliata per dare energia al Motore dell\'Innovazione.', 'Hai fatto un buon lavoro nel superare la prima delle sfide lasciate dal Guardiano Tyr. Non è che il primo passo del tuo viaggio, ma confido nel tuo successo. Ti sei $gmeritato:meritata; una possibilità di addentrarti ulteriormente nei segreti della Forgia.\n\nAggiungi l\'Essenza Imbottigliata al Motore dell\'Innovazione e vediamo cosa succede.', '', '', '', '', '', '', 47187),
(70632, 'itIT', 'Catalogando le Sponde del Risveglio', '', '', '', '', '', '', '', '', 47187),
(70631, 'itIT', 'Ripulire i cieli', '', '', '', '', '', '', '', '', 47187),
(70627, 'itIT', 'Che ne è del Clan Mantogelido?', 'Incontra Sonova Pestaneve al Presidio di Theron.', 'Potremmo unirci a un altro clan... ma non sappiamo di chi fidarci.\n\nTemo che i Primalisti abbiano tentato gli altri clan come hanno fatto col nostro.\n\nQuesta \"Spedizione delle Scaglie di Drago\" sostiene di avere un collegamento con il clan Mantogelido.\n\nPotrebbero essere corrotti. O potrebbero ascoltare il nostro avvertimento. In ogni caso, hanno bisogno di noi.\n\nC\'è un esperto di Mezzorsi al Presidio di Theron, Sonova Pestaneve. Va\' da lui e scopri cosa sa.', '', '', '', '', '', '', 47187),
(70625, 'itIT', 'Creazione Forgiata dalla Magia', '', '', '', '', '', '', '', '', 47187),
(70623, 'itIT', 'Ripulire i cieli', '', '', '', '', '', '', '', '', 47187),
(70620, 'itIT', 'La vita è fatta a scaglie', 'Raccogli $1oa Scaglie Adamantine per Ralathor il Robusto a Valdrakken.', 'Molti mi chiedono come sia diventato così bravo nella Scuoiatura. È a loro che rispondo: sono le scaglie.\n\nVuoi saperne di più? Portami delle scaglie, cosicché possa mostrarti di cosa parlo.', '', '', '', '', '', '', 47187),
(70618, 'itIT', 'La chiamata della forgia', 'Raccogli $1oa Minerale di Serevite per Sekita lo Scavaterra a Valdrakken.', 'La forgia... mi chiama. E vuole la Serevite. Tu, laggiù! Portami della Serevite! Sì, montagne di Serevite! <Sekita inizia a ridere con ardore.>', '', '', '', '', '', '', 47187),
(70617, 'itIT', 'Mio, mio, tutto mio!', 'Raccogli $1oa Minerale di Draconium per Sekita lo Scavaterra a Valdrakken.', 'Non c\'è niente di più utile del minerale di Draconium. Ci si possono fare tantissime cose. È il minerale perfetto, puro in ogni aspetto.\n\nPortami del Draconium. Devo averlo. Sei $gun minatore:una minatrice;, no? Allora mina!', '', '', '', '', '', '', 47187),
(70613, 'itIT', 'Portagli la Scorzatorta prima che torcano te', 'Raccogli $1oa Scorzatorta per Agrikus a Valdrakken.', '$p, sei $gun erbalista:un\'erbalista; capace, o sbaglio? È pieno di alchimisti che bussano alla mia porta... Be\', non che abbia una porta... Ma mi supplicano di fornirgli altra Scorzatorta. Abbiamo quasi esaurito le scorte!\n\nMi aiuterai a ottenerne altra? Temo che se gli alchimisti non potranno creare le fiale di cui hanno bisogno, inizieranno a utilizzare altri dei miei materiali.', '', '', '', '', '', '', 47187),
(70595, 'itIT', 'Sono richiesti servizi di Sartoria', 'Completa Ordini d\'Artigianato di Sartoria per il Consorzio degli Artigiani.', 'Ciao, ciao, ciao, $p! Gli Ordini d\'Artigianato stanno arrivando a destra e a manca!\n\nSe stai cercando lavoro, il Consorzio degli Artigiani ha sempre ordini da evadere!\n\nPuoi dare un\'occhiata ai nostri ordini pubblici o, se hai costruito una rete di clienti personale, completare alcuni ordini di gilda oppure ordini personali! Basta farlo, farlo, farlo!', '', '', '', '', '', '', 47187),
(70594, 'itIT', 'Sono richiesti servizi di Conciatura', 'Completa Ordini d\'Artigianato di Conciatura per il Consorzio degli Artigiani.', 'Ciao, ciao, ciao, $p! Gli Ordini d\'Artigianato stanno arrivando a destra e a manca!\n\nSe stai cercando lavoro, il Consorzio degli Artigiani ha sempre ordini da evadere!\n\nPuoi dare un\'occhiata ai nostri ordini pubblici o, se hai costruito una rete di clienti personale, completare alcuni ordini di gilda oppure ordini personali! Basta farlo, farlo, farlo!', '', '', '', '', '', '', 47187),
(70593, 'itIT', 'Sono richiesti servizi di Oreficeria', 'Completa Ordini d\'Artigianato di Oreficeria per il Consorzio degli Artigiani.', 'Ciao, ciao, ciao, $p! Gli Ordini d\'Artigianato stanno arrivando a destra e a manca!\n\nSe stai cercando lavoro, il Consorzio degli Artigiani ha sempre ordini da evadere!\n\nPuoi dare un\'occhiata ai nostri ordini pubblici o, se hai costruito una rete di clienti personale, completare alcuni ordini di gilda oppure ordini personali! Basta farlo, farlo, farlo!', '', '', '', '', '', '', 47187),
(70592, 'itIT', 'Sono richiesti servizi di Runografia', 'Completa Ordini d\'Artigianato di Runografia per il Consorzio degli Artigiani.', 'Ciao, ciao, ciao, $p! Gli Ordini d\'Artigianato stanno arrivando a destra e a manca!\n\nSe stai cercando lavoro, il Consorzio degli Artigiani ha sempre ordini da evadere!\n\nPuoi dare un\'occhiata ai nostri ordini pubblici o, se hai costruito una rete di clienti personale, completare alcuni ordini di gilda oppure ordini personali! Basta farlo, farlo, farlo!', '', '', '', '', '', '', 47187),
(70591, 'itIT', 'Sono richiesti servizi di Ingegneria', 'Completa Ordini d\'Artigianato di Ingegneria per il Consorzio degli Artigiani.', 'Ciao, ciao, ciao, $p! Gli Ordini d\'Artigianato stanno arrivando a destra e a manca!\n\nSe stai cercando lavoro, il Consorzio degli Artigiani ha sempre ordini da evadere!\n\nPuoi dare un\'occhiata ai nostri ordini pubblici o, se hai costruito una rete di clienti personale, completare alcuni ordini di gilda oppure ordini personali! Basta farlo, farlo, farlo!', '', '', '', '', '', '', 47187),
(70589, 'itIT', 'Sono richiesti servizi di Forgiatura', 'Completa Ordini d\'Artigianato di Forgiatura per il Consorzio degli Artigiani.', 'Ciao, ciao, ciao, $p! Gli Ordini d\'Artigianato stanno arrivando a destra e a manca!\n\nSe stai cercando lavoro, il Consorzio degli Artigiani ha sempre ordini da evadere!\n\nPuoi dare un\'occhiata ai nostri ordini pubblici o, se hai costruito una rete di clienti personale, completare alcuni ordini di gilda oppure ordini personali! Basta farlo, farlo, farlo!', '', '', '', '', '', '', 47187),
(70586, 'itIT', 'Cuci-nare in troppi', 'Crea $1oa Cappelli da Chef di Stoffabrada per Fulafong a Valdrakken.', 'Se c\'è una cosa che ho imparato nei miei anni da sarta, $p, è che troppi cuochi in cucina rovinano il brodo.\n\nIn questo caso, stavo per andare a bere qualcosa, quando è arrivato un ordine per un intero guardaroba di uniformi da chef.\n\nSe tu cucirai i cappelli, io mi occuperò del resto.', '', '', '', '', '', '', 47187),
(70582, 'itIT', 'Tessi al meglio, senza aiuti', 'Crea $1oa Rotoli di Stoffabrada per Fulafong a Valdrakken.', 'Se c\'è una cosa che ho imparato nei miei anni da sarta, $p, è l\'importanza della pratica.\n\nDevi sempre fare pratica, anche quando credi di aver padroneggiato ogni tecnica. Voglio che tu sia in grado di tessere in maniera eccellente senza la mia supervisione.\n\nPerché non fai pratica questa settimana? Crea alcuni Rotoli di Stoffabrada della miglior qualità possibile.', '', '', '', '', '', '', 47187),
(70571, 'itIT', 'Qui si vendono tamburi!', 'Crea $1oa Tamburi di Pelle Ferina per Plasmapelli Koruz a Valdrakken.', 'Siamo famosi ovunque per i nostri tamburi, i Centauri perfezionano questa tecnica da generazioni. Sfortunatamente, significa che i nostri tamburi sono in numero ridotto al giorno d\'oggi.\n\nHai una certa abilità anche tu, lo vedo, forse potresti aiutarmi e creare alcuni tamburi per i nostri negozi?', '', '', '', '', '', '', 47187),
(70569, 'itIT', 'Tasche per Trisket', 'Crea $1oa Cestini per i Fiori dell\'Erbalista per Plasmapelli Koruz a Valdrakken.', 'Ho molti preziosi clienti, ma Trisket è uno dei migliori e di recente mi ha contattato, perché ha rotto la sua sacca da erbalista.\n\nHo colto l\'occasione per offrirgli una selezione di cestini per rimpiazzare la sua vecchia sacca.\n\nPotresti aiutarmi con questo compito, $p? Trisket apprezzerebbe di sicuro.', '', '', '', '', '', '', 47187),
(70567, 'itIT', 'Quando dai un osso a un bakar', 'Crea $1oa Balestre di Ossabattute per Plasmapelli Koruz a Valdrakken.', 'Avevo alcuni dei più splendidi Archi di Ossabattute, ma i nostri bakar ci sono arrivati prima che potessimo usarli, amano masticare le ossa, che sia un arco oppure no, e ora sono rovinati!\n\nPuoi aiutarmi a crearne altri?', '', '', '', '', '', '', 47187),
(70565, 'itIT', 'Separazione per saturazione', 'Crea $1oa Pendenti dei Pericoli Imminenti per Tuluradormi a Valdrakken.', 'Orefice, ti piace la mia collana?\n\nCerto che ti piace. Purtroppo, non mi è possibile mostrarla debitamente a meno che sia messa in risalto.\n\nHo un\'idea, perché non crei alcuni semplici pendenti? Inonderemo il mercato con quelli; una volta che tutti indosseranno uno dei tuoi pezzi, la mia collana di qualità superiore risalterà senz\'altro!', '', '', '', '', '', '', 47187),
(70564, 'itIT', 'Che occhio!', 'Crea $1oa Lenti d\'Ingrandimento d\'Onice Frammentato per Tuluradormi a Valdrakken.', 'Orefice, sta per tenersi un\'esibizione, però mi preoccupa l\'idea che i clienti non riescano ad ammirare la bellezza di ogni taglio senza un debito paio di lenti.\n\nNon ti serve nulla di particolare, crea alcune lenti perché i nostri clienti possano vedere chiaramente.', '', '', '', '', '', '', 47187),
(70563, 'itIT', 'L\'esibizione', 'Crea varie gemme per Tuluradormi a Valdrakken.', 'Orefice, cosa ne pensi di fare pratica di taglio delle gemme?\n\nAvevo intenzione di mettere in mostra vari tagli. Potrei considerare di esporre anche le tue gemme, purché tu faccia in fretta. Non portarmi nulla da esporre che non sia di altissima qualità.', '', '', '', '', '', '', 47187),
(70560, 'itIT', 'L\'attrezzo più importante: una buona documentazione', 'Crea $1oa Compendi dell\'Esploratore del Nucleo per Talendara a Valdrakken.', '$gMio:Mia; apprendista! Oggi ti va di scrivere? La Spedizione delle Scaglie di Drago ha portato una gran quantità di annotazioni dalle loro avventure; ci è stato chiesto di riscrivere i loro scarabocchi in bella grafia e farne un compendio da poter usare sul campo. Ahimè, la mia mano non ce la fa oggi. Posso affidarmi a te?', '', '', '', '', '', '', 47187),
(70559, 'itIT', 'Rimetterci le penne', 'Crea $1oa Penne Fasciate dello Scriba per Talendara a Valdrakken.', '$gMio:Mia; apprendista, sono felice di vederti.\n\nAlcuni novizi oggi sono venuti da me per provare la Runografia. Hanno usato tutti troppa forza, rompendo così i loro pennini.\n\nDetesto chiedertelo, ma potresti creare delle nuove penne da tenere come scorta?', '', '', '', '', '', '', 47187),
(70558, 'itIT', 'Illusioni disilluse', 'Crea $1oa Cartapecora Illusoria - Scudo Magico per Talendara a Valdrakken.', '$gMio caro apprendista runografo:Mia cara apprendista runografa;, non potevi scegliere un momento migliore.\n\nC\'è stato un terribile incidente! Tutta la Cartapecora Illusoria che ho ordinato si è rivelata reale! Riesci a crederci? Pensano che sia un gioco? Qualcuno potrebbe farsi male!\n\nPensi di poter sistemare la situazione e creare delle vere illusioni?', '', '', '', '', '', '', 47187),
(70557, 'itIT', 'Senza mirare', 'Crea $1oa Fuochi d\'Artificio dello Stormo di Bronzo per Pinzalesta Scoppiabombe a Valdrakken.', 'Santi arnesi, non sai cosa ho in serbo per te oggi!\n\nA quanto pare, una mania per i fuochi d\'artificio si è diffusa tra i cacciatori. Cercano di spararli per spaventare le papere e farle volare. Scommetto che le papere sono troppo furbe per cascarci, ma ciò non significa che non possiamo guadagnarci qualcosa! Pensi di potercela fare?', '', '', '', '', '', '', 47187),
(70550, 'itIT', 'Ti do il benvenuto nell\'Adunanza.', 'Parla con Xavin nell\'Adunanza di Cobalto per vedere quali abilità sono disponibili nell\'area.', 'Ci farebbe comodo il tuo aiuto.\n\nLa Fiamma Frammentata ha preso il controllo della maggior parte dell\'Adunanza di Cobalto.\n\nAiutaci a combatterli. Siamo in pochi, ma ti saremo utili.', '', '', '', '', '', '', 47187),
(70549, 'itIT', 'Il frutto appetitoso appeso più in basso', '', '', '', '', '', '', '', '', 47187),
(70542, 'itIT', 'Rally della Vastità Azzurra', '', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(70541, 'itIT', 'Tattiche di caccia: Compagno', 'Scegli se combattere al fianco di un bakar o di un\'ohuna durante la Grande Caccia.', 'La tua Fama con i Maruuk cresce. Ora puoi cacciare insieme a un tenace bakar o a una veloce ohuna.', '', '', '', '', '', '', 47187),
(70540, 'itIT', 'Il miglior amico di un Ingegnere', 'Crea $1oa Multistrumenti per Pinzalesta Scoppiabombe a Valdrakken.', 'Ehi, hai visto il mio...\n\nEhm... forse potresti passarmi il...\n\nNe ho abbastanza, è il momento di procurarsi qualche attrezzo in più in questo negozio, mi capisci?', '', '', '', '', '', '', 47187),
(70533, 'itIT', 'Formula ben oliata', 'Crea $1oa Olio di Fuocotorto per Conflago a Valdrakken.', 'Sapevi che l\'Olio di Fuocotorto è un ottimo reagente per rifinire le tue formule? Io sì, però l\'ho finito. Non posso lavorare senza un\'ampia scorta di oli. Ti prego, $p, aiutami a rifornire il mio laboratorio.', '', '', '', '', '', '', 47187),
(70532, 'itIT', 'Aiutare gli incursori', 'Crea $1oa Pozioni di Cura Rinfrescanti per Conflago a Valdrakken.', 'Oh, $p, sono felice di vederti. Molti campioni sono stati feriti nell\'ultimo attacco contro i Primalisti. Abbiamo urgente bisogno di pozioni di cura. Come $gavventuriero:avventuriera;, immagino ne avrai parecchie a portata di mano. Ce ne serviranno molte.', '', '', '', '', '', '', 47187),
(70526, 'itIT', 'Rally delle Pianure di Ohn\'ahra', '', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(70501, 'itIT', 'Licenza di cacciare', 'Completa gli incarichi di addestramento della Grande Caccia.', 'Ah, finalmente sei $gpronto:pronta; a dimostrare il tuo valore? Ricorda che non si tratta semplicemente di andarsene in giro a dare la caccia a tutto ciò che si muove. La caccia degli Shikaar ha uno scopo. Cacciamo per sfamare e vestire il clan, per dimostrare la nostra forza contro i potenti nemici e per mantenere l\'equilibrio della natura.\n\nNon cacciamo sradicando ogni cosa, ma piantiamo i semi per la futura Grande Caccia. Dimostra di essere in grado di seguire queste istruzioni e potrai unirti a noi.\n\nTuttavia, non penso di poter dire la stessa cosa del tuo amico...', '', '', '', '', '', '', 47187),
(70450, 'itIT', 'Lontruk, lontruk ovunque', 'Spaventa le Lontruk Fastidiose.', 'Ehi, $gamico:amica;. Quelle lontruk continuano a rubarmi la preda!\n\nPersonalmente, le farei saltare in aria tutte, ma i nostri amici Tuskarr non sembrano molto d\'accordo. Ho creato questo dispositivo di dissuasione MK-SQ4L0, ma... non sono un grande nuotatore.\n\nTu sembri $guno:una; che ci sa fare. Perché non ci fai un favore, attivi il dispositivo, ti fai una nuotatina e le spaventi?', '', '', '', '', '', '', 47187),
(70446, 'itIT', 'Una storia personale', 'Incontra Bracithal presso l\'Osservatorio d\'Ossidiana.', 'Esplorando gli archivi, ho appreso che l\'Osservatorio di ossidiana è un luogo di importanza personale per il Custode della Terra. Posso solo immaginare quale conoscenza possa contenere sulla storia del nostro stormo...\n\nDato l\'interesse di Bracithal per l\'argomento, l\'ho informata della mia scoperta e spero vivamente che non sia stato un errore.\n\nÈ andata avanti in esplorazione. Ti prego di tenerla d\'occhio. È competente, ma questo argomento è piuttosto... spinoso. Chissà cosa potreste scoprire.', '', '', '', '', '', '', 47187),
(70444, 'itIT', 'I Campi della Ferocia', 'Incontra Gurgthock ai Campi della Ferocia.', 'Ai più coraggiosi tra gli Shikaar!\n\nRadunate i migliori e dirigetevi ai Campi della Ferocia. Potreste essere incoronati come i più feroci di tutti!\n\nDimostrate la vostra forza. Mostrateci il vostro combattimento migliore!\n\nSi applicano termini e condizioni.', '', '', '', '', '', '', 47187),
(70442, 'itIT', 'Battaglia al banchetto', '', '', '', '', '', '', '', '', 47187),
(70439, 'itIT', 'L\'Arcano Selvaggio', '', '', '', '', '', '', '', '', 47187),
(70438, 'itIT', 'Pesce volante', 'Raccogli dei pesci per rifornire la zona di pesca e sali sul draco per lanciarli dall\'alto.', 'Dovrebbero abboccare più pesci, non credi?\n\nEhi, mi è venuta un\'idea. La leggenda dice che questi laghi e questi fiumi non sono sempre stati pescosi. Si racconta che questi buchi si sono riempiti di pesci quando i draghi hanno deciso di alzarsi in volo e buttarceli dentro! Riesci a crederci?\n\nForse tu e il tuo draco potreste provare?', '', '', '', '', '', '', 47187),
(70437, 'itIT', 'Al Forte di Tyr', 'Incontra Alexstrasza presso il Seggio degli Aspetti.', 'Sono passati secoli dall\'ultima volta in cui gli stormi hanno visitato il Forte di Tyr.\n\nCiò nonostante, dobbiamo recarci là per scoprire se la Pietra del Giuramento Madre funziona ancora.\n\nTorna a parlare con me al Seggio degli Aspetti. Dobbiamo scoprire di più sui pericoli che potremmo incontrare nell\'antica fortezza di Tyr.', '', '', '', '', '', 'Incontra Alexstrasza al Forte di Tyr.', 47187),
