(70414, 'itIT', 'Terra tremante', 'Piazza i Totem Frantumanti per liberare i Rocciosi delle Caverne intrappolati.', 'Nel nome di Khaz\'goroth, cosa succede qui?\n\nQuesto magma sembra dotato di pensiero e sta consumando i Rocciosi delle Caverne. Non può essere un caso... devo scoprire cosa sta succedendo!\n\nPiazza questi Totem Frantumanti vicino agli elementali intrappolati per liberarli!', '', '', '', '', '', '', 47187),
