(70390, 'itIT', '(DNT) Chloe\'s Onboarding Kill Quest', 'Kill %1oa CREATURE NAME in POI NAME.', 'Uccidi queste creature che non sono ancora state create e aiutami ad apprendere!', '', '', '', '', '', '', 47187),
(70377, 'itIT', 'Stile trascurato', 'Trova a chi appartengono gli occhiali da sole.', '<Un disgustoso paio di occhiali da sole ricoperti di melma, ma sembrano molto costosi.>\n\n<Qualcuno sicuramente li sta cercando, è uno stile molto di moda al momento.>', '', '', '', '', '', '', 47187),
(70376, 'itIT', 'Seconda Sfida di Tyr: Vigore', 'Completa la Seconda Sfida di Tyr presso le Pianure di Ohn\'ahra.', '<Quando ti avvicini, l\'iscrizione sulla statua emette un debole bagliore.>\n\n\"Imbraccia il potere del Guardiano e dimostra l\'incrollabile determinazione di chi si erge forte.\"', '', '', '', '', '', '', 47187),
(70374, 'itIT', 'Himia, la Benedetta', 'Sconfiggi gli elementi.', 'Gli elementi rivendicano questa terra e non vedono di buon occhio la nostra intrusione.\n\nO, elementi, avete dimenticato la nostra protettrice, l\'aria! Invisibile, eppure onnipresente e vitale per ogni forma d\'esistenza! Dimenticata, con la stessa semplicità con cui la respirate. Dopo avermi affrontata, non la dimenticherete mai più.', '', '', '', '', '', 'Torna dall\'Anziana Nazuun a Teerakai.', 47187),
(70373, 'itIT', 'Alamurgl!', 'Sali sul Salterino e sconfiggi Alamurgl!', 'Alamurgl! Alamurgl! Alamurgl delgrbrrl!\n\nGrrruuuuum blarglg!\n\n<Non hai bisogno di una traduzione per sapere che vogliono che tu abbatta la versione Murloc di Alamorte. Prima che tu possa accettare o rifiutare, senti il rombo di un macchinario che si avvicina!>', '', 'Alamurgl! Alamurgl! Alamurgl delgrbrrl!', 'Alamurgl', '', '', '', 47187),
(70371, 'itIT', 'Alamurgl!', 'Sali sul Salterino e sconfiggi Alamurgl!', 'Alamurgl! Alamurgl! Alamurgl delgrbrrl!\n\nGrrruuuuum blarglg!\n\n<Non hai bisogno di una traduzione per sapere che vogliono che tu abbatta la versione Murloc di Alamorte. Prima che tu possa accettare o rifiutare, senti il rombo di un macchinario che si avvicina!>', '', 'Alamurgl! Alamurgl! Alamurgl delgrbrrl!', 'Alamurgl', '', '', '', 47187),
(70370, 'itIT', 'Esame per l\'occupazione', 'Rispondi al quiz sulla personalità di Efesta per scoprire la tua professione ideale.', 'Ciao! Ti interessa lavorare con il Consorzio degli Artigiani per ottenere profitti abbondanti e fornire beni e servizi per i clienti di tutta Azeroth?\n\nEccellente! Quali due abilità hai approfondito?\n\nMmm? Hai solo una professione? Che opportunità sprecata!\n\n<Efesta riflette per un istante.>\n\nCi sono! Ti farò una serie di domande sulla tua personalità e scopriremo quale seconda professione si abbina meglio alla prima! Che ne dici?', '', '', '', '', '', '', 47187),
(70368, 'itIT', 'Esame per l\'occupazione', 'Rispondi al quiz sulla personalità di Efesta per scoprire la tua professione ideale.', 'Ciao! Ti interessa lavorare con il Consorzio degli Artigiani per ottenere profitti abbondanti e fornire beni e servizi per i clienti di tutta Azeroth?\n\nMmm? Non hai alcuna professione? Che opportunità sprecata!\n\n<Efesta riflette per un istante.>\n\nCi sono! Ti farò una serie di domande sulla tua personalità e scopriremo quale professione faccia al caso tuo! Che ne dici?', '', '', '', '', '', '', 47187),
