(70355, 'itIT', 'Alchimia delle Isole dei Draghi', '', '', '', '', '', '', '', '', 47187),
(70352, 'itIT', 'Sempre più in alto', 'Uccidi i drospi cornuti e i Proto-Drachi Territoriali con Toluiqi.', 'Ehi, $gstraniero:straniera;! Hai già ucciso dei proto drachi, vero?\n\nQuindi, è logico pensare che con la tua esperienza, combinata con la mia abilità di caccia, ne abbatteremo un bel po\'! Ci sono delle sorgenti nelle vicinanze che attraggono quelle bestie.\n\nAiutami a dimostrare alla mia folle altra metà che sono io la migliore nella caccia.', '', '', '', '', '', '', 47187),
(70351, 'itIT', 'Festa in giardino', 'Parla con Akora presso le Pozze della Vita di Rubino.', 'Ho curato questo giardino per anni, preparandomi per il giorno in cui avrei finalmente accettato il mio Richiamo Vitale, e ora quel giorno è qui!\n\nAdoro i fiori, gli alberi e le piante... perfino gli insetti che ci vivono. Quando curo il giardino, riesco a percepire lo spirito della natura, il Grande Spirito del Drago.\n\nResta una sola cosa da fare: invocherò il Grande Spirito del Drago, proprio come nelle leggende.\n\n<Akora sorride raggiante.>\n\nIncontriamoci in giardino, vicino alla pozza dove riposano le sue ossa, poi ti spiegherò meglio.', '', '', '', '', '', '', 47187),
(70341, 'itIT', 'Una vittoria ben meritata', 'Torna dal Motore dell\'Innovazione a Valdrakken.', 'La cosa più piccola può contenere il tesoro più grande.\n\nPorta l\'essenza al Motore dell\'Innovazione.', '', '', '', '', '', '', 47187),
(70339, 'itIT', 'Sulle orme di Tyr: le Pianure di Ohn\'ahra', 'Trova la Seconda Sfida di Tyr presso le Pianure di Ohn\'ahra.', 'Anche se hai fatto un buon lavoro nella prima sfida, dubito che le altre saranno così facili da superare. Il Guardiano Tyr ha creato il Motore dell\'Innovazione solo per coloro che sono abbastanza saggi da usarlo.\n\nSe non hai cambiato idea, puoi trovare la seconda sfida nelle Pianure di Ohn\'ahra. Non vedo l\'ora di mettere alla prova le tue capacità, $gavventuriero:avventuriera;.', '', '', '', '', '', 'Trova la Seconda Sfida di Tyr presso le Pianure di Ohn\'ahra.', 47187),
(70338, 'itIT', 'Hanno preso i cuccioli', 'Salva i cuccioli.', 'Se Sylvie è così angosciata, significa che lì ci sono i suoi cuccioli!\n\nMentre era malata, i Giganti devono aver rapito i suoi piccoli e lei era troppo debole per opporsi.\n\nI cuccioli sono energici a questa età, si spera che finora siano stati capaci di sfuggire alle fauci dei Giganti...\n\nTi faccio un incantesimo di invisibilità: presto, devi salvarli prima che vengano mangiati!', '', '', '', '', '', '', 47187),
(70337, 'itIT', 'Vegliardente', 'Porta le Campane del Vento degli Ohn\'ir a Vegliardente.', 'Saluti, $gstraniero:straniera;.\n\nI venti mi dicono che c\'è un gruppo che si nasconde nelle rovine di Vegliardente. Sembrano interessati solo al passato, mentre noi Centauri scegliamo di vivere per il presente con la grazia di Ohn\'ahra.\n\nCiò nonostante, essi sono ospiti nella nostra casa. Ho creato per loro queste campane del vento, così che possano sentire la presenza di Ohn\'ahra. Che possa portare loro gioia e conforto.', '', '', '', '', '', '', 47187),
(70335, 'itIT', 'Semplici attrezzi da scavo', '', '', '', '', '', '', '', '', 47187),
(70319, 'itIT', 'Nergazurai', 'Porta un Cuore di Lontruk, un Femore di Grinfiadura, una Scaglia di Cornolesto e uno Stomaco d\'Avvoltoio a Muqur il Piovoso all\'Avamposto di Passotronco.', 'Mio zio mi ha raccontato molte storie sulla sua battaglia con un cornolesto di nome Nergazurai. Mi ha raccontato delle sue scaglie fucsia che attraversano le colline mentre caccia la sua preda, degli artigli affilati e del morso velenoso.\n\nMentre ero fuori a caccia, ho visto il suo bagliore, ma troppo tardi. Mi ha morso a una spalla. È stato terribile, come diceva mio zio, ma sono sopravvissuto.\n\nDevo curare l\'infezione del morso. Ti prego, prendi i reagenti che mi servono. Il tempo stringe.', '', '', '', '', '', '', 47187),
(70299, 'itIT', 'Difesa draconica', 'Uccidi i Primalisti nella Cicatrice Tempestosa.', 'Ho sentito delle voci nel vento parlare di alcuni stranieri che si sono alleati con il Clan Nokhud nel tentativo di sconfiggere i nostri vicini draghi. Questi Primalisti sono una piaga nelle pianure dei nostri antenati.\n\nUccidili e portami i nuclei degli elementali che comandano.', '', '', '', '', '', '', 47187),
(70279, 'itIT', 'Il sangue dei draghi', 'Uccidi Karkidan.', 'Come avrai senza dubbio notato, questa terra ospita delle creature che crescono oltre le normali dimensioni.\n\nNoi consideriamo queste bestie benedette dalle divinità delle terre selvagge e le reputiamo bersagli onorevoli per i cacciatori che vogliono dimostrare la propria forza. Una di queste bestie, che chiamiamo Karkidan, è qui vicino. Sarebbe notevole, se riuscissi a sconfiggerla.', '', '', '', '', '', '', 47187),
(70268, 'itIT', 'Ricordi rivissuti', 'Consegna il Diario a Veritistrasz.', '<Hai trovato un diario parzialmente distrutto. Sembra essere stato scritto dal punto di vista di una giovane femmina dei Draghi Neri, prima della corruzione.>\n\n<Anche se la parte posteriore è illeggibile, sfogliando la parte iniziale un nome attira la tua attenzione: Veritistrasz.>', '', '', '', '', '', 'Consegna il diario a Veritistrasz nel Santuario di Rubino.', 47187),
(70244, 'itIT', 'Non c\'è Nokhud da vedere', 'Entra nel villaggio con la Khanam Matra Sarest e riconquistalo dai Nokhud.', 'Per migliaia di anni, i Teerai hanno protetto il Corno di Drusahl, la nostra reliquia più sacra. Saccheggiando questo villaggio, Balakar ha tradito tutto ciò che significa essere un Maruuk. Ora non vi può essere più redenzione per lui.\n\nDobbiamo riconquistare il Corno prima che Balakar riesca a distruggerlo e salvare i Teerai ancora vivi. Ti aiuterò personalmente a portare il falso Khan davanti alla giustizia. I Nokhud conosceranno l\'ira della Khanam Matra!', '', '', '', '', '', '', 47187),
(70242, 'itIT', 'Una vita e poi un\'altra', 'Ottieni un Ricettacolo Inerte da Trellain nel Tempio della Vita di Rubino.', 'Sentivo che il suo amico aveva una profonda cicatrice. Qualcosa in questo posto l\'ha riaperta... forse per permettergli di guarire in modo pulito.\n\nOra tocca a Kolgar guarire.\n\nCerca Trellain sulla terrazza sopra di noi, dovrebbe essere lì a lavorare con gli incantatori. Digli che mi serve uno dei ricettacoli che usa nel suo lavoro e te ne darà uno senza farti pagare.', '', '', '', '', '', '', 47187),
(70241, 'itIT', 'Un finale amaro', 'Porta Bathoras da Duroz e Kolgar.', 'È successo e basta, io... Stava dormendo e io stavo guardando altrove e... Venivamo qui ogni giorno, voleva solo sedersi con i cuccioli, non sapevo che...\n\n<La faccia di Kolgar è solcata dalle lacrime. Si strofina gli occhi con il dorso della mano.>\n\nNo, lo sapevo. Lo sapevo! Non so cosa fare. Cosa devo fare adesso?\n\nPuoi... Puoi cercare Bathoras?', '', '', '', '', '', '', 47187),
(70240, 'itIT', 'Cure palliative', 'Raccogli $1oa Scattofiori, $2oa Bassogigli in Fiore e una Fiala delle Pozze della Vita Piena.', 'È un bene che tu l\'abbia portato qui. Vedo che sta soffrendo molto, anche se lo sopporta bene. Purtroppo, questo è il destino che ci accomuna tutti.\n\nTemo che sia l\'età ad affliggerlo e non la malattia, ma posso alleviare la sua sofferenza.\n\nPotresti raccogliere alcuni scattofiori, bassogigli e dell\'acqua fresca dal giardino vicino? Posso creare una pozione per lenire il suo dolore.', '', '', '', '', '', '', 47187),
(70239, 'itIT', 'Rimpianti taciuti', 'Cammina con Duroz e Kolgar per trovare aiuto.', 'Duroz è vecchio, malato e testardo come un kodo. Non c\'è stato modo di impedirgli di salire sull\'aeronave per venire qui. La cosa migliore che potessi fare era sorreggerlo.\n\nL\'ho visto soffrire abbastanza volte sul campo di battaglia da sapere quando nasconde il suo dolore. Peggiora di giorno in giorno, da quando è qui. Puoi aiutarmi a portarlo dai produttori di pozioni? La birra non basta più.\n\nPosso aiutarlo io a camminare, se tu ti occupi di trasportare le armi.', '', '', '', '', '', '', 47187),
(70236, 'itIT', 'L\'Occhio del Drago Rimosso', 'Consegna l\'oggetto a Emilia Bellocq.', '<Potrebbe trattarsi di qualcosa che Emilia Bellocq sta cercando.>', '', '', '', '', '', '', 47187),
(70235, 'itIT', 'Conto per la riparazione', 'Crea $1oa Martelli per Riparazioni di Serevite per Plasmametallo Kuroko a Valdrakken.', 'Le Isole dei Draghi non ospitano un conflitto simile da millenni. Nessuno mette in dubbio il nostro lavoro, ma qualsiasi armatura soffre l\'uso costante. Ho un grosso ordine di Martelli per Riparazioni di Serevite e mi serve una mano per completarlo. Se mi aiuterai, ti fornirò altre informazioni per migliorare la tua Forgiatura delle Isole dei Draghi.', '', '', '', '', '', '', 47187),
(70233, 'itIT', 'Carenza di asce', 'Crea $1oa Asce di Draconium per Plasmametallo Kuroko a Valdrakken.', 'Un errore negli ordini ha causato una grave carenza di nuove asce per i nostri esploratori. Abbiamo immediato bisogno di Asce di Draconium e ci serve l\'aiuto di tutti i fabbri. In cambio possiamo offrire nuova Conoscenza della Forgiatura per permetterti di creare pezzi ancora più epici.', '', '', '', '', '', '', 47187),
(70229, 'itIT', 'Boku il Mistico', 'Trova Boku a Teerakai.', 'I mistici sono stati tutti richiamati al Rifugio del Torrente qualche giorno fa, ma un mistico è rimasto. Si chiama Boku. Si trova in cima alla collina, al santuario di Ohn\'ahra.\n\nÈ solo un iniziato, ma dovrebbe essere in grado di comunicare con Ohn\'ahra e ottenere la sua benedizione. Con Ohn\'ahra al nostro fianco, potremmo riuscire a vincere questa guerra prima che inizi.', '', '', '', '', '', 'Trova Boku a Teerakai.', 47187),
(70221, 'itIT', 'Una prova di valore', '', '', '', '', '', '', '', 'Ricevi Prova dell\'Artigiano da Thomas Bright.', 47187),
(70220, 'itIT', 'Il Santuario Ombroso', 'Parla con la Capitana della Guardia Alowen, Sariosa, Sidra la Guaritrice e Viranikus.', 'Dobbiamo informare il resto dello Stormo dei Draghi Verdi che la barriera per il Bosco Antico è in pericolo. Io e Gerithus abbiamo molto di cui discutere.\n\n$n, metterò il mio marchio su di te, così gli altri draghi che lo vedranno sapranno che sei $gun messaggero fidato:una messaggera fidata;.\n\nRaduna il mio stormo. Devono sapere tutto e prepararsi alla battaglia.', '', '', '', '', '', '', 47187),
(70215, 'itIT', 'La curiosità è la chiave', 'Parla con l\'Incantatrice Distorcente Delandra all\'Accampamento Antonidas.', 'La mia esitazione nel discutere di questi simboli non è legata a una mancanza di fiducia in te, ma alla natura sconosciuta dei simboli stessi e delle pietre su cui risiedono.\n\nSì, pietre, più di una in realtà, sparse attraverso le isole.\n\n<L\'Incantatrice Distorcente Delandra ti osserva, un barlume di curiosità mista a emozione le brilla negli occhi.>\n\nNon ne avevi idea.\n\nMolto bene, la tua insistenza e il tuo desiderio di trovarmi dimostrano il tuo interesse nel comprendere ciò che hai scoperto; forse è giunto il momento di discuterne più a fondo.', '', '', '', '', '', '', 47187),
(70213, 'itIT', 'Harkyn Pietracupa', '', '', '', '', '', '', '', '', 47187),
(70212, 'itIT', 'Penumbrus', '', '', '', '', '', '', '', '', 47187),
(70210, 'itIT', 'Una tradizione non dimenticata', 'Posiziona l\'incenso ed elimina le bestie spettrali dai Kurgan Eterni.', 'Una tradizione degli Aylaag, quando siamo in questo campo, è che i nostri membri si rechino in pellegrinaggio ai Kurgan Eterni, per chiedere protezione in viaggio da ciò che tormentava i nostri antenati. La presenza dei Nokhud, però, rende questo pellegrinaggio pericoloso.\n\nSe non ti dispiace, ti chiederei di rispettare la nostra tradizione.', '', '', '', '', '', '', 47187),
(70209, 'itIT', 'Qua-Quattacco', '', '', '', '', '', '', '', '', 47187),
(70207, 'itIT', 'Brandello di Coda', 'Consegna l\'oggetto a Emilia Bellocq.', '<Potrebbe trattarsi di qualcosa che Emilia Bellocq sta cercando.>', '', '', '', '', '', '', 47187),
(70204, 'itIT', 'Artiglio Dorato', 'Consegna l\'oggetto a Emilia Bellocq.', '<Potrebbe trattarsi di qualcosa che Emilia Bellocq sta cercando.>', '', '', '', '', '', '', 47187),
(70203, 'itIT', 'Pesca e libera: Testa di Drago Temporale', '', '', '', '', '', '', '', '', 47187),
(70202, 'itIT', 'Pesca e libera: Pesce Scorpione Ceruleo', '', '', '', '', '', '', '', '', 47187),
(70201, 'itIT', 'Pesca e libera: Falena di Mare', '', '', '', '', '', '', '', '', 47187),
(70200, 'itIT', 'Pesca e libera: Piranha Millemorsi', '', '', '', '', '', '', '', '', 47187),
(70199, 'itIT', 'Pesca e libera: Sgombro Panzascaglia', '', '', '', '', '', '', '', '', 47187),
(70198, 'itIT', 'Il richiamo delle isole', 'Incontra Naleidea Brillafiumi a Durotar.', 'I nostri alleati si stanno radunando a Durotar. È un momento molto emozionante!\n\nUnisciti a noi, $n! È ora di salpare verso le Isole dei Draghi!', '', '', '', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(70197, 'itIT', 'Il richiamo delle isole', 'Incontra Toddy Baffetta al Porto di Roccavento.', 'Sei $gpronto:pronta; per l\'avventura di una vita? Perché io lo sono!\n\nI nostri alleati sono stati radunati e riforniti. Cosa stai aspettando?\n\nIncontriamoci al Porto di Roccavento. È ora di salpare verso le Isole dei Draghi!', '', '', '', '', '', '', 47187),
(70196, 'itIT', 'Sfrondare la Riserva', '', '', '', '', '', '', '', '', 47187),
(70195, 'itIT', 'Travolti dalla tempesta', 'Salva Altan e cerca indizi sullo straniero.', 'Secondo i rapporti, i Nokhud erano accompagnati da uno straniero che brandiva una magia mai vista prima. Questo straniero ha squarciato i nostri ranghi come una tempesta.\n\nSe i Nokhud hanno alleati capaci di scatenare tutto quel caos, dobbiamo scoprire il più possibile.\n\nHo inviato la mia ohuna, Altan, a cercare lo straniero, ma non è ancora tornata indietro e la cosa mi preoccupa. $n, puoi cercare degli indizi su questo straniero e scoprire cos\'è successo ad Altan?', '', '', '', '', '', '', 47187),
(70194, 'itIT', 'Segreti della specializzazione: Sartoria', '', '', '', '', '', '', '', '', 47187),
(70193, 'itIT', 'Segreti della specializzazione: Scuoiatura', '', '', '', '', '', '', '', '', 47187),
(70192, 'itIT', 'Segreti della specializzazione: Estrazione', '', '', '', '', '', '', '', '', 47187),
(70191, 'itIT', 'Segreti della specializzazione: Conciatura', '', '', '', '', '', '', '', '', 47187),
(70190, 'itIT', 'Segreti della specializzazione: Erbalismo', '', '', '', '', '', '', '', '', 47187),
(70189, 'itIT', 'Segreti della specializzazione: Oreficeria', '', '', '', '', '', '', '', '', 47187),
(70188, 'itIT', 'Segreti della specializzazione: Runografia', '', '', '', '', '', '', '', '', 47187),
(70187, 'itIT', 'Segreti della specializzazione: Ingegneria', '', '', '', '', '', '', '', '', 47187),
(70186, 'itIT', 'Segreti della specializzazione: Incantamento', '', '', '', '', '', '', '', '', 47187),
(70185, 'itIT', 'Una bestia misteriosa', 'Trova e uccidi la bestia, poi riporta la prova dell\'uccisione all\'Esploratrice Tomul.', '<Trovi l\'impronta di una grossa zampa nel terreno. Ti guardi intorno, nessuna di queste creature ha zampe simili, soprattutto non di quelle dimensioni.>\n\n<Forse i Centauri rimarranno colpiti se caccerai questa grande bestia.>', '', '', '', '', '', 'Porta la Pelle di Konkhular all\'Esploratrice Tomul.', 47187),
(70184, 'itIT', 'Segreti della specializzazione: Forgiatura', '', '', '', '', '', '', '', '', 47187),
(70183, 'itIT', 'Segreti della specializzazione: Alchimia', '', '', '', '', '', '', '', '', 47187),
(70182, 'itIT', 'Il dolce sapore della vittoria', 'Torna dal Motore dell\'Innovazione a Valdrakken.', 'Le cose più piccole racchiudono un grande potenziale. L\'Essenza Imbottigliata potrà sembrare cosa da poco, ma contiene un immenso potere.\n\nPortala al Motore dell\'Innovazione.', '', '', '', '', '', '', 47187),
(70181, 'itIT', 'Prima Sfida di Tyr: Precisione', 'Completa la Prima Sfida di Tyr presso la Vastità Azzurra.', '<Quando ti avvicini, l\'iscrizione sulla statua emette un debole bagliore.>\n\n\"Imbraccia il potere del Guardiano e porta la sua luce verso un futuro migliore per tutti noi.\"', '', '', '', '', '', '', 47187),
(70180, 'itIT', 'Avvio? Avviato!', 'Aiuta Greyzik ad attivare il dispositivo misterioso.', 'Della gente in città sostiene che questo dispositivo sia stato creato dal leggendario Guardiano dei Titani Tyr.\n\nIl problema è che non si riesce a farlo funzionare! Abbiamo provato i soliti trucchetti, smontarlo, ruotarlo, un goccio di elettrocuzione. Nulla ha funzionato. Anzi, mi è venuta un\'idea.\n\nVedi quel girocottero laggiù? Salta su e vediamo se possiamo dare a questa roba dei Titani qualcosina di più... intenso.', '', '', '', '', '', '', 47187),
(70179, 'itIT', 'Due al prezzo di uno', 'Ottieni dei Materiali da Costruzione dagli Elementali della Terra locali.', 'Salve, $gavventuriero:avventuriera;! Mi sembri una persona capace, potresti darmi una mano?\n\nAzkra e io siamo incaricate di vegliare su questa torre, che si trova in un \"emozionante stato di pre-ristrutturazione\", come mi piace chiamarlo. Il problema è che, non appena abbiamo iniziato a ripararla, gli Elementali della Terra locali ci hanno attaccato!\n\nAl che ho pensato: Zefren, perché non occuparti degli Elementali della Terra recuperando al contempo un po\' di materiali da costruzione? E qui è dove entri in campo tu! Puoi aiutarmi?', '', '', '', '', '', '', 47187),
(70178, 'itIT', 'Kit di Forniture per la Spedizione', 'Esamina i nuovi attrezzi disponibili nel Kit di Forniture per la Spedizione al Campo delle Scaglie di Drago.', '$gEsploratore:Esploratrice;, le tue scoperte sono state preziose.\n\nC\'è ancora tanto da scoprire e abbiamo gli strumenti per aiutarti a farlo.\n\nTorna al Campo delle Scaglie di Drago e preparati usando il Kit di Forniture per la Spedizione.', '', '', '', '', '', '', 47187),
(70175, 'itIT', 'Legatura Rotta', 'Consegna l\'oggetto a Emilia Bellocq.', '<Potrebbe trattarsi di qualcosa che Emila Bellocq sta cercando.>', '', '', '', '', '', '', 47187),
(70174, 'itIT', 'Gli Shikaar', 'Incontra la Khan Sansok.', 'La Khan Sansok è la cacciatrice più abile del nostro clan. Anche se non sente, ha dimostrato le sue capacità più e più volte, sia come cacciatrice che come capo.\n\nÈ una guida per noi, un capo fidato e una feroce protettrice dei Maruuk.\n\nÈ un onore per te parlare con lei.', '', '', '', '', '', '', 47187),
(70172, 'itIT', 'Misteri montani', '', '', '', '', '', '', '', '', 47187),
(70171, 'itIT', 'Piccoli inconvenienti felici', 'Trova l\'ultimo lavoro di Hudson.', '<Gli occhi di Ranpiata sono lucidi.>\n\nSono io? È per causa mia che ha perso la scintilla?\nDice di amarmi, ma... hai sentito come si sente quando non dipinge.\nVoglio il meglio per lui, quindi se è così... me ne andrò.\n\nC\'è un ultimo lavoro che ha buttato via, l\'ultima cosa che ha provato a disegnare prima di arrendersi.\n\nNon potevo permettere che andasse perduto, quindi l\'ho nascosto a casa nostra. Per favore, portaglielo... come ricordo.', '', '', '', '', '', '', 47187),
(70170, 'itIT', 'Spazza via i demoni', 'Recupera i Dipinti Perduti di Hudson dai boss finali delle spedizioni Sale dell\'Infusione, Accademia di Algeth\'ar, Cripta Azzurra e Naltharus.', 'Sa essere molto testardo, temo.\n\nMa non posso rinunciare ora, dovremo provare di nuovo!\n\nCi sono altri dipinti che ha buttato là fuori. Si trovano in posti ancora più pericolosi, spero che tu abbia voglia di una nuova sfida!', '', '', '', '', '', '', 47187),
(70169, 'itIT', 'Anche gli alberi hanno bisogno di amici', 'Parla con Rauvros.', 'So che tu e Ran state solo cercando di essere d\'aiuto.\n\nNon credo che qualcuno possa aiutarmi. La mia scintilla, la mia voglia di dipingere, è semplicemente... sparita.\n\nMa Ran ha ragione. Ci proverò, almeno questo ve lo devo.\n\nPortami questo tuo amico artista in erba.', '', '', '', '', '', '', 47187),
(70168, 'itIT', 'Piccoli inconvenienti tristi', 'Recupera i Dipinti Perduti di Hudson dai boss finali delle spedizioni Pozze della Vita di Rubino, Offensiva dei Nokhud e Conca dei Felcepelle.', 'Sei $gvenuto:venuta; fin qui... Mi spiace.\n\nIl mio caro Hudson amava dipingere. Era la sua vita! Non so cos\'abbia causato questo blocco.\n\nQualche settimana fa, di ritorno da un viaggio, ha preso tutte le sue opere incompiute e le ha gettate via in un impeto di rabbia.\n\nPer favore, $gviaggiatore:viaggiatrice;, se non ti dispiace... potresti ritrovarle? Potrebbero restituirgli la scintilla di cui ha bisogno.\n\nHudson si avventura anche in luoghi pericolosi per trovare i panorami migliori. Spero che tu sia $gpreparato:preparata;.', '', '', '', '', '', '', 47187),
(70166, 'itIT', 'Passione per la pittura', 'Consegna il Dipinto d\'Introduzione di Rauvros a Hudson.', 'Ti piace la mia collezione? Queste sono tutte le opere più belle di Hudson, il più grande pittore mai esistito.\n\nSono rare e probabilmente hanno un grande valore. Hudson è un recluso e non dipinge nulla di nuovo da tempo. Oh, quanto mi piacerebbe incontrarlo, imparare da lui!\n\nTu... sembri una persona audace. Lo troveresti per me? E-ecco! Porta con te qualcuno dei miei lavori. Magari ne sarà colpito!\n\nO forse non gli piaceranno... Oh cielo.', '', '', '', '', '', '', 47187),
(70164, 'itIT', 'La possibilità di una Meccanista', 'Parla con il Cronomante Phosildral e Sibrit Schioccapagina nelle Rovine della Cripta della Vita.', 'Un momento, $p, sto per fare una nuova scoperta!\n\nDopo il crollo dell\'asilo, non ho perso solo la mia capacità di combattere, ho perso la mia identità di Dracthyr. Forse puoi capire.\n\nMi è sempre piaciuto comporre e scomporre cose, per cui ho preso parte alla spedizione... Ma questo manufatto mi sta causando problemi.\n\nChiederesti a Phosildral e Sibrit di rivedere i miei appunti? Voglio dimostrare di essere un abile meccanista, a loro e a me stesso.', '', '', '', '', '', '', 47187),
(70163, 'itIT', 'Caverne Intersecanti - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(70161, 'itIT', 'Caverne Intersecanti', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(70159, 'itIT', 'Sapore di casa', 'Chiedi ai membri dell\'Orda al Campo delle Scaglie di Drago se possono prestarti gli ingredienti necessari.', 'Oh, finalmente! $gUn altro Dracthyr pronto:Un\'altra Dracthyr pronta; a dare a una mano.\n\nIo e mio fratello abbiamo cercato di preparare delle razioni di cibo, ma...\n\n<Scaralesh indica l\'ambiente circostante.>\n\nTutto è così diverso, da queste parti. È difficile trovare gli stessi ingredienti con cui cucinavamo di solito.\n\nMa possiamo adattarci! Chiedi all\'Orda se ha qualcosa che possiamo usare come verdura, una fonte di proteine e del liquido per le emulsioni. Così, avremo un pasto.', '', '', '', '', '', '', 47187),
(70158, 'itIT', 'Passeggiata in Giardino - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(70157, 'itIT', 'Passeggiata in Giardino', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(70156, 'itIT', 'Un remoto risveglio', 'Potenzia il portale.', 'Il portale si trova dietro di me; non c\'è modo di sapere quanto tempo abbiamo prima che l\'incantamento del ricettacolo svanisca, o peggio, si spezzi.\n\nUna tale quantità di energia instabile, se rilasciata, sarebbe catastrofica.\n\nContinuiamo?', '', '', '', '', '', '', 47187),
(70155, 'itIT', 'Osserva, ascolta, respira', 'Pesca con Sviscerak.', 'Salve, $r. Pochi si fermano a salutare, figuriamoci per restare per un po\'. La maggior parte ha fretta di raggiungere la prossima destinazione.\n\nVuoi pescare con me?', '', '', '', '', '', '', 47187),
(70154, 'itIT', 'Un varco che porta da qualche parte', 'Segui l\'Incantatrice Distorcente Delandra all\'interno del Portale.', 'L\'incantamento ci proteggerà dall\'energia instabile contenuta all\'interno.\n\nAprirò la strada verso la pietra più vicina.\n\nUna volta che saremo oltre, stammi $gvicino:vicina;. Mi servirà il tuo aiuto quando ci appresteremo ad attivare il dispositivo.', '', '', '', '', '', '', 47187),
(70152, 'itIT', 'Pesca frenetica!', '', '', '', '', '', '', '', '', 47187),
(70149, 'itIT', 'Speranza per le Alture', '', '', '', '', '', '', '', '', 47187),
(70148, 'itIT', 'Senza uno scopo', 'Cerca l\'Artiglio Ethrethi nell\'Ambasciata Riposo Alato.', 'Posso avere un attimo del tuo tempo?\n\nSono preoccupata per un altro Dracthyr che è passato di qui. Ha fatto a me e ai miei colleghi ogni genere di domanda, ma sembrava... deluso dalle nostre risposte.\n\nSi è presentato come \"Artiglio Ethrethi\", credo che sia uno dei vostri ranghi minori.\n\nHo avuto la sensazione che avesse bisogno di aiuto. Ti dispiace aiutarmi a mantenere la pace?\n\nL\'ho visto parlare con Kholmar, laggiù.', '', '', '', '', '', '', 47187),
(70146, 'itIT', 'Rifiuto delle Alture', '', '', '', '', '', '', '', '', 47187),
(70139, 'itIT', 'Per fortuna c\'è la protezione', 'Valuta i danni inflitti alle pietre della protezione nella Bacino del Forte di Tyr.', 'Questo bacino era protetto da tre pietre di protezione applicate da Tyr.\n\nAvevano lo scopo di stabilizzare la magia elementale che è prevalente nelle Isole dei Draghi.\n\nQuando mi hai fatto aprire gli occhi, ho percepito il danno fatto alla protezione occidentale. Temo che i Primalisti possano averle danneggiate tutte.\n\nPrima dobbiamo valutare il danno fatto per capire come procedere.', '', '', '', '', '', '', 47187),
(70136, 'itIT', 'Non c\'è tempo per soffrire', 'Recupera il Bastone dei Viaggiatori nel Tempo, le Note dei Viaggiatori nel Tempo, e uccidi l\'Alfa Frenetico nella Foresta Fluente di Thaldraszus.', 'Argh... un momento...\n\nIl mio primo incarico... l\'energia temporale instabile si sta diffondendo nella foresta... sta colpendo la fauna selvatica... devo valutarne l\'impatto e raccogliere quella magia per i Viaggiatori nel Tempo...\n\n<Zera scuote la testa per un attimo.>\n\nStavo giusto esaminando un branco di Vorquin, quando un orso traboccante di magia temporale mi ha attaccata. Mi ha presa alla sprovvista, me la sono cavata per un soffio.\n\nPotresti cercare la mia attrezzatura, $C? Forse dovrai anche affrontare quell\'orso.', '', '', '', '', '', '', 47187),
(70135, 'itIT', 'Elementali invasori', 'Uccidi $1oa Elementali Primordiali all\'Ambasciata Riposo Alato.', 'Gli artigiani e gli esploratori della Spedizione delle Scaglie di Drago non sono adatti agli sforzi della battaglia.\n\nMa tu e io lo siamo, $p.\n\nQui nelle Isole dei Draghi, usiamo la nostra forza per proteggere coloro che non possono farlo da soli.\n\nElimina gli elementali provenienti da nord, così che la spedizione possa concentrarsi su imprese più nobili.', '', '', '', '', '', '', 47187),
(70134, 'itIT', 'Ricordi', 'Recupera la Capsula del Tempo di Veritistrasz.', 'Grazie per avermi ascoltato, giovane. Ho un favore da chiederti.\n\nNon preoccuparti, niente più storie.\n\nQuando abbiamo lasciato questo posto, tanto tempo fa, ho lasciato una specie di... capsula del tempo. Saresti... Saresti così gentile da recuperarla per me? L\'abbiamo lasciata nel Tempio della Vita di Rubino, dietro uno dei pilastri.\n\nL\'ho nascosta con un Sigillo, attivandolo dovresti trovare la capsula del tempo.', '', '', '', '', '', '', 47187),
(70132, 'itIT', 'Rimani per un po\'', 'Siediti per un po\' e ammira il paesaggio.', '<Il vecchio Nano non reagisce alla tua presenza mentre ti avvicini. Guarda solo il paesaggio, con un profondo cipiglio sul viso. È un bel panorama, potrebbe essere piacevole prendersi una pausa e guardare la natura.>', '', '', '', '', '', '', 47187),
(70129, 'itIT', 'Toejam il Terribile', 'Aiuta Rowie a uccidere Toejam il Terribile.', 'Hai ragione, non sono abbastanza forte per affrontare quello Yeti... Non da solo!\n\nMa ci sei tu!\n\nIl covo di quello Yeti malvagio, Toejam il Terribile, è a un passo da qui. La grotta è... grande. Ma non spaventosa! Be\', forse un po\' spaventosa.\n\nPotresti andare lì dentro e dargli una lezioncina? Io... Io sarò proprio dietro di te!', '', '', '', '', '', '', 47187),
(70126, 'itIT', 'Il tocco finale', 'Convinci il cliente di Miguel ad affidargli i futuri Ordini d\'Artigianato.', 'Ah, $p, felice di vederti.\n\nHai dato una grande mano al Consorzio degli Artigiani e soprattutto a me e a Thomas. Grazie.\n\nC\'è un\'altra cosa che dovresti sapere come $gartigiano:artigiana;, ed è come costruire un rapporto di fiducia con i tuoi clienti.\n\nHo completato un Ordine d\'Artigianato per un cliente oggi, potresti andare a parlargli per conto mio? Cerca di convincerlo a venire da me per le sue future esigenze d\'artigianato. Ricordagli che deve venire da me personalmente se vuole articoli di alta qualità.', '', '', '', '', '', '', 47187),
(70125, 'itIT', 'Dov\'è Irathion?', 'Chiedi a Sendrax per quando è previsto l\'arrivo dei draghi.', 'Mmm, mi chiedo dove sia Irathion.\n\nAveva detto che ci avrebbe aspettati insieme a un ambasciatore di Alexstrasza la Protettrice della Vita, Regina dei Draghi.\n\nI draghi mantengono sempre le promesse.\n\nBe\'! Almeno c\'è questa draconide trepidante qui a salutarci... Potresti parlarci e chiederle quando arriveranno gli altri?', '', '', '', '', '', '', 47187),
(70124, 'itIT', 'Materiali per la professione', 'Raccogli $1oa Scaglie di Proto-Draghetto Primordiale.', 'Non ho mai visto proto-draghi del genere in tutta Azeroth.\n\nSembra che le loro scaglie siano naturalmente resistenti al fuoco e più forti dell\'acciaio, pur restando flessibili. Incredibile.\n\nGli artigiani non vedono l\'ora di mettere le mani su alcune scaglie per poterci lavorare.\n\nInizia con i piccoli. Le loro scaglie di dimensioni ridotte dovrebbero risultare più malleabili, finché non avremo affinato le nostre tecniche.', '', '', '', '', '', 'Incontra Thaelin Forgiacupa all\'Ambasciata Riposo Alato.', 47187),
(70123, 'itIT', 'Parassiti primordiali', 'Uccidi $1oa Proto-Drachi Primordiali sulla Costa Selvaggia.', '<Azurathel guarda con sospetto i proto-draghi in agguato sul crinale dietro di lui.>\n\nGiuro che quei proto-draghi si avvicinano di più al campo ogni volta che giro la testa...\n\nQuelli non sono i draghi inviati da Irathion per incontrarci.\n\nI proto-draghi sono predatori spietati con cui non si può ragionare. Dobbiamo essere spietati anche noi.\n\nDobbiamo ridurne la popolazione per tenere sotto controllo le loro ambizioni, o questa spedizione finirà ancor prima di iniziare.', '', '', '', '', '', 'Incontra il Comandante delle Scaglie Azurathel all\'Ambasciata Riposo Alato.', 47187),
(70122, 'itIT', 'Esploratori in pericolo', 'Salva 3 membri della Spedizione delle Scaglie di Drago nella Costa Selvaggia.', 'Non scambiare per timidezza gli interessi accademici della spedizione, $p.\n\nNon siamo degli eremiti che studiano libri in torri remote.\n\nSiamo avventurieri che danno la caccia alla conoscenza in prima persona in ogni angolo di Azeroth!\n\nQuesta passione per l\'avventura ci porta spesso su sentieri pericolosi e alcuni membri della spedizione hanno fatto il passo più lungo della gamba...\n\nMa, ehi! Il pericolo è avvincente!', '', '', '', '', '', 'Incontra Toddy Baffetta all\'Ambasciata Riposo Alato.', 47187),
(70112, 'itIT', 'Minaccia dei Mezzorsi', '', '', '', '', '', '', '', '', 47187),
(70110, 'itIT', 'Catalogando Thaldraszus', '', '', '', '', '', '', '', '', 47187),
(70100, 'itIT', 'Catalogando la Vastità Azzurra', '', '', '', '', '', '', '', '', 47187),
(70079, 'itIT', 'Catalogando le Pianure di Ohn\'ahra', '', '', '', '', '', '', '', '', 47187),
(70074, 'itIT', 'Frammentata e saccheggiata', '', '', '', '', '', '', '', '', 47187),
(70070, 'itIT', 'Ma... Io sono l\'eroe delle Anatre', 'Trova Fuocotroccolo e assicurati che arrivi a Gracus.', 'Aspetta un attimo, c\'è qualcosa...\n\n<Gracus si guarda attorno.>\n\nFuocotroccolo! Il piccolo dev\'essere andato di nuovo al fiume! Non importa quante volte glielo ripeta, cerca sempre di giocare con i drospi cornuti!\n\nHo bisogno che lo trovi, spero non si sia fatto ingoiare di nuovo.', '', '', '', '', '', 'Parla con Gracus di ciò che hai visto.', 47187),
(70069, 'itIT', 'Altri mi chiamano Capoanatra', 'Nutri $1oa anatroccoli e torna da Gracus.', 'I miei giorni stanno giungendo al termine... Ma i miei doveri non sono finiti.\n\nLa nidiata dovrebbe essere vicino al torrente. Li lascio lì, sperando che crescano più indipendenti. Presto dovranno cavarsela da soli.\n\nOggi contano su di te. Ti prego, porta alla nidiata affamata il cibo che hai raccolto, poi portami gli anatroccoli. Fai attenzione a Pilota, salta sempre da punti pericolosi.', '', '', '', '', '', '', 47187),
(70068, 'itIT', 'Catastrofe di cobalto', '', '', '', '', '', '', '', '', 47187),
(70067, 'itIT', 'Un messaggio per i Nokhud', '', '', '', '', '', '', '', '', 47187),
(70064, 'itIT', 'Per Imbu!', '', '', '', '', '', '', '', '', 47187),
(70062, 'itIT', 'Mi chiamano il Cacciainsetti...', 'Raccogli $1oa Parti di Scarabeo della Progenie Volante.', 'Ah, giovane $R, mi tornerebbe utile il tuo aiuto. Ho cresciuto varie generazioni qui.\n\nNessuna che adori più degli anatroccoli. Ahimè, il mio corpo è vecchio e stanco, ma il ciclo non si può fermare.\n\nHo bisogno che trovi del cibo per i miei piccoli.', '', '', '', '', '', '', 47187),
(70061, 'itIT', 'Ali in addestramento', 'Aiuta un draghetto a eliminare $2oa Erbette Agitate, $3oa Pungitori Invadenti e $4oa Raffiche Implacabili.', 'I draghi erano scomparsi dalle isole da parecchio tempo, $p. A dire il vero... Alcune delle nostre capacità si sono atrofizzate man mano che sono state tramandate di generazione in generazione.\n\nDovrebbe essere semplice addestrare questi draghetti, eppure abbiamo qualche difficoltà a gestirli.\n\nMa dimmi...\n\nHo visto che anche il Maggiordomo Selistra si affida a te per i compiti più cruciali. Ci daresti una mano aiutando uno dei nostri giovani?', '', '', '', '', '', '', 47187),
(70060, 'itIT', 'Ascesa dell\'Accademia - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(70059, 'itIT', 'Ascesa dell\'Accademia', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(70058, 'itIT', 'Guarigione e pace', 'Raccogli $1oa Morbide Piume di Rubino, $2oa Frammenti di Tessuto e $3oa Perla di Vetro intorno al Tempio della Vita di Rubino per aiutare a riparare l\'Anatroccolo Felix.', 'L\'Anatroccolo Felix si è fatto male mentre stavamo volando... Stavamo andando così bene e poi... ho colpito un albero!\n\n<Lillistrasza indica mestamente il pupazzo danneggiato a forma di papera che ha sulla testa.>\n\nLa sua imbottitura sta uscendo tutta! Le sue piume sono tutte stropicciate! Uno dei suoi occhi è caduto! Nooooo!\n\nPuoi aiutarmi ad aggiustare l\'Anatroccolo Felix, vero?', '', '', '', '', '', '', 47187),
(70055, 'itIT', 'Sigillo delle Tempeste', 'Consegna il Sigillo delle Tempeste al Cacciatore delle Tempeste William a Roccavento.', '<Qualcuno con una grande conoscenza della magia potrebbe voler studiare una scoperta simile.>', '', '', '', '', '', 'Consegna il Sigillo delle Tempeste al Cacciatore delle Tempeste William a Roccavento.', 47187),
(70052, 'itIT', 'Circuito delle Scogliere - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(70051, 'itIT', 'Circuito delle Scogliere', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(70050, 'itIT', 'A caccia di tempeste', 'Parla con il Cacciatore delle Tempeste William al Porto di Roccavento.', 'Quindi i bellimbusti ti stanno mandando all\'avventura, eh?\n\nVa bene. La spedizione non potrà salpare comunque, finché qualcuno non mette sotto controllo quelle tempeste elementali.\n\nParla con il Cacciatore delle Tempeste William. È lui a guidare la spedizione per quanto riguarda le tempeste e può fornirti gli strumenti di cui hai bisogno.\n\nIo coordinerò il resto dei preparativi qui mentre tu ti diverti là fuori.\n\nMi devi un favore, però!', '', '', '', '', '', 'Parla con il Cacciatore delle Tempeste William al Porto di Roccavento.', 47187),
(70049, 'itIT', 'Placando le tempeste', 'Raccogli $1oa Granuli di Energia Primordiale dai nemici attivi all\'interno delle tempeste primordiali a Kalimdor e nei Regni Orientali.', 'Questi Primalisti sono implacabili... Stanno scatenando devastazioni elementali nei Regni Orientali e a Kalimdor.\n\nDevi mostrare la stessa determinazione, $n. È l\'unico modo per fermarli.\n\nScopri dove sarà la loro prossima incursione, elimina i nemici all\'interno della tempesta primordiale prima che sia troppo tardi e sventa i loro piani. Dobbiamo proteggere Azeroth!', '', '', '', '', '', '', 47187),
(70048, 'itIT', 'Una minaccia primordiale', 'Raccogli $1oa Granuli di Energia Primordiale dai nemici attivi all\'interno delle tempeste primordiali a Kalimdor e nei Regni Orientali.', 'Raszageth non ha perso tempo per costruire il suo esercito di Primalisti.\n\nIl Kirin Tor ha rilevato enormi tempeste scatenate in punti chiave di Kalimdor e dei Regni Orientali.\n\nI Primalisti stanno sprigionando gli elementi per concentrare le loro forze. Sembra che abbiano intenzione di scatenare il caos non solo nelle Isole dei Draghi, ma anche nelle terre dell\'Alleanza e dell\'Orda.\n\nCerca il nemico e studiane i metodi. Dobbiamo fermarli prima che sia troppo tardi.', '', '', '', '', '', '', 47187),
(70047, 'itIT', 'Prigioni di Ghiaccio', '', '', '', '', '', '', '', '', 47187),
(70042, 'itIT', 'Opportunità in abbondanza', 'Raccogli diversi oggetti per Vish il Furtivo.', 'Mi hai spaventato, ho pensato di essere stato beccato!\n\nGuarda tutti i coraggiosi esploratori pronti a conquistare le Isole dei Draghi... con zaini pieni di attrezzi ed equipaggiamento.\n\nPotremmo diventare ricchi!\n\nGuarda in giro e prova a sgraffignare qualche oggetto, ti darò una parte dei profitti.', '', '', '', '', '', '', 47187),
(70041, 'itIT', 'Furia della Mangiatempeste', 'Sali sul Disco Volante di Khadgar e tieni a bada l\'armata dei Primalisti.', 'Raszageth sta tentando di strappare la magia arcana dalla torre, così da poterla distruggere!\n\nKalecgos sta facendo il possibile per fermarla, io sto usando la mia magia per rifornire l\'energia di faglia.\n\nTemo che non resisteremo ancora a lungo. Mentre parliamo, altri Primalisti si fanno strada qui per ostacolarci!\n\nPrendi il mio Disco Arcano modificato, tieni a bada i Primalisti... speriamo in un miracolo.', '', '', '', '', '', 'Parla con Kalecgos alla base di Vakthros.', 47187),
(70040, 'itIT', 'A spasso nel tempo', 'Raduna i tuoi alleati e vai a parlare con Nozdormu.', 'Quando la magia di bronzo si è scontrata con quella dell\'infinito, ha spedito Cronormu ed Eternus in una spericolata caduta attraverso il tempo.\n\nDurante la caduta, strappano il tessuto stesso del tempo, creando innumerevoli increspature nel tempo e nello spazio. Dobbiamo trovarle e riportarle qui, solo allora potremmo prevenire ulteriori danni. Prevedo che sarai tu a fermare la caduta di Cronormu.\n\nTi chiedo di radunare i tuoi alleati, dovrai salvare Cronormu mentre io mi concentro sulla sua magia.', '', '', '', '', '', 'Raduna i tuoi alleati e vai a parlare con Nozdormu.', 47187),
(70035, 'itIT', 'Regata sulle rapide di Ruriq', '', '', '', '', '', '', '', '', 47187),
(70034, 'itIT', 'Rifornimenti dell\'Artigiano: Scaglia di Salamantera', 'Consegna una Scaglia di Salamantera a Efesta presso il Tempio della Vita di Rubino.', 'Cerchi lavoro, $gscuoiatore:scuoiatrice;? Dal Consorzio degli Artigiani mi hanno chiesto di recuperare una Scaglia di Salamantera per i loro clienti.\n\nSarò anche un artigiano, ma non sono il fattorino di nessuno!\n\nMa... Ah, forse potresti trovarne una tu?', '', '', '', '', '', 'Consegna una Scaglia di Salamantera a Efesta presso il Tempio della Vita di Rubino.', 47187),
(70033, 'itIT', 'Rifornimenti dell\'artigiano: Stivali di Cuoio del Pioniere', 'Consegna degli Stivali di Cuoio del Pioniere a Efesta presso il Tempio della Vita di Rubino.', 'Cerchi lavoro, $gconciatore:conciatrice;? Dal Consorzio degli Artigiani mi hanno chiesto di realizzare degli stivali per i loro clienti.\n\nÈ chiaro che non sanno quanto sono popolare! Hai idea di quanti esploratori siano passati solo oggi, a lamentarsi delle loro scarpe rovinate?\n\nSe hai tempo, prendi queste misure. Magari il Consorzio degli Artigiani può essere una buona opportunità lavorativa per te.', '', '', '', '', '', 'Consegna degli Stivali di Cuoio del Pioniere a Efesta presso il Tempio della Vita di Rubino.', 47187),
(70032, 'itIT', 'Rifornimenti dell\'Artigiano: Occhiali dell\'Orefice', 'Consegna le Lenti d\'Ingrandimento d\'Onice Frammentato a Efesta al Tempio della Vita di Rubino.', 'Cerchi lavoro, orefice? Dal Consorzio degli Artigiani mi hanno chiesto di realizzare degli occhiali per i loro clienti.\n\nA me! Come se avessi tempo per certe richieste!\n\nPuoi occupartene tu?', '', '', '', '', '', 'Consegna le Lenti d\'Ingrandimento d\'Onice Frammentato a Efesta al Tempio della Vita di Rubino.', 47187),
(70031, 'itIT', 'Rifornimenti dell\'Artigiano: Mattarello Liscio dello Chef', 'Consegna un Mattarello Liscio dello Chef a Efesta presso il Tempio della Vita di Rubino.', 'Stai cercando lavoro, $grunografo:runografa;?\n\nHo ricevuto un ordine da una compagnia chiamata Consorzio degli Artigiani.\n\nSembra un compito abbastanza semplice per $gun apprendista:un\'apprendista; come te.', '', '', '', '', '', 'Consegna un Mattarello Liscio dello Chef a Efesta presso il Tempio della Vita di Rubino.', 47187),
(70030, 'itIT', 'Rifornimenti dell\'Artigiano: Ottiche di Qualità Garantita', 'Consegna un paio di Ottiche di Qualità Garantita a Efesta presso il Tempio della Vita di Rubino.', 'Ah, $gun ingegnere:un\'ingegnera;! Tempismo eccellente.\n\nHo degli schemi da sistemare, ma è appena passata una signora alta e ha richiesto un set di ottiche.\n\nSai come realizzarle, vero?\n\nPortale al Tempio della Vita di Rubino non appena saranno pronte. Credo che la signora abbia detto di far parte del Consorzio degli Artigiani, o qualcosa del genere.', '', '', '', '', '', 'Consegna un paio di Ottiche di Qualità Garantita a Efesta presso il Tempio della Vita di Rubino.', 47187),
(70029, 'itIT', 'Rifornimenti dell\'artigiano: Verghe Runiche di Serevite', 'Consegna $1oa Verghe Runiche di Serevite a Efesta al Tempio della Vita di Rubino.', 'Sembri avere un tocco magico, $gincantatore:incantatrice;. Potresti aiutarci con uno degli ordini che abbiamo ricevuto?\n\nIl Consorzio degli Artigiani ha richiesto diverse verghe di Serevite per un cliente, incantare verghe non è esattamente la mia specialità.\n\nUna volta fatto, Efesta al Tempio della Vita di Rubino ti ricompenserà per il tuo tempo e lavoro!', '', '', '', '', '', '', 47187),
(70028, 'itIT', 'Rifornimenti dell\'Artigiano: Depositi di Sale', 'Consegna $1oa Depositi di Sale a Efesta al Tempio della Vita di Rubino.', 'Cerchi lavoro, $gminatore:minatrice;?\n\nStavo parlando con Efesta e mi ha detto che il Consorzio degli Artigiani ha bisogno di sale per i suoi clienti.\n\nPotrei farlo io, ma... non ne ho voglia.\n\nFai $gil bravo:la brava; e occupatene tu, eh?', '', '', '', '', '', 'Consegna $1oa Depositi di Sale a Efesta al Tempio della Vita di Rubino.', 47187),
(70027, 'itIT', 'Rifornimenti dell\'Artigiano: Fasce di Stoffa dell\'Ispettore', 'Consegna delle Fasce di Stoffa dell\'Ispettore a Efesta presso il Tempio della Vita di Rubino.', 'Cerchi lavoro, $gsarto:sarta;? Dal Consorzio degli Artigiani mi hanno chiesto di realizzare delle polsiere per i loro clienti.\n\nSebbene apprezzi il fatto che questi esploratori si stiano interessando alla nostra tessitura, non ho tempo per certe richieste.\n\nMagari potrebbe interessarti questo tipo di progetto?', '', '', '', '', '', 'Consegna delle Fasce di Stoffa dell\'Ispettore a Efesta presso il Tempio della Vita di Rubino.', 47187),
(70026, 'itIT', 'Rifornimenti dell\'Artigiano: Scarabei della Lava', 'Consegna $1oa Scarabei della Lava a Efesta al Tempio della Vita di Rubino.', 'Cerchi lavoro, erbalista? Dal Consorzio degli Artigiani mi hanno chiesto di raccogliere degli scarabei per i loro clienti.\n\nIl terreno ne abbonda, ma non tanto da potermi semplicemente allontanare per occuparmene di persona.\n\nMa dato che sei in giro, che ne dici di raccogliere qualche scarabeo lungo la strada?', '', '', '', '', '', 'Consegna $1oa Scarabei della Lava a Efesta al Tempio della Vita di Rubino.', 47187),
(70025, 'itIT', 'Rifornimenti dell\'Artigiano: Falcetto di Draconium', 'Consegna un Falcetto di Draconium a Efesta presso il Tempio della Vita di Rubino.', 'Hai l\'aria di qualcuno che non ha niente da fare. Che ne dici di un impiego?\n\nHo un Ordine d\'Artigianato da gestire per il Consorzio degli Artigiani: si tratta di un Falcetto di Draconium. Potrei facilmente occuparmene io, ma come apprendista penso che abbia più senso che te ne occupi tu.\n\nCrea il falcetto e portalo al Tempio della Vita di Rubino. Lì, una Draenei di nome Efesta ti pagherà per il tuo lavoro.', '', '', '', '', '', 'Consegna un Falcetto di Draconium a Efesta presso il Tempio della Vita di Rubino.', 47187),
