(69992, 'itIT', 'Sigillo delle Tempeste', 'Consegna il Sigillo delle Tempeste alla Cacciatrice delle Tempeste Suhrakka a Durotar.', '<Qualcuno con una grande conoscenza della magia potrebbe avere interesse a studiare una scoperta simile.>', '', '', '', '', '', 'Consegna il Sigillo delle Tempeste alla Cacciatrice delle Tempeste Suhrakka a Durotar.', 47187),
(69984, 'itIT', 'Dente di Drago con Bande Dorate', 'Consegna l\'oggetto a Exadria.', '<Hai scoperto i resti di un drago caduto. Forse Exadria vorrebbe vederlo.>', '', '', '', '', '', '', 47187),
(69983, 'itIT', 'Osso Intagliato delle Fiamme', 'Consegna l\'oggetto all\'Inseguitrice Artigliata Kavia.', '<Rune misteriose di Djaradin, incise su un osso. Forse l\'Inseguitrice Artigliata Kavia vorrebbe vederle.>', '', '', '', '', '', '', 47187),
(69981, 'itIT', 'Soddisfazione del cliente', 'Chiedi ai clienti del Consorzio degli Artigiani se sono soddisfatti dei loro Ordini di Nuova Creazione.', 'Ehi, $c, hai un momentino per dare una mano?\n\nAlcuni dei nostri clienti preferiti hanno effettuato Ordini di Nuova Creazione tramite il Consorzio degli Artigiani, ma non abbiamo più saputo nulla.\n\nSe li incontri, puoi assicurarti che siano soddisfatti dei loro acquisti? Devo mantenere i clienti felici, felici, felici!', '', '', '', '', '', 'Consegna l\'equipaggiamento a Mahra Piegalberi presso il Crocevia Fluviale.', 47187),
(69980, 'itIT', 'Fibre marine: dono del Pescatore Tinnak', 'Porta la cima di fibre marine a Iskaara.', '<Riesci a vedere la mano spettrale del pescatore mentre afferra ancora un filo intessuto di un\'alga molto forte ma leggera. Nunvuq a Iskaara potrebbe conoscere un modo per sfruttarlo.>', '', '', '', '', '', '', 47187),
(69979, 'itIT', 'Una degna caccia', 'Uccidi Millemiglia, il Toro Antico.', 'La saggezza non si ottiene, si guadagna. Se vuoi dimostrare il tuo valore, lo farai nel modo tradizionale della mia gente, imparando con la pratica.\n\nDai la caccia a Millemiglia, il Toro Antico, che ci sfugge da generazioni.\n\nFacendolo, otterrai la saggezza che cerchi.', '', 'Millemiglia, il Toro Antico, è sfuggito a generazioni di cacciatori. Forse tu riuscirai finalmente a catturare quella bestia.', 'Millemiglia', '', '', '', 47187),
