(69965, 'itIT', 'Controllo qualità', 'Prova gli Attrezzi di Efesta sui geodi vicini per il Consorzio degli Artigiani.', 'Stai cercando lavoro, $c?\n\nRappresento una nuova società commerciale, il Consorzio degli Artigiani, che facilita i contatti tra artigiani e clienti attraverso la nostra rete di Ordini d\'Artigianato.\n\nLa Spedizione delle Scaglie di Drago ha effettuato un ordine per alcuni attrezzi minerari incantati. Gli attrezzi sono pronti, ma vorremmo testarli prima di completare l\'ordine.\n\nTi pagheremo per i tuoi servizi, ovviamente.', '', '', '', '', '', '', 47187),
