(69946, 'itIT', 'Un maestro della sua professione', 'Cerca il Maestro Khadin per apprendere la sua conoscenza professionale.', 'Mentre viaggiavo attraverso queste pianure ho incontrato un vecchio Centauro in una caverna a nord. Conosceva chiaramente molto bene la sua professione e voleva condividerla.\n\nMi ha aperto gli occhi su ciò che avevo imparato nelle Isole dei Draghi.\n\nSe vuoi specializzarti nella tua professione, cerca la saggezza di questo maestro. Il suo nome è Khadin, del Clan Teerai.', '', '', '', '', '', 'Parla con Khadin nella Grotta di Khadin.', 47187),
(69944, 'itIT', 'A caccia di tempeste', 'Parla con la Cacciatrice delle Tempeste Suhrakka alla Torre degli Zeppelin.', 'Devo ammetterlo, quel mago certo sa come fare un ingresso, non credi?\n\nNon potremo comunque salpare, finché qualcuno non mette sotto controllo quelle tempeste elementali.\n\nParla con la Cacciatrice delle Tempeste Suhrakka. È lei a guidare la spedizione per quanto riguarda le tempeste, e può fornirti gli strumenti di cui hai bisogno.\n\nMentre te ne occupi, io coordinerò il resto dei preparativi qui. Se non altro avrò del tempo per leggere qualche altro volume sulla storia dei draghi prima di dover salpare.', '', '', '', '', '', 'Parla con la Cacciatrice delle Tempeste Suhrakka alla Torre degli Zeppelin.', 47187),
(69939, 'itIT', 'Soccorso silvano', 'Ottieni un Cono di Neve e dallo alla Lontra Logorata.', 'Ah, $n, eccoti qui! Ti ho $gcercato:cercata; ovunque.\n\nUn altro dei nostri animaletti è stato afflitto da una particolare carenza di bocconcini. Non ti andrebbe di trovargli qualcosa di dolce da sbocconcellare?', '', '', '', '', '', '', 47187),
(69938, 'itIT', 'Pesca frenetica!', '', '', '', '', '', '', '', '', 47187),
(69936, 'itIT', 'Zambul, capo dei vandali', 'Sconfiggi il Sovrintendente Zambul.', 'Ottimo lavoro. Quei profanatori non possono costringere altri miei antenati a combattere per loro. Ma quel bruto che grida loro ordini deve essere gestito.\n\nQuello è il loro sovrintendente, Zambul. Deve essere fermato.\n\nDevi sconfiggerlo!', '', '', 'Sovrintendente Zambul', '', '', '', 47187),
(69934, 'itIT', 'Cuori sanguinanti', 'Consegna i Rifornimenti Medici.', 'Le pozioni sono pronte, ora puoi consegnarle.\n\nPorta una cassa in una piccola grotta nel burrone sotto di noi. Non ci sarà nessuno lì a prenderla, ma sarà usata bene, fidati.\n\nPortane un\'altra all\'infermeria dell\'Avamposto di Gelikyr. Un vecchio amico si prende cura dei pazienti laggiù.\n\nIo... mi rendo conto che non è una tua responsabilità e neanche mia, ma il tuo aiuto è stato sorprendentemente prezioso e questa medicina potrebbe salvare delle vite.', '', '', '', '', '', '', 47187),
(69933, 'itIT', 'Il prezzo della curiosità', 'Prendi un tralcio di Vite Testarda.', 'Guarda al di là del burrone, $r. Giorni fa, i Primalisti hanno attaccato l\'Avamposto di Gelikyr e la battaglia infuria ancora.\n\nQuelle persone hanno bisogno di unguenti e cure. Posso occuparmene io, ma i miei ingredienti stanno finendo. Dal momento che hai fatto irruzione in casa mia, ti affido questo compito.\n\nVai nel mio giardino e trova il viticcio più grande. Sradicalo e portamelo.', '', '', '', '', '', '', 47187),
(69932, 'itIT', 'Ogni vita è importante', 'Raccogli gli ingredienti per sostituire il condimento di Piccolo Getto Acqueo.', 'Fare pozioni per Gelikyr significa che non ho tempo per gli altri miei doveri.\n\nNel mio giardino è atterrata un\'anatra con una costola rotta. Ho curato la ferita, ma la sua medicazione deve essere sostituita. E dato che sei così impaziente di aiutare...\n\n<Szareth ti mette in mano una lista di ingredienti.>\n\nQuesto è ciò di cui avrai bisogno. Portami il resto.', '', '', '', '', '', '', 47187),
(69931, 'itIT', 'Picchiata e cattura', '', '', '', '', '', '', '', '', 47187),
(69930, 'itIT', 'Basrikron', '', '', '', '', '', '', '', '', 47187),
(69925, 'itIT', 'Placare le tempeste', 'Raccogli $1oa Granuli di Energia Primordiale dai nemici attivi all\'interno delle tempeste primordiali a Kalimdor e nei Regni Orientali.', 'Questi Primalisti sono implacabili... Stanno scatenando devastazioni elementali nei Regni Orientali e a Kalimdor.\n\nDevi mostrare la stessa determinazione, $n. È l\'unico modo per fermarli.\n\nScopri dove sarà la loro prossima incursione, elimina i nemici all\'interno della tempesta primordiale prima che sia troppo tardi e sventa i loro piani. Dobbiamo proteggere Azeroth!', '', '', '', '', '', '', 47187),
(69924, 'itIT', 'Torri del potere del fuoco', '', '', '', '', '', '', '', '', 47187),
(69923, 'itIT', 'Una minaccia primordiale', 'Raccogli $1oa Granuli di Energia Primordiale dai nemici attivi all\'interno delle tempeste primordiali a Kalimdor e nei Regni Orientali.', 'Raszageth non ha perso tempo per costruire il suo esercito di Primalisti.\n\nIl Kirin Tor ha rilevato enormi tempeste scatenate in punti chiave di Kalimdor e dei Regni Orientali.\n\nI Primalisti stanno sprigionando gli elementi per concentrare le loro forze. Sembra che abbiano intenzione di scatenare il caos non solo nelle Isole dei Draghi, ma anche nelle terre dell\'Alleanza e dell\'Orda.\n\nCerca il nemico e studiane i metodi. Dobbiamo fermarli prima che sia troppo tardi.', '', '', '', '', '', '', 47187),
(69919, 'itIT', 'Mestiere in difficoltà', 'Parla con Azley per saperne di più su come si completano gli Ordini d\'Artigianato.', 'Sembri $gun abile artigiano:un\'abile artigiana;, ti va di completare alcuni Ordini d\'Artigianato per altri avventurieri e arricchirti, arricchirti, arricchirti?\n\nTi spiegherò le regole per lavorare con il Consorzio degli Artigiani; quindi, potrai accettare gli Ordini d\'Artigianato in qualsiasi stazione d\'artigianato sulle Isole dei Draghi!', '', '', '', '', '', '', 47187),
(69918, 'itIT', 'Scossa delle fondamenta', 'Uccidi Tokara Spezzapietra, Molka la Tritatutto e gli elementali che hanno scatenato.', 'I Vincolapietra Djaradin minacciano di infliggere ingenti danni alle fondamenta della Cittadella! Dobbiamo fermarli.\n\nNon abbiamo avuto ancora il modo di riprendercela, e già rischia di crollare sotto i nostri piedi! Non possiamo permetterlo!\n\nFai ciò che puoi, $n... E con questo intendo uccidili!', '', 'Molka, così come Tokara Spezzapietra, è un\'abile manipolatrice della dura pietra d\'ossidiana che si trova al di sotto della cittadella.', 'Molka la Tritatutto', '', '', '', 47187),
(69915, 'itIT', 'Pubblicità mirate', 'Recupera i volantini dal Crocevia Fluviale e dai Caproni Ficcanaso.', 'Ciao, ciao, ciao! Stai cercando un lavoretto?\n\nStiamo facendo una GRANDE promozione per l\'apertura del nostro servizio degli Ordini d\'Artigianato e dobbiamo attirare l\'attenzione! Purtroppo, il vento ha sparpagliato i miei volantini e penso che delle capre li abbiano afferrati e siano scappate.\n\nPotresti recuperarli per me?', '', '', '', '', '', '', 47187),
(69914, 'itIT', 'I Djaradin si sono risvegliati', 'Attendi gli ordini dal Maggiordomo Selistra.', 'Vorrei che avessimo tempo per presentazioni più piacevoli, ma non possiamo essere tutti Cronormu, vero?\n\nIo sono Selistra, maggiordomo di Alexstrasza la Protettrice della Vita, Regina dei Draghi.\n\nLa Regina Alexstrasza mi ha pregato di portarvi i suoi più cordiali saluti e di accompagnarvi da lei alle Pozze della Vita.\n\nMa temo di dover chiedere il vostro aiuto, prima.\n\nI nostri antichi rivali, i Djaradin, si sono svegliati dal loro sonno sottoterra e hanno già assalito un vicino avamposto!', '', '', '', '', '', 'Incontra Sendrax all\'Ambasciata Riposo Alato.', 47187),
(69912, 'itIT', 'La mia prima, vera emergenza!', 'Convinci Sendrax a sparare un segnale di emergenza per avvertire i Draghi del tuo arrivo.', '<Sendrax sembra perplessa.>\n\nNon ho mai visto il Maggiordomo in ritardo per qualcosa, tanto meno COSÌ in ritardo per qualcosa di COSÌ importante.\n\nChe cosa insolita...\n\n<Sendrax si ridesta a un pensiero.>\n\nPotrei usare il mio segnale di emergenza per avvisarli del vostro arrivo. Verrebbero subito a salutarvi!\n\nNon ho mai sparato il mio segnale di emergenza prima d\'ora, però...', '', '', '', '', '', 'Incontra Irathion all\'Ambasciata Riposo Alato.', 47187),
(69911, 'itIT', 'Scusa il disordine', 'Aiuta l\'Ambasciatore Fastrasz a ristabilire l\'Ambasciata.', 'Vorrei potervi dare un ​​benvenuto come si deve alle Isole dei Draghi, ma io sono solo la sentinella.\n\n<Sendrax indica la torre dietro di lei.>\n\nPotresti provare a parlare con l\'Ambasciatore Fastrasz al Centro d\'Accoglienza. Potrebbe essere in grado di rispondere ad altre vostre domande prima che arrivino i Draghi.\n\nMa attenti a dove mettete i piedi: stava ripulendo le macerie, l\'ultima volta che l\'ho visto.', '', '', '', '', '', '', 47187),
(69910, 'itIT', 'Dov\'è Irathion?', 'Chiedi a Sendrax per quando sia previsto l\'arrivo dei draghi.', 'Che cosa insolita.\n\nEbissian ci aveva detto che Irathion ci avrebbe aspettati insieme a un ambasciatore di Alexstrasza la Protettrice della Vita, Regina dei Draghi.\n\nI draghi mantengono sempre le promesse.\n\nAlmeno c\'è questa draconide trepidante qui a salutarci... Potresti gentilmente chiederle quando arriveranno gli altri?', '', '', '', '', '', '', 47187),
(69904, 'itIT', 'Un silenzio sospetto', 'Trova gli apprendisti di Noriko nell\'Accampamento Antonidas.', 'Hai un minuto, $p? Non sento i miei due apprendisti Scrumpy e Tucky da un po\' di tempo.\n\nLa cosa mi preoccupa...\nLi ho mandati a prendere dei rifornimenti per la locanda. Non possono essersi allontanati troppo...\n\nCercali, per favore, ma fa\' attenzione: sono dei veri combinaguai.', '', '', '', '', '', '', 47187),
(69902, 'itIT', 'Mettiamo in pratica la teoria', 'Aiuta Tyrgon a curare la creatura.', 'Ho bisogno del tuo aiuto, $n...\n\nNon ci si può certo aspettare che io possa creare, domare il draghetto, curare e insegnare a questi bambini, tutto insieme! Finirei per far male tutti i miei compiti.\n\nOra, puoi iniziare usando quei fiori. Mi serviranno un paio di minuti per prepararmi a curare il proto-draghetto.\n\nSpero che i bambini imparino qualcosa da questo incidente.', '', '', '', '', '', '', 47187),
(69901, 'itIT', 'Una mano esperta', 'Raccogli $1oa Fiori della Luce Solare.', 'Iyali ha detto da quanto tempo questa povera creatura sta soffrendo? È troppo ferita per mangiare. Dobbiamo curarla in fretta.\n\nDi norma, la Spedizione delle Scaglie di Drago avrebbe tutto ciò di cui ho bisogno per aiutare questo piccolo, ma al momento mancano alcune risorse a causa di un ritardo nella spedizione per le Isole dei Draghi.\n\nMa non temere. Sarà la terra stessa ad aiutarci! Se potessi portarmi dei Fior di Sole, potrei creare un unguento per curare le ferite di questo poverino.', '', '', '', '', '', '', 47187),
(69900, 'itIT', 'Identificare la fonte', 'Uccidi il Primalista alle prese con gli esperimenti nella Riserva Selvaggia.', 'A giudicare da ciò che hanno detto i bambini, potremmo avere un Primalista che si aggira nella Riserva Selvaggia.\n\nDobbiamo indagare subito.\n\nStando a quanto hanno detto i ricercatori, i Primalisti amano rubare uova e draghetti per infonderli di potere e corromperli. Coloro che non si adattano al processo subiscono una morte lenta... non che ai Primalisti importi qualcosa.\n\nLi vogliamo fuori dalla riserva. Occupatene mentre tento di calmare i piccoli. Loro non devono saperne nulla.', '', '', '', '', '', '', 47187),
(69899, 'itIT', 'Ricerca segreta', 'Aiuta Iyali e i suoi amici.', 'So che mi sto comportando in modo strano. Mi dispiace!\n\nForse avevi già immaginato che stessi nascondendo qualcosa.\n\nPosso rivelarti il mio segreto, se lo desideri, ma devi promettere che non lo dirai agli adulti!', '', '', '', '', '', '', 47187),
(69898, 'itIT', 'Ricerca gastronomica', 'Raccogli $1oa pezzo di Carne di Bestia dei Fiumi Squisita.', 'Dunque, ho altri, ehm, compiti... Il professor Tyrgon è molto esigente! Vuole che scopriamo cosa, ehm, mangiano i proto-draghetti! Sì...\n\nE io conosco la risposta: le bestie dei fiumi!\n\nPuoi portarmi un pezzetto di carne di bestia dei fiumi? Un po\' di carne di bestia dei fiumi sarebbe un ottimo \"contributo visivo\" per il mio progetto.\n\nMa deve essere DAVVERO un bel pezzo, OK? Come... quelli delle Bestie dei Fiumi Grassottelle. Tipo... uno che una mamma darebbe al proprio proto-draghetto perché, ehm, renderebbe felice il signor Tyrgon.', '', '', '', '', '', '', 47187),
(69897, 'itIT', 'Compito per casa: \"Analisi di comportamento\"', 'Accarezza $4oa Draghetti Dormienti e torna a riferire a Iyali.', 'Devo parlare con qualcuno che conosce i proto-draghetti. Come quelli che vivono nella Riserva Selvaggia!\n\nSono aggressivi come i grandi? Mordono o sputano fuoco?\n\nE se io... ehm... tu ne accarezzassi uno? Capirebbe che sei gentile e stai cercando di aiutarlo?\n\nChiedo per la scienza, ovviamente. Tyrgon ci dice sempre di testare le nostre ippo... no... ipos... Uff! Ipotitest... Ugh! TEORIE!\n\nSecondo me vogliono essere accarezzati e li farebbe sentire meglio. Potresti provare?', '', '', '', '', '', '', 47187),
(69896, 'itIT', 'Deviazione disastrosa', 'Incontra l\'Elementalista Taiyang nelle Rovine della Cripta della Vita.', 'Sapevo che unirmi alla Spedizione delle Scaglie di Drago avrebbe significato avventurarsi in territori pericolosi. Ma non mi aspettavo di dover combattere gli elementali!\n\nIl nostro sito, le Rovine della Cripta della Vita, è un disastro! Delle mostruosità di pietra stanno emergendo dal terreno! Abbiamo chiamato un\'elementalista da consultare, ma credo che avrà bisogno di tutto l\'aiuto possibile.\n\nForse puoi aiutarla tu? Il nostro accampamento è oltre il fiume.', '', '', '', '', '', '', 47187),
