(69870, 'itIT', 'Immagini con uno scopo', 'Incontra Akunda la Catalogatrice e l\'Artigliere Fren vicino alle Rapide Traboccanti.', 'Le immagini uniscono le persone, $p.\n\nDi solito, i nostri catalogatori viaggiano in coppie per sicurezza ed è molto bello vedere membri di fazioni e provenienze diverse lavorare insieme alla ricerca della conoscenza su queste straordinarie isole.\n\nUna di queste coppie piene di entusiasmo al momento sta mappando uno dei fiumi centrali delle Sponde del Risveglio.\n\nSe vuoi aiutarci, unisciti a loro per catalogare la fauna locale.', '', '', '', '', '', 'Incontra Akunda la Catalogatrice e l\'Artigliere Fren vicino alle Rapide Traboccanti.', 47187),
(69869, 'itIT', 'Il paradiso per un catalogatore', 'Parla con la Catalogatrice Coralie nel Campo delle Scaglie di Drago.', '<Il Dottor Nanner sembra senza fiato mentre ti consegna una lettera che ti invita a tornare all\'accampamento della Spedizione delle Scaglie di Drago per l\'addestramento. Cerca avidamente di spiegare.>\n\nElfo gentile. Piccolo uomo orgoglioso. Molte fotocamere. Sì?\n\n<Il Dottor Nanner annuisce eccitato, in attesa di una tua risposta.>', '', '', '', '', '', 'Parla con la Catalogatrice Coralie nel Campo delle Scaglie di Drago.', 47187),
