(69855, 'itIT', 'La vocazione dello scalatore', 'Parla con il Ricognitore Jeb nel Campo delle Scaglie di Drago.', '<Il Dottor Nanner sembra senza fiato mentre ti consegna una lettera che ti invita a tornare all\'accampamento della Spedizione delle Scaglie di Drago per l\'addestramento. Cerca avidamente di spiegare.>\n\nDa Grande Jeb. Buon amico. Scala, ora. Sì?\n\n<Il Dottor Nanner annuisce eccitato, in attesa di una tua risposta.>', '', '', '', '', '', 'Parla con il Ricognitore Jeb nel Campo delle Scaglie di Drago.', 47187),
