(69097, 'itIT', 'Una cripta aperta', 'Parla con la Catalogatrice Jakes nel Campo delle Scaglie di Drago.', '<Il Dottor Nanner sembra senza fiato mentre ti consegna una lettera che ti invita a tornare all\'accampamento della Spedizione delle Scaglie di Drago. Cerca avidamente di spiegare.>\n\nNana rumorosa. Elfa seria. Pronti per te. Sì?\n\n<Il Dottor Nanner annuisce eccitato, in attesa di una tua risposta.>', '', '', '', '', '', 'Parla con la Catalogatrice Jakes nel Campo delle Scaglie di Drago.', 47187),
(69096, 'itIT', 'L\'intento di Taivan', 'Tenta di consolare il Centauro orfano, Chimei.', 'Vedi laggiù, quella figura seduta da sola sulla riva del fiume?\n\n<Indica a nord-est, dove vedi un giovane membro di una tribù dei Centauri che fissa l\'acqua.>\n\nChimei ha perso entrambi i genitori a seguito di un attacco dei Nokhud. Ho guarito le sue ferite fisiche, ma non ha mangiato o detto una singola parola fin da quel tremendo giorno. Se ne rimane lì a fissare l\'acqua. \n\nQuesto va oltre le mie capacità, non so proprio cosa fare. Proveresti a parlarci tu, $n?', '', '', '', '', '', '', 47187),
(69095, 'itIT', 'Il ritorno del segugio', 'Riporta Taivan a Maruukai.', 'Grazie a te e Taivan siamo riusciti a stabilizzare tutti, ma molti abitanti del villaggio avranno bisogno di restare ancora per un po\' a Maruukai per riprendersi.\n\nPerché voi due non riportate indietro la nostra carovana? Siete entrambi gli eroi del giorno, dopotutto!', '', '', '', '', '', '', 47187),
(69094, 'itIT', 'Salvataggio del Centauro', 'Salva i Centauri Feriti nel villaggio di Daruukhan.', 'Il tradimento dei Nokhud non conosce limiti! Solo artigiani vivono nel villaggio di Daruukhan, non avevano alcuna possibilità contro i predoni.\n\nAbbiamo un disperato bisogno del tuo aiuto, $n. I Nokhud sono ancora nelle vicinanze e dobbiamo occuparci dei feriti!\n\nPerlustra il villaggio e portami i sopravvissuti che trovi, cercheremo di occuparcene e stabilizzeremo chi possiamo!', '', '', '', '', '', '', 47187),
(69093, 'itIT', 'Un nuovo mistero', 'Parla con Naleidea Brillafiumi nel Campo delle Scaglie di Drago.', '<Il Dottor Nanner sembra senza fiato mentre ti consegna una lettera che ti invita a tornare all\'accampamento della Spedizione delle Scaglie di Drago. Cerca avidamente di spiegare.>\n\nPorta sigillata. Segreti dei Titani. Sì?\n\n<Il Dottor Nanner annuisce eccitato, in attesa di una tua risposta.>', '', '', '', '', '', 'Parla con Naleidea Brillafiumi nel Campo delle Scaglie di Drago.', 47187),
(68799, 'itIT', 'Ritorno al Tempio della Vita di Rubino', 'Torna al Tempio della Vita di Rubino.', 'Questo è solo l\'inizio del tuo viaggio nell\'arte del volo!\n\nTieni gli occhi aperti per nuove avventure ed esperienze su tutte le Isole dei Draghi e assicurati di farci visita in qualsiasi avamposto.\n\nPer ora, torna da Alexstrasza per continuare l\'esplorazione di queste terre.', '', '', '', '', '', 'Torna da Alexstrasza al Tempio della Vita di Rubino.', 47187),
(68798, 'itIT', 'Tu e i Glifi del Drago', 'Ottieni il Glifo del Drago all\'Osservatorio della Vetta, poi parla con Lithragosa per usare il tuo talento.', 'Ovviamente, io e Glensera non siamo gli unici con un interesse in questi avventurieri. Anche Lithragosa è entusiasta all\'idea di aiutarti a migliorare le tue abilità nel Volo Draconico e hai già incontrato Celormu, perfetto.\n\nCi sono glifi nelle Isole dei Draghi che ti aiuteranno a imparare nuovi trucchetti e abilità per il Volo Draconico. In realtà, ce n\'è uno proprio qui all\'Osservatorio della Vetta.\n\nUna volta trovato, Lithragosa ti aiuterà a usarlo!', '', 'Trovabili ovunque sulle Isole dei Draghi, questi glifi ti aiuteranno a imparare nuovi trucchi e abilità per il Volo Draconico.', 'Glifo del Drago', '', '', '', 47187),
(68797, 'itIT', 'Un nuovo set di corna', 'Incontra Glensera e usa il Podio della Trasformazione per personalizzare il tuo draco.', 'Proprio come i mortali, i draghi curano molto il proprio aspetto. Anche tuo draco è in grado di cambiare, a seconda di ciò che trovi e dell\'esperienza che fai.\n\nParla con Glensera al Podio della Trasformazione e scoprilo di persona!', '', '', '', '', '', '', 47187),
(68796, 'itIT', 'L\'Osservatorio della Vetta', 'Vai all\'Osservatorio della Vetta presso le Sponde del Risveglio.', 'Queste sono le basi per cavalcare un draco! Stai andando piuttosto bene.\n\nOra vorrei presentarti alcuni degli altri coinvolti in questa avventura. Ci siamo stabiliti nell\'Osservatorio della Vetta.\n\nCelormu ti aiuterà ad arrivarci! Parla con lui quando sarai $gpronto:pronta;.\n\nCi vediamo lì!', '', '', '', '', '', 'Incontra Ser Andestrasz all\'Osservatorio.', 47187),
(68795, 'itIT', 'Volo draconico', 'Parla con Ser Andestrasz nel Tempio della Vita di Rubino.', 'Forse avrai già notato una caratteristica di questo posto: le Isole dei Draghi sono immense.\n\nAlcuni dei drachi sono molto interessati a esplorare ogni angolo e anfratto segreto di questa terra ritrovata, anche quelli non facilmente raggiungibili da terra. Non vedono l\'ora di avere un altro paio di occhi che li aiutino nel loro viaggio e, in cambio, saranno ben felici di trasportare una persona attraverso queste terre.\n\nParla con Ser Andestrasz, qui nel Tempio della Vita di Rubino; saprà spiegarti meglio.', '', '', '', '', '', 'Parla con Ser Andestrasz nel Tempio della Vita di Rubino.', 47187),
(68794, 'itIT', 'Alleati dei Draghi', 'Parla col Alexstrasza presso il Seggio degli Aspetti a Valdrakken.', 'Il tuo aiuto presso le Isole dei Draghi non è passato inosservato, $n.\n\nLa Protettrice della Vita in persona desidera mostrarti qualcosa come ricompensa per il tuo servizio ai draghi.\n\nVai a parlarle in cima alla torre. Tutti gli Aspetti attendono il tuo arrivo.', '', '', '', '', '', 'Parla con Alexstrasza presso il Seggio degli Aspetti a Valdrakken.', 47187),
(68644, 'itIT', 'Zucchero, cannella e ogni cosa bella', 'Aiuta a curare Sylvie.', 'Laggiù! Ora ho tutto ciò che mi serve per Sylvie!\n\nAppena in tempo. Dubito che avrebbe resistito ancora per molto in questo stato.\n\nMa... mi serve qualcuno che mi aiuti. Chiederei a Cally, ma... ti dispiacerebbe darmi di nuovo una mano?\n\nFammi sapere quando possiamo cominciare, $n.', '', '', '', '', '', '', 47187),
(68643, 'itIT', 'Vitamine e minerali', 'Recupera $1oa fiale d\'acqua minerale.', 'Suppongo che avrei dovuto aspettarmi che Steria si sarebbe arrabbiata con me, dato che ti ho chiesto di combattere degli animali...\n\nOvviamente, esistono metodi di ricerca alternativi.\n\nPrendi queste fiale e raccogli dell\'acqua dai cristalli di ghiaccio vicini.\n\nTeorizzo che contengano minerali infusi con energia del cristallo di faglia... e che stiano alimentando il contagio.', '', '', '', '', '', '', 47187),
(68642, 'itIT', 'Ingredienti alla spina', 'Recupera $1oa Aculei Infusi Arcani.', 'Voglio aiutare Sylvie, ma non voglio rallentare Cally più di così.\n\nPer dare la medicina a Sylvie, ho bisogno di Aculei Infusi Arcani dei vetraculeo. So che a loro non dispiacerà se ne strappi un po\'! \n\nE ricordati dei bakar! Mangiano i vetraculeo e potrebbero arrabbiarsi se ti vedono che li tocchi. Se devi difenderti, puoi raccogliere qualche aculeo anche da loro.\n\nMa... cerca di non farlo, ti prego.', '', '', '', '', '', '', 47187),
(68641, 'itIT', 'Un muschio di ingredienti', 'Raccogli $1oa Grumi di Dracomuschio.', 'Povera piccola...\n\nDeve essersi ammalata dopo aver mangiato qualcosa di infetto.\n\nFortunatamente, mio nonno era un druido e mi ha insegnato come curare le malattie di origine arcana.\n\nNon ho tutti gli ingredienti con me, ma possiamo arrangiarci con quello che troviamo qui attorno!\n\nPer prima cosa, avrò bisogno di un po\' di dracomuschio. È un lichene raro che cresce solo sulle ossa di drago.', '', '', '', '', '', '', 47187),
(68639, 'itIT', 'Predatori polari furtivi', 'Uccidi $1oa Mantogelo Infetti.', 'La specie che ci hanno mandato a studiare è quella dei Mantogelo.\n\nI loro terreni di caccia sono stati contaminati dalle linee di faglia. Le energie arcane penetrano nell\'acqua e nelle piante... e in predatori come le vivolpi.\n\nMa a differenza degli altri organismi, i Mantogelo sopravvivono al processo e ne traggono potere.\n\nInoltre, diventano aggressivi... e questo è un problema. Affrontane qualcuno e io prenderò appunti sulla loro forza e aggressività. \n\nIl mio resoconto aiuterà il Kirin Tor a decidere cosa fare per aiutarli.', '', '', '', '', '', '', 47187),
(68087, 'itIT', 'Pericolo a Daruukhan', 'Parla col Messaggero Teerai per sentire quale sia la richiesta urgente di Selbekh.', 'Immagino che non ci sia altro da fare se non rimandare te e Taivan a Maruukai. \n\nAspetta... Chi si sta avvicinando? Non sarà un altro sconosciuto con un bakar gigante, spero!', '', '', '', '', '', '', 47187),
(68085, 'itIT', 'Plasmare un pastore', 'Insegna a Taivan come radunare le argali a Mallakh.', 'Vuoi che addestri il tuo bakar alla pastorizia? Questo è quello che facciamo qui, ma non ne ho mai addestrato uno così GROSSO finora... \n\nLe argali non sembrano essere infastidite dalla sua presenza e sono molto brave a giudicare il carattere delle altre bestie. Fidati di me.\n\nSono disposto a dargli una possibilità. Tuttavia, un bakar da pastore non deve essere solo gentile, ma anche intelligente. Se non sarà in grado di farsi carico del gregge, le argali non gli obbediranno. È più difficile di quanto sembri! Prova pure, io guarderò da qui.', '', '', '', '', '', '', 47187),
(68084, 'itIT', 'Il gigante gentile', 'Manda Taivan ad addestrarsi dal Pastore Tevatei a Mallakh.', 'Se Taivan è davvero \"mansueto\" come dice Jadar, forse sarà più adatto come bakar da pastore!\n\nI membri del Clan Aylaag sono esperti pastori di argali e non sono così orgogliosi da negare l\'aiuto a un altro clan.\n\nManda Taivan dal Pastore Tevatei al Mallakh, si trova tra due colline a sud-ovest. È lì che addestrano i loro bakar.\n\nOhn\'ahra, per favore, fa\' che funzioni. Non ho davvero altre idee...', '', '', '', '', '', '', 47187),
(68083, 'itIT', 'Riprova, Taivan!', 'Torna dalla Guaritrice Selbekh a Maruukai e dalle la brutta notizia.', 'Torna dai Teerai e digli che nemmeno io posso addestrare Taivan a diventare un cacciatore. Semplicemente non ha la stoffa.\n\nÈ il bakar più mansueto che abbia mai visto e scommetto che proverebbe persino a fare amicizia con la selvaggina, se glielo lasciassimo fare! Hah!', '', '', '', '', '', 'Torna dalla Guaritrice Selbekh a Maruukai.', 47187),
(67921, 'itIT', 'Segugio da caccia', 'Dai la caccia a bestie pericolose con Taivan per dimostrare che è degno di essere addestrato.', 'Vai a cacciare le bestie vicine con il tuo bakar gigante. Più grandi sono, meglio è. Lo osserverò da qui e deciderò se il tuo bakar è degno dell\'addestramento degli Shikaar.\n\nAttenzione, accetterò solo il meglio.', '', '', '', '', '', '', 47187),
(67772, 'itIT', 'Il Problema con Taivan', 'Aiuta la Guaritrice Selbekh a preparare Taivan per l\'addestramento.', 'Ti do il benvenuto a Maruukai. Sono Selbekh, guaritrice del Clan Teerai.\n\nTe la cavi con gli animali, $n? Forse un nuovo arrivo è proprio ciò di cui ho bisogno per risolvere il mio problema.\n\nEcco Taivan: pur essendo un ottimo compagno, è diventato una specie di peso per il mio clan. Temo che se non riusciremo a trovare un buon utilizzo per lui, dovrò mandarlo via. Mi aiuterai?', '', '', '', '', '', '', 47187),
(67744, 'itIT', 'Shezra', '', '', '', '', '', '', '', '', 47187),
(67742, 'itIT', 'Perimetro dell\'Archivio - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(67741, 'itIT', 'Perimetro dell\'Archivio', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(67724, 'itIT', 'Le fiamme difensive', 'Ottieni $1oa Seta di Brivitela.', 'Io e Kattigat siamo venuti qui per dimostrare il nostro valore fermando la Fiamma Frammentata e recuperando Valthrux.\n\nOra siamo bloccati qui, a prenderci cura di quest\'Elfa dopo che è stata morsa da un ragno di ghiaccio. Non abbiamo ancora avuto modo di affrontare la Fiamma Frammentata e quei ragni potrebbero farci fuori in ogni momento!\n\nDobbiamo tenerli a bada.\n\nPer fortuna c\'è un modo naturale per respingerli: bruciando la seta dei loro bozzoli, si crea un profumo che li repelle.\n\nPrendi della seta e la getterò nel fuoco. Li terrà alla larga!', '', '', '', '', '', '', 47187),
(67717, 'itIT', 'Regina delle Ragnatele Ashkaz', '', '', '', '', '', '', '', '', 47187),
(67700, 'itIT', 'Verso le Isole dei Draghi!', 'Cavalca la Scaglia di Drago Frastagliata alle Isole dei Draghi dal Porto di Roccavento.', 'Buone notizie, $p! La nostra spedizione di punta è sbarcata sulle Isole dei Draghi.\n\nGrazie ai tuoi sforzi e a quelli degli altri membri della Spedizione delle Scaglie di Drago, abbiamo stabilito un sito di sbarco protetto e preso contatto con l\'ambasciata dello Stormo dei Draghi.\n\nSei $gpronto:pronta; ad accompagnarci nel nostro prossimo viaggio verso le Isole dei Draghi?', '', '', '', '', '', 'Incontra Toddy Baffetta sulle rive delle Isole dei Draghi.', 47187),
(67606, 'itIT', 'Un rimedio driadico', 'Ottieni un Dolcetto Saporito dei Cuccioli e dallo all\'Anatroccolo Avvilito.', 'Mentre eri via, ho sentito da un Coniglio dei Sogni che uno degli anatroccoli del posto si sente piuttosto giù di tono. Fortunatamente, so esattamente come risolvere il problema!\n\nOgni volta che mi sento giù, faccio uno spuntino con qualcosa di dolce e gustoso! Me ne intendo di creature carine e adorabili, quindi so per certo che lo stesso principio si applicherà anche a lui.\n\nQuesto anatroccolo in particolare va matto per un dessert locale noto come Dolcetto Saporito dei Cuccioli. Ne troveresti uno e lo porteresti al povero piccolo? È la cosa driadica da fare, dopotutto!', '', '', '', '', '', '', 47187),
(67605, 'itIT', 'Piane tonanti', 'Ottieni il Corno di Ayanga.', 'C\'è una grande bestia della tempesta che vaga per questo crinale. Molti cacciatori Shikaar hanno tentato di ucciderla, ma nessuno è sopravvissuto.\n\nSe vuoi andare a caccia di gloria, puoi tentare di abbattere la bestia. Riporta indietro il suo corno come tributo.', '', 'Un terribile sauro del tuono con la brutta abitudine di distruggere gli accampamenti dei Centauri.', 'Ayanga', '', '', '', 47187),
(67566, 'itIT', 'Sorvolo delle Terre Gelide - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(67565, 'itIT', 'Sorvolo delle Terre Gelide', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(67564, 'itIT', 'Corriere dell\'artigiano', 'Consegna la Fattura del Consorzio degli Artigiani a Thomas Bright.', 'Stai andando al Santuario della Vita?\n\nTi dispiacerebbe portare questa fattura a Thomas Bright? Ha ordinato alcune bottiglie personalizzate e il nostro vetraio è finalmente tornato con il prezzo dei materiali necessari.\n\nDovresti trovarlo in fondo al sentiero, probabilmente a uccidere di chiacchiere qualche povera anima su quanto sia grandioso suo marito...\n\nSicuramente, ti pagherà per il tuo tempo.', '', '', '', '', '', 'Consegna la Fattura del Consorzio degli Artigiani a Thomas Bright al Tempio della Vita di Rubino.', 47187),
(67299, 'itIT', 'Sparite, drachi', 'Usa un Detonatore Arcano per sconfiggere $1oa Proto-Drachi.', 'I Primalisti stanno attaccando incessantemente il nostro accampamento con i loro drachi!\n\nSiamo riusciti a tenerli a bada con i nostri scudi, ma ci farebbe comodo una mano per abbatterli.\n\nUsa uno dei nostri detonatori per colpire i drachi!', '', '', '', '', '', '', 47187),
(67298, 'itIT', 'Meraviglie del mondo', 'Scopri come Thomas ottiene la sua intuizione da artigiano.', 'Mio marito Thomas ha acquisito molte intuizioni dall\'esplorazione di queste terre primordiali.\n\nForse seguire le sue orme ti ispirerebbe allo stesso modo?', '', '', '', '', '', '', 47187),
(67297, 'itIT', 'Giro di Iskaara - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(67296, 'itIT', 'Giro di Iskaara', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(67295, 'itIT', 'È la mia specialità', 'Parla con Miguel Bright di una specializzazione professionale.', 'Allora, hai iniziato a specializzarti, eh? È una cosa meravigliosa, avere un\'abilità esclusiva che puoi chiamare tua.\n\nCome membro del Consorzio degli Artigiani, sarei felice di aiutarti nel percorso per affinare la tua specializzazione.\n\nHai un minuto per ascoltare le mie parole di saggezza e forse imparare qualcosa che ti aiuti nelle tue avventure?', '', '', '', '', '', '', 47187),
(67222, 'itIT', 'Nubi oscure', 'Ripulisci l\'Altura Cantavento dalla presenza dei Primalisti.', 'I Primalisti hanno infettato l\'Altura Cantavento con i loro assurdi insegnamenti. I nostri simili in quelle zone sono talmente sciocchi da ascoltarli.\n\nSe riuscissimo a liberare questo terreno sacro dalla loro presenza, forse gli altri clan ci aiuterebbero nel momento del bisogno. Pensi di poterci aiutare?', '', '', '', '', '', '', 47187),
(67221, 'itIT', 'Fissato col metallo', 'Raccogli $1oa pezzi di Draconium Cristallizzato nella Riva Cinerea.', 'Per sfruttare appieno il potenziale della Forgia del Custode della Terra, devi imparare le basi per creare la Lega d\'Ossidiana Ardente. Solo allora potrai seguire le orme dei più grandi fabbri di Neltharion.\n\nPortami un pezzo di Draconium Cristallizzato trovato nelle profondità della Riva Cinerea. A quel punto avrai da me la conoscenza che desideri.', '', 'Pericolosamente animata dal potere del Draconium all\'interno.', 'Scheggia d\'Acciaio Cristallizzata', '', '', '', 47187),
(67220, 'itIT', '10.0 [DNT] [GAMEPLAY TEST] - [SPAWNTRACKING] (JSS)', '', '', '', '', '', '', '', '', 47187),
(67178, 'itIT', 'Occhi bianchi, drago blu', 'Aiuta Yumadormu a sconfiggere Setogosa.', '$PC, puoi assicurarti che la partita si svolga nel modo più equo possibile?\n\nNon sarebbe la prima volta che Setogosa cerca di piegare le regole a suo vantaggio. \n\nNon vorrei che Yumadormu perdesse perché qualcuno ha barato.', '', '', '', '', '', '', 47187),
(67177, 'itIT', 'RICERCATO: Mangiatore', 'Uccidi Mangiatore e recupera le sue corna.', 'Se vuoi stare tra i Tuskarr, ti conviene dare una mano!\n\nDi recente, una bestia che chiamiamo Mangiatore si è stanziato qui vicino.\n\nA quanto pare, altri della sua specie stanno migrando in quest\'area e possiamo sfruttare la situazione a nostro vantaggio.\n\nUccidi Mangiatore e portami le sue corna. Ci serviranno come materiale da costruzione per espandere questo avamposto.', '', 'Un\'enorme bestia lontana dal suo normale territorio di caccia.', 'Mangiatore', '', '', '', 47187),
(67175, 'itIT', 'Come disinnescare una barca giocattolo esplosiva', 'Parla con la madre di Toolk, poi recupera la barca giocattolo.', 'Non mi piace l\'idea di togliere un giocattolo a una bambina, ma per il Kirin Tor sarebbe molto utile studiare in che modo sia riuscito ad assorbire così tanta energia arcana.\n\nD\'altra parte... non voglio offendere i nostri nuovi alleati Tuskarr. A dirla tutta, ho una bacchetta che potrebbe dissolvere la magia...\n\nAndiamo a parlare con la madre di Toolk, poi decideremo cosa fare.', '', '', '', '', '', '', 47187),
(67174, 'itIT', 'Individuazione arcana', 'Esamina gli oggetti dei Tuskarr nella Zona di Pesca di Khuri per trovare tracce di magia arcana.', 'Salve! Sono Miva Occhio Stellare e sto conducendo delle ricerche arcane in quest\'area.\n\nLa Vastità Azzurra è piena di magia; in parte è benevola... ma in parte può essere piuttosto pericolosa.\n\nHo il compito di assicurarmi che non ci siano energie arcane negli oggetti di proprietà dei Tuskarr.\n\nAbbiamo già avuto un incidente all\'Accampamento Antonidas con una cassetta da pesca che ha preso fuoco spontaneamente!\n\nPuoi prendere il mio rilevatore ed esaminare alcuni degli oggetti qui attorno? Io devo ancora parlare con Julk.', '', '', '', '', '', '', 47187),
(67173, 'itIT', 'Ladruncoli Gnoll', '', '', '', '', '', '', '', '', 47187),
(67167, 'itIT', 'È ora di duellare!', 'Sfida $1oa Dracthyr a una partita a Hearthstone.', 'Ora che ho di nuovo il mio mazzo di carte, posso concentrarmi sul reclutamento di nuovi membri nel mio club! Stavo pensando di chiedere ai Dracthyr...\n\nOh, questa è un\'altra cosa con cui puoi aiutarmi, $n!\n\nSarò un po\' impegnato a cercare di convincere altri draghi a unirsi e voglio davvero coinvolgere i Dracthyr.\n\nTi dispiace parlare con loro per conto mio? Ti avviso, molti di loro non hanno mai giocato prima d\'ora.', '', '', '', '', '', '', 47187),
(67154, 'itIT', 'Residui entropici', 'Raccogli $1oa Sabbia Vetrificata dalle creature nelle Sabbie Mutevoli.', 'Quando un\'entità attraversa i flussi temporali, le sabbie del tempo possono accumularsi sul suo corpo.\n\nNormalmente, questa sabbia si dissipa poco dopo, ma a volte le fluttuazioni entropiche intrinseche nei viaggi temporali la fanno vetrificare. In questi casi, diventa piuttosto difficile rimuoverla. Ho rovinato diverse paia di scarpe in questo modo.\n\nLa sabbia vetrificata può essere molto potente per i nostri scopi. Sarebbe il caso di recuperarne il più possibile.', '', '', '', '', '', '', 47187),
(67143, 'itIT', 'Un dono dal cuore', 'Crea un Cuore in Bottiglia |A:Professions-Icon-Quality-Tier3-Small:20:20|a con qualsiasi professione.', 'Ora che abbiamo raccolto l\'Essenza Elementale, pensi di poterla mettere in questa bottiglia?\n\nÈ una ricetta semplice, puoi crearla proprio come qualsiasi altra ricetta.\n\nSe hai perso, o usato, i reagenti di qualità, puoi sempre ottenerne altri dagli elementali alla Conca dei Drospi Cornuti.', '', '', '', '', '', 'Consegna il dono a Miguel Bright presso il Tempio della Vita di Rubino.', 47187),
(67142, 'itIT', 'Cibo per dragoni', 'Raccogli la Carne Carbonizzata dalla Lava dai Guardinghi della Crosta di Flusso Ardente.', 'Difendere la Cittadella d\'Ossidiana mette fame. Noi draghi mangiamo molto e dobbiamo rifornire le nostre riserve di cibo.\n\nNascosti sotto la lava indurita ci sono dei vermi molto gustosi che si contorcono nel magma. Potranno non sembrarti appetibili, ma ti assicuro che per un drago affamato sono una delizia!\n\nPrendi il nostro servitore Gulchak e usa il suo puntatore per dirigerlo verso i movimenti nella lava, così attirerà i vermi da raccogliere.', '', '', '', '', '', '', 47187),
(67137, 'itIT', 'Equipaggiamento professionale', 'Parla con Mahra Piegalberi.', 'Ho saputo da Efesta che anche tu ti occupi di artigianato.\n\nVorremmo regalarti dell\'attrezzatura professionale. È a questo che servono i partner commerciali, giusto?\n\nParla con la nostra sarta, Mahra Piegalberi, per farti prendere le misure.', '', '', '', '', '', 'Parla con Mahra Piegalberi al Tempio della Vita di Rubino.', 47187),
(67111, 'itIT', 'L\'apprendista in difficoltà', 'Ottieni $1oa Ghiandole Velenifere Congelate.', 'Questa missione è stata un errore fin dall\'inizio. Alia Planasoli ci ha chiesto aiuto per impedire alla Fiamma Frammentata di ottenere un pericoloso manufatto. L\'avevamo rintracciato fino a queste rovine, ma...\n\nLa Fiamma Frammentata ci ha battuti sul tempo, e per giunta tutta l\'area è infestata dai ragni di ghiaccio. Alia è stata avvelenata e temo che non sopravviverà a lungo senza l\'antidoto.\n\nPosso prepararlo io, ma mi servono le ghiandole velenifere prese dai ragni. Non voglio lasciarla da sola... Puoi occupartene tu?', '', '', '', '', '', '', 47187),
(67100, 'itIT', 'Un dono per Miguel', 'Parla con Thomas di questioni riguardanti la qualità, poi raccogli $2oa Spiriti Ardenti vicino alla Conca dei Drospi Cornuti per il dono di Miguel.', '$p, mi faresti un favore? Voglio fare un regalo a mio marito, Miguel.\n\nLui rappresenta tutto per me, ma ultimamente ho avuto molto da fare e non ho avuto il tempo di preparargli niente.\n\nPotresti aiutarmi a preparare qualcosa di alta qualità?', '', '', '', '', '', '', 47187),
(67099, 'itIT', 'Occhi di drago', 'Parla con Myridian, Zepharion ed Evorian nelle aree vicine.', 'Sappiamo che i Djaradin ci attaccheranno direttamente, ma mi preoccupano anche altri pericoli. Soprattutto quelli meno ovvi.\n\nHo inviato tre draghi a ispezionare l\'area circostante e individuare eventuali minacce.\n\nIncontra ciascuno di loro. Portami i loro rapporti. Dopo aver raccolto queste informazioni, torna da me in modo che possiamo prepararci al meglio per ciò che i Djaradin stanno pianificando.', '', '', '', '', '', '', 47187),
(67096, 'itIT', 'Volo della Foresta Fluente - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(67095, 'itIT', 'Volo della Foresta Fluente', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(67094, 'itIT', 'Gli straordinari delle driadi', 'Aiuta Thalendra a nutrire i numerosi animaletti di Valdrakken.', 'È meraviglioso rivedere Valdrakken così piena di vita! Purtroppo, ci sono tantissime cose che hanno sofferto migliaia di anni di abbandono... Tra esse ci sono tutte le adorabili piccole creature della città! Ahimè, non abbiamo abbastanza Driadi per andare in giro a prenderci cura di tutte.\n\nDimmi, che ne diresti di diventare Driade Onoraria di Valdrakken? Alcuni dei piccoli amici della città sono rimasti troppo a lungo senza i loro spuntini preferiti. Mi aiuteresti a prendermi cura di loro?', '', '', '', '', '', '', 47187),
(67093, 'itIT', 'Un santuario anomalo', 'Trova un modo per prendere la reliquia nascosta all\'interno del Santuario Perduto nelle Sabbie, poi torna da Nozdormu nel Seggio degli Aspetti a Valdrakken.', 'La mia squadra di ricerca ha trovato uno strano santuario nelle vicinanze. Siamo stati in grado di tradurre alcune delle scritte sull\'esterno. Sono rune dei Titani, per essere precisi, che crediamo facciano riferimento ad Aman\'thul il Sommo Padre, il capo dei Titani, in diversi punti.\n\nAbbiamo cercato di ispezionare meglio il luogo, ma dobbiamo aver attivato le difese del santuario: un\'enorme amalgama di sabbia ci ha bloccati e siamo a malapena riusciti a uscirne vivi.\n\nNon siamo certi di cosa stia proteggendo, ma dev\'essere qualcosa importante. Potresti indagare tu?', '', '', '', '', '', 'Torna da Nozdormu a Valdrakken.', 47187),
(67084, 'itIT', 'Lo Scopo d\'Argento', 'Piazza i Lingotti di Titanacciaio Antico nella forgia e porta a termine l\'incarico che Tyr vi ha affidato.', '<L\'eco di Tyr si attiva alla tua presenza.>\n\nOra potete procedere con il vostro incarico, amici miei.\n\nLanciate i lingotti nel fuoco e attivate la forgia. Ho già preparato le procedure necessarie.\n\nLa Scaglia Argentea è la chiave che contiene lo schema. Il suo scopo vi sarà rivelato.', '', '', '', '', '', 'Parla con Alexstrasza al Forte di Tyr.', 47187),
(67081, 'itIT', 'Un\'infusione di materiali', 'Recupera $1oa Lingotti di Titanacciaio Antico e sconfiggi lo Tsunami Primordiale nelle Sale dell\'Infusione.', '<L\'immagine di Tyr parla di nuovo.>\n\nHai riattivato la forgia. Il prossimo incarico non sarà così semplice.\n\nNella scaglia sono trascritti gli schemi di qualcosa che vi chiedo di forgiare. Ho affidato a Irideus, uno dei miei guardiani, il compito di conservare i materiali necessari. La loro origine è speciale, ne sono rimasti davvero pochi.\n\nCercate Irideus nelle Sale dell\'Infusione, dove spero che il suo occhio vigile abbia mantenuto la struttura in perfetto ordine e funzionamento.', '', '', '', '', '', '', 47187),
(67080, 'itIT', 'Rifornimenti dell\'Artigiano: Soluzione Alchemica del Drago', 'Usa la ricetta per gli Intrugli di Recupero per creare $1oa bottiglie di Soluzione Alchemica del Drago da consegnare a Efesta presso il Tempio della Vita di Rubino.', 'Cerchi lavoro, alchimista?\n\nIl Consorzio degli Artigiani mi ha contattato con un Ordine d\'Artigianato per le mie soluzioni alchemiche. Anche se mi interessano molto queste pratiche commerciali, ho troppo da fare.\n\nForse questa è un\'opportunità per te, apprendista. Crea della soluzione alchemica recuperando i tuoi intrugli precedenti e portala a Efesta; la troverai lungo il sentiero.', '', '', '', '', '', '', 47187),
(67079, 'itIT', 'Sottochiave', 'Recupera il Disco di Sicurezza Primario e il Disco di Sicurezza Secondario all\'interno del Forte di Tyr.', 'La sicurezza nella forgia è più stretta di qualsiasi altra area del Forte di Tyr. Sarà una sfida per noi, $C.\n\nSolo alcune unità intorno al forte avrebbero la capacità di superare questi sistemi di sicurezza, i protocolli di sicurezza richiedono più di un codice, in caso di corruzione.\n\nNon sarà facile farsi dare l\'accesso da queste unità, potresti dover usare la forza. Fai attenzione, $n.', '', '', '', '', '', '', 47187),
(67078, 'itIT', 'Istruzioni per il commiato', 'Piazza la Scaglia Argentea nella forgia del Forte di Tyr.', '<L\'eco parla con una voce antica.>\n\nAi miei cari amici, devo scusarmi per la mia partenza improvvisa.\n\nTuttavia, non vi ho lasciati senza un aiuto. So che siete in un momento di grande bisogno, ma, per assicurarmi che questo dono non cada nelle mani sbagliate, devo chiedervi di completare una serie di incarichi.\n\nIl primo dovrebbe essere semplice: riattivare la forgia nel Forte di Tyr. La Scaglia Argentea è la chiave.', '', '', '', '', '', 'Parla con Koranos al Forte di Tyr.', 47187),
(67077, 'itIT', 'Memorie dal passato', 'Parla con Nozdormu per assistere al ricordo del passato.', 'Questo è il posto dove abbiamo visto il nostro amico Tyr per l\'ultima volta.\n\nNon capivamo il motivo per cui dovesse andarsene, solo che era qualcosa di importante.\n\nAnche se può essere difficile per i nostri cuori, penso che questa scintilla ci abbia portati qui per essere nuovamente testimoni di quel tempo. Con l\'aiuto di Nozdormu potremo rivivere quel momento e vedere se ci sono altri indizi lasciati da Tyr per noi.', '', '', '', '', '', '', 47187),
(67076, 'itIT', 'La scintilla della scoperta', 'Indaga sulla Scintilla Titanica nel Forte di Tyr.', 'Nonostante questa scintilla sia di origine peculiare, ha un ché di familiare. Non so che scopo avesse, ma penso possa guidarci verso il prossimo passo per districare questo mistero.\n\nSeguila e cerca di scoprire di più sulla sua funzione, io continuerò a indagare, nel frattempo.', '', '', '', '', '', 'Parla con Kalecgos al Forte di Tyr.', 47187),
(67075, 'itIT', 'La magia interiore', 'Estrai la magia nascosta dalle console al Forte di Tyr per svelare il mistero della Scaglia Argentea.', 'Intrigante, molti misteri si annidano in questa cittadella. Nessuno, tranne il Guardiano Tyr stesso, li comprende. Se vogliamo fare chiarezza, dobbiamo esplorare ulteriormente il Forte di Tyr.\n\nPenso che la scaglia attirerà i segreti contenuti in questo luogo.\n\nAd ogni modo, c\'è una complicazione, i guardiani del Forte di Tyr sono ancora... instabili, potrebbero considerare la tua esplorazione come un attacco e, pertanto, ostacolarti. Prendi questo condotto, ti aiuterà in caso i guardiani ti diano problemi.', '', '', '', '', '', '', 47187),
(67074, 'itIT', 'Un dono argenteo', 'Parla con Alexstrasza per scoprire il dono di Tyr.', 'Poco prima della sua morte, il Guardiano Tyr ci ha donato una scaglia di drago forgiata dall\'argento più puro. L\'abbiamo conservata nelle cripte di Valdrakken durante la nostra assenza, ma credo sia il momento di condividerla.\n\nNonostante non ne conosca la funzione, è sempre stata un simbolo di unità e amicizia per noi. In quanto $galleato:alleata; dei dragoidi, vogliamo condividerla con te. Torna a parlarmi quando te la sentirai, $n.', '', '', '', '', '', '', 47187),
(67073, 'itIT', 'Alba rossa', 'Trova Alexstrasza.', 'Siamo così vicini a recuperare i nostri poteri... Se Raszageth dovesse riuscire nel suo intento prima che i nostri poteri tornino, le cose si metterebbero male per tutta Azeroth.\n\nNon dobbiamo permettere che ciò accada, $n!\n\nSbrigati, devi trovare e aiutare Alexstrasza prima che tutto sia perduto!', '', '', '', '', '', '', 47187),
(67068, 'itIT', 'Che brezzolina!', 'Raccogli un Uovo di Cacciabrezza.', 'Cacciabrezza?!? Oh, quei rapaci sono sempre un problema. Proprio l\'altro giorno, la nostra stalliera, Marren, è quasi morta cadendo mentre cercava di addomesticarne uno.\n\nÈ una tipa piuttosto orgogliosa, quindi ha dato la colpa al cacciabrezza. Mi ha detto che se la creatura non avesse creduto che le sue uova fossero sotto attacco, non sarebbe stata così aggressiva e non l\'avrebbe spinta oltre il bordo della rupe.\n\nImmagino che questo significhi che forse riuscirai a trovare le uova che cerchi là fuori. La zona a cui si riferiva era a est, appena oltre il fianco della montagna.', '', '', '', '', '', 'Torna da Rumiastrasza al Banchetto di Rubino a Valdrakken.', 47187),
(67067, 'itIT', 'Alla scoperta del Granoturco Salterino', 'Raccogli $1oa steli di Granoturco Salterino Selvatico.', 'C\'è una chef Drago a Valdrakken? Davvero? Dovrò chiederle di provare la mia zuppa di arciluce! È un\'antica ricetta di famiglia.\n\nConosco la pianta di cui parli: cresce attorno ai ruscelli in questa zona, ma ha causato qualche problema.\n\nGli steli di Granoturco Salterino sembrano costituire un territorio di caccia naturale per scarabei e salamantere, che, a loro volta, sono prede naturali dei drospi cornuti. Se riesci ad avvistarli in campo aperto, non sono un problema, ma ce ne sono alcuni che riescono a essere straordinariamente furtivi.\n\nIo mi guarderei le spalle, se fossi in te.', '', '', '', '', '', 'Torna da Rumiastrasza al Banchetto di Rubino a Valdrakken.', 47187),
(67066, 'itIT', 'Delizie da approfondire', 'Raccogli un Pesce Mutante all\'Acquamatta', 'Rumi e Bocconacciuolo?\n\nAccidenti, ne è passato di tempo. Mangiare pesce insieme a due chef, un drago e un\'anatra, sembra l\'inizio di una storia che l\'Anziana Poa potrebbe raccontare ai giovani del villaggio. Sarebbe difficile dimenticare un simile evento!\n\nIl pesce in questione era un Pesce Mutante all\'Acquamatta, uno dei preferiti dei Tuskarr! Sono rari, ma si trovano appena fuori dalla costa in questa zona.\n\nUn avvertimento: è la stagione degli amori dei dentazzurri e quelle belve assetate di sangue sono pronte a sbranarti se tocchi i loro spuntini preferiti.', '', '', '', '', '', 'Torna da Rumiastrasza al Banchetto di Rubino a Valdrakken.', 47187),
(67065, 'itIT', 'Freschezza fungina', 'Cattura 7 Tartufi Devastati dal Tempo dal Futuro dei Primalisti.', 'Un fungo delizioso? I futuri alternativi non sono dispense da saccheggiare in cerca di spuntini mattutini.\n\nEppure... mentirei se dicessi che non ho mai sognato di assaporare di nuovo la cucina di Rumi e Bocconacciuolo.\n\nMolto bene! Hai il mio permesso di attraversare il portale, ma ti consiglio di cercare altre persone con cui viaggiare.\n\nI miei Custodi mi hanno parlato di questi funghi scuri in passato. Pare che non restino mai nello stesso posto. Non so bene cosa intendessero, ma tienilo a mente.', '', '', '', '', '', 'Torna da Rumiastrasza al Banchetto di Rubino a Valdrakken.', 47187),
(67064, 'itIT', 'Sconclusionata delizia', 'Raccogli $1oa Bulbi di Algaserpe Luccicante', 'Oh, Rumiastrasza! Io e le sorelle Driadi, Celina e Felina, abbiamo trascorso una serata incantevole a cucinare per lei.\n\nL\'alga che abbiamo mangiato quella volta appartiene a una varietà particolare chiamata Algaserpe Luccicante. Banchi di pescibalza se ne nutrono lungo tutta la costa e non mi stupirebbe se ti attaccassero mentre cerchi di cogliere il loro cibo preferito dal fondale marino.\n\nPorta i miei saluti agli chef quando li vedi. Sono sempre i benvenuti qui nel nostro santuario.', '', '', '', '', '', 'Torna da Rumiastrasza al Banchetto di Rubino a Valdrakken.', 47187),
(67063, 'itIT', '10.000 anni di arrosti', 'Raccogli $1oa Spezie di Lava Piccanti.', 'Spezie? Oh! Sei l\'amico di chella cuoca drago. Chella con l\'anatra chef in testa.\n\nI Djaradin raccolgono una polvere, la Spezia di Lava Piccante, dagli elementali di fuoco cchiu\' sotto. \n\nNun mi guarda\' accussì! È accussì che la chiamano i Djaradin, mica io!\n\nBuona fortuna là sotto. Io non ci andrei da solo, se fossi in te.', '', '', '', '', '', 'Torna da Rumiastrasza al Banchetto di Rubino a Valdrakken.', 47187),
(67062, 'itIT', 'Conflitto dilagante', '', '', '', '', '', '', '', '', 47187),
(67053, 'itIT', 'Possibilità di pace', 'Presentati ai rappresentanti dell\'Orda.', 'Che la Luce sia con te, $p.\n\nQuesta spedizione è sotto la protezione dell\'Orda e dell\'Alleanza. I nostri ordini sono chiari: aiutare tutti i membri della spedizione, a prescindere dalle loro affiliazioni.\n\nLe rappresentanti dell\'Orda, la Signora della Guerra Asciatetra e sua figlia Shuja, sono di guardia dall\'altro lato dell\'accampamento.\n\nHo combattuto al fianco della Signora della Guerra Asciatetra contro il Flagello. È valorosa e servirà bene questa spedizione.\n\nOffrile il tuo aiuto. Mostrale che l\'Alleanza onora i suoi accordi.', '', '', '', '', '', 'Parla con la Signora della Guerra Breka Asciatetra all\'Ambasciata Riposo Alato.', 47187),
(67050, 'itIT', 'Gelomorso: cause e sintomi', 'Piazza i totem per liberare i Cacciatori Tuskarr intrappolati nella Vastità Azzurra.', 'I totem sono abitati da degli elementi, $r. Falli uscire e spezza il ghiaccio. Libera i tuoi amici Tuskarr!', '', '', '', '', '', '', 47187),
(67047, 'itIT', 'Scalda via questi brividi', 'Raccogli $1oa foglie di Sagittata Freddogelo.', 'Credo che la pianta che stai cercando abbia uno stelo sottile e delle foglie rosse.\n\nTuttavia, sarà difficile non imbattersi in questi ignobili ragni mentre raccogli i fiori. Ti consigli di starne alla larga, oppure di tenere un\'arma affilata a portata di mano.\n\nFai sapere al tuo amico drago che può ricompensarmi con una tazza o due di infuso, la prossima volta che mi trovo in città.', '', '', '', '', '', 'Torna da Rumiastrasza al Banchetto di Rubino a Valdrakken.', 47187),
(67044, 'itIT', 'Racconto di un eroe: Yanikk', 'Ascolta il racconto di Yanikk.', 'Lascia che ti racconti la storia di Yanikk.', '', '', '', '', '', '', 47187),
(67039, 'itIT', 'Un viaggio incredibile', 'Trova gli animali scomparsi', 'Durante l\'ultimo viaggio tra gli accampamenti abbiamo smarrito alcune mascotte del clan. Non sanno dare la caccia agli animali, quindi dubito che riescano a sopravvivere là fuori!\n\nPotresti andare a cercarle? Non saranno utili per la caccia, ma sono comunque dei membri importanti del clan.', '', '', '', '', '', '', 47187),
(67036, 'itIT', 'La rabbia del Kirin Tor', 'Usa il Detonatore Arcano per aiutare Khadgar a sconfiggere i Primalisti.', 'Ho assemblato i pezzi del dispositivo che hai trovato.\n\nPosizionalo vicino a Khadgar e usalo per respingere i Primalisti!\n\nDobbiamo tenerli a bada solo finché Kalecgos non arriva.', '', '', '', '', '', '', 47187),
(67035, 'itIT', 'Conservazione della Conoscenza', 'Trova $1oa Tomi Antichi sparsi nell\'Accampamento Antonidas.', 'Saluti, $R. Sono Althanus. Avrei preferito incontrarti in tempi... meno caotici.\n\nStavamo aiutando il Kirin Tor con lo studio della storia di questo luogo, quando i Primalisti hanno attaccato.\n\nTemo che molti dei tomi siano ancora là fuori, col rischio che vengano distrutti durante questo terribile assalto.\n\nTi prego, devi ritrovarli! Se vengono distrutti, la storia di questo posto andrà perduta con essi.', '', '', '', '', '', '', 47187),
(67034, 'itIT', 'Dell\'aria e dell\'acqua', 'Recupera i reagenti dalle Fonti dei Draghi Ruggenti.', 'A est c\'è una grande Fonte dei Draghi che funge da area di nidificazione per le aquile selvagge. Le piume perdute da queste creature mantengono ancora per qualche tempo la propria energia magica e sono utilizzabili in svariati rituali.\n\nAll\'interno dell\'area sono anche presenti degli spiriti elementali in preda alla furia: i loro nuclei potrebbero rivelarsi molto utili.\n\nPortami entrambi questi trofei, ma ricorda che le aquile sono sacre: non accetterò le piume che ti procurerai facendo loro del male.', '', '', '', '', '', '', 47187),
(67033, 'itIT', 'Assembla le difese', 'Recupera $1oa pezzi del Detonatore Arcano.', 'I Primalisti hanno cacciato il Kirin Tor da quando siamo arrivati nella Vastità Azzurra. Detestano la nostra pratica della magia arcana.\n\nInvierò un messaggio a Kalecgos perché ritorni dagli Archivi Azzurri. Nel frattempo, dobbiamo tenerli a bada.\n\nSembra che le nostre difese arcane principali siano state distrutte durante il loro attacco iniziale. Portami i pezzi cosicché io possa riassemblarle.', '', '', '', '', '', '', 47187),
(67032, 'itIT', 'Ascesa di Vakthros - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(67031, 'itIT', 'Ascesa di Vakthros', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(67027, 'itIT', 'Ombra della Morte', '', '', '', '', '', '', '', '', 47187),
(67015, 'itIT', 'Forgiare la risposta', '', '', '', '', '', '', '', '', 47187),
