(67007, 'itIT', 'Assistenza all\'archivio', 'Parla con Kemora negli archivi di Valdrakken.', '<Le lettere nitide e pulite, scritte con un tocco elegante, svaniscono rapidamente nell\'inchiostro bagnato e macchiato della pergamena con un odore che ricorda una bevanda fermentata.>\n\nCERCATORI DI AVVENTURA, APPASSIONATI DI ARCHIVIAZIONE!\n\nGli archivi chiamano coloro che cercano risposte, che hanno brama di scoprire e che desiderano svelare segreti del passato e, forse, del futuro!\n\nQuesta richiesta non è per i deboli di cuore, né per quelli di volontà vacillante.\n\nAstenersi perditempo!\n\n- Kemora', '', '', '', '', '', '', 47187),
(67006, 'itIT', 'Spegnere la Fiamma', '', '', '', '', '', '', '', '', 47187),
(67005, 'itIT', 'Come addestrare un Proto-Draco', '', '', '', '', '', '', '', '', 47187),
(67004, 'itIT', 'Belle cose in grandi forzieri', 'Trova uno Scrigno del Custode della Terra per me. Portalo qui e potremo condividerne le ricchezze.', 'Grazie ai nostri sforzi abbiamo tutto ciò che ci serve per aprire lo Scrigno del Custode della Terra. Ce ne sono svariati, sotto la Cittadella! Trovane uno e ti ricompenserò...\n\nHo forgiato delle catene per spostarlo. Porta qui lo Scrigno e potremo condividerne le ricchezze.\n\nRicorda che ho inviato anche altri a trovare gli scrigni.', '', '', '', '', '', 'Torna dal Fuochista Volrax, con o senza lo Scrigno del Custode della Terra.', 47187),
(67003, 'itIT', 'Slalom della Vastità Azzurra - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(67002, 'itIT', 'Slalom della Vastità Azzurra', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66998, 'itIT', 'Acqua... acqua... fuoco!', 'Uccidi gli Elementali della Lava nella Caverna Eruttante.', 'In tutti questi anni trascorsi a prendermi cura degli Elementali della Lava, non li ho mai visti comportarsi così! Riusciamo a malapena a tenerli a bada all\'interno della caverna.\n\nHai un minuto da dedicarmi? Possiamo tenere sotto controllo l\'uscita mentre tu cerchi di eliminarne abbastanza.\n\nTieni, porta con te questo Elementale dell\'Acqua Imbottigliato.\n\nNe ho sempre qualcuno con me, quando mi occupo degli Elementali della Lava! I nemici naturali sono un buon diversivo!', '', '', '', '', '', '', 47187),
(66997, 'itIT', 'Asilo nido', 'Incontra Vaeros nei giardini delle Pozze della Vita di Rubino.', 'È meraviglioso, Lasztak ha accettato la Chiamata come Custode dei draghetti! Soprattutto considerando quante di queste preziose creaturine stanno mettendo i denti proprio in questo momento.\n\nInoltre, i giardini nido stanno avendo qualche problema. I cuccioli sono stressati e i custodi sono... be\', più stressati del solito.\n\nPer favore, appena hai un momento libero, vieni a trovarmi nei giardini. Anche il tuo aiuto ci farebbe comodo!', '', '', '', '', '', '', 47187),
(66987, 'itIT', '[DNT] 10.0 Explorers - Ch2 - Fake Quest Requirement (SMART)', '', '', '', '', '', '', '', '', 47187),
(66972, 'itIT', 'Il vecchio Zannapietra', 'Abbatti il vecchio Zannapietra vicino all\'Accampamento Antonidas.', 'Ho un compito ingrato per te, $p. Non tutte le uccisioni sono una sfida di abilità, alcune sono semplicemente una questione di compassione.\n\nC\'è un vecchio mammut che vaga nella foresta a est dell\'Accampamento Antonidas. L\'ho avvistato da lontano qualche tempo fa e sento i suoi tristi barriti di tanto in tanto. Sta chiaramente soffrendo.\n\nHa iniziato a seminare il caos nel sottobosco e temo che stia diventando un pericolo per gli altri.\n\nDaresti sollievo al mio vecchio cuore donando pace a quell\'anima stanca. Portami la sua zanna, così potremo rendergli onore.', '', 'Un vecchio maschio di mammut che è diventato un pericolo per sé e per gli altri.', 'Il vecchio Zannapietra', '', '', 'Parla con Hemet Nesingwary Jr. nel Campo Che Non C\'è.', 47187),
(66971, 'itIT', 'Il volto della morte', 'Dai la caccia a Gelofauce a nord della Vallata dei Mantogelido.', 'Dimmi, $gamico mio:amica mia;. Hai mai guardato in faccia la morte?\n\n<Nesingwary fa una pausa drammatica.>\n\nMa che sto dicendo? Certo che sì.\n\nLa morte, dopotutto, ha molti volti.\n\nHo sentito dire dai Tuskarr Imbu che uno di questi volti alberga proprio su queste colline. Pronunciare il suo nome equivale a invocare una morte fredda e violenta.\n\nGelofauce.\n\n<Nesingwary si guarda intorno con cautela.>\n\nBe\', ora devi dargli la caccia, per il mio bene!', '', 'Un leggendario presagio di morte sul ghiaccio.', 'Gelofauce', '', '', 'Parla con Hemet Nesingwary Jr. nel Campo Che Non C\'è.', 47187),
(66970, 'itIT', 'Ty\'foon l\'Asceso', '', '', '', '', '', '', '', '', 47187),
(66969, 'itIT', 'Clan delle Pianure', 'Fai rapporto alla Khan Sansok a Maruukai.', 'Mentre aspettate l\'arrivo dell\'emissario, la Khan Sansok vorrebbe chiederti com\'è andato l\'incontro con i clan. Mi ha chiesto di cercarti e di dirti di incontrarla nel centro di Maruukai.', '', '', '', '', '', '', 47187),
(66968, 'itIT', 'Sfoltire il branco', 'Dai la caccia a Yetor vicino allo Scudo di Ronin.', '<Nesingwary indica un lato del sentiero.>\n\nVedi quelle impronte nella neve?\n\nSi tratta di Yeti.\n\nC\'è qualcosa che non va se cacciano così vicino alla strada. Vedi se riesci a trovare il loro capobranco. Non vogliamo che inizino a tendere imboscate ai viaggiatori!\n\nSe dovesse rivelarsi un nemico particolarmente violento, prendi la sua testa come trofeo. Dovrebbe bastare per dissuadere gli altri.', '', 'Peggio di un grosso yeti c\'è solo un grosso yeti con i suoi amici.', 'Yetor', '', '', 'Parla con Hemet Nesingwary Jr. nel Campo Che Non C\'è.', 47187),
(66964, 'itIT', 'Manufatti nelle mani sbagliate', 'Trova Alia Planasoli presso le Rovine Perdute nella Vastità Azzurra.', 'Abbiamo una miriade di problemi, anzi... un numero incalcolabile di problemi!\n\nOh, cielo, da dove inizio?\n\nIl Kirin Tor ha scoperto un piano della Fiamma Frammentata: stanno cercando un manufatto chiamato \"Valthrux\".\n\nHa un potere immenso e pare essere... senziente. Questo è un aumento esponenziale del pericolo!\n\nUna certa Alia Planasoli è andata a sud con alcuni Tuskarr per indagare sulla Fiamma Frammentata. Dovrebbe essere già tornata...\n\nTi prego, trovala e impedisci alla Fiamma Frammentata di ottenere il manufatto!', '', '', '', '', '', '', 47187),
(66963, 'itIT', 'Fuori per una consegna', 'Riferisci al Catalogatore Wulferd al campo base vicino che la sua merce non arriverà tanto presto.', 'Avevo provato a dire a Vevesi che potevo tirare io il carro fuori dal fango.\n\nMa no, ha insistito per usare la magia per tirarlo fuori... e guarda cos\'ha combinato.\n\n<Il Trasportatore Bennet sospira.>\n\nMentre cerco di parlare con Vevesi, potresti risalire la collina fino al campo base e far sapere al Catalogatore Wulferd che potrebbe aver bisogno di un\'altra cassa di rifornimenti per la sua macchina fotografica da Boralus?', '', '', '', '', '', 'Riferisci le cattive notizie al Catalogatore Wulferd nel Campo delle Scaglie di Drago.', 47187),
(66962, 'itIT', '[DNT] 10.0 Explorers - Ch1 - Fake Quest Requirement (SMART)', '', '', '', '', '', '', '', '', 47187),
(66961, 'itIT', 'Unirsi alla caccia', '', '', '', '', '', '', '', '', 47187),
(66960, 'itIT', 'Klozicc l\'Asceso', '', '', '', '', '', '', '', '', 47187),
(66958, 'itIT', 'Proteggere e servire', 'Dai la caccia a Cornocruento a est di Iskaara.', 'Stavo parlando con alcuni cacciatori fuori da Iskaara l\'altro giorno e mi hanno riferito di essersi imbattuti in una scena piuttosto raccapricciante.\n\nA quanto pare, un Rinoceronte particolarmente feroce chiamato Cornocruento ha iniziato ad attaccare i Bruffali nei dintorni.\n\nI Bruffali devono già fare i conti con parecchia competizione nell\'ecosistema della Vastità Azzurra, senza doversi preoccupare di un bruto che invade il loro territorio per attaccare le loro mandrie!\n\nPortami il suo corno. Vorrei fare una buona impressione sui nostri amici Tuskarr!', '', 'Una bestia vendicativa che sta decimando la popolazione locale di bruffali.', 'Cornocruento', '', '', 'Parla con Hemet Nesingwary Jr. nel Campo Che Non C\'è.', 47187),
(66957, 'itIT', 'Un\'ombra nel ghiaccio', 'Ispeziona la cima del Ghiacciaio che sovrasta l\'Accampamento Antonidas.', 'Ho sentito delle voci passando per l\'Accampamento di Antonidas, racconti di fauna mutilata rinvenuta nelle steppe gelide: sembra che fossero poco più di rimasugli sanguinolenti.\n\nQualunque cosa sia, ha decimato la fauna locale e i Maghi ne hanno paura.\n\nDai un\'occhiata in cima al ghiacciaio. Se proprio dovessi scommettere, è lì che mi stabilirei, se fossi un grande predatore.\n\nPortami un pezzo della creatura, così potremo rassicurare il Kirin Tor.', '', 'Un gigante maligno che si diletta nel giocare con le sue prede.', 'Gelopugno', '', '', 'Parla con Hemet Nesingwary Jr. nel Campo Che Non C\'è.', 47187),
(66956, 'itIT', 'Il Cacciadraghi Igordan', '', '', '', '', '', '', '', '', 47187),
(66952, 'itIT', 'I vestiti dello Gnoll', 'Raccogli 20 pezzi di Stoffa Indossata dagli Gnoll ottenuta dagli Gnoll delle Isole dei Draghi per Dothenos dell\'Accordo di Valdrakken.', 'Gli Gnoll sono una minaccia costante: lanciano costantemente incursioni sanguinose e attacchi contro le spedizioni e i popoli delle Isole dei Draghi. Com\'è dunque possibile che le loro vesti siano così pulite?\n\nDopo le tue battaglie con questi incursori, potresti raccogliere un campione della stoffa che indossano da analizzare?', '', '', '', '', '', '', 47187),
(66950, 'itIT', 'Cuore di Gigante', 'Raccogli 5 Nuclei Giganti dai Giganti Fusi, di Montagna o del Ghiaccio delle Isole dei Draghi per consegnarli a Temnaayu dei Tuskarr di Iskaara.', 'Si dice che nelle Isole dei Draghi si aggirino diversi giganti, con gemme meravigliose custodite all\'interno dei loro nuclei. Normalmente non diamo la caccia alle creature delle isole in cerca di tesori, ma questi giganti hanno causato parecchi problemi.\n\nDovendo comunque eliminare questi giganti molesti, potremmo approfittarne e recuperare anche queste gemme preziose.', '', '', '', '', '', '', 47187),
(66948, 'itIT', 'L\'arrivo dell\'emissario', 'Informati sulla situazione nelle profondità dei Giardini di Smeraldo.', 'Devo ammettere che non ho mai lasciato i Giardini di Smeraldo in tutta la mia vita e non ho mai incontrato un Centauro, tanto meno un essere mortale del continente!\n\nTuttavia, non sono qui per una visita di cortesia, ma per implorare l\'aiuto del Centauro, per mettere al sicuro la nostra Pietra del Giuramento e proteggere la nostra carica.\n\nSono felice di vedere che anche tu sei qui per aiutarci. C\'è molto di cui discutere.', '', '', '', '', '', '', 47187),
(66947, 'itIT', 'Volata della Vastità Azzurra - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66946, 'itIT', 'Volata della Vastità Azzurra', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66944, 'itIT', 'Pigmenti di Pavone', 'Raccogli 8 Piume di Pavone dai pavoni delle Isole dei Draghi per Gnoklin Spirastrana della Spedizione delle Scaglie di Drago.', 'I pavoni delle Isole dei Draghi hanno delle piume così variopinte! Scommetto che potremmo ricavarne dei pigmenti, utilizzabili come inchiostri dai nostri runografi.', '', '', '', '', '', '', 47187),
(66943, 'itIT', 'Legno per scrivere', 'Recupera 15 Cartapecore di Corteccia dai Treant del Decadimento delle Isole dei Draghi per darli a Dothenos dell\'Accordo di Valdrakken.', 'Abbiamo scoperto informazioni insolite durante i nostri studi delle Isole dei Draghi. Ad esempio, la corteccia dei Treant afflitti dalla magia del decadimento è simile ad una cartapecora di pelle.\n\nQuesta strana cartapecora è in grado di contenere la magia per iscrizioni più potenti, quindi è molto utile! Potresti aiutarci ad ottenerne altra?', '', '', '', '', '', '', 47187),
(66940, 'itIT', 'Sperimentazione sugli elisir', 'Raccogli 15 campioni di Muco di Gorloc dai Gorloc delle Isole dei Draghi per Dhurrel dei Centauri Maruuk.', 'Di recente i nostri alchimisti stanno ricercando diversi nuovi ingredienti con cui sperimentare. L\'ultima novità oggetto di studio è... a dir poco interessante.\n\nSembra che il muco di Gorloc abbia delle proprietà potenzialmente molto utili per determinati elisir.', '', '', '', '', '', '', 47187),
(66939, 'itIT', 'A caccia del Mastro Cacciatore', 'Dai la caccia al Mastro Cacciatore Krakle vicino allo Scudo di Imbu.', 'Ho sentito da una delle guardie del Campo Che Non C\'è che un essere abietto sta mutilando la fauna locale. Si fa chiamare \"Mastro Cacciatore\".\n\nLa caccia è una cosa, ma non riesco a tollerare la tortura di un essere vivente.\n\nInoltre, al mio carro farebbe comodo un amuleto portafortuna.\n\n<Nesingwary sputa a terra.> \n\nPortami la sua zampa.', '', 'Un diabolico gnoll che trae grande piacere nel torturare innocenti animali selvatici.', 'Mastro Cacciatore Krakle', '', '', 'Parla con Hemet Nesingwary Jr. nel Campo Che Non C\'è.', 47187),
(66934, 'itIT', 'Distruggere il Distruttore', '', '', '', '', '', '', '', '', 47187),
(66933, 'itIT', 'Scatto dello Specchio del Cielo', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66931, 'itIT', 'Cos\'è questo trambusto?', 'Scopri l\'origine del trambusto al Tempio della Vita di Rubino.', 'Non era una semplice scossa.', '', '', '', '', '', '', 47187),
(66929, 'itIT', 'Devo raccoglierle tutte', 'Recupera il mazzo di Yumadormu.', '$PC, ti dispiace aiutarmi a recuperare le mie carte?\n\nHo detto a Setogosa che ne ho bisogno per mostrare agli altri studenti come giocare a Hearthstone. Voglio formare un club, ma non me le vuole restituire!\n\nÈ sempre stata scortese con me, ma ora sta esagerando.', '', '', '', '', '', '', 47187),
(66921, 'itIT', 'Scatto di Maruukai', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66903, 'itIT', 'Ripulisci le mura', '', '', '', '', '', '', '', '', 47187),
(66901, 'itIT', 'Spezzare il mondo', '', '', '', '', '', '', '', '', 47187),
(66897, 'itIT', 'Combustibile per la Forgia', 'Raccogli 10 Nuclei Magmatici dalle creature di lava delle Isole dei Draghi per Dhurrel dei Centauri Maruuk.', 'Per creare le lame migliori, ti serve il calore che solo un Nucleo Magmatico può fornire. Cerchiamo di tenere un po\' a portata di mano come fonte di carburante per le nostre forge. Ultimamente siamo a corto di nuclei e ci farebbero comodo dei rifornimenti.\n\nIl Nucleo Magmatico può essere ottenuto dalla maggior parte delle creature di lava delle Isole dei Draghi.', '', '', '', '', '', '', 47187),
(66895, 'itIT', 'Come il vecchio capo', 'Elimina Vyzos la Profetessa.', 'I Dragoidi Devastamondi si fidano troppo facilmente. Abbiamo seguito diversi capi negli anni, convinti che ognuno di loro ci avrebbe portati all\'Ora del Crepuscolo e al ritorno di Alamorte.\n\nEppure, Alamorte non è tornato, e non c\'è alcun Crepuscolo.\n\nÈ giunta l\'ora di un nuovo capo. Tu puoi aiutare ad avviare questo cambiamento.', '', 'L\'ultimo di una lunga processione di capi.', 'Vyzos la Rendita', '', '', '', 47187),
(66894, 'itIT', 'Come il vecchio capo', 'Elimina Aizir l\'Infuocato.', 'I Dragoidi Devastamondi si fidano troppo facilmente. Abbiamo seguito diversi capi negli anni, convinti che ognuno di loro ci avrebbe portati all\'Ora del Crepuscolo e al ritorno di Alamorte.\n\nEppure, Alamorte non è tornato, e non c\'è alcun Crepuscolo.\n\nÈ giunta l\'ora di un nuovo capo. Tu puoi aiutare ad avviare questo cambiamento.', '', 'L\'ultimo di una lunga processione di capi.', 'Aizir l\'Infuocato', '', '', '', 47187),
(66893, 'itIT', 'Salvataggio di Becchy', 'Cura $1oa Cornolesto Feriti alle Rapide Traboccanti.', 'Non ne saprò un bel niente sugli elementali dell\'acqua, ma conosco bene i cornolesto!\n\nHo preparato un unguento che li manterrà sani e pronti a combattere. A dirla tutta, non ho mai avuto la possibilità di applicarlo su un vero cornolesto, ma ho fatto moltissimi studi a riguardo.\n\nÈ ora di farsi coraggio e di spalmarglielo per bene!', '', '', '', '', '', '', 47187),
(66892, 'itIT', 'Dilemma del Diluvio', 'Uccidi $1oa Elementali dell\'Acqua nelle Rapide Traboccanti.', 'Gli elementali stanno uccidendo i cornolesto! So come combattere contro creature belle grosse, ma non avrei mai pensato di dover affrontare un elementale! Questi cosi non assomigliano affatto a dei cuccioli di sauri del tuono...\n\n<Dazakros sospira, agitato.>\n\nFai fuori qualcuno di questi elementali. I cornolesto sono creature più sveglie di quanto si pensi, si difenderanno se ne avranno modo!', '', '', '', '', '', '', 47187),
(66891, 'itIT', 'Cenere esplosiva', 'Ottieni 20 Ceneri Esplosive dalle fenici delle Isole dei Draghi per Gnoklin Spirastrana della Spedizione delle Scaglie di Drago.', 'Le fenici infuocate nelle Isole dei Draghi creano una sostanza insolita simile alla cenere quando muoiono. Potrebbe essere usata per creare dei miglioramenti sostanziali per alcuni complessi ed innovativi macchinari. Anche se probabilmente la userei per creare esplosivi...', '', '', '', '', '', '', 47187),
(66890, 'itIT', 'Strumenti Rubati', 'Raccogli 20 Strumenti Rubati dagli Gnoll delle Isole dei Draghi per Dothenos dell\'Accordo di Valdrakken.', 'Siamo stati tormentati dagli Gnoll che assalgono le nostre carovane di rifornimenti. Sembrano ossessionati dai i vari strumenti di ingegneria che trasportano. Non possiamo rischiare che questi violenti predoni scoprano la nostra arte speciale e questi furti ci hanno danneggiati più di quanto mi piaccia ammettere.\n\nSe riuscissimo a recuperare alcuni degli strumenti di ingegneria rubati, potremo rimetterci in pari.', '', '', '', '', '', '', 47187),
(66886, 'itIT', 'Ascesa del Giardino di Smeraldo - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66885, 'itIT', 'Ascesa del Giardino di Smeraldo', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66884, 'itIT', 'Equipaggiamento ignifugo', 'Recupera 10 Pezzi di Equipaggiamento Ignifugo dai Djaradin delle Isole dei Draghi per Temnaayu dei Tuskarr di Iskaara.', 'L\'armatura dei Djaradin può resistere persino alle fiamme più furenti. Qualità simili sarebbero di grande aiuto per combatterli!\n\nCerca di recuperare qualcosa dai Djaradin, potremo studiarlo e applicare gli stessi incantamenti alle nostre armature.', '', '', '', '', '', '', 47187),
(66883, 'itIT', 'Antico Anello per Corno', 'Consegna l\'oggetto a Exadria.', '<A Exadria potrebbe interessare.>', '', '', '', '', '', '', 47187),
(66882, 'itIT', 'Zaino Perduto', 'Consegna l\'oggetto all\'Inseguitrice Artigliata Kavia.', '<All\'Inseguitrice Artigliata Kavia potrebbe interessare.>', '', '', '', '', '', '', 47187),
(66881, 'itIT', 'Corsa del Fiume della Gola - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66880, 'itIT', 'Corsa del Fiume della Gola', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66879, 'itIT', 'Caos tra i cornolesto', 'Incontra Dazakros alle Rapide Traboccanti.', 'Cornolesto! Hanno dei becchi in grado di spezzare le ossa, gambe veloci da sfuggire al pericolo e possono mangiare praticamente qualsiasi cosa sulle isole.\n\nQuesta Chiamata è facilissima! Non devo fare altro che passare del tempo con i miei uccelli preferiti. E se succede qualcosa, so come domare tutte le creature delle isole. \n\nTi andrebbe di seguirmi fino all\'altopiano dei cornolesto? Non mi dispiacerebbe un po\' di aiuto mentre mi preparo.', '', '', '', '', '', '', 47187),
(66878, 'itIT', 'Volo nel Pantano - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66877, 'itIT', 'Volo nel Pantano', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66875, 'itIT', 'Preservare il Passato: Accademia di Algeth\'ar', 'Ottieni il Fuoco Fatuo del Sogno dei Ricordi Intrappolati dalla Preside nell\'Accademia di Algeth\'ar.', 'Meraviglioso! L\'Accademia di Algeth\'ar è nuovamente aperta. La Preside Doragosa deve essere felice di tornare nelle sue sale d\'insegnamento.\n\nÈ passato molto tempo dall\'ultima volta in cui ho avuto la possibilità di parlare con la mia cara e vecchia amica, forse potresti andare a vedere se è disponibile per un tè. Potresti avere anche la possibilità di iscriverti all\'accademia; ho sentito dire che ora è aperta a tutti gli studenti.\n\nHo pensato potesse interessarti, visto quanto spesso fai visita a me e a questi archivi.', '', '', '', '', '', '', 47187),
(66874, 'itIT', 'Preservare il Passato: Sale dell\'Infusione', 'Ottieni il Distributore Olografico dallo Tsunami Primordiale nelle Sale dell\'Infusione.', 'Sapevi che nelle profondità del Forte di Tyr c\'è una gigantesca struttura chiamata Sale dell\'Infusione? Così misteriosa! Così intrigante! Così tante possibilità!\n\nIl Guardiano Tyr ha messo al sicuro molti dei suoi segreti, laggiù. Mi chiedo quali saranno... Era davvero il più geniale dei Guardiani.\n\n<Kemora sembra sognare ad occhi aperti.>\n\nTuttavia, i Primalisti stanno facendo un disastro, sicuramente danneggeranno tutte le meraviglie del Guardiano Tyr se non vengono fermati. Ti prego, sbarazzati di loro prima che facciano troppi danni.', '', '', '', '', '', '', 47187),
(66868, 'itIT', 'Preservare il Passato: Eredità di Tyr', 'Ottieni il Gingillo Senza Tempo dal Cronosignore Deios a Uldaman.', 'Ho scandagliato gli archivi in cerca di informazioni sul Guardiano Tyr e sorprendentemente ogni menzione di Uldaman è stata strappata via; è rimasta solamente mezza pagina riguardante un segreto che nascondeva laggiù.\n\nRoba affascinante, no? Indubbiamente ci sono altri segreti che sono stati celati là dentro. Forse tu, con alcuni dei tuoi amici, potresti andare a investigare. Custodirò qualsiasi cosa mi riuscirai a portarmi.', '', '', '', '', '', '', 47187),
(66864, 'itIT', 'Recupero delle Reliquie: Conca dei Felcepelle', 'Ottieni il Feticcio della Decatriarca dalla Decatriarca Occhiofurioso alla Conca dei Felcepelle.', 'Ah! Ho un compito per te. Si dice che gli Gnoll della Conca dei Felcepelle stiano usando la magia del decadimento... un potente strumento, nelle mani giuste. Non nelle zampacce degli Gnoll.\n\nDovremmo fare le nostre ricerche riguardo a questa questione urgente. Recati alla conca e riportami un po\' della loro magia così che possa... così che possiamo vedere che tipo di poteri hanno imbrigliato.\n\nFa\' attenzione, e porta qualche amico con te, i Felcepelle hanno l\'abilità di farti avvizzire persino le ossa.\n\nSarebbe un peccato se succedesse.', '', '', '', '', '', '', 47187),
(66860, 'itIT', 'Recupero delle Reliquie: Eredità di Tyr', 'Ottieni la Clessidra delle Sabbie Mutevoli dal Cronosignore Deios a Uldaman.', 'Kemora mi ha assegnato alla ricerca di ogni possibile riferimento esistente del Guardiano Tyr e Uldaman. Persino i miei tagli da carta hanno i loro tagli da carta con tutti i libri che ho dovuto sfogliare tentando di trovare quello che sta cercando.\n\nQuasi tutte le menzioni sono state strappate o distrutte. A quanto pare qualcosa di prezioso è stato nascosto ad Uldaman e sarei molto felice se me lo portassi.\n\nCosì da poter aiutare Kemora nella sua ricerca, ovviamente.', '', '', '', '', '', '', 47187),
(66848, 'itIT', 'Presagi portati dal vento', 'Aiuta Ohn Seshteng con il suo rituale.', 'Ohn\'ahra parla una lingua diversa dalla nostra. La sua voce viene portata dai venti. Noi mistici siamo stati addestrati a sentire la sua presenza, seguire la sua chiamata e interpretare i suoi messaggi.\n\nHo usato i materiali che hai raccolto per vincolare i totem a questa particolare chiamata. Aiutami con il rituale per canalizzare la sua voce e interpretare il suo canto.', '', '', '', '', '', '', 47187),
(66847, 'itIT', 'Segrete delle Incarnazioni: furia della Mangiatempeste', 'Entra nelle Segrete delle Incarnazioni e sconfiggi Raszageth.', 'No! Abbiamo rinchiuso le Incarnazioni per proteggere questo mondo, ma ora Raszageth ha intenzione di liberarle!\n\nNon possiamo permetterglielo, $n. La vita su Azeroth sarà in grave pericolo se non la fermi!\n\nDevo tornare al Seggio degli Aspetti, per parlare con Nozdormu e stabilire un piano. Non preoccuparti, non ti lascerò senza aiuti. Kalecgos e Khadgar verranno inviati ad aiutarti mentre ti avventuri nella cripta.\n\nBuona fortuna, $gcampione:campionessa;.', '', '', '', '', '', 'Parla con Kalecgos presso il Seggio degli Aspetti a Valdrakken.', 47187),
(66846, 'itIT', 'Il cuore del mazzo', 'Aiuta l\'apparizione a creare una nuova carta.', 'Il giorno in cui le Isole dei Draghi iniziarono il loro sonno fu il giorno della mia ultima partita. Il destino è stato crudele e ho perso la mia carta più forte ancor prima di poter competere.\n\nVedi, la carta di Guo-Hee era mia. Non so come i suoi antenati l\'abbiano trovata.\n\nPurtroppo, non posso riprendermela perché è stata nella sua famiglia per secoli. È stato un errore sciocco da parte mia.\n\nForse tu e io potremmo creare una carta insieme? Una carta davvero unica... Sì! Mi aiuterai?\n\nTorna a parlarmi appena puoi.', '', '', '', '', '', '', 47187),
(66845, 'itIT', 'Olografica leggendaria', 'Trova il fantasma draconide e recupera la carta leggendaria.', 'La scorsa notte dormivo nel mio giaciglio, girandomi e rigirandomi, quando un gelo innaturale ha riempito la locanda.\n\nPoi, dal nulla ho visto... il fantasma di un Draconide! È passato attraverso il mio bagaglio e poi è svanito nel nulla!\n\nMa il vero orrore è che quando mi sono alzata... Il fantasma aveva preso la mia carta più amata!\n\nSaresti così gentile da trovare il fantasma e recuperare la mia carta? È il mio bene più prezioso.', '', 'Qualunque sia la motivazione, rubare non è mai una buona idea.', 'Apparizione misteriosa', '', '', '', 47187),
(66844, 'itIT', 'La grande Shokhari', 'Uccidi la Volpe dei Cieli Shokhari.', 'Di tutti gli animali che ho visto da queste parti, la grande Volpe dei Cieli, Shokhari, era la più superba.\n\nÈ un peccato che abbia attaccato uno sciamano degli Gnoll, perché ora è impazzita a causa del decadimento. L\'ho vista mangiare uno dei suoi cuccioli e ho capito che qualcosa non andava.\n\nHo portato via gli altri piccoli, qui, ma Shokhari mi ha attaccato, ferendomi. Credevo di non farcela.\n\nShokhari dev\'essere soppressa. Se il decadimento continuerà a deteriorare la sua mente, presto attaccherà anche noi.', '', 'Questa vivolpe, un tempo maestosa, regnava su queste foreste. Ora, il Decadimento l\'ha resa folle.', 'Volpe dei Cieli Shokhari', '', '', '', 47187),
(66843, 'itIT', 'Alla ricerca di Lukh', 'Scopri cos\'è successo a Lukh.', 'Ah! Hai visto il mio assistente, Lukh?\n\nHa detto di voler dare uno sguardo intorno, ma è sparito da un\'ora!\n\nGli ho detto che non è sicuro allontanarsi, ma quel ragazzo è un vero testardo.\n\nNon posso certo biasimarlo, questa zona è molto carina e lui ha un debole per i fiori.\n\nPotresti aiutarmi a trovarlo? Hanno bisogno di me e di questo carro alla Vedetta Tre Cascate!', '', '', '', '', '', '', 47187),
(66841, 'itIT', 'Un frammento del passato', 'Raccogli l\'artefatto e portalo a Thanessa Sbocciargento.', 'Ho visto che correvi dentro e fuori dall\'accampamento aiutando tutti. Pensi di poter aiutare anche il vecchio Gannar?\n\nStavo perlustrando l\'area e qualcosa è balzato a questi vecchi occhi stanchi. Penso che sia un antico coccio o qualcosa del genere, appena più a sud di qui, poco prima di quella cascata.\n\nIo non me la cavo un granché a nuotare, ma ti darò qualche moneta e potrai portare a Thanessa Sbocciargento quello che trovi.', '', '', '', '', '', 'Porta il manufatto a Thanessa Sbocciargento.', 47187),
(66840, 'itIT', 'Sicurezza acquatica', 'Porta tre campioni d\'acqua a Manny Read.', 'La mia più grande responsabilità è assicurarmi che tutti abbiano accesso ad acqua potabile pulita.\n\nCon gli Gnoll a est alle prese col decadimento, devo assicurarmi che l\'accampamento sia sicuro.\n\nNon voglio allarmare nessuno prelevando campioni personalmente, ma credo che siano necessari dei test.\n\nPortami campioni dalle tre cascate qui vicino e ti ricompenserò profumatamente.', '', '', '', '', '', '', 47187),
(66839, 'itIT', 'A tutta birra!', 'Raccogli Bacche di Sangue, Bacche di Corno Bronzeo e Boccioli di Foglia di Drago.', 'La banda e io avevamo un po\' di tempo libero e ci andava proprio una bella pinta di idromele, quindi siamo andati alla locanda.\n\nMa, argh, ci crederesti? Non ne avevano neanche una goccia! Che razza di locanda è? Una gestita da trogloditi, ecco che razza di locanda!\n\nQuindi prendiamo in mano noi la situazione! Nella foresta a est ci sono fiori ed erbe che potremmo usare per preparare del dolce idromele. Hai voglia di aiutarmi a raccogliere fiori? Ci sarà anche qualcosa per te!', '', '', '', '', '', '', 47187),
(66838, 'itIT', 'Fa freddo quassù', 'Raccogli le Pellicce Spesse d\'Orso dagli Orsi Mantospesso.', 'Essere una brava locandiera significa anticipare le esigenze degli ospiti. Sfortunatamente, non mi aspettavo che qui le notti sarebbero state così fredde. Ops?\n\nI miei ospiti avranno bisogno di coperte belle spesse. Magari delle pellicce d\'orso? \n\nCi sono dei grandi orsi nella foresta appena a est di qui. Se mi porti alcune delle loro pellicce, te le pago!\n\nPer favore! Pensa agli avventurieri e ai loro piedi tanto, tanto freddi...', '', '', '', '', '', '', 47187),
(66837, 'itIT', 'Niente per colazione', 'Raccogli della carne di Camminatori Vorquin e di Bruffali Striati a sud della Vedetta Tre Cascate.', 'Mio fratello Valdo avrebbe dovuto ordinare più provviste, ma è passata una settimana e non è arrivato niente.\n\nNon mi sorprende, quello scansafatiche probabilmente ha preferito fare un pisolino! Ora siamo a corto di cibo e io ho troppi impegni per andare a cacciare... E poi mi devo occupare pure delle faccende di Valdo!\n\nPotresti andare a caccia per noi? La carne dei vorquin e dei bruffali striati a sud di qui manterrebbe la cucina operativa finché non riuscirò a ordinare altre provviste.', '', '', '', '', '', '', 47187),
(66836, 'itIT', 'Circuito del Boschetto Spargisole - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66835, 'itIT', 'Circuito del Boschetto Spargisole', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66834, 'itIT', 'Rellen, il Dotto', 'Fai offerte nella tana delle offerte e assisti a tutti gli insegnamenti di Rellen.', 'Porta le tue offerte alla tana centrale. Puoi assistere alla leggenda di Rellen, il Dotto, che ha mostrato ai Centauri la vita come la conosciamo.', '', '', '', '', '', '', 47187),
(66833, 'itIT', 'Marmosona in difficoltà', '', '', '', '', '', '', '', '', 47187),
(66831, 'itIT', 'Casa è dove si trovano le rane', 'Incontra Keshki alle Pozze della Vita per liberare le rane salvate.', 'Tutte le rane sono state radunate, $n! Credo che, uh, dovremmo portarle ad Akora in ogni caso. Saranno più al sicuro alle Pozze della Vita finché i drospi cornuti non si annoieranno e se ne andranno altrove.\n\nEhm, beh, direi che non abbiamo trovato nulla per tirare su il morale ad Akora. Spero che capisca...', '', '', '', '', '', '', 47187),
(66830, 'itIT', 'Drospi cornuti alla riscossa!', 'Usa il Vaso di Keshki per attirare $1oa Rane Maltrattate e metterle in salvo.', 'Oh, quei drospi cornuti mi fanno impazzire!\n\n<Keshki pesta i piedi furiosa, mandando i suoi occhiali di traverso.>\n\nSono dei grossi e voraci bulli! Solo perché questo luogo porta il loro nome, non significa che possano saltare ovunque mangiando tutto ciò che è più piccolo di loro!\n\nEcco, usa il mio vaso di lucciole, è il miglior amico di un allevatore di rane, dovrebbe calmarle così da poterle raccoglierle per metterle al sicuro.\n\nSe dei drospi cornuti ti intralciano, non farti problemi a rendergli pan per focaccia!', '', '', '', '', '', '', 47187),
(66828, 'itIT', 'Riunione nella conca', 'Incontra Keshki alla Conca dei Drospi Cornuti', 'Non ho mai visto Akora così turbata. Di solito è solare come i suoi fiori, ma la leggenda significa molto per lei. Ne parla praticamente sempre...\n\n<Keshki giocherella con gli occhiali.>\n\nNon so molto sulle piante, e non credo che delle rane tirerebbero su di morale nessuno tranne me, ma a nord di qui c\'è un posto tranquillo per pensare, la Conca dei Drospi Cornuti. Forse là potremmo trovare qualcosa per tirarla su di morale, o almeno escogitare un piano per aiutarla.', '', '', '', '', '', '', 47187),
(66827, 'itIT', 'Il fiore delle nostre fatiche', 'Raccogli $1oa Frutti del Drago Maturi, $1oa Fiori del Drago Profumati e $1oa Baccelli di Semi Rigogliosi nel giardino per offrirli allo Spirito dei Draghi.', 'La leggenda narra che la canti solo in onore di coloro che dimostrano la loro devozione per la vita.\n\nHo curato questo giardino per anni, penso che finalmente io e le mie piante siamo pronte.\n\nPreparerò il necessario vicino alla pozza, tu puoi aiutarmi con il raccolto.\n\nRaccogli i baccelli di semi dai cespugli, i fiori del drago nei campi soleggiati e i frutti del drago in cima agli alberi... Puoi usare il mio vecchio rastrello, per aiutarti. Fai attenzione, a volte il fogliame morde!', '', '', '', '', '', '', 47187),
(66825, 'itIT', 'Un Richiamo Vitale di Rubino', 'Partecipa alla Cerimonia di Richiamo Vitale al Tempio della Vita di Rubino.', '$p! Che fortuna che tu sia qui! Stiamo per iniziare una Cerimonia di Richiamo Vitale e saremmo onorati se tu volessi assistere.\n\nLa Chiamata di un dragobestia è molto speciale. Alcuni diventano abili giardinieri, altri si prendono cura di una fauna particolare.\n\nQuesti giovani draghibestia hanno terminato il loro addestramento e sono pronti a ricevere le loro prime Chiamate. So che sarebbero entusiasti di vederti partecipare. Appena puoi, presenta loro ciascuno degli oggetti su questo tavolo.', '', '', '', '', '', '', 47187),
(66805, 'itIT', 'Chiavi di lealtà', 'Raccogli $1oa Chiave d\'Ossidiana Superiore.', '', '', '', '', '', '', 'Consegna la chiave assemblata a Sabellian, alla Cittadella d\'Ossidiana.', 47187),
(66788, 'itIT', 'Un n-uovo futuro', 'Aiuta Madre Elion a ripristinare la zona.', 'Stento a crederci! Uova dello Stormo dei Draghi Neri, dopo tutto questo tempo!\n\nMa guarda lo stato di questo posto! Non va bene! Niente è troppo, per queste uova.\n\nAnche se quei due gradassi, che litigano come bambini per avere per sé il favore della Protettrice della Vita, non staranno certo pensando a noi! Tu, invece, non lasceresti mai sola una vecchia guardiana delle uova, vero?', '', '', '', '', '', '', 47187),
(66787, 'itIT', 'Rondò di Riposo Alato - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66786, 'itIT', 'Rondò di Riposo Alato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66785, 'itIT', 'L\'Ultima Guardiana delle Uova', 'Parla con Madre Elion.', 'Capisco la tua preoccupazione, $C, ma tutto verrà rettificato a breve, poiché sembra che tra poco avremo compagnia.\n\nResta pure ad assistere. Dovrebbe essere piuttosto catartico.\n\nParla con la nostra guardiana delle uova quando hai un momento, però. Senza dubbio avrà bisogno di supporto.', '', '', '', '', '', 'Parla con Madre Elion.', 47187),
(66784, 'itIT', 'Indebolire la tempesta', 'Uccidi gli Evocatori della Tempesta Primalisti per chiudere il Corridoio della Tempesta.', 'Combatti bene, per essere una creatura che sta in equilibrio su due sole gambe!\n\nNon importerà quanto combattiamo, finché i Primalisti continueranno a ricevere rinforzi. Dobbiamo chiudere quel portale, il Corridoio della Tempesta!\n\nFatti strada nella caverna qui vicino e uccidi gli Evocatori della Tempesta Primalisti che lo stanno tenendo aperto. Ti aiuterò, se potrò.', '', '', '', '', '', '', 47187),
(66783, 'itIT', 'Il rinnovo dei voti', 'Aiuta Khan Sansok, Khan Tigari, Khanam Matra Sarest e Merithra a scambiarsi regali.', 'Secoli fa, feci un voto di amicizia e collaborazione col primo Centauro. Sebbene molte cose siano cambiate, sento che è giunto il momento per noi di rinnovare quel voto.\n\nÈ stata composta una formula per aiutare le future generazioni di Centauri a ricordare il loro legame con lo Stormo dei Draghi Verdi. A ogni versetto si deve rispondere con un\'offerta dei khan. Spero che i Centauri ricordino ancora il significato originale.\n\nLa scelta del dono è fondamentale: scegli l\'offerta giusta e la nostra lealtà sarà vincolata.', '', '', '', '', '', '', 47187),
(66781, 'itIT', 'Una questione di gusti', 'Trova una roccia da leccare per Mordigan Boccaferro a Nicchia del Baleniere.', 'Non c\'è più rispetto!\n\nUn paio di Gorloc puzzolenti rubano oggetti del nostro equipaggiamento e dobbiamo chiudere tutto... Bah! Io lecco rocce da quando tu non eri che $gun poppante:una poppante;! Non mi servono complicati marchingegni gnomeschi... \n\nPortami una roccia e te lo dimostrerò!', '', '', '', '', '', 'Torna da Mordigan Boccaferro.', 47187),
(66780, 'itIT', 'Pretendente al trono', 'Parla con i seguaci di Irathion.', 'Ho dedicato la mia vita a salvare Azeroth dalla distruzione più e più volte, e questo folle crede di poter venire qui a reclamare il titolo di Aspetto? Non credo proprio.\n\nParla con la mia gente, $n. Senti cos\'hanno da dire su di me e ciò che ho fatto per questo mondo.', '', '', '', '', '', '', 47187),
(66779, 'itIT', 'Erede legittimo', 'Parla con i seguaci di Sabellian.', 'Come erede di Neltharion e capo dell\'unico Stormo dei Draghi Neri sopravvissuto, non mi aspettavo certo di dover competere per i miei diritti di nascita. In particolare, non contro un draghetto presuntuoso più giovane di te, mortale.\n\nComunque, se hai bisogno di conoscere i fatti, parla pure con i membri del mio stormo. Non devi certo fidarti solo della mia parola.', '', '', '', '', '', '', 47187),
(66778, 'itIT', 'Ottovolante degli Uktulut - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66777, 'itIT', 'Ottovolante degli Uktulut', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66737, 'itIT', 'Un inizio migliore', 'Pianta dei semi in $1oa zolle di Suolo Fertile e falli germogliare.', 'Vaeros è diligente, ma i draghetti hanno un talento per cacciarsi nei guai. Non il mio, naturalmente. ma immagino che non tutti i draghi si oppongano alla gravità del loro rango.\n\nAnche se aborro incoraggiare il gioco all\'aperto invece dello studio, ti aiuterò a proteggere il giardino più efficacemente. Prendi questi semi e piantali nelle vicinanze. Una volta maturi, i boccioli producono un profumo che gli insetti trovano fastidioso.\n\nI giardinieri possono aiutarti... e forse anche i miei fratelli di bronzo, se ti comporti bene.', '', '', '', '', '', '', 47187),
(66735, 'itIT', 'Solo una sfoltitina', 'Sfoltisci $1oa Cespugli Erbosi', 'Le api che spaventano i draghetti non sono l\'unico problema. Mentre l\'impollinazione è solitamente una buona cosa, lo sciame di api ha causato la crescita della flora fuori controllo.\n\nTi dispiacerebbe prendere le mie cesoie da giardinaggio e tagliare gli arbusti? Alcuni hanno già iniziato a far germogliare pericolose piante sferzanti, ma spero che possiamo impedire ad altri di farlo. Dopotutto, prevenire è meglio che curare!\n\nE... un po\' di prevenzione mi farebbe comodo in questo momento, $n.', '', '', '', '', '', '', 47187),
(66734, 'itIT', 'Niente di apersonale', 'Usa il Diffusore per Fumo per calmare e raccogliere $2oa Api Fastidiose, poi liberale vicino al lago.', 'Oh, lode alla Protettrice della Vita! Qualcuno con niente da fare!\n\nQuesti giardini sono di solito un bel parco giochi per i nostri draghetti, ma le api si sono moltiplicate senza controllo per via della recente fioritura. I draghetti sono terrorizzati, i draghi sono irritati e solo ieri uno dei draghetti è stato punto e...\n\n<Vaeros fa un respiro profondo per riprendersi, poi ti guarda implorante.>\n\nPotresti radunare le api e trasferirle vicino al lago? Prendi questo diffusore per fumo, le calmerà.', '', '', '', '', '', '', 47187),
(66733, 'itIT', 'Corsa sul Fiume della Giungla Apicale - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66732, 'itIT', 'Corsa sul Fiume della Giungla Apicale', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66730, 'itIT', 'Autentici sopravvissuti', 'Trova e parla con il Vecchio Zannatetra al Lago Ghiacciato nella Vastità Azzurra.', 'Siamo esausti, lo so, ma non possiamo dimenticare perché siamo qui. La nostra gente conta su di noi e non ho certo intenzione di deluderla. Dobbiamo trovare un rifugio temporaneo in queste lande selvagge... e conosco il posto giusto.\n\nOra smettila di lamentarti e DATTI UNA MOSSA.', '', '', '', '', '', 'Trova e parla con il Vecchio Zannatetra al Lago Ghiacciato nella Vastità Azzurra.', 47187),
(66728, 'itIT', 'Volo del Flusso Ardente - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
