(66725, 'itIT', 'Circuito della Riserva Selvaggia', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66724, 'itIT', 'La Pescalumi', 'Recupera $1oa Pescilume e riponili nel cesto delle offerte.', 'Mi dispiace che ti abbiano $gcoinvolto:coinvolta; in tutto questo, viandante. \n\nMio fratello tende a... lasciarsi trasportare. Questa è solo l\'ultima delle sue follie, ma potrebbe costargli cara. \n\nNon mi darà mai ascolto, probabilmente neppure a te. \n\nMa forse la nostra antenata, Kauriq la Pescalumi, che è anche la sua ossessione, potrebbe farlo rinsavire.\n\nPesca un po\' di Pescilume e portali qui. Li userò per comunicare con il suo spirito, che alberga in questa pietra.', '', '', '', '', '', '', 47187),
(66722, 'itIT', 'Slalom della Riserva Selvaggia - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66721, 'itIT', 'Slalom della Riserva Selvaggia', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66719, 'itIT', 'Un passo indietro', 'Proteggiti dalla Chiamata.', 'È con grande dispiacere che devo dire che conosco la difficile situazione che deve affrontare la tua specie in queste rovine. Procedendo, anche tu soccomberai sicuramente alla loro follia.\n\nChe sia per merito della tua educazione o della tua natura, il richiamo che senti è fisiologico. Hai una brama che deve essere saziata.\n\nMi vergogno molto di dire che possiedo i mezzi per alimentare questa maledizione. Non sarà proprio la stessa cosa, ma sarai in grado di funzionare... Per ora.', '', '', '', '', '', '', 47187),
(66718, 'itIT', 'Gli Gnoll devono morire', '', '', '', '', '', '', '', '', 47187),
(66715, 'itIT', 'L\'estrazione', 'Salva i Tuskarr dall\'Accampamento dei Mantonevoso nella Vastità Azzurra.', 'Ora la cosa più importante è recuperare la mia gente. Preferibilmente sana e salva.\n\nE per quanto mi addolori ammetterlo, non sono in condizioni di combatterli da solo.\n\nCi aiuterai?', '', '', '', '', '', 'Parla con Gelomorso per saperne di più sui cacciatori Tuskarr', 47187),
(66714, 'itIT', '[DNT]QuestNameHere', '', '', '', '', '', '', '', '', 47187),
(66713, 'itIT', '[DNT]QuestNameHere', '', '', '', '', '', '', '', '', 47187),
(66712, 'itIT', 'Sorvolo dei Freddolesto - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66711, 'itIT', 'Delizia nell\'oscurità', 'Raccogli $1oa Buccini di Fiume per Hadari.', 'A causa della natura del nostro clan, alcune risorse scarseggiano. Non abbiamo tempo per metterci a minare il metallo.\n\nIl defunto Khan aveva stabilito diversi legami commerciali con vari individui e non vedo motivo di interrompere questi rapporti.\n\nNella baia qui vicino ci sono delle vasche in cui catturiamo dei molluschi; sono considerati una prelibatezza da alcuni dei nostri vicini. Portamene un po\', così potrò scambiarli.', '', '', '', '', '', '', 47187),
(66710, 'itIT', 'Sorvolo dei Freddolesto', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66709, 'itIT', 'Fondamenti di medicina da campo', 'Aiuta il Vecchio Zannatetra a riprendersi dalle ferite.', '<Difficile dire da quanto tempo questo Tuskarr ferito sia qui nel bel mezzo della foresta, ma non vivrà ancora a lungo se qualcuno non lo aiuta.>', '', '', '', '', '', '', 47187),
(66708, 'itIT', 'Cavalieri nella neve', 'Trova i cacciatori Tuskarr dispersi nella Vastità Azzurra.', 'Salve, $C. Questa cupola magica è davvero stupefacente, non è vero? Ma anche se è in grado di proteggerci dal freddo pungente e dalle insidie delle terre selvagge, non possiamo affidarci in eterno al Kirin Tor.\n\nQualche giorno fa alcuni dei nostri cacciatori più esperti si sono avventurati nella foresta in cerca di cibo e provviste, ma non hanno più fatto ritorno. So che il loro leader, il Vecchio Zannatetra, è molto capace, ma... è difficile non preoccuparsi per loro.\n\nPotresti cercarli?', '', '', '', '', '', 'Trova i cacciatori Tuskarr dispersi nella Vastità Azzurra.', 47187),
(66706, 'itIT', '[DNT]QuestNameHere', '', '', '', '', '', '', '', '', 47187),
(66704, 'itIT', 'Mugurlglrlgl!', 'Murglulggllgll!', 'Mrglgulglrrlglgul! Grurguglullgurl!\n\nGruglrlgllrugl rrgulgrulgrgl grugll gurgull gur. Murgllgllrugl gurgllglrl Murgul gruggullgl. Murguglegurgllgur gurgll gurgulgul guruulgurllgr guuglrllgl.\n\nMgrgulllglll gurl gugll.\n\n<Non credi di aver capito ciò che ti è stato detto, ma ci sono un sacco di gesti che ti ricordano il pugnalare. Sembra che questo Murloc voglia che tu uccida qualcosa.>', '', '', '', '', '', '', 47187),
(66703, 'itIT', 'Effetto valanga', 'Recupera $1oa Totem dei Mantonevoso dagli Sciamani Mantonevoso nella Vastità Azzurra.', 'Gnoll Mantonevoso intelligenti. Sanno che metti cibo su ghiaccio, cibo buono più a lungo. Ma non ghiaccio qualunque, no... Ghiaccio magico meglio!\n\nQui c\'è zampino di sciamani. E anche messo Gelomorso qui, per morire di fame vicino a tutta questa deliziosa carne dei Tuskarr.\n\nSe $r vuole aiutare i Tuskarr, tempo è poco.\n\nMa Gelomorso sa rompere incantesimo!\n\nPerché Gelomorso aiuta? Neanche a lui piacciono gli sciamani.', '', '', '', '', '', '', 47187),
(66700, 'itIT', 'Il Locus Nero', 'Porta il Locus Nero alla Telemante Aerilyn.', 'È davvero interessante, vero? Il Locus era troppo per la Fiamma Frammentata. Tuttavia, si adatta perfettamente alle mie mani. Interessante.\n\n<Adenedal scuote la testa.>\n\nForse no. Non oggi. Non di nuovo. Prendilo tu. Non è un fardello che posso portare.\n\nArrivederci, $gamico mio:amica mia;.', '', '', '', '', '', '', 47187),
(66699, 'itIT', 'Chiedere alla gente del luogo', 'Parla con i Tuskarr nell\'Accampamento Antonidas.', 'Kalecgos è saggio a cercare il consiglio dei Tuskarr. La loro conoscenza di questo territorio ricopre intere generazioni.\n\nMolti di loro stanno sostando qui, prima di raggiungere i loro vari accampamenti dislocati per l\'intera Vastità. \n\nChiedi in giro! Qualcuno dovrà pur sapere qualcosa delle linee di faglia locali.', '', '', '', '', '', '', 47187),
(66698, 'itIT', 'Contare le argali', 'Parla con il Pastore Aylaag e riporta la pecorella smarrita al clan.', 'Una delle nostre risorse chiave è il nostro branco di argali. Ogni perdita è stata tremenda per la forza del nostro clan.\n\nAlcune delle argali si sono separate e si sono allontanate dalle altre. I nostri pastori potrebbero aver bisogno del tuo aiuto per recuperarle.', '', '', '', '', '', '', 47187),
(66696, 'itIT', 'Sfida del destino: destino delle Terretetre', '', '', '', '', '', '', '', '', 47187),
(66692, 'itIT', 'Anello del Tempio della Vita di Rubino - Avanzato', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66691, 'itIT', 'Waking Shores - Race 01 - Intermediate', 'Plana attraverso i cerchi.', 'Questo percorso ha un aspetto simile al precedente, ma la disposizione dei punti di controllo è più varia.\n\nSe ti blocchi, usa il fischietto e ti farò tornare in gara.', '', '', '', '', '', '', 47187),
(66690, 'itIT', 'L\'Offensiva dei Nokhud: l\'ultimo antenato', 'Sconfiggi il Khan Balakar e raccogli il Medaglione degli Antenati nell\'Offensiva dei Nokhud.', 'Hai dimostrato di volerci dare il tuo aiuto, con un vero interesse per i nostri valori e la nostra vita. C\'è un altro antenato di cui vorrei parlarti, ma sarà pericoloso.\n\nUccidi il traditore Balakar, capo di Nokhud, figlio di nessuno. Indossa sempre un medaglione prezioso. Portamelo e sarò per sempre in debito con te.', '', '', '', '', '', '', 47187),
(66689, 'itIT', 'Non è solo una pietra', 'Mostra le Schegge Toccate dalla Tempesta a Watu.', '<Le schegge sono lisce e leggermente calde al tatto. Al loro interno saettano dei fulmini, in profondità.>\n\n<Forse Watu o Olekk ne sapranno di più.>\n\n<Il pensiero di separarti dalle schegge fa nascere in te un improvviso impulso di tenerle vicino a te. Per sempre.>', '', '', '', '', '', 'Torna da Watu all\'Avamposto Pignadura.', 47187),
(66688, 'itIT', 'Tracce di Vento', 'Raccogli i pegni del vento e consegnali al Ricettacolo delle Offerte vicino alla Pietra Risonante.', 'Quando gli elementi, i veri primordiali del mondo, sfidarono i Centauri, Himia li incontrò con il nostro dono: il vento.\n\nUna Pietra Risonante si erge nelle pianure. Lì puoi offrire pegni del vento per evocare la sua memoria. Questi pegni si trovano tutti intorno a noi, la piuma di un uccello, la spora di una pianta, le canne di un fiume.', '', '', '', '', '', '', 47187),
(66687, 'itIT', 'Terra dei Predatori', 'Raccogli $1oa Tele di Tessiombra, $2oa Artigli di Vivolpe e $3oa Scaglie di Spinatonante.', 'Dovresti sapere di Rellen, il Dotto, colui che ha dato ai Centauri gli strumenti per sopravvivere in una terra spietata. Il suo ricordo richiede sacrifici di bestie degne.\n\nAbbi cura di te, viandante. Non sono pericolosi quanto i secoli passati, ma sono ancora i massimi predatori.', '', '', '', '', '', '', 47187),
(66684, 'itIT', 'A caccia di tempeste', 'Distruggi i Primalisti e la loro fonte di magia della tempesta.', '<Con un rapido movimento, Watu estrae la scheggia e annaspa per l\'aria>\n\nIo... Avevo perso completamente il controllo. Olekk aveva ragione. Questa terribile magia deve essere opera dei Primalisti. Per favore, fermali!\n\nDevo riportare mio fratello all\'accampamento.', '', '', '', '', '', '', 47187),
(66683, 'itIT', 'Ultima analisi', 'Indaga sulle Schegge Toccate dalla Tempesta nell\'Avamposto Pignadura.', '<Watu mormora tra sé e sé, con gli occhi chiusi e le braccia conserte.>\n\nCerto che sono io quello a venir preso a cornate da un cervo. E ora sono solo un altro tizio bisognoso di cure. Mio fratello si prenderà tutto il merito e nessuno a casa sarà sorpreso.\n\n<Watu solleva lo sguardo.> Cosa? Cos\'hai lì con te? Rocce Luminose? Ci darò un\'occhiata, ma per il resto chiedi a qualcun altro. Io sono un cacciatore, non un archeologo. <Watu sbuffa, guardando la gamba.> Forse è segno che devo cambiare lavoro. Continua, ti sei $gdimostrato:dimostrata; più utile di me.', '', '', '', '', '', '', 47187),
(66681, 'itIT', 'Tempeste in abbondanza', 'Uccidi $1oa Bestie Toccate dalla Tempesta tra i Pini Saggiacima.', 'Se ti stai avventurando tra i pini, uccidi tutti gli animali Toccati dalla Tempesta. Non è una richiesta semplice per me, ma chiaramente stanno soffrendo. Non possono essere aiutati e stanno diffondendo il contagio.\n\nSospetto che sia opera dei Primalisti. Sicuramente agiscono da un avamposto nelle vicinanze, dove ho visto uno strano altare magico.\n\nVado a indagare di nuovo. Se non sarò qui prima del tuo ritorno, l\'esploratore Watu potrà informarti su compiti aggiuntivi. Siamo grati per qualsiasi aiuto.', '', '', '', '', '', '', 47187),
(66680, 'itIT', 'Contare le pecore', 'Ingraziati Desiderino con il cibo e usa il Fischietto di Desiderino per salvare $3oa Argali Perdute tra i Pini Saggiacima.', 'Che frustrazione. Me l\'ha fatto un cervo rabbioso mentre mio fratello Olekk e io stavamo esplorando.\n\n<Watu indica la sua gamba insanguinata e sussulta.>\n\nSei qui per aiutarci? Dopo l\'attacco dei Primalisti, il nostro branco di argali si è disperso tra i pini. La loro lana e il loro latte sono essenziali per le funzioni dell\'accampamento.\n\nPrendi questo fischietto e ordina a Desiderino di riportare a casa le argali. Sondo, il macellaio, ha da parte qualcuno dei suoi spuntini preferiti, se Desiderino dovesse aver bisogno di un po\' di incoraggiamento.', '', '', '', '', '', '', 47187),
(66679, 'itIT', 'Anello del Tempio della Vita di Rubino', 'Plana attraverso i cerchi.', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66676, 'itIT', 'Entrando con circospezione', 'Raggiungi Radiya alle Sorgenti degli Ohn\'ir.', 'Questa è Lizi. È la mia amica segreta. Mi sono occupata di lei da quando è stata respinta da sua madre.\n\nLe sue condizioni non mi piacciono per niente... Qualsiasi cosa le abbiano fatto è oltre la mia conoscenza. Devo riportarla a casa. La mia Ohn mi punirà per il resto dei miei giorni, ma non importa: Lizi ha bisogno di aiuto. Ti sarò per sempre grata, $p. Mi dispiace che sia più difficile di quanto tu avessi messo in conto.\n\nSe non ti dispiace... Ti prego! Affronta la furia della mia Ohn con me! Incontriamoci alle sorgenti.', '', '', '', '', '', 'Torna da Radiya alle Sorgenti degli Ohn\'ir.', 47187),
(66675, 'itIT', 'Il Potere degli Aspetti', 'Aiuta Alexstrasza alla Pietra del Giuramento Madre.', 'La Pietra del Giuramento Madre è un antico dono, garantito ai nostri stormi dai Titani. Se quello che abbiamo appreso è vero, allora sarò in grado di riattivarla e, così facendo, di ripristinare il potere dei nostri Aspetti.\n\nNon siamo certi del risultato ma, se abbiamo anche solo una minima possibilità di successo, dobbiamo provare.\n\n$n, mi farebbe piacere se volessi unirti a me in questa impresa.', '', '', '', '', '', '', 47187),
(66671, 'itIT', 'La strada verso il nulla', 'Incontra Maddy Spargicolpi al Campo Che Non C\'è nella Vastità Azzurra.', 'Sembri $gun avventuriero:un\'avventuriera; abile e $gvolonteroso:volonterosa;! Come intendi aiutare la Spedizione delle Scaglie di Drago?\n\nAbbiamo un bell\'accampamento nel mezzo di una landa selvaggia.\n\nIl lavoro non mancherà di certo, se intendi recarti fin laggiù.\n\nParla con mia sorella Maddy quando arrivi, ci penserà lei a sistemarti.', '', '', '', '', '', 'Incontra Maddy Spargicolpi al Campo Che Non C\'è nella Vastità Azzurra.', 47187),
(66660, 'itIT', 'Pronti... partenza...', 'Unisciti ad Andantenormu e Siazerathel nel passato.', '<Lo sguardo di Nozdormu non è attento.>\n\nPiù cadono e più viaggiano velocemente, strappando il tessuto del tempo e creando grandi increspature. Devi essere veloce per catturarle.\n\n<Lo sguardo di Nozdormu si concentra e si sposta verso di te.>\n\nInvierò i miei Viaggiatori nel Tempo per aiutarti a orientarti nei flussi temporali e accelerare i tuoi sforzi. Evita di affrontare gli abitanti temporali e non fermarti finché non avrai trovato Cronormu!\n\nVai. Abbiamo poco tempo.', '', '', '', '', '', '', 47187),
(66658, 'itIT', 'Offensiva dei Nokhud: custodi dei fondatori', 'Accedi all\'Offensiva dei Nokhud, sconfiggi Teera e Maruuk e colloca le loro armi nel Kurgan Teerakai.', 'Le armi di Teera e Maruuk sono state rimosse prima che riuscissimo a fermare il Necroinvocatore Arban. I nostri più grandi antenati potrebbero combattere nuovamente in queste pianure... per i Nokhud.\n\nRaggiungi l\'Offensiva dei Nokhud e trova Maruuk e Teera. Quando li avrai sottomessi, riporta le loro armi al tumulo funebre di Teerakai. Lì, potranno riposare con l\'onore che meritano, in un luogo dove potremo proteggerli più facilmente.', '', '', '', '', '', '', 47187),
(66657, 'itIT', 'E rimanete morti!', 'Entra nel Kurgan principale e sconfiggi il Necroinvocatore Arban.', 'Il Necroinvocatore Arban si è rintanato nel più grande dei Kurgan, dove riposano i primi antenati dei Maruuk. Ferma Arban prima che riesca a far risorgere Maruuk e Teera!', '', '', '', '', '', '', 47187),
(66656, 'itIT', 'Un sonno davvero eterno', 'Sconfiggi ogni spirito di Centauro rinomato, poi usa il Totem del Riposo di Zorig per liberarli tutti.', 'Gli antenati sono attanagliati da questa magia oscura. Combatteranno prima di seguirci. Gli Ukhel hanno rianimato i nostri più feroci guerrieri e cacciatori. Fermarli non sarà un compito facile.\n\nVerrò anche io ad aiutare, è ora che rimetta in uso la lancia di mia madre.\n\nUna volta sconfitti, usa questo totem che ho creato per aiutare gli spiriti sottomessi a ritrovare la strada verso i Kurgan.', '', '', '', '', '', '', 47187),
(66655, 'itIT', 'Reagenti della De-Negromanzia', 'Raccogli $1oa Teschi Intatti dai compagni rianimati e $2oa Zolle di Suolo Sacro.', 'Temo che gli spiriti non potranno ritrovare le loro tombe, anche dopo che li avremo liberati dalla presa degli Ukhel.\n\nGli Ukhel stanno rianimando anche i famigli animali dei nostri antenati, le creature che li hanno accompagnati e protetti in vita.\n\nPortami i teschi di quegli animali e il suolo sacro disturbato da quei nemici. Combinati, questi reagenti dovrebbero aiutare gli antenati a trovare la pace.', '', '', '', '', '', 'Incontra Zorig più avanti nei Kurgan Eterni.', 47187),
(66654, 'itIT', 'Dissacratore annientatore', 'Uccidi i Dissacratori Nokhud e gli Agitafosse Ukhel e recupera le armi ancestrali che hanno preso.', 'Mia madre era un\'eroina. Merita di riposare in pace, non certo questa... schiavitù! Nessuno dei nostri eroi la merita.\n\nQuei mostri devono pagare per questo. E così i nostri antenati potranno tornare a riposare con le loro armi, con onore. Prendi le armi da quei dissacratori!', '', '', '', '', '', 'Incontra Zorig più avanti nei Kurgan Eterni.', 47187),
(66652, 'itIT', 'Ritorno dal creatore', 'Esamina il rituale degli Ukhel presso il tumulo vicino.', 'Da qui non riesco a vedere cosa stiano facendo, ma temo stiano dissacrando i kurgan.\n\nRaggiungi la tomba più vicina e vedi se riesci a fermare il rituale che stanno eseguendo. E se dovessi trovare qualcosa che possa farci capire perché sono qui, riportamelo.', '', '', '', '', '', 'Restituisci la lancia a Zorig.', 47187),
(66651, 'itIT', 'Fino a No-khud', 'Incontra l\'Iniziato Zorig ai Kurgan Eterni.', 'I Clan Nokhud e Ukhel hanno invaso i Kurgan Eterni, dove riposano i nostri più stimati antenati, i loro scopi non possono che essere maligni.\n\nHo inviato l\'Iniziato Zorig per indagare, ma non è ancora tornato.\n\nÈ un individuo capace, ma manca di convinzione. Ti prego, aiutalo a porre fine alle loro attività ripugnanti!', '', '', '', '', '', '', 47187),
(66650, 'itIT', 'La fine del destino', 'Sconfiggi $1oa boss diversi nelle incursioni Predestinate.', '<Sei $gcalmo:calma;. La natura di quest\'esperienza rimane oscura, ma non è più sconosciuta. Ora possiedi una certa maestria su queste traversie, la chiarezza è la ricompensa definitiva.>\n\n<Con mente lucida e mano ferma avanzi un\'ultima volta. Crea il tuo destino e guardalo svelarsi davanti a te.>', '', '', '', '', '', '', 47187),
(66647, 'itIT', 'Dispersione elementale', 'Recupera il Focus Elementale.', 'Kalecgos e io siamo sotto fuoco nemico nei cieli sopra la montagna. I Primalisti inesorabili, e le loro armate sembrano infinite.\n\nPresto, Kalecgos e io verremo sopraffatti.\n\nMa ho un piano.\n\nAlla base della montagna si trova una burbera orchessa chiamata Ruvin Tritarocce. Il Kirin Tor l\'ha affrontata numerose volte.\n\nLei possiede un dispositivo che può assorbire e reindirizzare le energie elementali.\n\nPrendi il dispositivo e incontriamoci all\'interno.', '', 'Ruvin è il possessore del potente focus elementale.', 'Ruvin Tritarocce', '', '', 'Incontra la proiezione di Khadgar più avanti nei Prati di Vakthros.', 47187),
(66646, 'itIT', 'Causalità letali', 'Uccidi Elementali del Tempo.', 'L\'Infinito ha forzato le energie del tempo verso l\'aggressione. Non promette nulla di buono.\n\nTi prego, uccidi ogni Elementale del Tempo che incontri mentre assisti l\'Ambasciatrice Cronormu. Io rimarrò qui per aiutarla a contenere Eternus.', '', '', '', '', '', '', 47187),
(66633, 'itIT', 'Dichiarazione d\'intenti', 'Pianta uno stendardo di Drago Nero nei cadaveri dei $1oa Djaradin.', 'Questi Djaradin credono che lo Stormo dei Draghi Neri sia finito. Non temono né rispettano l\'autorità di Irathion.\n\nAbbiamo bisogno di una dichiarazione per ricordare loro che lo Stormo d\'Ossidiana è tornato, e che noi siamo più forti che mai.\n\nUccidi i Djaradin e marchia ogni cadavere, così che non dimentichino chi comanda qui.', '', '', '', '', '', '', 47187),
(66622, 'itIT', 'Attrezzi ribelli', 'Salva $1oa Attrezzi Ribelli.', 'È terribile! I miei *hic* strumenti sono scappati mentre ero distratto. Non sopporto *hic* l\'idea che siano là fuori, senza dubbio spaventati a morte!\n\nLi recupereresti tutti quanti per me? Sii paziente e *hic* cerca di tranquillizzarli: sono sicuro che diventerete amici!', '', '', '', '', '', '', 47187),
(66612, 'itIT', 'Il dilemma del Guardiagranchi', 'Uccidi $1oa Gorloc nell\'Accampamento Gocciapicco.', 'I granchi sono in pericolo!\n\nQuesto gruppo ha attraversato una stagione difficile. Il loro habitat precedente è stato saccheggiato dai Primalisti, poi io li ho condotti in questa zona, dove sono stati invasi dai Gorloc!\n\nPensavo sarebbero stati al sicuro qui, ma i Gorloc alimentano l\'aggressività nei loro granchi, portandoli a una morte precoce!\n\nPer favore, sconfiggi alcuni Gorloc in modo che i granchi possano scappare!', '', '', '', '', '', '', 47187),
(66611, 'itIT', 'Ripulire i cieli', 'Uccidi $1oa insetti.', 'Riesci a sentirli? Insetti! Dappertutto. Alcuni di loro stanno diventando molto grossi.\n\nPerché tu e il tuo amico fluttuante non usate l\'energia termica dietro di me per fare qualcosa?', '', '', '', '', '', '', 47187),
(66598, 'itIT', 'Competenze dei Nobili Oscuri', 'Trova l\'Incantatrice Distorcente Delandra presso l\'Accampamento Antonidas, nella Vastità Azzurra.', 'I simboli antichi non sono il mio campo. Comunque...\n\n<Thaelin rovista tra le sue cose, poi tira fuori una mappa, in cima alla quale è scritto il nome Antonidas in grandi lettere storte.>\n\nAh! Eccola qua!\n\nCerto, non è una passeggiata, ma potrai trovare qualcuno che usa la magia antica... qui.\n\n<Indica un punto sulla mappa.>\n\nForse avranno qualcosa per te.', '', '', '', '', '', '', 47187),
(66597, 'itIT', 'Una pietra primitiva', 'Ispeziona il Monolito Antico Inciso.', 'La pietra dietro di me è solo una parte di, come la chiamate voi, un\'antica tecnologia in cui ci siamo imbattuti qui nelle isole.\n\nMa non siamo interamente certi di cosa sia. Scioccante, davvero.\n\nAbbiamo contattato alcuni amici nella speranza che sappiano aiutarci. Nel frattempo, forse puoi scoprire come usarla?', '', '', '', '', '', '', 47187),
(66596, 'itIT', 'Sussurri nei venti', 'Parla con l\'Arcimago Khadgar a Roccavento.', 'Ciao, $p. È passato un po\' di tempo e vorrei che avessimo più tempo per i convenevoli.\n\nMa, vedi, ho appena avuto una conversazione piuttosto illuminante... No, direi sibillina... Sì, una conversazione sibillina con un vecchio amico.\n\nA volte una rivelazione può essere entrambe le cose, dopo tutto.\n\nDevo davvero raccontarti quello che ho scoperto.', '', '', '', '', '', '', 47187),
(66595, 'itIT', 'Scoperta sopita', 'Consegna il messaggio a Thaelin Forgiacupa all\'Avamposto delle Scaglie di Rubino nelle Sponde del Risveglio.', '<Non importa come questa curiosa pergamena sia finita nelle tue borse, l\'importante è il messaggio che contiene.>\n\nMembri della Spedizione delle Scaglie di Drago!\n\nÈ richiesta la vostra assistenza! Fate rapporto all\'Avamposto delle Scaglie di Rubino immediatamente!\n\n<Prima di poter leggere la firma, le lettere scritte magicamente sulla pergamena si dissipano in una nuvola di polvere bianca e blu, lasciando solo una pagina vuota e un delizioso profumo di fiori.>', '', '', '', '', '', '', 47187),
(66589, 'itIT', 'Coordinamento della spedizione', 'Recluta esploratori, artigiani e studiosi a Roccavento per la spedizione sulle Isole dei Draghi.', 'Il mio nome è Toddy. Sarò a capo del nostro gruppo di allegri avventurieri sotto lo stendardo della Spedizione delle Scaglie di Drago. Arriveremo ai dettagli più avanti. Per ora, occupiamoci di mettere insieme un equipaggio!\n\nOgni spedizione che si rispetti ha una varietà di persone: studiosi, artigiani e, naturalmente, esploratori.\n\nAllora? Cosa ci fai ancora qui? Raduna l\'equipaggio!', '', '', '', '', '', 'Riferisci la notizia del tuo successo a Toddy Baffetta presso il Porto di Roccavento.', 47187),
(66586, 'itIT', 'Eredità di Tyr: segreti del passato', 'Dirigiti a Uldaman nelle Maleterre. Scopri la causa delle interferenze.', 'Per impedire a Raszageth di liberare le altre Incarnazioni, il potere degli Aspetti deve essere ripristinato.\n\nMa non sarà facile, i Titani tacciono e il Guardiano Tyr è morto da tempo.\n\nLa regina Alexstrasza ha messo a punto un piano: nel cuore delle Maleterre si trova una struttura titanica chiamata Uldaman. A quanto pare, gli alleati di Tyr potrebbero aver nascosto lì un disco contenente i suoi ricordi.\n\nPorta i tuoi alleati a Uldaman e trova il disco per la Regina dei Draghi. Speriamo che la conoscenza di Tyr possa essere usata per riabilitare gli Aspetti.', '', '', '', '', '', '', 47187),
(66582, 'itIT', 'Procurare il potere', 'Raccogli energia nel ricettacolo per l\'Incantatrice Distorcente Delandra all\'Accampamento Antonidas.', 'In circostanze normali, catturare energia non è un problema. Tuttavia, l\'energia di cui necessitiamo è enorme e instabile. Questo ricettacolo incantato dovrebbe permetterti di trasportarla in sicurezza.\n\nC\'è una regione, a sud-ovest, popolata da creature cariche di energia. Si tratta di energia anomala; è potente, ma instabile.\n\nCattura la loro energia e riportala a me, poi ci imbarcheremo insieme in questa avventura.', '', '', '', '', '', '', 47187),
(66578, 'itIT', 'A > B Reward Test (Low Health)', '', '', '', '', '', '', '', '', 47187),
(66577, 'itIT', 'Un invito in-Aspettato', 'Parla con Irathion per sapere della riunione del Concilio.', 'Oh, $p. Che tempismo impeccabile!\n\nHo appena incontrato il Ser Comandante Turalyon e i suoi alleati, e hanno accettato l\'invito degli Aspetti alle Isole dei Draghi.\n\nVerrai anche tu, vero? Non sarebbe lo stesso senza di te!\n\nImmagino che tu abbia notato dei volti sconosciuti tra chi è riunito qui. Quelli con le ali sono chiamati Dracthyr. Mi conoscono da poco tempo, ma sono già grandi ammiratori.\n\nOh, ma che fine hanno fatto le mie maniere? Dovremmo andare a scambiarci due chiacchiere.', '', '', '', '', '', '', 47187),
(66575, 'itIT', 'Oggetto Committente: Fiala', 'Consegna l\'oggetto al Vigilante Alvi.', '<Questa strana fiala nascosta nel mucchio di cianfrusaglie dei Tarasek sembra riempita con un liquido viscoso e pieno di bollicine.>\n\n<Sarebbe una saggia idea mostrarlo ad Alvi.>', '', '', '', '', '', '', 47187),
(66559, 'itIT', 'Ritorno all\'accampamento', 'Torna dall\'Esaminatore Rowe a Nicchia del Baleniere.', 'Ho visto Mordigan uscire di corsa da lì, sembrava un Nano posseduto. Andrò a cercarlo per accertarmi che torni dagli altri sano e salvo.\n\nSe costeggi la rupe e scendi dalle cascate, dovresti evitare di attirare l\'attenzione di altri Gorloc. \n\nCi vediamo all\'accampamento.', '', '', '', '', '', '', 47187),
(66558, 'itIT', 'Rowie', 'Trova Rowie.', 'Tu sei l\'$gavventuriero:avventuriera; che è $gtornato:tornata; con gli altri da Felcepelle, non è così? Allora probabilmente sai cos\'è successo a Kaqiata...\n\nSuo figlio, Rowie, è rimasto sconvolto quando sua madre non ha fatto ritorno con Brena e gli altri ed è scappato. Io resterò qui nel caso tornasse, ma tu potresti cercarlo?\n\nCredo sia fuggito verso la caverna ghiacciata a est. Ha detto di voler combattere contro gli Yeti là dentro!', '', '', '', '', '', '', 47187),
(66557, 'itIT', 'Conoscenze accademiche', 'Trova un altro esperto di lingue dei Mezzorsi al Campo Che Non C\'è.', 'Sì, questo dialetto dei Mezzorsi Mantogelido si sta rivelando un osso duro da decifrare, anche per me.\n\nDei miei colleghi al Campo Che Non C\'è potrebbero esserci d\'aiuto. Ho sentito che ci sono altre tribù di Mezzorsi nell\'area: fare un confronto con le loro varianti linguistiche potrebbe portarci a qualche risultato.', '', '', '', '', '', '', 47187),
(66556, 'itIT', 'Un antro favol-orso', 'Ispeziona la caverna', 'Be\', il tuo accento è pessimo e diecimila anni di isolamento e deriva linguistica non giocano certo a nostro favore, ma a grandi linee credo di aver capito.\n\nIl concetto di base riguardava un \"vento malvagio in una caverna\", o una \"caverna della tempesta maligna\". Quello, oppure che il loro bucato era troppo giovedì?\n\nAscolta, non è come imparare lo gnomesco, ci sono diverse imprecisioni nella traduzione. Ma la parte della \"caverna\" dovrebbe essere giusta, quindi potremmo cominciare da lì.', '', '', '', '', '', '', 47187),
(66555, 'itIT', 'Seguire il disc-orso', 'Aiuta Sonova con le traduzioni.', 'Sì, sembra proprio si sia scatenato l\'inferno lassù, come una tempesta che passando ha sconquassato ogni cosa. È comprensibile che siano sul piede di guerra, ma perché attaccarci?\n\nSarebbe molto più semplice discutere, ma i Mantogelido sono famosi per essere scarsamente loquaci e non sembrano parlare i dialetti comuni del mezzorsese. Mezzorsiano? Be\', hai capito cosa intendo.\n\nSuppongo che tu non sia $griuscito:riuscita; a fare una bella chiacchierata con loro mentre li tenevi d\'occhio, dico bene?', '', '', '', '', '', '', 47187),
(66554, 'itIT', 'Autodifesa aggressiva', 'Sconfiggi $1oa Mezzorsi Mantogelido.', 'I Mantogelido sono in fermento, non credo proprio faranno i salti di gioia vedendoti ficcare il naso nel loro territorio.\n\nNon esitare a difenderti, nel caso dovessero attaccarti: fargli capire chiaramente che fai sul serio potrebbe ridare loro un po\' di buon senso.\n\nCerca solo di non uccidere nessuno, OK? So che tipi siete voi avventurieri...', '', '', '', '', '', '', 47187),
(66553, 'itIT', 'Vallata analizzata', 'Scopri $1oa indizi nella Vallata dei Mantogelido.', 'I Mantogelido sono un caso speciale tra i Mezzorsi.\n\nLi definirei degli \"isolazionisti\". Sono fantasmi che vivono nelle caverne, le loro pellicce si mimetizzano con la neve.\n\nSe ne stavano sempre per i fatti loro, ma ora sono diventati aggressivi. Hanno attaccato il nostro accampamento senza nessun motivo!\n\nC\'è qualcosa che non va. Non posso chiedere loro cos\'è successo, ma forse tu puoi trovare degli indizi nel loro villaggio?', '', '', '', '', '', '', 47187),
(66550, 'itIT', '[PH] More Storms!', '', '', '', '', '', '', '', '', 47187),
(66549, 'itIT', 'Rally delle Sponde del Risveglio', '', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66534, 'itIT', 'Decollo', 'Esplora Orgrimmar.', 'Sembra che il nostro arrivo non sia passato inosservato. Forse c\'è ancora speranza per questa gente.\n\nIo mi occuperò di Ebissian e dei capi dell\'Orda e cercherò di risolvere la questione. Tu vai in ricognizione.\n\nScopri cos\'ha da offrire questo posto. Dovremo restare qui per un po\', dopotutto.\n\nRaggiungici quando avrai finito. Per allora dovremmo aver sistemato tutte le faccende più noiose.', '', '', '', '', '', '', 47187),
(66529, 'itIT', 'Un migliaio di parole', 'Scatta una foto a Dervishian vicino allo Scheletro del Proto-Drago.', 'Con tutto quello che abbiamo imparato qui, non riesco a immaginare di andarmene senza un ricordino.\n\nSaresti così gentile da farmi una foto accanto a questi fossili di proto-drago?', '', '', '', '', '', '', 47187),
(66528, 'itIT', 'Re senza corona', 'Esamina lo Scheletro di Proto-Drago.', 'Questo antico proto-drago doveva essere una creatura maestosa quando era in vita. Forse uno dei più grandi che la Riserva Selvaggia abbia mai visto.\n\nMa non è bastato. Osservando lo scheletro più da vicino, potremmo conoscere la storia dei suoi ultimi momenti.', '', '', '', '', '', '', 47187),
(66527, 'itIT', 'Protografia professionale', 'Usa l\'Apparato di Potenziamento Verticale e scatta una foto al Proto-Drago Addormentato.', 'Non ho mai addestrato $gun fotografo bravo:una fotografa brava; come te... ancora $gvivo:viva;, quantomeno. È una professione pericolosa.\n\nA proposito di pericolo, il nostro obiettivo finale è un grosso proto-drago che riteniamo possa essere uno dei prossimi predatori alfa di questa riserva. Avviciniamoci e scattiamogli una foto!', '', '', '', '', '', '', 47187),
(66526, 'itIT', 'Difendere le terre selvagge', 'Libera 5 Proto-Draghetti Catturati o Proto-Drachi Prigionieri.', 'La Riserva Selvaggia è una delle poche aree in cui prosperano i proto-draghi. Ma i Primalisti stanno distruggendo i loro luoghi di nidificazione, facendo sortite per catturare proto-draghetti e proto-drachi su cui sperimentare.\n\nNon avere pietà: individua i bracconieri, eliminali e libera i loro prigionieri. Ne va della specie dei proto-draghi!', '', '', '', '', '', '', 47187),
(66525, 'itIT', 'Protografia competitiva', 'Fotografa un Uovo di Proto-Drago Infuso e un Proto-Draco Infuso.', 'Bene, ora che hai fatto pratica con alcuni scatti iniziali, che ne dici di passare a qualcosa di un po\' più impegnativo?\n\nHo individuato uno splendido proto-draco che volava nell\'area proprio dietro di noi. Belle corna, squame scoppiettanti di elettricità... Probabilmente opera di quei Primalisti, ma l\'arte è arte!\n\nVedi se riesci a scattare una foto del proto-draco e di alcune delle sue uova. Potrebbe essere necessario salire un po\' per ottenere una buona inquadratura!', '', '', '', '', '', '', 47187),
(66524, 'itIT', 'Protografia per principianti', 'Scatta foto ai Proto-Draghi.', 'Quindi ti interessa la catalogazione? Sei nel posto giusto!\n\nLa Riserva Selvaggia è una cornucopia di sapere che aspetta solo di essere scoperto e archiviato con l\'aiuto del mio fantastico Catalogaizer 3.000, Isole dei Draghi Edition. Ora con motion capture potenziato!\n\nPer fare esperienza, fotografa un uovo di proto-drago, un draghetto che impara a volare e di un proto-draco a caccia. Poi, incontriamoci vicino all\'antico scheletro di proto-drago a ovest di qui, così potrò giudicare le tue foto.', '', '', '', '', '', '', 47187),
(66523, 'itIT', 'Badare alla Forgia', 'Recupera dei reagenti per la forgia raccogliendo Pelli di Drospi Cornuti, Tizzoconi Dormienti e Nuclei Distaccati nei dintorni dell\'Accampamento Antonidas.', 'Se stai cercando un istruttore, mi dispiace dirti che io... Ah, non sei $gun apprendista:un\'apprendista;! Ti faccio le mie scuse, lascia che mi presenti.\n\nSono la Custode Vernagos, una dei guardiani di queste rovine. In particolare, porto sulle mie spalle il gravoso incarico di restituire a questo luogo il suo antico splendore.\n\nMagari potresti darmi una mano? Tutti i reagenti che mi servono si trovano qui vicino: nuclei elementali del ghiaccio, tizzoconi, pelle di drospi cornuti.\n\nArticoli standard, diciamo. Che ne dici?', '', '', '', '', '', 'Torna dal Custode Vernagos all\'Accampamento Antonidas.', 47187),
(66517, 'itIT', 'Una nuova fonte di armi', 'Ottieni 25 Armi Intatte di Dracthyr dalla Fiamma Frammentata nelle Isole dei Draghi per Dhurrel dei Centauri Maruuk.', 'La Fiamma Frammentata rappresenta una grave minaccia per i nostri confini. Le loro armi sono preoccupanti. Recupera ciò che puoi dalle loro armi e potremo studiarle per trovare qualsiasi punto debole, inoltre potremo usarle per difenderci.\n\nHo fiducia in te, $gstraniero:straniera;: se completerai questa missione per noi, ti insegnerò alcune delle nostre tecniche di Forgiatura.', '', '', '', '', '', '', 47187),
(66516, 'itIT', 'Gemme di poco conto... non credo proprio!', 'Raccogli 25 Gemme Semplici dai Djaradin delle Isole dei Draghi per Gnoklin Spirastrana della Spedizione delle Scaglie di Drago.', 'È uno spreco. I Djaradin di questa terra usano potenti gemme come semplici decorazioni... meri gioielli! Hanno una miriade di utilizzi possibili come telescopi, specchi, focalizzatori e per non parlare del fatto che hanno molte proprietà magiche.\n\nDobbiamo risolvere la situazione, $gesploratore:esploratrice;. Sottrai ai Djaradin le loro gemme e portamele. Farò in modo che vengano sfruttate meglio. Fai attenzione, i Djaradin sono feroci guerrieri.', '', '', '', '', '', '', 47187),
(66513, 'itIT', 'Decollo', 'Esplora Roccavento.', 'Forse dovremmo farci un\'idea di questa città, se vogliamo che diventi la nostra nuova casa. Chiamala pure missione esplorativa, se vuoi.\n\nVai, scopri cos\'ha da offrire questo posto. Io seguirò Irathion e cercherò di aiutarti in ogni modo possibile.\n\nCerca di non infastidire gli abitanti del posto, però. Non credo che molti di loro siano abituati a vedere dei Draghi da vicino.\n\nIncontriamoci una volta che ti sarai $gfatto:fatta; un\'idea del posto.', '', '', '', '', '', '', 47187),
(66511, 'itIT', 'Popolare tra i Tuskarr di Iskaara', 'Parla con Murik a Iskaara.', 'Continui a dimostrarci di essere parte integrante della nostra comunità.\n\nPer onorare questo legame, vieni a Iskaara: ho preparato un pacco di provviste per aiutarti.', '', '', '', '', '', '', 47187),
(66509, 'itIT', 'Paranoia 1', '', 'Agura mi ha mandata qui per raccogliere FIORI per la mia ANSIA, ma ci sono CREATURE e sono terrorizzata.', '', '', '', '', '', '', 47187),
(66504, 'itIT', 'Una scheggia di mana cristallizzato', 'Porta il cristallo da Lathos.', '<Il piccolo cristallo blu vibra leggermente quando viene toccato e produce una lieve melodia che ricorda una canzone lontana. Puoi sentire le parole riecheggiare come una musica dolce nella tua testa.>\n\nLathos potrebbe trovarlo interessante.', '', '', '', '', '', 'Porta il cristallo da Lathos.', 47187),
(66503, 'itIT', 'Per amore degli altri', 'Ispeziona la cima della Torre in Rovina all\'Accampamento Antonidas.', 'Ah, vedo che i miei apprendisti ti hanno $gcoinvolto:coinvolta; nei loro giochetti.\n\n<Noriko ridacchia.>\n\nSembra che si siano imbattuti in qualcosa d\'interessante, e tu con loro. Lo scopo di queste rovine si sta lentamente rivelando e dietro ci sono ben più di semplici immagini sbiadite e canzoni...\n\nDalla vetta di questa torre proviene un richiamo.\n\nScorgo la curiosità nei tuoi occhi. Vai, hai il mio permesso.\n\nVedi cosa riesci a trovare.', '', '', '', '', '', 'Torna da Noriko all\'Accampamento Antonidas.', 47187),
(66500, 'itIT', 'Punti di vista', 'Scopri le antiche immagini dell\'Accampamento Antonidas.', 'Non abbiamo fatto niente! Non abbiamo fatto niente!\n\nAspetta un attimo...\n\nMi sembri $gun:una; $r importante... Vuoi sapere un segreto?\n\nA quanto pare, in queste rovine scorre della magia! E noi possiamo vederla!\n\n<Scrumpy gonfia il petto con orgoglio.>\n\nPosso mostrarti come fare per vederla! Ma... aspetta a dirlo a Noriko.', '', '', '', '', '', '', 47187),
(66493, 'itIT', 'Invio avviato!', 'Porta i pacchi agli Apprendisti del Kirin Tor all\'Accampamento Antonidas.', '<Senti un mormorio soffocato provenire dall\'altra parte del portale.>\n\nEhi! Ehi, tu!\n\nHo della posta per i nostri apprendisti sul campo: kit curativi, regali, articoli che hanno ordinato tramite corriere magico...\n\nNiente di particolare, insomma.\n\nMi faresti il favore di consegnarglieli?', '', '', '', '', '', '', 47187),
(66489, 'itIT', 'Approntare le difese', 'Potenzia le Difenditrici Azzurre all\'Accampamento Antonidas.', 'Il Custode Cynegos e io stavamo giusto discutendo dell\'impatto che l\'attacco dei Primalisti ha avuto sui piani per assaltare l\'Adunanza di Cobalto e ho avuto un\'idea.\n\n<Celeste estrae una bacchetta dalle pieghe della sua veste.>\n\nPrendi la mia bacchetta e potenzia le loro armi!\n\nBasta giusto un po\' di fuoco...', '', '', '', '', '', '', 47187),
(66488, 'itIT', 'RICERCATO: Frigellus', 'Uccidi Frigellus nei pressi dell\'Accampamento Antonidas.', '<Le iscrizioni della pagina brillano di una fioca luce blu.>\n\nIl Frigellus elementale, una sorta di trastullo un tempo molto apprezzato da Malygos, ha sofferto della noncuranza del suo padrone.\n\nAnche se questo insediamento un tempo sereno è ormai crollato, la rozza e giocosa creatura ha continuato a crescere, corrotta e deturpata dal male che affligge questa terra.\n\nFai in modo di eliminarla.\n\nInforma il Custode Cynegos del tuo successo.', '', '', 'Frigellus', '', '', '', 47187),
(66484, 'itIT', 'Conosci il Tuo Nemico: Proto-Draghi', 'Dai la caccia a qualche Proto-Drago nei pressi della Giungla Apicale.', 'La zona brulica di quelle possenti belve! Non c\'è problema. Grazie al Mirino da Rilevamento puoi individuare dei punti deboli nella loro robusta corazza di scaglie. Puoi anche escogitare qualche trucco per evitare le loro zanne e i loro artigli affilati.', '', '', '', '', '', '', 47187),
(66482, 'itIT', 'In cerca di trofei: Fauceterra', '', '[PH] Get rid of that annoying flying lizard!', '', '', 'Fauceterra', '', '', '', 47187),
(66473, 'itIT', 'La Terra si risveglia', 'Sconfiggi l\'Ira Primordiale e la Grandine Primordiale nel Promontorio di Gelkyr.', 'I demoni in quella caverna erano troppo per me.\n\n<Sharnax è visibilmente affaticata e tossisce.>\n\nHo visto cosa sei in grado di fare.\n\nHo bisogno che tu uccida quegli elementali prima che raggiungano il loro pieno potenziale. Non possiamo permettere ai Primalisti di prendere il controllo del Forte di Tyr!', '', '', '', '', '', '', 47187),
(66472, 'itIT', 'Prima-lista', 'Consegna il Mucchio di Ordini dei Primalisti al Comandante Thadezus sul ponte del Promontorio di Gelikyr.', 'I varchi sono chiusi, gli elementali sono stati eliminati e i Primalisti sono stati fermati... per ora.\n\n<Sharnax ride.>\n\nEsiste qualcosa che non sappiamo fare, $C? Immagino che solo il tempo ce lo dirà.\n\nRiporta i piani al comandante. Di certo sarà felice di vedere che abbiamo avuto successo.', '', '', '', '', '', 'Parla con il Comandante Thadezus sul ponte del Promontorio di Gelikyr.', 47187),
(66471, 'itIT', 'Ottima pianificazione', 'Ottieni $1oa Ordini dei Primalisti dai Primalisti vicini nella terrazza superiore del Promontorio di Gelikyr.', 'Il comandante mi ha ordinato di stabilire una base avanzata e di eliminare qualsiasi resistenza. Solo a quel punto ho capito una cosa...\n\n<Sharnax emette un lungo sospiro.>\n\nI Primalisti stavano parlando del Forte di Tyr.\n\nA meno che tu non sia eccezionalmente abile negli interrogatori, ho bisogno che tu scopra i loro piani.', '', '', '', '', '', 'Incontra Sharnax fuori dalla caverna al Promontorio di Gelikyr.', 47187),
(66470, 'itIT', 'Una spinta in avanti', 'Ottieni la Pietra del Varco Velata, Terrestre e Gelida, e chiudi $7oa Varchi Elementali.', '<Sharnax si gratta il mento.>\n\nIl comandante aveva ragione. I Primalisti stanno chiamando rinforzi dai piani elementali.\n\n<Sharnax sorride compiaciuta.>\n\nSarebbe un peccato se accadesse qualcosa ai loro varchi, $c.', '', '', '', '', '', 'Incontra Sharnax fuori dalla caverna al Promontorio di Gelikyr.', 47187),
(66468, 'itIT', 'Ciò che un tempo era nostro', 'Sconfiggi i Primalisti che occupano il Promontorio di Gelkyr.', '<Thadezus sbuffa al tuo arrivo.>\n\nSei $gun:una; mortale d\'azione, o ti leverai di torno, $c?\n\nHo perso molti buoni soldati a causa di quei Primalisti.\n\nAbbiamo un\'idea di ciò che stanno pianificando, ma dobbiamo prima eliminare il nemico e salvare i miei sottoposti.', '', '', '', '', '', 'Parla con Sharnax al Promontorio di Gelikyr.', 47187),
(66467, 'itIT', 'L\'arte imita la vita', 'Uccidi lo Sputaveleno Superiore.', 'L\'ultima volta che ero in questa caverna, ho disegnato un enorme fiore che trasuda una linfa tossica e viscida. È uno dei miei disegni migliori, non lo dimenticherei se ci provassi.\n\nQuella linfa è ciò che rende velenose le lance dei Tarasek, ne sono certo. Devono aver iniziato a raccoglierla per avvelenare le loro armi.\n\nLa pianta è bellissima; sarà un peccato ucciderla. Tuttavia, non possiamo permettere che i Tarasek continuino a raccoglierne la linfa. $n, ti prego di eliminare la pianta e mettere fine a tutto questo casino.', '', '', 'Sputaveleno Superiore', '', '', '', 47187),
(66465, 'itIT', 'Veleno neutralizzato', 'Distruggi $1oa Scorte di Lance Avvelenate.', 'Anche con il loro capo andato, dubito che i Tarasek smettano di usare le loro lance con la punta avvelenata semplicemente perché glie lo chiediamo gentilmente. Non posso rischiare che anche solo una di queste armi venga usata su un viandante ignaro.\n\nDovranno essere distrutte tutte. Se non le hai trovate nelle casse presso le pozze, vuol dire che i Dentebrace stanno tenendo le lance più vicine alla fonte. \n\nNessuno si farà più male a causa della mia imprudenza. Entra nella caverna e distruggi tutte le casse di armi che trovi.', '', '', '', '', '', '', 47187),
(66464, 'itIT', 'Campi della Ferocia: maestro della caccia!', 'Sconfiggi la Maestra Cacciatrice Amaa.', 'Ci siamo. Tu e i tuoi amici avete fatto il colpaccio: uno scontro contro la campionessa, la Maestra Cacciatrice Amaa in persona. Non ci sarà niente da festeggiare, lei è spietata. È stato bello conoscerti.\n \nDopo che ti avrà ucciso, posso avere la tua roba?', '', '', '', '', '', '', 47187),
(66463, 'itIT', 'Campi della Ferocia: vendetta degli elementi!', 'Sconfiggi il Campione Primalista.', 'Stiamo cambiando l\'elenco dei partecipanti all\'ultimo minuto, perché un pezzo grosso dei Primalisti vuole unirsi alla competizione per affrontarti. E non ho certo intenzione di dire di no a un drago elementale arrabbiato.\n\nCe la puoi fare sicuramente. Altrimenti... Be\'... Hai firmato la liberatoria, sì?', '', '', '', '', '', '', 47187),
(66462, 'itIT', 'Campi della Ferocia: disperse nel Sogno!', 'Sconfiggi Sherath e Taresh.', 'Sai, per essere nelle Isole dei Draghi, non ne ho visti molti di draghi. Tuttavia, abbiamo ottenuto un duo di dragoidi che hanno chiesto di iscriversi in coppia alla competizione.\n\nSembrano molto ansiosi di mettersi alla prova, quindi buona fortuna!', '', '', '', '', '', '', 47187),
(66461, 'itIT', 'Campi della Ferocia: nemico dal vulcano!', 'Sconfiggi Ciqa il Coglipace.', 'Uno dei primi volontari per questa competizione proviene dalle Sponde del Risveglio. Un grosso Djaradin, non tanto aggressivo quanto i suoi simili.\n\nSembra che gli piaccia lo sport del combattimento, il che, ehi, per me va benissimo.', '', '', '', '', '', '', 47187),
(66460, 'itIT', 'Campi della Ferocia: signore del decadimento!', 'Sconfiggi Marcianotte.', 'Ho provato a coinvolgere uno di quegli schifosi Gnoll nel torneo. Sfortunatamente nessuno dei miei collaboratori sa come parlarci.\n\nIn compenso, siamo riusciti a catturare una delle loro strane creazioni. Sarà un ottimo avversario! Fammi sapere quando vuoi iniziare il secondo round!', '', '', '', '', '', '', 47187),
(66459, 'itIT', 'Campi della Ferocia: terrore della palude!', 'Sconfiggi Maneet.', 'Un caloroso benvenuto a tutti ai Campi della Ferocia!\n\nAnche se questo campo di combattimento viene utilizzato per eventi tradizionali, i Centauri mi hanno gentilmente concesso di aprire fuori stagione. Dicono che sia un buon modo per testare la loro forza e guadagnare onore.\n\nVuoi portare a casa il titolo di $gcampione:campionessa;? Allora fammi sapere quando sei $gpronto:pronta; e potrai affrontare la competizione introduttiva.', '', '', '', '', '', '', 47187),
(66458, 'itIT', 'Retaggio di Tyr: Segreti del passato', 'Entra a Uldaman: Eredità di Tyr nelle Maleterre e recupera il disco.', 'Per impedire a Raszageth di liberare le altre Incarnazioni, il potere degli Aspetti deve essere ripristinato.\n\nPurtroppo, i Titani sono piuttosto occupati e il Guardiano Tyr è morto da tempo.\n\nLa regina Alexstrasza ha suggerito un piano: nel cuore delle Maleterre si trova una struttura titanica chiamata Uldaman. A quanto pare, gli alleati di Tyr potrebbero aver nascosto lì un disco contenente i suoi ricordi.\n\nSi dice che il posto sia stato invaso dai Trogg. Raduna i tuoi alleati e dirigiti verso Uldaman; recupera il disco nel nome della Regina dei Draghi!', '', '', '', '', '', '', 47187),
(66457, 'itIT', 'La fine dell\'Era Blu', 'Uccidi Scagliablu.', 'Tutti i Dentebrace seguono un bruto gigante che per comodità chiamo Scagliablu. È sempre stato un tipo aggressivo, ma finora ha sempre tenuto il suo branco di saccheggiatori lontani dalle strade principali. Certo, erano territoriali, ma ostili? Non fino a ora.\n\nScagliablu dev\'essere responsabile di questo improvviso cambiamento. Trovalo e abbattilo.', '', 'Capo dei Dentebrace. Non molto incline alle trattative.', 'Scagliablu', '', '', '', 47187),
(66456, 'itIT', 'Una punta velenosa', 'Raccogli 8 Lance Avvelenate.', 'Non eccello nel mio lavoro, ma almeno ho prestato attenzione quando stavo imparando a farlo. Ogni Vigilante degno del suo nome sa come preparare un antidoto. Mi serve abbastanza veleno per prepararlo correttamente.\n\nNori ha detto che il Tarasek che l\'ha attaccata aveva lance imbevute di quella roba. Trovalo e portami la sue lance. Se il mio presentimento è corretto, potrò creare un antidoto con il residuo dalle punte delle lance.\n\nSpero solo di avere abbastanza tempo.', '', '', '', '', '', '', 47187),
(66449, 'itIT', 'Operazione autonoma', 'Salva $1oa draghetti in pericolo mentre elimini Vincolacenere Tornecha e $2oa Fenici Fuocartiglio.', 'I Torcipolvere Qalashi stanno cercando di imprigionare i nostri draghetti. Sembra che il loro capo voglia usarli per i suoi perfidi scopi, non possiamo permetterlo!\n\nI Djaradin non sono i soli nemici qui, anche le fenici danno la caccia ai nostri draghetti, e rappresentano un ulteriore pericolo.\n\nDevi proteggerli, elimina i nemici che li minacciano. Osoria ti aiuterà.', '', 'Un pericoloso avversario, abile nella manipolazione di ceneri e fuliggine.', 'Vincolacenere Tornecha', '', '', '', 47187),
(66448, 'itIT', 'Vigilante ribelle', 'Trova la Vigilante Alvi.', 'I Vigilanti hanno tenuto le strade di Thaldraszus al sicuro per i viaggiatori più a lungo che io possa ricordare. È un dovere a cui la mia famiglia ha tenuto fede per generazioni.\n\nAhimè, mia sorella Alvi sembra meno interessata alla cosa, di recente. Dovrebbe fare rapporto a me ogni mattina, ma è un giorno che non la vedo. \n\nSe trovi una Draconide di Bronzo a est di qui, con la testa tra le nuvole, ti chiedo di mandarmela. Altrimenti dovrò cercarla da sola.', '', '', '', '', '', '', 47187),
(66447, 'itIT', 'Oltre la barriera', 'Esamina la Cripta della Vita nelle Rovine della Cripta della Vita.', 'Ora che la barriera è crollata, esploriamo la cripta.', '', '', '', '', '', '', 47187),
(66445, 'itIT', 'Onore ai nostri caduti', 'Recupera i seguenti oggetti dai Djaradin.', 'I Djaradin non hanno alcun riguardo per la santità della Cittadella o per i corpi della nostra gente! Spezzano le ossa dei morti e prendono i loro cimeli personali come souvenir.\n\nQuesta mancanza di rispetto spezza il cuore di ogni orgoglioso drago nero. I nostri morti meritano onore.\n\nRecupera gli oggetti che i Djaradin hanno strappato ai corpi dei nostri caduti.', '', '', '', '', '', '', 47187),
(66442, 'itIT', 'Passiamo alla teoria', 'Aiuta a mettere alla prova i globi contro la Barriera dei Titani nelle Rovine della Cripta della Vita.', 'Ora abbiamo quattro Globi elementali! Vediamo quale ipotesi si rivelerà giusta.', '', '', '', '', '', '', 47187),
(66441, 'itIT', 'Impegno distillato', 'Uccidi Roggian nella caverna a est delle Rovine della Cripta della Vita.', 'Il Globo della Pietra Primordiale è un ritrovamento provvidenziale, ma Acadia e Tae\'shara hanno ipotesi contrastanti sulla barriera.\n\nIo ho la mia. Forse con più globi elementali la risposta sarà chiara.\n\nUno degli esploratori ha visto un elementale dell\'acqua gigantesco in una caverna vicina. Sconfiggi l\'elementale e forse troverai un altro globo.', '', 'Gli esploratori riferiscono che questo elementale sta crescendo velocemente.', 'Roggian', '', '', '', 47187),
(66439, 'itIT', 'Piani avvampanti', 'Recupera i Frammenti di Fiamma Primordiale dalle forze dei Primalisti nella Conca dei Drospi Cornuti.', 'Sfere elementali, eh? Se c\'è terra, ci dev\'essere fuoco!\n\nI Primalisti vicino ai nidi dei drospi cornuti stanno riplasmando la terra con la lava. Se qualcuno sa qualcosa sul Globo delle Fiamme Primordiali, sono loro!\n\nEliminali e vedi se hanno qualcosa di utile!', '', '', '', '', '', '', 47187),
(66438, 'itIT', 'Obiettivi ambiziosi', 'Trova l\'Esploratrice Ri\'tal nella Conca dei Drospi Cornuti.', 'L\'aria è un elemento potente. Taglia la pietra e gonfia le vele per portarci dove dobbiamo andare.\n\nLa mia ipotesi è che l\'aria sarà la soluzione più efficace per rimuovere questa barriera. È semplice, davvero.\n\nI miei esploratori riferiscono di aver trovato il Globo delle Burrasche Primordiali. L\'Esploratrice Ri\'tal può condurti a esso. Puoi trovarla vicino alla Conca dei Drospi Cornuti. Presto!', '', '', '', '', '', '', 47187),
(66437, 'itIT', 'Elemento chiave', 'Riporta il Globo della Pietra Primordiale all\'Elementalista Taiyang nelle Rovine della Cripta della Vita.', '<Questo globo di terra pulsa di energia.>\n\n<L\'Elementalista Taiyang potrebbe sapere cosa farne.>', '', '', '', '', '', '', 47187),
(66436, 'itIT', 'Piantagrane dissotterrati', 'Uccidi $1oa Elementali della Terra nelle Rovine della Cripta della Vita.', 'Gli Elementali della Terra non stanno solo cercando di respingerci, stanno distruggendo anche manufatti ed equipaggiamenti! È come se fossero stati programmati per distruggere qualsiasi cosa creata dai Titani.\n\nLi stiamo tenendo a bada, ma con loro qui non possiamo dedicarci allo studio di questo luogo. Ti prego, aiutaci a respingerli, così potremo continuare esplorare!', '', '', '', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(66435, 'itIT', 'Recupero del sito', 'Salva $1oa Esploratori Bersagliati nelle Rovine della Cripta della Vita.', 'Come Sciamano ho lavorato con molti elementali, ma mai così aggressivi!\n\nLa spedizione ha scoperto una cripta dei Titani proprio qui, ma una barriera protegge la camera interna. Quando abbiamo cercato di dissolvere la barriera, gli elementali ci hanno attaccati!\n\nQuando gli elementali hanno colpito, molti esploratori stavano lavorando al sito di scavo. Sono intrappolati e, per giunta, nessuno di loro sa combattere!\n\nPer favore, vai nel sito di scavo ad aiutarli!', '', '', '', '', '', '', 47187),
(66429, 'itIT', 'Non dimenticherò', 'Incontra Rannan fuori dal Campo Che Non C\'è.', 'Mi... Mi serve un attimo per riprendermi, per favore.\n\nTorna al Campo Che Non C\'è, $p. Ci vediamo lì.', '', '', '', '', '', '', 47187),
(66428, 'itIT', 'Mai dare per scontata un\'amicizia', 'Usa il D.E.R.A.P.O.N.E. per dissolvere la barriera arcana.', 'Bene! Il D.E.R.A.P.O.N.E. è calibrato e pronto a entrare in azione... tutto tuo!\n\nPerché non lo uso io? Semplice!\n\nBisogna considerare tutte le eventualità.\n\nMettiamo che esploda, chi potrebbe ripararlo se io mi ritrovassi ferito, privo di sensi o addirittura morto? Ci pensi?\n\nOra vai, dissolvi la barriera così potremo tornare all\'accampamento e curare Lathos. Io starò... proprio qui.', '', '', '', '', '', '', 47187),
(66427, 'itIT', 'Una minaccia incombente', 'Uccidi Tharohn.', 'Le mie ferite non sono curabili sul campo. Temo siano troppo gravi per permettermi di combattere.\n\nDevo chiederti nuovamente aiuto, $n.\n\nDevi trovare Tharohn e impedirle di sovraccaricare altre console.\n\nIn questo modo farai guadagnare tempo a Rannan per calibrare il D.E.R... D.E.R.A.P.S... O qualunque nome abbia scelto stavolta.\n\nForse allora potremo contrastare le macchinazioni della Fiamma Frammentata.', '', 'Una leader della Fiamma Frammentata che non si fermerà davanti a nulla per brandire il potere delle Rovine di Karnthar.', 'Manipolatrice Arcana Tharohn', '', '', '', 47187),
(66426, 'itIT', 'Corsa contro il tempo', 'Raggiungi la torre a est.', 'Sento che l\'energia arcana sta crescendo.\n\nSospetto che non resti molto tempo prima che le rovine facciano sembrare l\'A.M.S. di Rannan una stella lontana nel cielo notturno.\n\nDobbiamo andare lì e fermarla!\n\nFai attenzione, $p.\n\nIncontriamoci alla torre orientale, così faremo il punto della situazione.', '', '', '', '', '', 'Incontra Rannan e Lathos alla torre orientale.', 47187),
(66425, 'itIT', 'Sovraccarico arcano', 'Aiuta Rannan a dissolvere le bolle arcane.', 'Ecco! Ho finito!\n\nTi presento... il D.E.R.A.P.S.!\n\nTADAAAN!\n\nL\'ho calibrato sulla frequenza dell\'energia che circonda le console dei draghi e ci ho inciso un glifo di Dissoluzione Magica.\n\nIl D.E.R.A.P.S. disperderà l\'energia arcana e spegnerà la console dei draghi, ma il glifo si indebolirà dopo ogni utilizzo.\n\nNiente male, vero?\n\nHo rilevato quattro di queste console nelle nostre vicinanze. Vai a spegnerle!', '', '', '', '', '', '', 47187),
(66423, 'itIT', 'Timori e validazioni', 'Cerca degli indizi sull\'origine delle rovine.', 'La morte di questi membri della Fiamma Frammentata sottolinea quanto siano pericolose le Rovine di Karnthar.\n\nRannan crede che, con qualche aggiustamento, il D.E.R. possa ancora placare le energie di questo posto.\n\nAncora una volta, però, stiamo trattando i sintomi e non la causa.\n\nCerca indizi tra le rovine e vedi se riesci a carpire la loro funzione originale. E affrettati, $n. Potremmo non avere molto tempo!', '', '', '', '', '', '', 47187),
(66422, 'itIT', 'La spedizione continua!', 'Incontra Rannan e Lathos alla torre.', 'Un sito antico, un\'organizzazione con motivazioni imperscrutabili, persino il D.E.R. di Rannan e le sue analisi...\n\nÈ tutto così entusiasmante per l\'esploratore che è in me!\n\nDobbiamo scoprire di più su quello che sta succedendo qui.\n\nCi sono delle scale a sud che portano a una torre. Dobbiamo proseguire.', '', '', '', '', '', '', 47187),
(66421, 'itIT', 'La Cicatrice Tempestosa', '', '', '', '', '', '', '', '', 47187),
(66419, 'itIT', 'Lealtà unica', '', '', '', '', '', '', '', '', 47187),
(66412, 'itIT', 'Continua pure, Basilton', 'Parla con Basilton nei Giardini.', 'C\'è un\'altra cosa che questo vecchio Draconide vorrebbe chiederti, prima che tu te ne vada.\n\nQuando io e Ser Basilton ci siamo conosciuti, ci lanciavamo insieme in ogni genere di avventura. Credo che sia per questo che ora si allontana spesso. Gli manca l\'esplorazione.\n\nNon posso più fargli compagnia, ma tu sì! Puoi portarlo a vedere luoghi che non avrei mai immaginato, te lo leggo in faccia!\n\nMa prima dovremmo chiedere a Basilton cosa ne pensa.', '', '', '', '', '', '', 47187),
(66391, 'itIT', 'Verso le rovine!', 'Incontra Rannan e Lathos alle Rovine di Karnthar.', 'Ti interessa sapere della mia invenzione, il D.E.R.? No?\n\nBe\', te lo dico comunque, perché si dà il caso che abbia trovato qualcosa.\n\nOggi ha rilevato un ENORME PICCO di energia arcana dalle Rovine di Karnthar. Lathos pensa che la colpa sia della Fiamma Frammentata. È l\'occasione PERFETTA per mettere alla prova il D.E.R.!\n\nVuoi venire? Sarà fantastico.', '', '', '', '', '', '', 47187),
(66369, 'itIT', 'La protezione terrigena', 'Attiva la Protezione Terrigena.', 'Grazie agli anelli che hai raccolto, ho potenziato una protezione radunando le pietre che la circondano e creando un Difensore Terrigeno Vivente per proteggere il territorio.\n\nProva la Protezione Terrigena per assicurarti che funzioni.', '', '', '', '', '', '', 47187),
(66368, 'itIT', 'Un\'isola in tempesta', 'Elimina $1oa Manifestazioni Ghermitrici e Scioglitore Igneo.', 'Non c\'è stato un attimo di respiro, la minaccia degli elementali è incessante!\n\nUn momento di riposo sarebbe utile e mi permetterebbe di creare altre protezioni per la nostra difesa.\n\nScopri cosa puoi fare per rallentare l\'assalto al nostro perimetro.', '', '', 'Scioglitore Igneo', '', '', '', 47187),
(66364, 'itIT', 'Per far volare un aquilone', 'Raccogli 10 Ali di Proto-Drago Fresche dai proto-drachi e dai proto-draghi delle Isole dei Draghi per Temnaayu dei Tuskarr di Iskaara.', 'Lascia che ti parli di un\'opportunità.\n\nI proto-drachi e i proto-draghi hanno una grande capacità di movimento con le loro ali. Per non parlare dell\'ossatura estremamente estendibile. Creiamo la maggior parte dei nostri aquiloni con cuoio tirato, ma con i proto-drachi che causano tutti questi problemi, se riuscissi a portarmi alcune delle loro ali, potrei creare degli aquiloni che sarebbero l\'invidia della tribù.', '', '', '', '', '', '', 47187),
(66363, 'itIT', 'Brocchieri del Basilisco', 'Ottieni 20 Pelli di Basilisco Rigide dai Basilischi delle Isole dei Draghi per Dhurrel dei Centauri Maruuk.', 'Le scaglie interconnesse sono la chiave per fermare una freccia. Gli scudi che facciamo sono i migliori nelle pianure, ma purtroppo sono a corto di pelli di basilisco per il mio prossimo ordine.\n\nHai dimostrato interesse nel conoscere di più sul nostro mestiere, recupera delle pelli di Basilisco dalle Isole dei Draghi e ti istruirò sulle nostre tecniche.', '', '', '', '', '', '', 47187),
(66356, 'itIT', 'Troncoferreo', '', '', '', '', '', '', '', '', 47187),
(66354, 'itIT', 'La scintilla', 'Ricostituisci le parti danneggiate della Pietra del Giuramento.', 'La forgia è pronta. Tutto ciò che serve ora è il fuoco.\n\nPosiziona i frammenti della Pietra del Giuramento danneggiata sulla forgia e Irathion creerà la scintilla per dare inizio al procedimento.', '', '', '', '', '', '', 47187),
(66353, 'itIT', 'Anomalie D.E.R.', 'Usa il D.E.R. per dissolvere tre anomalie arcane.', 'C\'è MOLTA energia arcana qui...\n\nMa il D.E.R. può aiutarci! È un dispositivo fantastico, è proprio nel nome: \"Dispositivo Eccezionale di Rannan\"! Serve a rilevare E dissipare l\'energia arcana.\n\nEcco... tienilo! Senti il POTERE nelle tue mani? No?\n\nBe\', ora che ce l\'hai, prendilo e dissipa quelle anomalie!', '', '', '', '', '', '', 47187),
(66352, 'itIT', 'Ciò che sa il nemico', 'Trova i documenti della Fiamma Frammentata e portali a Lathos.', 'È fondamentale determinare cosa abbia in mente di fare la Fiamma Frammentata in queste rovine e cosa significhi il picco di energia.\n\nLo faremo alla vecchia maniera: ricognizione e spionaggio.\n\nLe rovine sono invase dai devoti della Fiamma Frammentata. Sono sicuro che alcuni di loro hanno con sé ordini che potrebbero svelare i loro misteriosi obiettivi.\n\nDevi ottenere quei documenti a ogni costo!', '', '', '', '', '', '', 47187),
(66351, 'itIT', 'Fumo sulla montagna', 'Trova l\'aereo della Ricognitrice Yips.', '<Il Ricognitore Jeb guarda la cresta montuosa oltre l\'accampamento e annusa l\'aria.>\n\nNon mi piace. La Ricognitrice Yips avrebbe dovuto essere qui giorni fa. Mi avrebbe dovuto aiutare a insegnare ai nuovi esploratori come scalare questi pilastri in sicurezza.\n\nOra vedo del fumo in lontananza.\n\nNon mi piace per niente.', '', '', '', '', '', '', 47187),
(66349, 'itIT', 'Roccia d\'addestramento', 'Rimuovi $1oa rocce', 'Rimuovi quelle rocce!', '', '', '', '', '', '', 47187),
(66344, 'itIT', 'Col vento alle spalle', 'Cavalca con Gerithus e Merithra.', 'Quindi i Primalisti sono riusciti a rafforzarsi alleandosi al Clan Nokhud.\n\nSiamo stati in grado di tenerli a bada fino ad adesso, ma i Nokhud hanno portato una nuova arma: una balista ammazzadraghi. Temo che Solethus non sarà l\'ultimo drago a cadere vittima dell\'oscura magia della tempesta.\n\nVieni, ti porterò nel rifugio dei draghi al Santuario Ombroso. Puoi dirmi cosa sai dei Nokhud mentre la Khanam Matra raduna le truppe. Dobbiamo prepararci per la prossima mossa.', '', '', '', '', '', '', 47187),
(66340, 'itIT', 'Nel blu', 'Incontra Masud il Saggio al Crocevia Fluviale.', 'Abbiamo fatto la nostra parte. Anche se io devo restare qui per vegliare sulla Pietra del Giuramento e guidare lo Stormo dei Draghi Verdi, sappi che hai tutta la nostra gratitudine e fiducia.\n\nHo saputo che il Kirin Tor ha bisogno d\'aiuto per recuperare la Pietra del Giuramento Azzurra. Aiutandoli con la loro Pietra del Giuramento, saremo un passo più vicini a curare Azeroth.\n\nCerca Pakina e Masud il Saggio del Kirin Tor, ti daranno ulteriori istruzioni. Buon viaggio e sogni d\'oro, $n.', '', '', '', '', '', '', 47187),
(66339, 'itIT', 'Offensiva dei Nokhud: Il vento appartiene al cielo', 'Sconfiggi il Khan Balakar e salva Ohn\'ahra nella Offensiva dei Nokhud.', 'Il tuo tempo con noi è finito, $n, o ci aiuterai ancora?\n\nI miei esploratori riferiscono che Balakar si è ritirato nella sua roccaforte, dove tiene prigioniera Ohn\'ahra. È inaccettabile!\n\nNel frattempo, i suoi predoni Nokhud scorrazzano per le pianure seminando distruzione. Mentre noi li affrontiamo in battaglia, potresti infiltrarti nella Roccaforte dei Nokhud e salvare Ohn\'ahra? Lo farai, per noi?', '', '', '', '', '', '', 47187),
(66337, 'itIT', 'Solcatempeste', 'Sconfiggi Koroleth.', '$n, vieni qui! Siamo a un passo dalla vittoria!\n\nI ranghi dei Primalisti sono stati spezzati, ormai non combattono quasi più. Tutto ciò che abbiamo ottenuto ora dipende dalla battaglia finale contro il capo dei Primalisti, Koroleth.\n\nChiudiamo questa storia, tu e io, insieme! Alla battaglia, $gfratello:sorella;!', '', 'Questo capo dei Primalisti vuole distruggere il santuario dei Draghi Verdi!', 'Koroleth', '', '', '', 47187),
(66336, 'itIT', 'L\'isola di smeraldo', 'Incontra Merithra nel Bosco Antico.', 'Il tuo contributo non mi è sfuggito, mortale. È soprattutto grazie al tuo coraggio se siamo stati in grado di sconfiggere i Primalisti!\n\nHo invitato i Centauri nel Bosco Antico. Tu, insieme alla Khanam Matra e al suo popolo, meriti lo stesso onore.\n\nPercorri questo sentiero e supera lo specchio d\'acqua, passa sotto l\'arco e prosegui tra gli alberi. Ti aspetterò lì.', '', '', '', '', '', '', 47187),
(66335, 'itIT', 'Piloni segnalatori', 'Marchia i Piloni dei Primalisti con i Semi Incantati.', 'Ora che quelle vili armi sono state distrutte, lo Stormo dei Draghi Verdi può unirsi alla battaglia.\n\nAbbiamo molta più familiarità con la situazione a terra. Dobbiamo illuminare i bersagli così che Merithra e i suoi draghi possano attaccare dall\'alto.\n\nMerithra mi ha dato questi semi incantati. Posizionali vicino ai piloni dei Primalisti. Useremo la loro luce per richiamare gli attacchi dei draghi in volo.', '', '', '', '', '', '', 47187),
(66333, 'itIT', 'Giustizia per Solethus', 'Uccidi $1oa Guerrafondai Nokhud e distruggi $2oa Baliste Ammazzadraghi.', 'Finché ci sarà anche un solo Drago Verde ancora in vita, quei Primalisti non profaneranno impunemente il Bosco Antico.\n\nSiamo ansiosi di fare la nostra parte in questa battaglia, ma finché quelle baliste ammazzadraghi sono sul campo, non possiamo avvicinarci. I guerrieri più forti dei Nokhud le custodiscono, quindi dovrai abbattere anche loro.\n\nDistruggi le baliste e i Guerrafondai Nokhud, mortale. Elimina quella minaccia e i Draghi Verdi volgeranno le sorti della battaglia.', '', '', '', '', '', '', 47187),
(66331, 'itIT', 'Il fronte dei Primalisti', 'Parla con l\'Esploratrice Tomul, Ari e Belika, Ohn Seshteng e Merithra alla Cicatrice Tempestosa.', 'La Khanam Matra ci ha fatto sapere che è arrivata con le sue truppe ai Giardini di Smeraldo. Hanno localizzato Koroleth e i suoi Primalisti: sembra che una massiccia invasione nemica si stia radunando su una spiaggia a nord.\n\nLa Khanam Matra ha diversi esploratori che sorvegliano le posizioni strategiche intorno al campo di battaglia. Vai a raccogliere i loro rapporti, poi mi troverai con le mie truppe sul fronte di battaglia. La gloria ci attende e, se avremo successo in battaglia, assaporeremo la vendetta.', '', '', '', '', '', '', 47187),
(66329, 'itIT', 'Suonare il corno', 'Ascolta i piani di Balakar e Koroleth.', 'Perché avrebbero portato Ohn\'ahra qui? A meno che...\n\n$n! Non credo che Balakar intenda distruggere il Corno. Penso che sia una trappola! Dobbiamo trovare un modo per superare questo vento, subito!', '', '', '', '', '', '', 47187),
(66328, 'itIT', 'Drago Verde a terra', 'Incontra la Khanam Matra all\'Abbeveratoio.', 'Quei draghi sono scesi sulle pianure a ovest. Dobbiamo raggiungerli rapidamente prima che lo facciano i Nokhud.\n\nNon vorremmo che pensassero che tutti i Maruuk sono loro nemici a causa delle azioni di Balakar.', '', '', '', '', '', '', 47187),
(66327, 'itIT', 'Inseguire il vento', 'Ascolta il rapporto dell\'Esploratrice Tomul.', 'Dobbiamo prenderci un momento per fermarci ed esaminare la nostra strategia.\n\nAbbiamo bisogno della benedizione di Ohn\'ahra per suonare il Corno di Drusahl ed evocare i Draghi Verdi. Senza il loro aiuto, non possiamo vincere questa guerra. I Nokhud sono più numerosi degli altri clan e hanno i Primalisti dalla loro parte. E ora Koroleth ha catturato la nostra Madre del Vento! Dobbiamo trovare Ohn\'ahra prima che i Nokhud possano lanciare il loro attacco finale e circondare Maruukai.\n\nInvierò tutti i nostri esploratori, spero che non sia troppo tardi!', '', '', '', '', '', '', 47187),
(66326, 'itIT', 'I ferri del proprio mestiere', 'Ottieni $4oa Martello con Scala di Precisione, $3oa Incudine Bicorne d\'Ossidiana, $2oa Pinze d\'Acciaio Nero e $1oa Punteruoli di Artiglio di Drago.', 'Una fucina di questo potere ha bisogno di strumenti specializzati, in grado di sopportare il tremendo calore.\n\nMa i Djaradin hanno saccheggiato il posto e hanno rubato molti degli attrezzi di cui abbiamo bisogno per questo lavoro.\n\nSe puoi, recupera gli attrezzi, così possiamo tornare a lavorare per armare i nostri alleati.', '', '', '', '', '', '', 47187),
(66324, 'itIT', 'Mai dimenticati', 'Recupera oggetti e sopravvissuti all\'interno dell\'Asilo del Supporto.', 'L\'antidoto è pronto, usalo per cercare i sopravvissuti nell\'Asilo del Supporto. Fai in fretta, l\'effetto non durerà a lungo ed è probabile che tu debba riapplicarlo più volte.\n\nSe dovessi trovare qualcuno della mia gente ancora in vita, ti prego di portarlo in salvo.\n\nIn caso contrario, ti chiedo di recuperare i loro anelli per corno, così che i loro nomi possano essere onorati.\n\nAll\'interno forse troverai qualche prova su come questa infestazione possa aver avuto luogo.', '', '', '', '', '', '', 47187),
(66320, 'itIT', 'Il flusso del tempo', 'Raggiungi le Sabbie Mutevoli per parlare con Cromie.', 'I fili del tempo scorrono come un fiume, con molte curve e rami. A volte i flussi possono essere cambiati, ma qualsiasi anomalia ignorata può condannare il nostro destino a una falsa linea temporale.\n\nCi stiamo avvicinando a una di quelle anomalie. Ho inviato Cronormu alle Sabbie Mutevoli per investigare e risolvere qualsiasi problema dell\'unica vera linea temporale.\n\nPrevedo che il tuo aiuto sarà inestimabile.\n\nTi prego di aiutarci, incontra Cronormu.', '', '', '', '', '', '', 47187),
(66308, 'itIT', 'Alimentare il fuoco', 'Ottieni $1oa Carbone di Scheggia Cinerea.', 'La creazione di nuove armi e armature nella Forgia del Custode della Terra ci assicurerà la vittoria sui Djaradin.\n\nMa le fiamme della forgia devono restare alimentate costantemente. Il Carbone di Scheggia Cinerea fornirà il calore più intenso, necessario per forgiare le armi.\n\nPuoi trovare del Carbone di Scheggia Cinerea nei depositi e dagli elementali all\'interno della Riva Cinerea.', '', '', '', '', '', '', 47187),
(66299, 'itIT', 'L\'attesa detonaz... detOVAzione', 'Uccidi la Matriarca Strillastormo', 'Il prototipo ha funzionato! Eccellente!\n\nÈ giunta l\'ora di servire la portata principale. Questa volta, $gil cuoco:la cuoca; sarai tu!\n\nApporterò alcune piccole modifiche e ti preparerò di nuovo il travestimento. Poi tu prenderai il nostro capolavoro esplosUOVO, lo metterai in questo stufato rancido, raggiungerai la caverna della Matriarca, lo impiatterai e planerai via con tanto di esplosione alle spalle!\n\nSe tutto va come previsto, ci sarà pollo arrosto sul menù! Perché l\'esplosione la cuocerà a puntino. L\'hai capita?', '', 'La solitaria Matriarca delle Arpie Strillastormo! Soddisferai il suo vorace appetito con un bell\'esplosivo della professoressa Cinguetti o con la tua carne?', 'Matriarca Avethyra, Capo delle Arpie Strillastormo', '', '', '', 47187),
(66279, 'itIT', 'È arrivato l\'orologio', 'Porta l\'orologio da tasca a Orizmu nei Giardini.', 'Oh sì, questo orologio da tasca appartiene a uno dei Factotum che mi aiutano a occuparmi dei giardini. \n\nÈ uno dei figli di Nozdormu. Orizmu, credo? Non riesco a tenere a bada tutti questi bambini. La maggior parte dei giorni sta presso quella clessidra vicino all\'albero di Alexstrasza senza muoversi. O strizzare gli occhi.\n\nLa famiglia di Nozdormu è sempre stata strana, se vuoi un parere. Ma ti sarà grato se gli porterai questo.', '', '', '', '', '', 'Porta l\'orologio da tasca a Orizmu nei Giardini.', 47187),
(66278, 'itIT', 'Cianfrusaglie di un Draconide', 'Porta l\'orologio da tasca a Gryrmpech nei Giardini.', '<Tra i tanti mucchi di rottami giace un orologio da tasca scintillante. Forse Gryrmpech saprà cosa farne.>', '', '', '', '', '', 'Porta l\'orologio da tasca a Gryrmpech nei giardini.', 47187),
(66277, 'itIT', '[DNT] Making Quest', 'Uccidi $1oa Banditi.', 'Benvenuto $gavventuriero: avventuriera; alla tua prima missione! Oggi uccideremo dei maledetti banditi. Forza vai subito a farli fuori!', '', '', '', '', '', '', 47187),
(66270, 'itIT', 'Pesta-lo-Gnoll', 'Sconfiggi i sedicenti signori della guerra.', 'Oh, Luce... ce ne sono altri in arrivo! Com\'è potuto succedere?\n\nTutti i miei articolati piani! Giorni interi passati in questo lago rancido! Gli assassinii!\n\nTutto questo avrebbe dovuto gettarli nel caos e far crollare il loro insediamento, ma li abbiamo a malapena rallentati!\n\nForse... forse hai ragione, $n. Forse mi sbagliavo...\n\nNo! Impossibile! Ci siamo dentro fino al collo ormai.\n\nVa\'... occupati di questi nuovi arrivati, mi serve tempo per riprendermi.', '', '', '', '', '', '', 47187),
(66269, 'itIT', 'Giusto per sicurezza', 'Uccidi $1oa Elementalisti Zannatonante.', 'Uccidi chiunque abbia la parvenza di essere vagamente incline alla magia. O abbia capacità organizzative. O sembri troppo ambizioso.\n\nDavvero, mi affido al tuo intuito.\n\nIl tuo \"intuito\" ti dice di smettere di parlare con me? Dai, $C! Stanno... tramando qualcosa di terribile, ovviamente!', '', '', '', '', '', '', 47187),
(66268, 'itIT', 'La terza volta è quella giusta', 'Uccidi Graffiasangue.', 'Che cosa? Un altro Gnoll ha già preso il comando? Non dicevano che il potere logora? E che ne è stato del periodo di lutto, se non altro per salvare le apparenze?\n\nNon hanno il minimo senso della decenza? Un minimo di vergogna? Nessun rispetto per un piano ben progettato? Mi ero già organizzato!\n\nOccupati di questo Graffiasangue. Mi serve una pausa.\n\nE non ho bisogno delle tue insinuazioni, grazie molte!', '', 'Chi è morto e l\'ha nominato condottiero?', 'Graffiasangue', '', '', '', 47187),
(66267, 'itIT', 'Soccorso faunistico', 'Libera $1oa animali maltrattati.', 'Quei demoni! Una cosa è saccheggiare e uccidere, ma maltrattare gli animali?!? Non posso tollerarlo.\n\nQuegli Gnoll hanno piazzato trappole per animali che usano per nutrire le loro bavose iene. Trova un modo per liberare i loro pelosi prigionieri e mostra a quei furfanti come un vero Mago tratta gli animali!\n\nCerto che è un ragionamento etico, tenendo in considerazione le mie azioni. Cosa stai cercando di insinuare esattamente?', '', '', '', '', '', '', 47187),
(66266, 'itIT', 'Luridi cani', 'Uccidi $1oa Matriarche Iene e $2oa Iene Meticce.', 'Quei maledetti sacchi di pulci, le Iene Meticce allevate dagli Gnoll, devono sparire! Non solo sono a dir poco maleducate, se ti raccontassi dove le ho viste fare i propri bisogni non mi crederesti... ma riescono a fiutare il mio odore infischiandosene di qualsiasi illusione.\n\nFai un favore al mondo civilizzato e toglile dalla circolazione.', '', '', '', '', '', '', 47187),
(66265, 'itIT', 'A chi tocca adesso?', 'Uccidi Storcidenti.', 'Ah, sembra che un altro Gnoll si sia fatto avanti per assumere il comando. Proprio come mi aspettavo. Già.\n\nAvere un fidato Vice-Signore della Guerra per assicurare la prosecuzione del governo è perfettamente sensato, non trovi? Basterà colpirli più a fondo per far crollare il loro apparato burocratico, no?\n\nCosa? Dovrei prendermi un attimo per riflettere sui miei pregiudizi verso gli Gnoll? Ridicolo! Sono Gnoll!\n\nPresto però, bisogna battere il ferro finché è caldo, uccidi Storcidenti prima che organizzino un\'elezione!', '', 'Comunque, quante iene può avere un Gnoll?', 'Storcidenti', '', '', '', 47187),
(66264, 'itIT', 'Senz\'armi e senza rabbia', 'Ottieni $1oa Armamenti dei Masticaossa.', 'C\'è una quantità di armi piuttosto inquietante che circola là sopra. Fargliene sparire qualcuna dovrebbe contribuire a calmare un po\' le acque. O almeno i miei nervi.\n\nCosa potrebbero fare senza armi, dopo tutto? Attaccare a mani nude? Ah ah!', '', '', '', '', '', '', 47187),
(66263, 'itIT', 'Un approccio di precisione', 'Uccidi Sferzapugni.', 'Gli Gnoll sono orride creature, puzzolenti, si grattano in continuazione ridendo e fissandoti, e non accennano certo a diminuire in numero. Noi, e con noi intendo tu, potremmo anche sterminarli senza sosta per giorni interi, ma non otterremo nulla. Non possono restare qui.\n\nDobbiamo tagliare la testa al toro! Elimina il loro comandante e si ritroveranno inerti, in preda all\'indecisione e alla disperazione.\n\nCome sarebbe a dire perché dovremmo farlo? Non è ovvio? Sono Gnoll! Quale altre ragione può servirti?', '', 'Che speranze hanno senza il loro amato capo?', 'Sferzapugni', '', '', '', 47187),
(66262, 'itIT', 'Ripulitura dell\'acqua di rifiuto', 'Rimuovi $1oa Pile Marcescenti dal lago.', 'Per prima cosa, devo riavere la mia base operativa! Ma con gli elementali che scorrazzano qui attorno è estremamente difficile guadagnare terreno.\n\nOvviamente è colpa di quei maledetti Gnoll.\n\nGli Gnoll hanno gettato nel lago così tanti rifiuti, scarti vari e solo la Luce sa cos\'altro, che hanno fatto impazzire gli elementali.\n\nSii gentile e dai una ripulita eliminando le schifezze peggiori, prima che la situazione precipiti. E, soprattutto, prima che sporchino irreparabilmente le mie vesti!', '', '', '', '', '', '', 47187),
(66261, 'itIT', 'Un piccolo contrattempo', 'Raggiungi Detry.', 'Ah, $gavventuriero:avventuriera;! Sei proprio il tipo di persona ben equipaggiata che speravo di incontrare.\n\nSono in questo posto sperduto in missione per il Kirin Tor e, mentre sistemavo il mio campo, sono stato attaccato da alcuni sporchi, rognosi Gnoll.\n\nIn realtà, un numero piuttosto allarmante di Gnoll si è radunato nelle vicinanze e sembra siano abbastanza da rappresentare una minaccia per la Vastità.\n\nMa non temere, ho un piano! Incontriamoci in quel lago laggiù e ti spiegherò tutto.', '', '', '', '', '', '', 47187),
(66259, 'itIT', 'Una bufera di pessime notizie', 'Consegna il tuo rapporto alla Khanam Matra a Maruukai.', '$n, dobbiamo raccontare alla Khanam Matra tutto quello che è successo, inclusa la cattura di Ohn\'ahra.\n\nDovrai andare il prima possibile a Maruukai, senza di me: cadendo ho subito delle ferite e ti rallenterei.\n\nNon preoccuparti per me. Ci vedremo più tardi. Ora vai!', '', '', '', '', '', '', 47187),
(66258, 'itIT', 'Oh, no, Ohn\'ahra!', 'Sconfiggi i nemici mentre Boku prova a liberare Ohn\'ahra.', 'Quella Primalista sta bloccando Ohn\'ahra, ma a fatica. Non sembra accorgersi di noi.\n\nLa Khan Tigari direbbe: \"Anche la brezza più lieve può far cadere un sasso in bilico\". Se riuscissi a interrompere il suo incantesimo, anche solo un po\', Ohn\'ahra potrebbe riuscire a liberarsi.\n\nTu occupati di distrarre le guardie, ho un\'idea!', '', '', '', '', '', '', 47187),
(66257, 'itIT', 'Stregoneria volatile', 'Usa il Totem del Vento di Boku per distruggere i Carri dei Nokhud.', 'Si dice che Ohn\'ahra abbia infuso la lancia del nostro antenato, Maruuk, con il suo potere. Khan Balakar deve aver raccontato questa leggenda ai Primalisti.\n\nHanno rubato la magia alle Figlie di Ohn\'ahra, l\'hanno inquinata con la magia della tempesta e l\'hanno infusa nei dardi di balista. Perché i Nokhud hanno bisogno di armi simili?\n\nDobbiamo scoprirlo subito. I dardi sono stati caricati su dei carri da trasporto. Prendi i miei totem e piazzane uno sopra ogni carro che incontri; la mia magia del vento li farà a pezzi.', '', '', '', '', '', '', 47187),
(66256, 'itIT', 'Uguaglianza rapace', 'Libera $1oa Figlie di Ohn\'ahra ed elimina $2oa Primalisti presso l\'Altura Cantavento.', 'Abbiamo scoperto perché i Nokhud vogliono totem mistici: possono essere usati per catturare le Figlie di Ohn\'ahra. Sebbene i Nokhud abbiano rubato i totem, sono i Primalisti quelli che si celano dietro a questo abominio.\n\nLe Figlie di Ohn\'ahra sono sacre ohuna, benedette dalla stessa Madre del Vento. Ti prego, $n, libera ogni ohuna che vedi! E se ti imbatti in qualche Primalista...\n\n<Boku si interrompe, ma la sua espressione è di cupa determinazione.>', '', '', '', '', '', '', 47187),
(66254, 'itIT', 'Mistico pessimistico', 'Piazza i Totem del Potenziamento attorno a Boku.', 'Guerra? Draghi? Hai bisogno che contatti Ohn\'ahra?\n\nNon posso! Non riesco a sentire la sua voce. Sono solo un iniziato e sembra che Ohn\'ahra mi abbia negato le sue benedizioni. Forse non sono abbastanza bravo...\n\n<Boku inizia a frugare in una borsa.>\n\nQuando la mia mentore mi ha assegnato a questo clan, mi ha regalato questi totem. Ha detto che mi avrebbero potenziato se mai avessi dubitato di me stesso.\n\nMi aiuterai a piazzarli? Cercherò di invocare Ohn\'ahra ancora una volta.', '', '', '', '', '', '', 47187),
(66252, 'itIT', 'A rapporto!', 'Torna a Valdrakken e fai rapporto alla Capitana Drine.', 'La minaccia dei Primalisti sì è affievolita, $n. Presto il nostro esercito ci raggiungerà da Valdrakken e ripulirà ciò che resta.\n\nDovresti tornare alla città e informare la Capitana Drine sull\'accaduto. Sicuramente le interesserà sapere cos\'è successo al Comandante Eranog.\n\nGrazie ancora, $n, per tutto.', '', '', '', '', '', '', 47187),
(66251, 'itIT', 'Vigile del fuoco', 'Uccidi Magmartiglio.', 'Il Comandante Eranog ci ha traditi e ha lasciato questa bestia al comando.\n\nHai già fatto così tanto per me, ma non riesco ad affrontare quel mostro nelle mie condizioni attuali.\n\nTi prego, fai quest\'ultima cosa per me e assicurati che il Cancello della Rocca del Sud non cada nelle mani dei Primalisti.\n\nDobbiamo uccidere il loro capo!\n\nAiutami, $n.', '', 'Il Capo dei Primalisti sta attaccando il Cancello della Rocca del Sud.', 'Magmartiglio', '', '', '', 47187),
(66250, 'itIT', 'Dov\'è il Capo?', 'Accompagna il Guardiano Velomir ed esamina la Torre d\'Osservazione presso il Cancello della Rocca del Sud.', 'Questa è l\'unica parte della fortezza dove non abbiamo ancora cercato, $n. Se il Comandante Eranog si trova da qualche parte, dev\'essere qui.\n\n<Velomir guarda verso la porta vicina.>\n\nVediamo cosa riusciamo a scoprire.', '', '', '', '', '', '', 47187),
(66249, 'itIT', 'Cieli sgombri', 'Controlla uno Scorpione d\'Assedio e usalo per liberare i cieli dai Purosangue Giuramagma.', 'Hai fatto bene a raccogliere quelle lance e la corda, così possiamo assicurarci che quei Primalisti non dominino più i cieli!\n\nC\'è una piattaforma sulla scalinata con diversi Scorpioni d\'Assedio. Usando la corda per incordare gli archi e le lance come munizioni, dovresti riuscire a colpire i draghi dei Giuramagma in aria!\n\nSe riesci a liberartene, il sentiero verso la guglia sarà sicuro per continuare la ricerca del Comandante Eranog.', '', '', '', '', '', 'Incontra il Guardiano Velomir sulla torre d\'osservazione presso il Cancello della Rocca del Sud.', 47187),
(66248, 'itIT', 'Ricollegare il tutto', 'Recupera $1oa Rotoli di Corda Pesante', 'Sembra che questa bobina di corda pesante sia in buone condizioni.\n\nIl Guardiano Velomir ha detto di tenere gli occhi aperti e trovare materiali utili, forse se trovassi qualche altra bobina potrebbe fargli comodo.', '', '', '', '', '', '', 47187),
(66247, 'itIT', 'Arma Leggermente Usata', 'Raccogli $1oa Lance dei Giuramagma.', 'Questa lancia sembra in buono stato, considerate le condizioni del suo precedente proprietario.\n\nIl Guardiano Velomir ha detto di tenere gli occhi aperti per trovare materiali utili, forse si possono ottenere altre lance come questa dai Giuramagma.', '', '', '', '', '', '', 47187),
(66246, 'itIT', 'La nebbia della battaglia', 'Cerca i membri dell\'unità del Guardiano Velomir presso il Cancello della Rocca del Sud.', 'L\'attacco dei Primalisti è arrivato all\'improvviso. La mia unità ha tentato di trovare il nostro capo, il Comandante Eranog, ma prima che potessimo arrivare dall\'altra parte della guarnigione siamo stati tagliati fuori.\n\nDurante la battaglia, il Sergente Tagrik, il capo della mia unità, ha tenuto a bada tre Primalisti da solo, mentre Kaora, Mikor e io combattevamo al suo fianco.\n\nLe loro urla sono l\'ultima cosa che ricordo prima di cadere.\n\nTi prego, $R, se trovi qualche traccia della mia unità fammi sapere cos\'è successo.', '', '', '', '', '', '', 47187),
(66245, 'itIT', 'Ricordare i caduti', 'Ottieni $1oa Sigilli della Guarnigione della Rocca del Sud.', 'Così tanti dei miei compagni sono caduti.\n\nTi prego, raccogli i loro sigilli identificativi in modo che i loro nomi non vengano dimenticati.', '', '', '', '', '', '', 47187),
(66244, 'itIT', 'A Valdrakken', 'Raggiungi Valdrakken e incontrati con Alexstrasza la Protettrice della Vita.', 'Grazie a te, abbiamo evitato una catastrofe.\n\nAd ogni modo, dovremmo riunirci con gli altri Aspetti per metterli al corrente di cosa è successo qui.\n\nTi prego, incontriamoci al Seggio degli Aspetti all\'interno di Valdrakken. Sicuramente gli altri avranno informazioni riguardo alle intenzioni di Raszageth e dei suoi Primalisti.\n\nC\'è un passaggio per Thaldraszus a nord est, è un volo dal panorama stupendo, ma ti prego di non tardare troppo.', '', '', '', '', '', '', 47187),
(66242, 'itIT', 'Controllo meteorologico', 'Uccidi $1oa Essenze Tempestose e $2oa Invocatori delle Tempeste Iniziati.', 'Questa tempesta innaturale è carica di magia. A quanto pare, i Nokhud stanno imparando a manipolare la sacra essenza dell\'Altura Cantavento per creare elementali della tempesta. Alcuni hanno avuto più successo di altri.\n\n<Boku fa un gesto allo sfortunato iniziato Nokhud che fuma ancora per le ustioni dei fulmini.>\n\n$n, non possiamo permettergli di continuare.', '', '', '', '', '', '', 47187),
(66241, 'itIT', 'Rally di Thaldraszus', '', 'Vola attraverso i cerchi che contrassegnano il percorso.', '', '', '', '', '', '', 47187),
(66239, 'itIT', 'Decadimento in espansione', 'Incontra Brena all\'avamposto commerciale.', '<Brena rigira varie volte il totem di Scrocchiazampa tra le sue grosse mani.>\n\nScrocchiazampa è una pedina. Non è lui la fonte di questa putrefazione. Dobbiamo trovarla, prima che il decadimento si diffonda ulteriormente.\n\nI Tuskarr più vicini sono stanziati in un avamposto commerciale oltre il ponte sulla strada per Iskaara.\n\nDovremmo controllare che stiano bene... e in fretta.', '', '', '', '', '', '', 47187),
(66237, 'itIT', 'Alleati spirituali', 'Parla con le autorità.', 'Il nostro arrivo non è passato inosservato.\n\nPrima di entrare, lasciami parlare con loro. Ho dei trascorsi col concilio.\n\nDopo avremo tutto il tempo per i convenevoli.', '', '', '', '', '', '', 47187),
(66236, 'itIT', 'Il vento porta Notizie', 'Incontra Boku all\'Altura di Cantavento.', 'I Nokhud stanno prendendo i totem. I Primalisti stanno catturando le ohuna. Ohn\'ahra tace.\n\nQuali che siano i piani dei Nokhud, dobbiamo sventarli. Tu e Boku dovete andare all\'Altura Cantavento, è probabile che i nostri nemici siano già lì.\n\nCerca Ohn\'ahra. Se le sue figlie sono in pericolo, senza dubbio andrà da loro e noi dovremo aiutare. La Madre del Vento è potente, ma temo ciò che questi Primalisti sono capaci di fare.', '', '', '', '', '', 'Incontra Boku all\'Altura di Cantavento.', 47187),
(66232, 'itIT', 'Conteggio che sale', 'Raccogli $1oa Fiocchi di Cristallo sulla Riva dei Gorloc.', 'Siamo felici di accoglierti con i tuoi amici nel nostro piccolo insediamento, anche se a dire il vero nessuno ci ha chiesto nulla... Comunque sia, da $gbuon vicino:buona vicina; saresti così gentile da portarmi dei Fiocchi di Cristallo, nel caso fossi $gdiretto:diretta; alle sorgenti? Li usiamo per conservare ogni genere di cosa. Da queste parti sono fondamentali per conservare il cibo.\n\nI Gorloc più grandi ne sono praticamente ricoperti. Magari puoi recuperare qualche fiocco da loro?', '', '', '', '', '', '', 47187),
(66230, 'itIT', 'Una richiesta sospetta', 'Recupera il \"Libro Mastro\" di Alvi e riportalo alla Vigilante Alvi.', 'I Tarasek hanno preso tutto quello che potevano, incluso il mio libro mastro degli esploratori.\n\nQueste lucertole troppo cresciute accumulano monili e trofei a decine. Sono sicura che hanno nascosto il mio libro mastro da qualche parte. Potresti tenere gli occhi aperti mentre attraversi il passo?\n\nOh, e $n? Se dovessi trovarlo, non leggerlo. Il contenuto è... diciamo, personale.', '', '', '', '', '', '', 47187),
(66228, 'itIT', 'Accampamento Antonidas', 'Incontra Noriko l\'Onnisciente all\'Accampamento Antonidas.', 'Il Kirin Tor ha stabilito il nostro accampamento principale a sud di qui: si tratta dell\'Accampamento Antonidas.\n\nCredo che Noriko e Khadgar ora si trovino lì, per reclutare avventurieri pronti ad aiutare Kalecgos a riconquistare la Pietra del Giuramento Azzurra.\n\nSe vuoi darci una mano, vai lì.', '', '', '', '', '', 'Incontra Noriko l\'Onnisciente all\'Accampamento Antonidas.', 47187),
(66227, 'itIT', 'Pesca rilassante', 'Pesca $3oa Pesciolini dalla Coda Blu nella Zona di Pesca di Khuri.', 'Un altro paio di mani! Mi farebbe comodo un po\' di aiuto nell\'acciuffare abbastanza pesce da portare a casa per un pasto.\n\nQuesti membri del Kirin Tor sembrano preoccupati da qualcosa in questa zona chiamato \"anomalie magiche\", non so cosa voglia dire.\n\nSentitevi liberi di restare tutto il tempo che volete, purché aiutiate.\n\nPrendi una canna da pesca e mettiti a pescare, l\'unione fa la forza!', '', '', '', '', '', '', 47187),
(66226, 'itIT', 'Compagni di sostegno emotivo', 'Salva le creature innocenti dai Nokhud al Rifugio del Torrente.', 'Ti prego, non farmi del male...\n\nCosa? Ah, sei qui per aiutare? Allora devi salvare gli animali!\n\nI Nokhud hanno attaccato senza preavviso. Siamo fuggiti tutti per metterci in salvo! Io ho trovato rifugio nel lago.\n\nGli animali! Li abbiamo lasciati indietro. Ti prego, ti prego, salva quelle creature. Chissà quali crudeltà i Nokhud hanno in serbo per loro.', '', '', '', '', '', '', 47187),
(66225, 'itIT', 'Trovare i Totem', 'Raccogli $1oa Cataste di Totem dai Nokhud al Rifugio del Torrente.', 'Boku ha chiesto perché ho inviato un messaggio chiamando tutti i mistici al Rifugio del Torrente.\n\nNon ho inviato alcun messaggio. Balakar deve aver attirato i miei mistici in una trappola per paralizzare il Clan Ohn\'ir.\n\nMa potrebbe esserci un secondo motivo. I Nokhud stanno raccogliendo tutti i totem mistici che riescono a trovare. Questi totem sono benedetti da Ohn\'ahra.\n\nLe motivazioni di Nokhud non sono chiare, ma non possiamo permettere loro di prendere i doni di Ohn\'ahra. Recupera quanti più totem possibili.', '', '', '', '', '', '', 47187),
(66224, 'itIT', 'Mistico mistero', 'Incontra Boku e vai al Rifugio del Torrente.', 'Mi dispiace, non mi è stato possibile comunicare con Ohn\'ahra. Avrai bisogno di qualcun altro per soddisfare la richiesta della Khanam Matra.\n\nDiversi giorni fa, i miei compagni mistici sono stati chiamati al Rifugio del Torrente su richiesta urgente della Khan Tigari. Dovrebbero essere ancora lì.\n\nCi vediamo fuori città, il minimo che posso fare è mostrarti la strada.', '', '', '', '', '', '', 47187),
(66223, 'itIT', 'Possiamo tenerlo?', 'Porta a Neelo $1oa Pescegelido preso da un mercante di Iskaara o pescato nell\'oceano delle Isole dei Draghi.', 'Sta cercando di mangiarci solo perché ha una fame esagerata!\n\nPesce! Nessuno può rifiutare del succulento pesce freddo crudo!\n\nIl pescegelido, poi, è il massimo. Si può pescare ovunque nell\'oceano! Se non dovessi riuscire a pescarne, Jinkutuk di Iskaara te ne venderà un po\'.\n\nPortamene così tanto da fargli passare la fame!', '', '', '', '', '', '', 47187),
(66222, 'itIT', 'La Quiete prima della Tempesta', 'Comunica gli ordini di Jebotai ai cittadini di Teerakai.', 'I Nokhud sono potenti e hanno molti alleati. Ci vorranno tutte le nostre forze per resistergli.\n\n$n, hai la fiducia della Khanam Matra. I suoi ordini erano di radunare i nostri amici e preparare la nostra gente.\n\nHo bisogno del tuo aiuto: cerca Hojin per mobilitare il resto della Guardia del Khan. Avvisa l\'Esploratrice Khenyug di possibili incursioni dei Nokhud. Informa Agura di aspettarsi dei feriti e riferisci a Gensai di preparare le provviste.\n\nQuanto ai mistici, credo che se ne siano andati di recente. Vedrò se ne rimane qualcuno a Teerakai.', '', '', '', '', '', '', 47187),
(66221, 'itIT', 'L\'avventura continua', 'Parla con Alexstrasza presso il Seggio degli Aspetti a Valdrakken.', 'Con la Pietra del Giuramento di Bronzo rigenerata, Alexstrasza può procedere con il suo piano.\n\nRaggiungi Valdrakken, $n. Vorrà sapere del tuo successo.', '', '', '', '', '', '', 47187),
(66218, 'itIT', 'Canaglie all\'impazzata', 'Trova Neelo e Nau.', 'Salve di nuovo.\n\nPotresti fare un favore a me e Norukk? I nostri piccoli, Neelo e Nau, sono fuori a giocare. Sanno che è ora di rientrare.\n\nIo ho da fare, per favore, vai a cercarli. Dubito che siano in pericolo, i miei piccoli sanno cavarsela da soli.', '', '', '', '', '', '', 47187),
(66217, 'itIT', 'RICERCATO: Krojek il Predatore della Costa', 'Uccidi Krojek il Predatore della Costa', 'Ormai sono diversi anni che teniamo sotto osservazione lo squalo gigante noto con il nome di Krojek, in attesa del momento giusto per dargli la caccia.\n\nSembra che stia spostando la sua area di caccia sempre più vicino alla riva. Questo significa che il momento di agire è arrivato. Raduna il tuo gruppo di caccia ed eliminalo!', '', 'Un tempo punto di riferimento dell\'ecosistema locale, il Predatore della Costa ha spostato la sua area di caccia troppo vicino a Iskaara.', 'Krojek il Predatore della Costa', '', '', '', 47187),
(66213, 'itIT', 'L\'intreccio di una storia', 'Racconta all\'Anziana Poa una storia a base di pesce.', 'La mia adorata moglie, Poa, è un\'eccellente cantastorie.\n\nMa ormai sono trent\'anni che racconta sempre le stesse! Ti prego, $c, parla con Poa e raccontale qualcosa di nuovo.\n\nCome dici? Le tue avventure? Non essere $gridicolo:ridicola;, non mi interessa quella roba! Le storie migliori sono quelle che parlano di pesce. Raccontale una storia sui pesci, a costo di inventartene una!', '', '', '', '', '', '', 47187),
(66212, 'itIT', 'Pesca: Falena di Mare', 'Pesca $1oa Falene di Mare dall\'oceano che circonda le Isole dei Draghi.', 'Non c\'è NESSUNO che sa più COME SI PESCA?\n\n<Lukoturukk agita i baffi con rabbia.>\n\nTu, con la faccia, vammi a prendere del pesce. Del BUON pesce. E non voglio sentir fiatare!', '', '', '', '', '', '', 47187),
(66211, 'itIT', 'Conca dei Felcepelle: Alla fonte', 'Entra nella Conca dei Felcepelle e affronta la Decatriarca Occhiofurioso.', 'Non potremo mai ringraziarti abbastanza per aver respinto gli Gnoll di Felcepelle. \n\nMa continuano ad accumulare potere e ad assorbire la loro malsana magia del decadimento da una fonte celata nel cuore della Conca dei Felcepelle. E come se non bastasse, sono settimane che non abbiamo notizie dei Tuskarr che risiedono in quella zona!\n\nTemo stia accadendo qualcosa di terribile. Dobbiamo proteggere il nostro mondo. Per favore, raduna le tue forze, trova la nostra gente e cerca di fermare il decadimento!', '', '', '', '', '', '', 47187),
(66210, 'itIT', 'Raduna la famiglia', 'Raccogli $1oa Offerte Funebri in giro per Iskaara, quindi riponile nella Barca Funebre.', 'Il tuo amico Kalecgos desidera discutere delle linee di faglia, ma dobbiamo anche occuparci dei preparativi per il funerale.\n\nMentre io parlo con lui, potresti raccogliere le ultime offerte a Iskaara per poi riporle nella Barca Funebre, al fianco del caro vecchio Ponoliak?\n\nSpero che tu riesca a prenderti un attimo di pausa per goderti le meraviglie della città! La mia gente ti accoglierà calorosamente, a maggior ragione dopo l\'aiuto che ci hai dato a Felcepelle.', '', '', '', '', '', '', 47187),
(66206, 'itIT', 'Nozdormu, sono qui per negoziare', '', '', '', '', '', '', '', '', 47187),
(66201, 'itIT', 'Zoccoli di guerra', 'Vai a Teerakai e consegna il messaggio della Khanam Matra a Jebotai della Guardia del Khan.', 'Balakar schiererà le sue forze per la guerra. Farò lo stesso, ma siamo in inferiorità numerica.\n\nI draghi hanno chiesto il nostro aiuto e insieme combatteremo ad armi pari. Per rispondere alla loro richiesta di alleanza, devo suonare il Corno di Drusahl, ma ho bisogno della benedizione di Ohn\'ahra. Mi aiuterai?\n\nVai a Teerakai e consegna la mia dichiarazione di guerra al mio luogotenente, Jebotai. Schiererà le mie forze e ti indirizzerà ai mistici che possono trovare Ohn\'ahra.', '', '', '', '', '', 'Vai a Teerakai e consegna il messaggio della Khanam Matra a Jebotai della Guardia del Khan.', 47187),
(66196, 'itIT', 'Uno starnazzo d\'aiuto', 'Riporta l\'Anatroccolo Imbollato all\'Accampamento degli Ecologi.', '<Questo anatroccolo si agita freneticamente all\'interno della bolla, starnazzando per la paura.>\n\n<Forse gli ecologi sanno come aiutarlo?>', '', '', '', '', '', 'Riporta l\'Anatroccolo Imbollato all\'Accampamento degli Ecologi.', 47187),
(66187, 'itIT', 'Mordigan il Folle e il Re di Cristallo', 'Decristallizza Mordigan Boccaferro sulla Riva dei Gorloc.', 'Ho esplorato il perimetro. Se Mordigan si trova qui da qualche parte, sarà certamente dentro questa caverna.\n\n<Dall\'entrata della caverna si sente l\'eco di imprecazioni soffocate e insulti provenienti dall\'interno.>\n\nÈ sicuramente dentro questa caverna.\n\nLOU-C ha detto che questi cristalli sono in grado di causare una grave disidratazione. Vedi se riesci a separarlo dai suoi... reperti geologici. Cerca di non fargli troppo male.\n\nNel suo campo gode di un certo rispetto.', '', '', '', '', '', 'Parla con Aelnara.', 47187),
(66177, 'itIT', 'Nessun Nano verrà abbandonato', 'Segui il percorso di Mordigan Boccaferro lungo la Riva dei Gorloc.', 'Questi livelli di sale sono alle stelle! Dobbiamo trovare Mordigan e tirarlo fuori da lì, ormai sarà così disidratato da rischiare la vita.\n\nSi è allontanato solo da un paio d\'ore. Vedi se riesci a capire in che direzione è andato quel vecchio Nano brontolone!', '', '', '', '', '', 'Trova Aelnara a Riva dei Gorloc.', 47187),
(66176, 'itIT', 'Sperimentazione elementale', 'Conduci $1oa esperimenti elementali sulla Riva dei Gorloc.', 'Vai a condurre degli esperimenti sugli Elementali dell\'Acqua che stanno molestando i Gorloc!', '', '', '', '', '', 'Ottimo lavoro!', 47187),
(66175, 'itIT', 'Esperimento sul campo', 'Aiuta LOU-C a eseguire i suoi test nella Nicchia del Baleniere.', 'Grazie a te, il nostro rilevamento geologico può definirsi operativo al 96%!\n\n<LOU-C inarca le sopracciglia.>\n\nQueste sono percentuali da principianti.\n\nAiutami ad analizzare i campioni che hai raccolto con il mio Geoscansionatore 289-07. Dovrebbe fornirci un\'idea di base su quello che sta succedendo sull\'altopiano.', '', '', '', '', '', 'Parla con LOU-C Frizzabuglio nella Nicchia del Baleniere.', 47187),
(66169, 'itIT', 'La vendetta è un piatto che va servito caldo', 'Uccidi $1oa Primalisti Giuramagma all\'interno del Cancello della Rocca del Sud.', 'I Primalisti ci hanno colti di sorpresa.\n\n<Velomir sputa con disgusto.>\n\nI miei compagni sono stati fatti a pezzi da questi mostri. Sarei morto anche io, se non fosse stato per te.\n\nIn lontananza riesco ancora a sentire i suoni della battaglia. Forse qualcuno è ancora vivo, forse persino il Comandante Eranog.\n\nAiutami, crea un diversivo, così che io possa dirigermi verso una posizione più vicina.\n\nUccidere alcuni di questi cosiddetti \"Giuramagma\" sarebbe perfetto.', '', '', '', '', '', '', 47187),
(66167, 'itIT', 'Problemi a sud', 'Raggiungi la Guarnigione della Rocca del Sud.', 'In base alle tue scoperte, sospetto che i Primalisti stiano attaccando la Guarnigione del Comandante Eranog alla Rocca del Sud. I miei Giurascaglia non possono lasciare la città, è esattamente quello che sperano i Primalisti.\n\nHo nuovamente bisogno del tuo aiuto, $n.\n\nVai alla Rocca del Sud, scopri quale tipo di forze stiamo affrontando e, se possibile, mettiti in contatto con i guardiani della guarnigione.', '', '', '', '', '', '', 47187),
(66166, 'itIT', 'Occhi e Orecchie', 'Trova indizi presso Valdrakken.', 'I Primalisti hanno sparso la loro propaganda tra i cittadini di Valdrakken. \n\nI nostri nemici sono troppo furbi per parlare in presenza dei miei Giurascaglia, ma forse tu potresti avvicinarti abbastanza per origliare le loro conversazioni e vedere se c\'è qualcosa di interessante da scoprire.\n\nHo segnato alcune posizioni sulla mappa per investigare ulteriormente. \n\nPrendi questa pietra incantata, finché la terrai a portata di mano, potremo comunicare.\n\nSei $gpronto:pronta;?', '', '', '', '', '', '', 47187),
(66164, 'itIT', 'Dita viscide', 'Recupera $1oa Parti Rubate sulla Riva dei Gorloc.', 'Ora che Mordigan è a leccare le sue rocce, possiamo occuparci del nocciolo del problema...\n\nQuei perfidi uomini pesce hanno rubato le mie parti!\n\nEravamo in questo piccolo e insignificante villaggio da poco più di un\'ora e BAM! Gorloc ovunque! Rowe urlava, Aelnara anche e io me ne andavo in giro roteando la mia chiave meccanica come una Gnoma impazzita!\n\nVedi se riesci a risolvere la situazione e recuperare alcune delle mie parti!', '', '', '', '', '', '', 47187),
(66163, 'itIT', 'Senza un posto dove nascondersi', 'Uccidi $2oa Infiltrati Primalisti presso Valdrakken.', 'Ti do il benvenuto a Valdrakken, prode $R.\n\nC\'è un\'aria un po\' pesante in città. No, non mi riferisco all\'afa.\n\nI Primalisti sono in agguato, fomentando il dissenso tra i cittadini della nostra città...\n\nI nostri nemici sono furbi e si travestono da cittadini per nascondersi dai Giurascaglia. Sanno come evitare le mie guardie, ma non sospetteranno di $guno straniero:una straniera;.\n\nPrendi questa gemma Occhio di Drago, ti aiuterà a vedere attraverso i loro travestimenti.\nVai, scovali e uccidi questi infiltrati!', '', '', '', '', '', '', 47187),
(66159, 'itIT', 'Un messaggio davvero terribile', 'Parla con Alexstrasza al Seggio degli Aspetti presso Valdrakken.', 'Kalecgos non ha intenzione di parlare di quello che è successo nella Vastità Azzurra fino al tuo arrivo.\n\nDi qualunque cosa si tratti, solo a pensarci mi vengono i brividi, $n.', '', '', '', '', '', '', 47187),
(66156, 'itIT', 'Popolare con la Spedizione delle Scaglie di Drago', 'Parla con la Catalogatrice Jakes al Campo delle Scaglie di Drago.', 'Le tue gesta non sono passate inosservate e continui a dimostrare di essere all\'altezza dei più grandi esploratori!\n\nTorna al Campo delle Scaglie di Drago: ho preparato alcune provviste per aiutarti a continuare l\'esplorazione.', '', '', '', '', '', '', 47187),
(66155, 'itIT', 'Regata sulle rapide di Ruriq', 'Naviga sulla Saltafiumi lungo il fiume.', 'Non mi aspettavo l\'approvazione di mio fratello... ma la cosa mi rende comunque felice. \n\nÈ giunto il momento! Vediamo se il nostro duro lavoro ha dato i suoi frutti!\n\nRaggiungimi a bordo della Saltafiumi, $n: salperemo sul fiume e durante il viaggio prenderemo del pesce per Iskaara!', '', '', '', '', '', '', 47187),
(66154, 'itIT', 'Campioni di salivazione', 'Raccogli $1oa Campioni di Saliva sulla Riva dei Gorloc.', '<Il non morto rinsecchito si stringe l\'attaccatura del naso con le dita e sospira profondamente.>\n\nQuesto avrà un impatto tutt\'altro che positivo sul mio curriculum. Non si sa come, ma in un singolo giorno siamo riusciti a provocare i Gorloc locali, perdere metà del nostro equipaggiamento e ora siamo anche a corto di un Nano. \n\nIn questa situazione, il protocollo ci impone di essere il più efficienti possibile. Elimina un po\' dei nostri nemici dentati e già che ci sei portami la loro saliva per ulteriori analisi.\n\nSolo roba buona, mi raccomando.', '', '', '', '', '', '', 47187),
(66152, 'itIT', 'Senza meta', 'Incontra Garz al Campo Che Non C\'è.', 'Non possiamo restare qui.\n\nNon so che fare, dove andare...\n\nTorneremo al Campo Che Non C\'è. I Tuskarr devono sapere cos\'è successo agli Spinaruggine.\n\nSe raccontiamo la nostra storia, forse non accadrà più...', '', '', '', '', '', '', 47187),
(66151, 'itIT', 'Il suo cuore di pietra', 'Uccidi Cuordipietra.', 'Urliamo di dolore per il nostro capo, anche se è vivo.\n\nCiò che resta di Cuordipietra è nella caverna davanti a noi.\n\nMolti hanno cercato di ragionare con lui, ma lui li ha uccisi... e ha quasi ucciso Narn.\n\nÈ un mostro! Questo è l\'obiettivo dei Primalisti: ci trasformerebbero in pietra e fiamme per metterci al loro servizio.\n\nCuordipietra non è più uno Spinaruggine; deve essere distrutto prima che altri subiscano la stessa sorte.', '', 'Il dono dei Primalisti ha trasformato il corpo del Capo Tribù degli Spinaruggine in pietra indurita.', 'Cuordipietra', '', '', '', 47187),
(66150, 'itIT', 'Salvare Radza', 'Salva Radza Artiglio Tonante.', 'Radza Artiglio Tonante è la nostra custode spirituale, che mantiene vive le nostre tradizioni e la nostra storia.\n\nLe credenze primaliste vanno contro tutti i valori del nostro clan. Sapevo Radza avrebbe sfidato Cuordipietra!\n\nLui farà di tutto per metterla in ginocchio, perché nessuno diventa capoclan senza la benedizione di Radza.\n\nNarn dice che Khargall Cinquezanne, la guardia del capoclan, sta cercando di spezzarla. Se Radza muore, il nostro clan morirà con lei.\n\nVai ad aiutarla, $n, e preparati: non la lascerà andare senza combattere.', '', '', '', '', '', 'Incontra Radza Artiglio Tonante nell\'Antro degli Spinaruggine.', 47187),
(66149, 'itIT', 'Influenza elementale', 'Distruggi $1oa Totem del Vincolo Terrestre dei Primalisti, poi incontra Narn nell\'Antro degli Spinaruggine.', 'Narn ha detto che non tutti gli Spinaruggine hanno seguito Cuordipietra o i Primalisti.\n\nAlcuni oppositori sono tenuti prigionieri da dei totem che emettono roccia e fango... Li costringono all\'obbedienza.\n\nDistruggi i totem. Liberali!', '', '', '', '', '', 'Incontra Narn nell\'Antro degli Spinaruggine.', 47187),
(66148, 'itIT', 'Ex famiglia di Mezzorsi', 'Uccidi $1oa Mezzorsi ed Elementali Spinaruggine, poi incontra Narn nell\'Antro degli Spinaruggine.', 'I Primalisti sono arrivati e ci hanno offerto un nuovo potere: il controllo degli elementi.\n\nNon pensavo che Cuordipietra avrebbe accettato i loro doni, il nostro clan non aveva bisogno di potere. Non ha pensato al costo che avrebbe comportato.\n\nLa sua terribile decisione non può essere annullata: la magia ha corrotto il mio clan, come una malattia che fa marcire una radice.\n\nIl mio cuore si spezza al solo pensiero, ma eliminare i corrotti è l\'unica soluzione.', '', '', '', '', '', 'Incontra Narn nell\'Antro degli Spinaruggine.', 47187),
(66147, 'itIT', 'Cristalli nell\'acqua', 'Raccogli $1oa Campioni di Cristallo a Riva dei Gorloc.', 'Forse ora non sembra, ma siamo professionisti. La spedizione ci ha affidato il compito di trovare una concrezione di cristalli rari nell\'area; potremmo definirlo un rilevamento geologico.\n\nIo sto ancora cercando di rimettermi in sesto dopo l\'attacco dei Gorloc... Quindi saresti così gentile da cercare questi cristalli? Torna indietro con dei campioni, se ci riesci.', '', '', '', '', '', '', 47187),
(66141, 'itIT', 'Tradizioni infrante, corpi anche', 'Incontra Garz e Narn sulla strada per l\'Antro degli Spinaruggine.', 'Non riconosco più i miei compagni Mezzorsi. Hanno fatto delle... brutte cose. E sono diventati degli esseri ancora più malvagi.\n\nNon c\'erano mai stati scontri fratricidi tra Mezzorsi, prima!\n\nMio fratello e io siamo fuggiti. Io sono venuto qui a cercare aiuto, mentre lui è rimasto vicino alla tana del nostro clan.\n\nAiutaci, prima che il nostro clan sia spacciato!', '', '', '', '', '', '', 47187),
(66139, 'itIT', 'Fuoco e fiamme, finalmente', 'Usa l\'Essenza d\'Acqua Concentrata per sconfiggere l\'Inferno Fiammeggiante nei Giardini.', 'D\'accordo, giovane, ti ho messo tutte le essenze elementali dell\'acqua in questo vaso.\n\nSe lo lanciassi contro quello grosso, dovrebbe funzionare. Voglio dire, quando mai l\'acqua non ha funzionato contro il fuoco? È a prova di idiota.\n\nMa il caldo, uh, non va bene per le mie giunture, quindi resterò qui. Confido che tu possa farcela.\n \nBuona fortuna, giovane!', '', '', '', '', '', '', 47187),
(66138, 'itIT', 'Come la sabbia nella clessidra', 'Raccogli $1oa Mucchi di Sabbia del Tempo Scompigliata nei Giardini.', 'Come il resto dei giardini, la clessidra di Nozdormu ha dovuto affrontare il tumulto elementale. Dei turbolenti elementali del vento sono entrati e hanno sparpagliato la sabbia magica che c\'era al suo interno.\n\nSenza questa sabbia, l\'influenza di Nozdormu è molto ridotta.\n\nCome Factotum in addestramento, mi è stato ordinato di supervisionare la clessidra in ogni momento. Se potessi raccogliere le sabbie al posto mio, ti sarei eternamente grato.', '', '', '', '', '', '', 47187),
(66137, 'itIT', 'Elementale, Alexstrasza', 'Uccidi $1oa Boccioli della Morte Invasivi e Piantine Sferzanti nei Giardini.', 'Sicuramente gli sporoidi non sono l\'unica fauna selvatica a creare subbuglio.\n\nL\'albero di Alexstrasza è sempre stato una spina nel fianco. La sua magia vitale attira ogni sorta di pianta e animale, buono e cattivo. E indovina chi deve occuparsi dei cattivi? Il Vecchio Gryrmpech, ecco chi!\n\nA parte tutto, sono troppo vecchio per questo.\n\nI Factotum non sono addestrati al combattimento; quindi, tocca a te occuparti del problemino di erbacce della Protettrice della Vita.', '', '', '', '', '', '', 47187),
(66136, 'itIT', 'Estratto Elementale', 'Raccogli $1a Essenza d\'Acqua nei Giardini.', 'Qualche giorno fa, un enorme Elementale del Fuoco ha distrutto il laghetto. Credo sia dietro tutto questo trambusto, ma è troppo grande per affrontarlo. Dobbiamo indebolirlo in qualche modo.\n\nMa non sottovalutare ancora il Vecchio Gryrmpech, ho un piano!\n\nGli Elementali dell\'Acqua hanno deciso di rintanarsi nel gazebo dello Stormo dei Draghi Blu. Se riuscissi a raccogliere abbastanza essenze da loro, potremmo sfruttare la loro magia.\n\nCombattere il fuoco con il fuoco, no? Più che altro, il fuoco con l\'acqua.\n\nComunque, è il caso che tu vada.', '', '', '', '', '', '', 47187),
(66135, 'itIT', 'L\'apprendista del Giardiniere', 'Cerca Ser Basilton nel capanno del giardino, ripulendo le pile di rottami.', 'Ser Basilton! Ser Basilton, dove sei?\n\nIl mio assistente e apprendista, Ser Basilton, è scomparso! Adora esplorare, ma è persino peggio di me nel difendersi. Sono un giardiniere, non un guerriero!\n\nPotresti andare a cercare quel vagabondo? Ho bisogno di lui qui, così posso pensare. Di solito è nel capanno, scavando tra pile di cianfrusaglie.\n\nFai attenzione, però, può essere caustico all\'inizio.', '', '', '', '', '', '', 47187),
(66134, 'itIT', 'La disinfestazione di Azeroth', 'Uccidi $1oa Piantine Agitate nei Giardini.', 'Ehi tu! Giovane!\n\nDammi una mano, ti va? Questi sporoidi mi stanno distruggendo le piante!\n\nI giardini sono stati invasi da ogni tipo di elementale, sembra che stiano... condizionando la fauna. È come se la loro energia avesse fatto impazzire questi sporoidi!\n\nSono già troppo occupato con questi tre. Ti prego! Prima che mi distruggano tutti i fiori.', '', '', '', '', '', '', 47187),
(66133, 'itIT', 'Chiavi di lealtà', 'Raccogli $1oa Chiave d\'Ossidiana Superiore.', '', '', '', '', '', '', 'Consegna una chiave assemblata alla Cittadella d\'Ossidiana.', 47187),
(66131, 'itIT', 'Sbloccare il nostro passato', 'Ottieni $1oa Chiave Assemblata', 'Portami una Chiave Assemblata', '', '', '', '', '', 'Consegna una chiave assemblata a una fazione nella Cittadella dei Draghi Neri.', 47187),
(66130, 'itIT', 'Sbloccare il nostro passato', 'Ottieni $1oa Chiave Assemblata', 'Portami una Chiave Assemblata', '', '', '', '', '', 'Consegna una chiave assemblata a una fazione nella Cittadella dei Draghi Neri.', 47187),
(66129, 'itIT', 'Sbloccare il passato comune', 'Ottieni $1oa Chiave Assemblata', 'Portami una Chiave Assemblata', '', '', '', '', '', 'Consegna la chiave assemblata a qualsiasi fazione della Cittadella d\'Ossidiana.', 47187),
(66126, 'itIT', 'Sbloccare il passato comune', 'Ottieni $1oa Chiave Assemblata', 'Portami una Chiave Assemblata', '', '', '', '', '', 'Consegna la chiave assemblata a qualsiasi fazione della Cittadella d\'Ossidiana.', 47187),
(66124, 'itIT', 'Uscita di scena trionfante', 'Fuggi dall\'Enclave dei Freddolesto con il Maggiordomo Selistra.', 'Da ciò che ho visto, la Regina ha fatto ritorno al Vivaio Selvaggio. È un avamposto per sorvegliare i Proto-Drachi nella zona. Spero solo che le sue difese siano sufficienti.\n\nDobbiamo recarci lì immediatamente!', '', '', '', '', '', '', 47187),
(66123, 'itIT', 'Tagliare la testa', 'Sconfiggi Jadzigeth nell\'Enclave dei Freddolesto.', 'Jadzigeth, uno degli orribili luogotenenti di Raszageth, guida con orgoglio i Primalisti.\n\nMostriamo loro cosa succede a chi si oppone a noi.', '', 'La luogotenente di Raszageth continuerà a essere un grosso problema finché non verrà fermata.', 'Jadzigeth', '', '', '', 47187),
(66122, 'itIT', 'Proto-Scontro', 'Sconfiggi $2oa proto-draghi nell\'Enclave dei Freddolesto.', 'Questi proto-draghi ci odiano. Ci ritengono una versione distorta dei draghi, manipolati e incatenati dai Titani. Non capiscono.\n\nPer questo si sentono al sicuro persino mentre attaccano le nostre mura.\n\nMa si sbagliano!\n\n$p, prendi questa lancia e uccidi i nostri nemici.', '', '', '', '', '', 'Incontra il Maggiordomo Selistra all\'Enclave dei Freddolesto.', 47187),
(66121, 'itIT', 'Evacuare le uova', 'Salva 4 uova dall\'Enclave dei Freddolesto.', 'I Primalisti hanno rubato le nostre uova per i loro rituali deviati! Devono essere fermati.\n\nAiutaci a recuperare le uova prima che sia troppo tardi. Segna ogni uovo che trovi, $p. Mi assicurerò che vengano portate via in sicurezza.', '', '', '', '', '', 'Incontra il Maggiordomo Selistra all\'Enclave dei Freddolesto.', 47187),
(66119, 'itIT', 'Pozze della Vita di Rubino: Invasione dei Primalisti', 'Vai alle Pozze della Vita di Rubino e ferma l\'attacco dei Primalisti.', 'I Primalisti sono penetrati nella nostra terra. Non eravamo preparati per un attacco così intenso... In molti sono riusciti a passare.\n\nUno dei nostri draconidi si è messo al loro inseguimento, ma non ha ancora dato sue notizie. Temo il peggio.\n\nIo rimarrò di guardia. Dovranno passare sui nostri cadaveri, se vogliono entrare nelle nostre mura! Ma tu devi affrontare quelli che sono già entrati.\n\nVai!', '', '', '', '', '', '', 47187),
(66118, 'itIT', 'Assalto basaltico', 'Distruggi $1oa Rupi Rabbiose nell\'Assalto dei Freddolesto.', 'Raszageth e i suoi Primalisti hanno evocato degli imponenti elementali della terra per abbattere le nostre mura. Dobbiamo fermarli!', '', '', '', '', '', '', 47187),
(66117, 'itIT', 'Liberare il campo di battaglia', '', '', '', '', '', '', '', '', 47187),
(66116, 'itIT', 'La minaccia principale', 'Trova il Comandante Leathanak all\'Assalto dei Freddolesto.', 'Ci sono troppe uova vulnerabili da mettere al sicuro. Se il nemico irrompe, tutto sarà perduto!\n\nSono certo che le nostre guardie si stiano radunando sul campo per respingerli. Parla con il Comandante Lethanak, userà la tua forza dove sarà più utile.', '', '', '', '', '', '', 47187),
(66115, 'itIT', 'Il compito dei Rossi', 'Parla con i custodi nel Tempio della Vita di Rubino.', 'La nostra vocazione è la compassione. Aiutiamo gli altri stormi non solo per il loro bene, ma per quello di tutti i draghi.\n\nForse parlare con i draghibestia qui al Tempio della Vita di Rubino ti aiuterebbe a comprenderci meglio.', '', '', '', '', '', '', 47187),
(66114, 'itIT', 'A beneficio della regina', 'Cavalca con il Maggiordomo Selistra fino al Tempio della Vita di Rubino.', 'Salviamo le nostre preziose uova per proteggere il futuro di tutti gli Stormi dei Draghi. I Primalisti non provocano semplicemente dolore o angoscia con le loro azioni.\n\nPossono portarci all\'estinzione.\n\nDevo informare subito la nostra regina.', '', '', '', '', '', '', 47187),
(66113, 'itIT', 'Un trasporto discreto', 'Ripara il Carro Preso in Prestito.', '[DNT] Our foes watch the skies. I will risk no harm to the future of my flight, so we must travel by less traditional mean.\n\nI ordered a more... down to earth means of transport be acquired, but it seems to have suffered some damage during the exchange. You are undoubtedly more familiar with such things than I, $r, so your assistance in repairing the wagon would be most appreciated.', '', '', '', '', '', '', 47187),
(66112, 'itIT', 'Andiam... Andiam... Andiamo a crear!', 'Raccogli un Nucleo Terrestre Primordiale e un Nucleo Fuso Primordiale.', 'Hai mai visto elementali così potenti?!?\n\n<Grun esulta.>\n\nLe guardie si lamentano tutto il tempo perché ci devono combattere, ma bisogna guardare il quadro generale... Elementali più grandi significa componenti più grandi!\n\nMentre sei là fuori a eliminare gli elementali per la nostra sicurezza o cose così, cerca di raccogliere i pezzi di quelli più grandi che trovi, così posso provare a farci qualcosa!', '', '', '', '', '', '', 47187),
(66111, 'itIT', 'Elementali invasori', 'Uccidi $1oa Elementali Primordiali all\'Ambasciata Riposo Alato.', 'Gli artigiani e gli esploratori della Spedizione delle Scaglie di Drago non sono adatti agli sforzi della battaglia.\n\nMa tu e io lo siamo, $p.\n\nQui nelle Isole dei Draghi, usiamo la nostra forza per proteggere coloro che non possono farlo da soli.\n\nElimina gli elementali provenienti da nord, così che la spedizione possa concentrarsi su imprese più nobili.', '', '', '', '', '', '', 47187),
(66110, 'itIT', 'Possibilità di pace', 'Presentati ai rappresentanti dell\'Alleanza.', 'Aka\'magosh, $p.\n\nQuesta spedizione è sotto la protezione dell\'Orda e dell\'Alleanza. Le nostre istruzioni sono chiare: aiutare tutti i membri della Spedizione delle Scaglie di Drago, a prescindere dalle loro affiliazioni.\n\nI rappresentanti dell\'Alleanza, la Capitana Garrick e suo figlio Henry, sono di guardia all\'altro lato dell\'accampamento.\n\nHo combattuto a fianco della Capitana Garrick contro il Flagello. È onorevole e servirà bene questa spedizione.\n\nOffrile il tuo aiuto. Mostrale che l\'Orda onora gli accordi presi.', '', '', '', '', '', 'Parla con il Capitano Garrick all\'Ambasciata Riposo Alato.', 47187),
(66108, 'itIT', 'Una soluzione aggressiva', 'Uccidi Sogglmoggl, re dei Faucimolli e Turbinrugurggl, re dei Pinnavento.', 'Benché sia felice che Tharu ora capisca il mio punto di vista, ti ringrazio anche di aver salvato la fauna mentre stavo oziando.\n\nLa situazione è molto più grave del previsto, ha fatto bene a intervenire. Con ciò che abbiamo scoperto, temo che questo bombardamento elementale non si fermerà finché non avremo eliminato i Gorloc.\n\nSe fossi in Tharu, e se pensassi in modo pratico, colpirei direttamente i loro capi. Senza nessuno a guidarli, i combattimenti dovrebbero cessare e non minaccerebbero più le paludi.', '', '', '', '', '', '', 47187),
(66107, 'itIT', 'Salvataggio della fauna', 'Salva la fauna delle Paludi Irrequiete.', 'Non ci vuole un ecologo per vedere che le paludi sono in serio pericolo.\n\nMa Iskha ci ha messo qui a esaminare creature morte, quando quello che dovremmo fare è impedire che muoiano! Lo scopo dello Stormo dei Draghi Rossi è preservare la vita, non dissezionarla!\n\nAdoro Iskha, è bravo in ciò che fa, ma se aspettiamo che finisca di riflettere, non ci saranno più delle paludi da salvare. Io mi occuperò dei suoi dubbi, tu vai a sporcarti gli stivali e salva qualche animale selvatico.', '', '', '', '', '', '', 47187),
(66106, 'itIT', 'Questione di gusci', 'Raccogli $1oa Conchiglie Infuse d\'Acqua e $1oa Conchiglie Infuse di vento da Faucimolli e dai Gorloc Pinnavento.', 'È stato sciocco da parte mia dubitare di Iskha, insisteva perché c\'era altro da capire. Non sarebbe mio amico se non fosse sempre due passi avanti a me.\n\nPossiamo farci perdonare passando all\'azione, ovviamente. Se sono le conchiglie a causare tutto questo caos elementale, perché non vai nel loro accampamento e le togli dalle loro zampe viscide?\n\nRiporta i mucchi di Conchiglie Infuse d\'Acqua e Conchiglie Infuse di Vento, abbastanza da permettere a Iskha di fare tutte le ricerche che vuole.', '', '', '', '', '', '', 47187),
(66105, 'itIT', 'Una soluzione chirurgica', 'Uccidi $1oa Elementali dell\'Acqua Sfrenati e $1oa Elementali del Vento Sfrenati.', 'Credo che stiamo raccogliendo abbastanza dati da qui, ma...\n\nTharu è un ecologo eccezionale e preferisce che agiamo. L\'ecosistema è fragile e potremmo danneggiarlo se non stiamo attenti, tuttavia concordo che siamo alle strette.\n\nPotrebbe valere la pena di assecondarlo, in parte.\n\nEliminare gli elementali infuriati dovrebbe farci guadagnare tempo senza intralciare le nostre ricerche. Assicurati di eliminarli in egual numero, non vogliamo causare altri squilibri.', '', '', '', '', '', '', 47187),
(66104, 'itIT', 'Perizia ecologica', 'Disseziona i cadaveri dei Gorloc.', 'Non so più cosa fare, $n. Tharu e io abbiamo esaminato quasi tutti i cadaveri, incagliandoci alla fine perché non riusciamo a trovarci d\'accordo sulla metodologia. Se solo mi ascoltasse!\n\n<L\'Ecologo Iskha sospira.>\n\nLo stress della situazione colpisce entrambi. Non ho ancora neppure un\'ipotesi valida.\n\nSembra che tu abbia uno stomaco forte, potresti occuparti di questi ultimi due Gorloc? Puoi usare il mio bisturi.', '', '', '', '', '', '', 47187),
(66103, 'itIT', 'Voglia di compiacere', 'Metti alla prova le abilità di $1oa Assassini e Vendicatori Grinfianera al Baluardo d\'Ossidiana.', 'Ci servono truppe per difendere la Cittadella d\'Ossidiana. Ora che abbiamo un punto d\'appoggio, è importante assicurarsi di avere occhi e corpi pronti per affrontare lo sforzo.\n\nAbbiamo truppe di riserva aggiuntive al Baluardo d\'Ossidiana.\n\nSono ben addestrate, ma trarrebbero beneficio da un test di combattimento con una persona abile ed esperta come te. Così sapremo se sono pronti!', '', '', '', '', '', 'Incontra Fao l\'Implacabile al Baluardo d\'Ossidiana.', 47187),
(66101, 'itIT', 'Una vista spettacolare', 'Usa il Disco dell\'Ispettore per decollare ed esplorare l\'area.', 'Toddy e Naleidea hanno richiesto immediatamente un rapporto di rilevamento dell\'area circostante.\n\nFortunatamente, ho acquistato un Telescopio Incantato e un Disco dell\'Ispettore che ci aiuteranno a esplorare le aree vicine dalla sicurezza delle nuvole.\n\nPurtroppo, ho una paura mortale delle altezze e non riesco a mettere piede su quell\'aggeggio.\n\nTu non soffri di vertigini, vero?', '', '', '', '', '', '', 47187),
(66100, 'itIT', 'Aumento di peso', 'Recupera $1oa Rifornimenti del Vigilante.', 'Questa volta ho davvero sbagliato. Mi sono allontanata dall\'accampamento solo per un momento, ma sono tornata a malapena in tempo per vedere i Tarasek prendere tutto quello che non era inchiodato a terra.\n\nQuei rifornimenti erano costosi e non posso chiedere aiuto per ottenerne altri! Mia sorella Nori crede che io sia un\'incapace anche senza tutto questo.\n\nSe sei $gsicuro:sicura; di voler attraversare la valle, ti andrebbe di far caso a eventuali sacchi di provviste perduti?', '', '', '', '', '', '', 47187),
(66087, 'itIT', 'È ora di chiudere', 'Aiuta i Viaggiatori nel Tempo uccidendo nemici perduti nel tempo, potenziando gli alleati di bronzo, riportando manufatti perduti e chiudendo Fenditure del Tempo nelle Sabbie Mutevoli.', 'Queste incursioni spingono l\'integrità di questa linea temporale sino al punto di rottura. Se solo avessimo altri Viaggiatori nel Tempo addestrati!\n\nNonostante tu non abbia ancora molta esperienza con il Bastone, mi è stato detto che ci hai aiutati molto! Con un po\' di impegno, penso che potresti aiutarci ancora di più.\n\nNormalmente dovresti affrontare un addestramento completo, ma questi sono tempi... insoliti. Prendi questa pergamena di conoscenza avanzata e respingi gli invasori! Fai in fretta però, l\'effetto dovrebbe durare solo temporaneamente.', '', '', '', '', '', '', 47187),
(66085, 'itIT', 'Se potessimo tornare indietro nel tempo', 'Chiudi le Fenditure del Tempo nelle Sabbie Mutevoli con Siaszerathel.', '$gUn vero Viaggiatore nel Tempo:Una vera Viaggiatrice nel tempo; non abbandona mai una crisi. Perché aspettare e studiare quando abbiamo già gli strumenti che ci servono?\n\nDato che hai il mio bastone originale, io ne ho trovato uno di scorta. Sicuramente non lo cercherà nessuno. Ecco il piano: concentriamo le nostre forze su quelle fenditure e portiamo a casa la giornata. Tutte le giornate, in effetti. Scusa, questa cosa del tempo mi confonde.\n\nChe ne dici? Il compito dovrebbe essere abbastanza semplice, giusto?', '', '', '', '', '', '', 47187),
(66084, 'itIT', 'In tempi come questi', 'Ottieni $1oa unità di Residuo Temporale dei nemici perduti nel tempo nelle Sabbie Mutevoli.', 'Nonostante quel piccolo incidente durante l\'addestramento, credo tu possa aiutarci qui.\n\nLe distorsioni nella valle permettono a diverse epoche di passare nella nostra. Non siamo certi del perché queste linee temporali si connettano, il che è allarmante. Dobbiamo saperne di più.\n\nTi prego, cerca di scoprire qualcosa riguardo le creature che fuoriescono dalle varie linee temporali. Certamente il loro passaggio deve avere lasciato dei residui, studiandoli potremo forse trovare un modo di superare questa crisi.', '', '', '', '', '', '', 47187),
(66083, 'itIT', 'Come la prima volta', 'Parla con Andantenormu e partecipa all\'addestramento da Viaggiatore nel Tempo.', 'Prendersi cura dei flussi temporali è un compito pericoloso.\n\nNonostante tu non sia tra i Viaggiatori nel Tempo, l\'Ambasciatrice Cronormu ritiene che sarai di grande aiuto. Per accertarci della tua sicurezza dobbiamo prima addestrarti.\n\nSfortunatamente, tutti i nostri istruttori sono ancora dispersi. Farò del mio meglio per aiutarti. Vediamo come ce la caviamo. So che l\'Ambasciatrice Cronormu conta su di noi.', '', '', '', '', '', '', 47187),
(66082, 'itIT', 'Tempo in bottiglia', 'Ottieni energia temporale dalla fauna caricata temporalmente uccisa nella Foresta Fluente di Thaldraszus.', 'Fantastico! Il Bastone dei Viaggiatori nel Tempo è intatto! Ma resta ugualmente prosciugato.\n\nHo un\'idea! Potresti ricaricarlo usando l\'energia temporale che aleggia attorno alle creature infettate nella foresta. Sfortunatamente, questo significa ucciderle. L\'energia le ha rese pericolose e instabili, avremmo dovuto ugualmente abbattere la popolazione...\n\nA volte bisogna fare sacrifici per il bene superiore. Potresti aiutare? Mi serve ancora un attimo per riprendermi.', '', '', '', '', '', '', 47187),
(66081, 'itIT', 'Il tempo sta per scadere', 'Raccogli $1oa Collettori Temporali nella Foresta Fluente di Thaldraszus.', 'Con il Tempio di Bronzo sotto attacco, l\'energia temporale si sta diffondendo ovunque.\n\nI Viaggiatori nel Tempo hanno posizionato dei collettori nella foresta, con la speranza di raccogliere tutta la magia vagante. Tutto ciò che viene raccolto può essere usato come ulteriore fonte di energia! Considerata la nostra crisi di risorse, questa è un\'ottima notizia.\n\nAvrei dovuto recuperare i collettori, ma mi serve un attimo di respiro.\n\nPotresti occupartene tu al posto mio?', '', '', '', '', '', '', 47187),
(66080, 'itIT', 'Difficoltà temporali', 'Trova la recluta scomparsa nella Foresta Fluente a Thaldraszus.', 'Saluti, $C. Appena in tempo!\n\nQualche disturbo al tempio sta causando uno squilibrio nei flussi temporali, si stanno riversando nella valle. Non solo, ma mancano un sacco di Viaggiatori nel Tempo!\n\nAbbiamo richiesto altro aiuto, ma una delle nuove reclute non è ancora arrivata.\n\nPuoi andarla a cercare? Fai attenzione però, il tempo è in un massiccio stato di flusso continuo nella valle, non c\'è modo di sapere quali pericoli incontrerai!', '', '', '', '', '', '', 47187),
(66079, 'itIT', 'Irathion attende', 'Incontra Irathion al Baluardo d\'Ossidiana.', 'Queste uova rappresentano una nuova generazione di draghi. Devono essere protette e curate. Eppure... il mio cuore soffre e mi preoccupo per Irathion. Temo che la sua testardaggine e la sua determinazione lo porteranno a compiere qualche gesto avventato. \n\nAbbiamo potuto contare su di te per tutti questi anni, $n. Forse puoi andare al mio posto e aiutarlo. \n\nCercalo nel Baluardo d\'Ossidiana. E ti prego, veglia su di lui. Ne sono rimasti così pochi del suo stormo.', '', '', '', '', '', 'Incontra Irathion al Baluardo d\'Ossidiana.', 47187),
(66078, 'itIT', 'Esercizio incisivo', 'Metti alla prova le abilità di $1oa Assassini e Vendicatori Grinfianera.', 'Per anni ho aiutato i Grinfianera, istruendoli e incoraggiandoli affinché provassero a raggiungere le stesse vette che hai toccato tu.\n\nForse non hanno raggiunto degli obiettivi nobili quanto i tuoi, ma hanno avuto sicuramente successo. Mi hanno reso orgoglioso.\n\nCiascuno di loro sarebbe onorato di dimostrarti le sue abilità. Credo che rivedrai un po\' di te in loro.', '', '', '', '', '', '', 47187),
(66076, 'itIT', 'Drospo Cornuto Antico', '', '', '', '', '', '', '', '', 47187),
(66074, 'itIT', 'Regina dei Falcidi Primordiale', '', '', '', '', '', '', '', '', 47187),
(66071, 'itIT', 'Falchi volanti', 'Assisti $1oa Grifalchi Piumablu Feriti.', 'Sono la Professoressa Harleen Cinguetti, straordinaria e famigerata ornitologa! Sono venuta qui per studiare i Grifalchi Piumablu delle Isole dei Draghi, ma immagino che ci siano volatili più grossi di cui occuparci prima.\n\nScommetto che queste Arpie sono arrivate da Kalimdor quando le isole sono state riaperte. Sono piuttosto invasive e banchettano come un branco di Ogre al buffet del Casinò degli Acqualorda.\n\nDiamo ai grifalchi nativi di qui una possibilità di combattere. Prendi questo kit medico e usalo sui feriti.', '', '', '', '', '', '', 47187),
(66070, 'itIT', 'Ossa di Lamafulgida', '', '', '', '', '', '', '', '', 47187),
(66057, 'itIT', 'Ripristinare la fede', 'Ripara la Pietra del Giuramento d\'Ossidiana.', 'I frammenti infranti sono stati riforgiati! Ora possiamo riparare la Pietra del Giuramento.\n\nDai una mano a Irathion per completare la riparazione.', '', '', '', '', '', 'Incontra Irathion al Trono d\'Ossidiana', 47187),
(66056, 'itIT', 'Forgiare un nuovo futuro', 'Prepara la Forgia del Custode della Terra.', 'La Forgia del Custode della Terra è la più potente di tutte le forge dei draghi. I nostri antenati la usavano per creare le armi e le armature più potenti per difendere Azeroth.\n\nNel cuore della forgia risiede il potere necessario per ricostituire i frammenti infranti della Pietra del Giuramento.\n\nAndiamo a preparare la forgia per il lavoro che c\'è da fare.', '', '', '', '', '', 'Consegna il Carbone di Scheggia Cinerea al Mastro Forgiatore Bazentus.', 47187),
(66055, 'itIT', 'Un passato infranto', 'Recupera $2oa Frammenti di Pietra del Giuramento.', 'La Pietra del Giuramento è danneggiata, mancano dei pezzi.\n\nFai di tutto per recuperare i frammenti. Forse c\'è un modo per ripararla!', '', '', '', '', '', '', 47187),
(66049, 'itIT', 'Pietra del Giuramento d\'Ossidiana', 'Trova la Pietra del Giuramento d\'Ossidiana.', 'Quando Neltharion divenne il Custode della Terra, giurò di proteggere questo mondo, $n, di salvaguardare i luoghi più profondi della terra e, con il suo stormo, di servire nel ruolo di difensori di Azeroth. La Pietra del Giuramento d\'Ossidiana rappresenta quella promessa. \n\nDobbiamo attivare la pietra e far sapere alle Isole dei Draghi che lo Stormo dei Draghi Neri è tornato!\n\nSeguimi, $n.', '', '', '', '', '', '', 47187),
(66048, 'itIT', 'Con le migliori intenzioni e programmi', 'Riesamina i piani con i vari membri delle forze di Irathion.', 'Attaccare i Djaradin che controllano la Cittadella d\'Ossidiana non sarà un\'impresa facile. Anche con Irathion e i suoi Grinfianera, sarà una battaglia feroce. Irathion sarà anche sicuro di sé, ma... io ho qualche dubbio.\n\nForse possiamo parlare con chi sta contribuendo a pianificare la strategia per scoprire se riusciamo a trovare qualche margine di miglioramento.', '', '', '', '', '', 'Riferisci le tue scoperte a Irathion al Baluardo d\'Ossidiana.', 47187),
(66044, 'itIT', 'Prendere le mura', 'Elimina le tre Arbaleste d\'Assedio e il Campione Choruk.', 'Sabellian e gli altri draghi stanno trattenendo i Djaradin, per il momento. Dobbiamo agire in fretta per rendere sicure le torri e assicurarci la vittoria.\n\nIo e te elimineremo le Arbaleste d\'assedio che ci minacciano dall\'alto.\n\nFammi sapere quando vuoi cominciare.', '', '', '', '', '', 'Incontra Irathion.', 47187),
(66040, 'itIT', 'Ritorno al futuro', 'Difendi i tuoi alleati dall\'Impero Nero fino alla creazione del portale temporale.', 'Non cadremo più nel tempo, ma siamo lontane nel passato. Intendo \"I Titani non hanno ancora visitato Azeroth\" tipo di passato. Tornare a casa sarà... difficile.\n\nMa noi draghi possiamo farlo! \n\nAvremo bisogno di te per tenere lontani quei servitori dell\'Impero Nero. Non dovrebbe volerci troppo tempo! \n\nCredo.\n\nProbabilmente.\n\nNon preoccuparti! Tieni lontani quei mostri e noi ci occuperemo del resto! Facile!', '', '', '', '', '', '', 47187),
(66039, 'itIT', 'Il tempo di Cromie', 'Trova Cromie e completa il Rituale di Stabilizzazione Temporale.', 'Questo... Questo è l\'Impero Nero. Abbiamo viaggiato veramente molto nel passato.\n\nGuarda! Vedo l\'Ambasciatrice Cronormu ed Eternus! Dobbiamo sbrigarci e completare il rituale. \n\nNon sono abbastanza curioso di vedere dove potrebbero finire la prossima volta.', '', '', '', '', '', '', 47187),
(66038, 'itIT', 'Gara nel tempo!', 'Corri nel tempo, seguendo il Percorso di Cromie ed Eternus.', '$n, dobbiamo agire in fretta per raggiungere l\'Ambasciatrice Cronormu e intendo letteralmente.\n\nZera e io faremo ciò che possiamo per velocizzare i nostri progressi, ma è imperativo evitare di interagire con questo periodo il più possibile. Farlo ci rallenterebbe e non saremmo in grado di acciuffare l\'Ambasciatrice prima che si perda anche nella magia di Nozdormu.\n\nNon abbiamo un momento da perdere!\n\n|cFF0000FF(Accettando questa missione inizierà un timer)|r', '', '', '', '', '', '', 47187),
(66037, 'itIT', 'Ritorno alla realtà', 'Torna da Nozdormu nel Presente.', 'Siamo riusciti ad aumentare il legame dell\'Ambasciatrice Cronormu con il nostro tempo. Non ho dubbi che, quando la troveremo, potremo finire il rituale.\n\nPer ora, torniamo al nostro presente e in un mondo con... molti meno Murloc.', '', '', '', '', '', '', 47187),
(66036, 'itIT', 'Mugurlglrlgl!', 'Murglulggllgll!', 'Mrglgulglrrlglgul! Grurguglullgurl!\n\nGruglrlgllrugl rrgulgrulgrgl grugll gurgull gur. Murgllgllrugl gurgllglrl Murgul gruggullgl. Murguglegurgllgur gurgll gurgulgul guruulgurllgr guuglrllgl.\n\nMgrgulllglll gurl gugll.\n\n<Non credi di aver capito ciò che ti è stato detto, ma ci sono un sacco di gesti che ti ricordano il pugnalare. Sembra che questo Murloc voglia che tu uccida qualcosa.>', '', '', '', '', '', '', 47187),
(66035, 'itIT', 'Particelle di Murloc', 'Prosciuga $1oa Granuli Temporali.', 'Una linea temporale alternativa nata dai Murloc?!?\n\nPerdona il mio egoismo, ma potresti recuperare qualche granulo vagante di energia temporale mentre individui l\'Ambasciatrice Cronormu?\n\nPassaci semplicemente in mezzo e il tuo bastone dovrebbe fare il resto. Esaminerò i dati più avanti, quando non ci staremo avventurando tra i periodi lacerati delle varie realtà di Azeroth.', '', '', '', '', '', '', 47187),
(66033, 'itIT', 'Verso il... passato?', 'Prendi il portale e incontrati con Andantenormu ad Azmerloth.', 'È un peccato che non siamo riusciti a stabilizzare Cronormu, ma c\'è un altro luogo in cui forse potremmo essere in grado di afferrarla e porre fine alla sua caduta nel tempo.\n\n<Nozdormu aggrotta le sopracciglia.>\n\nGli scorci di questa linea temporale passata sono... strani, anche considerando alcune delle visioni a cui ho assistito nella mia vita.\n\nStai in guardia, $n. Non so cosa affronterai, ma è qualcosa di potente e... stranamente familiare.', '', '', '', '', '', 'Prendi il portale e incontrati con Andantenormu ad Azmerloth.', 47187),
(66032, 'itIT', 'Ritorno al presente', 'Torna da Nozdormu nel Presente.', 'Questa linea temporale è oscura e caotica, la disgregazione temporale qui ha causato ingenti danni. Resterò qui ancora un po\' in questa linea temporale, per cercare di sistemare le increspature rimaste. \n\nTorna da Nozdormu. Vorrà sapere del nostro successo, anche se è meno soddisfacente di quanto avremmo voluto.', '', '', '', '', '', '', 47187),
(66031, 'itIT', 'Prendere tempo', 'Recupera l\'Essenza Elementale per l\'accampamento dei sopravvissuti.', 'Non dovrei stupirmi di essere qui.\n\nQuesta non è l\'Azeroth che volevo, ma è quella che ho. Stiamo combattendo per preservare ciò che resta e riprenderci il mondo, ma il tuo arrivo ha causato dei problemi.\n\nUsiamo l\'essenza di quegli elementali per alimentare le nostre protezioni e tenerci al sicuro. Vedi quella barriera? È l\'unica cosa che ci separa dall\'essere scoperti e distrutti e tu hai prosciugato le nostre risorse. Riportaci un po\' di quell\'essenza e potremo sopravvivere un altro giorno.', '', '', '', '', '', '', 47187),
(66030, 'itIT', 'Resistenza tutt\'altro che inutile', 'Cura i combattenti della resistenza nel Futuro dei Primalisti.', 'Le increspature temporali hanno causato problemi alla gente qui. I nemici appaiono dove non erano, o sono molto più forti di quanto dovrebbero. Questi cambiamenti sono piccoli, ma disastrosi.\n\nTi chiedo di aiutare i combattenti della resistenza locale. Cura le loro ferite cosicché possano combattere ancora una volta. Imposta la loro linea temporale sul suo percorso corretto, come se non avesse mai interagito con la nostra. Non è molto, ma è ciò che possiamo fare per loro.', '', '', '', '', '', '', 47187),
(66029, 'itIT', 'Sintonia Temporale', 'Usa il Cronocristallo su Eternus e Cromie nel Futuro dei Primalisti per impedire che cadano attraverso il tempo.', 'Cronormu ed Eternus stanno cadendo tra le pieghe nel tempo, ma sento che si fermano ogni tanto. Questi brevi istanti sono la nostra opportunità per trovarle.\n\n<Nozdormu evoca un piccolo Cronocristallo.>\n\nHo infuso questo cristallo con il mio potere e la mia risonanza temporale. Sono andate in un futuro... preoccupante. Trovale e usalo. Speriamo che tu possa fissare la loro posizione nel tempo prima che sfuggano di nuovo.', '', '', '', '', '', 'Torna da Nozdormu nel presente.', 47187),
(66028, 'itIT', 'Verso il Futuro!', 'Raggiungi il Futuro dei Primalisti.', 'Ho rintracciato Cronormu ed Eternus in un potenziale futuro. Non so cosa incontrerai, so solo che sarà oscuro e caotico.\n\nSoridormi ha portato alcuni dei nostri Viaggiatori nel Tempo in quel futuro per mantenere stabile la nostra connessione. Il suo potere è considerevole, e sarà necessario per mantenere aperto il portale, per cui dovrà affidarsi a te.\n\nSoridormi sarà in grado di indicarti cosa fare una volta là.\n\nAffrettati, $n, trova Cronormu.', '', '', '', '', '', 'Parla con Soridormi nel Futuro dei Primalisti.', 47187),
(66027, 'itIT', 'Chiamare i Draghi Blu', 'Osserva Kalecgos mentre richiama lo Stormo dei Draghi Blu.', 'Non posso più avere timore di riunire i Draghi Blu, $n. La cosa migliore per noi è diventare una famiglia... piuttosto che ostinarci a rappresentare un mero frammento del nostro passato.\n\nAnche se non posso rivendicare la Pietra del Giuramento, sono in grado di sfruttare il suo potere per inviare un messaggio a tutti i Draghi Blu.\n\nÈ giunto il momento che il loro Aspetto... si rivolga a loro.', '', '', '', '', '', '', 47187),
(66026, 'itIT', 'Intervento urgente necessario', 'Incontra Brena a Felcepelle.', 'La fonte di questi attacchi devono essere i Felcepelle.\n\nCi siamo scontrati con gli Gnoll Felcepelle per generazioni, ma sino ad ora non sono mai stati nulla più che un fastidio.\n\nNon abbiamo altra scelta, dobbiamo prendere misure urgenti contro gli Gnoll. Il loro orrido decadimento distruggerà la Vastità Azzurra, inclusa qualsiasi cosa tu stia cercando.\n\nVediamoci fuori dalla conca, ci servirà tutto l\'aiuto possibile.', '', '', '', '', '', '', 47187),
(66025, 'itIT', 'La minaccia dei Nokhud', 'Discuti i prossimi passi.', 'L\'esercito del Clan Nokhud sta conquistando Maruukai.\n\nDiscutiamo le nostre prossime mosse nelle stanze del Khan. Dobbiamo tenere i Maruuk al sicuro!', '', '', '', '', '', '', 47187),
(66024, 'itIT', 'Coprirsi le code', 'Uccidi la Guardia Bahir.', 'I Nokhud stravedono per le storie di guerra dell\'antico passato della nostra specie. In verità, sono deboli e infantili. E hanno reciso la loro connessione con Ohn\'ahra in un colpo solo.\n\nBene! Se vogliono seguire il sentiero della corruzione in cerca di guerra, noi li accontenteremo.\n\nNaturalmente, Bahir è stata lasciata al comando per coprire la fuga. Il suo sangue bagnerà presto la terra.', '', 'Bahir, rimasto al comando grazie a Balakar, aspettava questo momento da lungo tempo.', 'Guardia Bahir', '', '', 'Torna dalla Khanam Matra Sarest.', 47187),
(66023, 'itIT', 'Tregua infranta', 'Uccidi $1oa forze dei Nokhud.', 'Balakar è un disonore per il suo clan. Lo conduce nell\'occhio del ciclone, accecato dalla sua brama di potere.\n\nIl tradimento è un sintomo di fragilità. Bisogna abbatterli tutti.', '', '', '', '', '', '', 47187),
(66022, 'itIT', 'La Khanam Matra', 'Fai rapporto ad Akato della Guardia del Khan per partecipare all\'udienza di Gemisath con la Khanam Matra.', 'Non posso indugiare nelle terre dei Centauri, devo tornare ai giardini non appena possibile.\n\nLa Khanam Matra ha accettato di ascoltare la nostra richiesta d\'aiuto. Attende il mio arrivo in cima al krutal, l\'edificio centrale di Maruukai.\n\nAnche se prima dovrò parlarle da sola, tu sei più che $gbenvenuto:benvenuta; a unirti a noi.', '', '', '', '', '', '', 47187),
(66021, 'itIT', 'Stranieri indesiderati', 'Sconfiggi $1oa Centauri Nokhud.', 'Ah! Guardati. Debole. Come quei patetici cacciatori che ti hanno $gportato:portata; qui.\n\nVuoi conoscere i Nokhud? Noi ci esprimiamo combattendo.\n\nIl nostro rituale di combattimento è chiamato \"tabarr\". Ci addestriamo, lottiamo e ci rende più forti. Non c\'è posto per la debolezza nel nostro clan.\n\nBasta parlare ora, va\' a lottare.', '', '', '', '', '', 'Fai rapporto all\'Esploratrice Tomul.', 47187),
(66020, 'itIT', 'Presagi e incenso', 'Raccogli $1oa Boccioli Dolcelatte, pestali per ottenere Incenso Dolcelatte e poi aiuta Ohn Seshteng nel rituale.', 'Ho condiviso con la Khan Tigari il presagio che abbiamo ricevuto prima di entrare a Maruukai. Ha espresso preoccupazione, perché anche a lei il vento sembrava freddo.\n\nQui coltiviamo alcuni fiori, i cui boccioli possono essere bruciati per ottenere un effetto simile alla trance. Li usiamo per rafforzare il nostro legame con un presagio.\n\nTi chiedo di raccoglierne un po\', così potremo creare l\'incenso da bruciare. Con l\'aiuto della mia Khan, forse potremo capire meglio le difficoltà di Ohn\'ahra.', '', '', '', '', '', '', 47187),
(66019, 'itIT', 'Onorare i nostri antenati', 'Aiuta Qariin Dottiur a cucinare un pasto per gli antenati.', 'I nostri antenati camminano al nostro fianco sui venti di Ohn\'ahra, guidandoci e proteggendoci. Tutti i Maruuk, sia morti che vivi, si radunano in pace al Khural.\n\nIl profumo di questo pasto richiama gli antenati al nostro fuoco. Il Khural inizierà al loro arrivo.', '', '', '', '', '', '', 47187),
(66018, 'itIT', 'Clan Nokhud', 'Accompagna Tomul dalla Guardia Bahir.', '<Okir traduce i segni della Khan Sansok in voce.>\n\nIl Clan Nokhud è stato l\'ultimo a salire al potere. Il loro defunto Khan, Jhakan, radunò un potente esercito per impadronirsi del territorio dei predecessori. È così che agisce il nostro popolo.\n\nJhakan si era guadagnato il rispetto degli altri, ma suo figlio ha agito diversamente. Balakar ha ucciso suo padre e ha preso il controllo del clan. Da allora, i Nokhud si sono sempre più isolati. Ma per conoscere i Maruuk, devi familiarizzare anche con loro.', '', '', '', '', '', 'Incontra l\'Esploratrice Tomul all\'accampamento dei Nokhud.', 47187),
(66017, 'itIT', 'Clan Ohn\'ir', 'Incontra Ohn Seshteng alle pozze mistiche.', '<Okir traduce i segni della Khan Sansok in voce.>\n\nI mistici delle nostre terre, come Ohn Seshteng, appartengono al Clan Ohn\'ir. Non è un clan composto da famiglie, ma da Centauri provenienti da tutte le pianure che hanno un legame innato con Ohn\'ahra. Trascorrono la vita impegnandosi a mantenere quella connessione e affinando le loro abilità. A un certo punto della loro vita, ricevono l\'incarico di consiglieri per diversi clan e si occupano di proteggere le nostre terre.\n\nOhn Seshteng è andata a parlare con il suo Khan del presagio che ha ricevuto. Vai con lei per apprendere degli Ohn\'ir.', '', '', '', '', '', 'Incontra Ohn Seshteng alle pozze mistiche.', 47187),
(66016, 'itIT', 'Clan Teerai', 'Fai rapporto a Qariin Dotur.', '<Okir traduce i segni della Khan Sansok in voce.>\n\nll Clan Teerai è quello delle Khanam Matra, la nostra connessione diretta con gli antichi Maruuk. Sono le detentrici delle nostre tradizioni e fungono da cantastorie.\n\nPer capire i Maruuk, devi capire il Clan Teerai. Una delle figlie della Khanam Matra, Qariin Dotur, sta preparando un pasto per i nostri antenati. Aiutala. Ti parlerà della nostra gente.', '', '', '', '', '', 'Fai rapporto a Qariin Dotur.', 47187),
(66015, 'itIT', 'La Pietra del Giuramento dei Draghi Blu', 'Raggiungi con Kalecgos la Pietra del Giuramento dei Draghi Blu.', 'La Vastità Azzurra è stata stabilizzata per ora, altri Draghi Blu sono arrivati... appena in tempo.\n\nÈ il momento di tornare agli Archivi Azzurri e reclamare la Pietra del Giuramento.\n\nGradirei la tua presenza là, $n. Il tuo aiuto è stato fondamentale.', '', '', '', '', '', '', 47187),
(66011, 'itIT', 'In ricordo di Ysera', 'Trova Theramus.', 'Oh no! Ora penso di aver capito. Theramus... gli manca Ysera, e lei non può tornare.\n\nVieni! Credo di sapere dove è andato. Non lo infastidiremo ulteriormente, ma gli diremo che ci dispiace e che gli daremo lo spazio che gli serve.\n\nSiamo qui l\'uno per l\'altro, nella natura che ci circonda.', '', '', '', '', '', '', 47187),
(66009, 'itIT', 'A difesa di Vakthros', 'Sconfiggi Korthrox il Distruttore.', 'È giunto il momento, $n. Le forze dei Primalisti in volo diminuiscono, ora che hai sistemato la situazione a terra.\n\nRaszageth sta chiamando uno dei suoi luogotenenti a supporto dei Primalisti, tutto grazie a te.\n\nHo bisogno che ti occupi di questo mostro mentre io mi spingo oltre per affrontare Raszageth e aiutare Khadgar.\n\nCerca la mia magia durante lo scontro, farò il possibile per aiutarti.\n\nÈ tempo che Raszageth affronti la furia dell\'Aspetto della Magia!', '', 'Uno dei luogotenenti di Raszageth, intenzionato a distruggere i Draghi Blu.', 'Korthrox il Distruttore', '', '', 'Trova Khadgar risalendo Vakthros e parla con lui.', 47187),
(66007, 'itIT', 'Aria libera', 'Distruggi $1oa Segnalatori di Lava.', 'I Primalisti stanno usando questi enormi globi per tenere a bada Kalecgos.\n\nDi questo passo, Kalecgos sarà troppo ferito per continuare a combattere. Se dovesse cadere, non riusciremmo ad affrontare Raszageth.\n\nLa gemma potenziata che possiedi dovrebbe consentirti di passare per un elementale e proseguire di nascosto.\n\nUsa la gemma per distruggere i globi, così dovresti dare spazio a Kalecgos di sguinzagliare il suo potere.\n\nIo concentrerò la mia attenzione sul difendere la torre da Raszageth.', '', '', '', '', '', 'Incontra Kalecgos in una caverna all\'interno della Vetta di Vakthros.', 47187),
(66006, 'itIT', 'Ritorna da Roscha', 'Riporta i rifornimenti al Maniscalco Roscha.', 'Baba si è riposata e le scorte di Roscha sono state recuperate. Possiamo tornare senza farla inquietare ancora di più.\n\nPrendi delle casse quando vai. Manderò dei guerrieri per il resto.', '', '', '', '', '', '', 47187),
(66005, 'itIT', 'Medaglione dell\'Amico Caduto', 'Riporta il Medaglione dell\'Amico Caduto a Khasar.', '<Questo pezzo di metallo masticato era una volta uno splendido ornamento di grande importanza per un Centauro Shikaar.> \n\n<Khasar potrebbe saperne di più sul proprietario.>', '', '', '', '', '', 'Riporta il Medaglione dell\'Amico Caduto a Khasar.', 47187),
(66004, 'itIT', 'Galgresh', '', '', '', '', '', '', '', '', 47187),
(66003, 'itIT', 'Anelli per domarli', 'Raccogli $1oa Anelli Vincolanti Fusi.', 'I Djaradin qui sono diventati sfrontati, vincolando elementali delle fiamme e permettendo loro di distruggere la zona. La fauna è fuggita e gli elementali sono pericolosamente vicini ai nostri accampamenti.\n\nPer fortuna ho potuto costruire un piccolo bastione di pietra per opporci alla marea di fiamme scatenata dai Djaradin... Noi non cadremo!\n\nOttieni gli anelli magici che vincolano gli elementali delle fiamme, serviranno a rinforzare le nostre difese.', '', '', '', '', '', '', 47187),
(66001, 'itIT', 'Un\'ultima speranza', 'Salva l\'ultimo Uovo di Drago Infuso.', 'Un\'intera nidiata di draghetti, perduta...\n\n<Sendrax raddrizza la schiena e porta in alto il mento.>\n\nC\'è un altro posto che non abbiamo ancora controllato: l\'enorme luogo del rituale dove il proto-drago ha lasciato le uova.\n\nLanciamoci in una carica congiunta contro le loro spietate difese e salviamo ciò che possiamo, $p.', '', '', '', '', '', '', 47187),
(66000, 'itIT', 'La biblioteca di Alexstrasza', 'Salva $1oa opere d\'importanza culturale.', '<Le pagine di questo libro sono ridotte in cenere.>\n\n<I Primalisti stanno bruciando gli antichi tomi contenuti in questo posto, mandando in fumo la storia degli Stormi dei Draghi.>\n\n<Salva ciò che puoi.>', '', '', '', '', '', '', 47187),
(65999, 'itIT', 'Unghie e denti rossi', 'Uccidi $1oa invasori Primalisti.', 'Il Comandante Lethanak ha avvertito le nostre reclute di aver ricevuto un rapporto sulla Mangiatempeste, Raszageth: è scappata dalla sua prigione! Sembra che i suoi servitori l\'abbiano seguita, minacciando la nostra gente.\n\nSi muovono rapidamente... Si dice che queste rovine siano state abbandonate durante l\'ultima pattuglia.\n\nDobbiamo fermare i Primalisti.\n\nPer la Protettrice della Vita e per tutti gli Stormi dei Draghi!', '', '', '', '', '', '', 47187),
(65998, 'itIT', 'Il futuro degli stormi', 'Salva le Uova di Drago di Rubino.', 'Dopo l\'addestramento, il compito più importante che si possa assegnare a un Draconide è la preservazione delle uova di drago a costo della propria vita.\n\nEsistiamo e ci alleniamo per questo unico scopo.\n\nIo non posso più starmene da parte a osservare, $p. Con il furto e l\'infusione delle uova, i Primalisti minacciano l\'intero futuro degli Stormi dei Draghi!\n\nSiamo in netta inferiorità numerica, ma resterai al mio fianco? Combatterai per salvare gli Stormi dei Draghi?', '', '', '', '', '', '', 47187),
(65997, 'itIT', 'Alla ricerca di Sendrax', 'Trova Sendrax alle rovine del Vivaio della Protettrice della Vita.', 'La Cadetta Sendrax è passata di qui non molto tempo fa.\n\nHa inoltrato gli ordini del Comandante Lethanak a tutti i draconidi: devono radunarsi presso le Pozze della Vita. Tutto il nostro reggimento difensivo è partito in quella direzione poco dopo.\n\nI nostri esploratori, però, erano di pattuglia tra le vecchie rovine, quindi Sendrax è andata a cercarli.', '', '', '', '', '', 'Incontra Sendrax al Vivaio della Protettrice della Vita.', 47187),
(65996, 'itIT', 'Rinforzi veterani', 'Aiuta le guardie ferite e trova Sendrax.', 'Il Comandante Lethanak è stato perspicace, come sempre. Avremo bisogno dell\'aiuto delle nostre guardie più capaci per fermare questa minaccia. Radunarli è il compito perfetto per una giovane cadetta come Sendrax, ma potrebbe aver bisogno di supporto.\n\nSendrax dovrà andare a ovest, ma la zona potrebbe essere già stata invasa. Anche lì ci sarà bisogno di aiuto. Prendi questa mistura e dai loro il tuo sostegno.', '', '', '', '', '', 'Incontra Sendrax all\'Avamposto del Vivaio.', 47187),
(65995, 'itIT', 'La Cittadella d\'Ossidiana', 'Consegna i Progetti dei Qalashi a Irathion.', '<A un primo sguardo, questa sembra essere una comunicazione interna tra gli accampamenti dei Djaradin.>\n\n<Le parole \"Cittadella d\'Ossidiana\" ti saltano all\'occhio.>\n\n<Forse Irathion sarebbe interessato a vedere questo oggetto.>', '', '', '', '', '', '', 47187),
(65994, 'itIT', 'Giustizia dei Djaradin', '', '', '', '', '', '', '', '', 47187),
(65993, 'itIT', 'Guastafeste', 'Uccidi Tritacarne Sotok nel Forte Spaccascaglia.', 'Ah, sì.\n\nHo visto la capa di quei giganti tornare da un\'incursione poco dopo il mio arrivo. Starà festeggiando la vittoria da qualche parte nell\'accampamento.\n\nSarebbe un peccato se qualcuno interrompesse la festa, non credi?', '', 'Il condottiero a capo dell\'attacco dell\'Avamposto Cuor di Drago.', 'Tritacarne Sotok', '', '', 'Incontra Irathion all\'interno del Forte Spaccascaglia.', 47187),
(65992, 'itIT', 'Informazioni Grinfianera', 'Parla con le spie di Irathion nascoste nel Forte Spaccascaglia.', 'Mentre Selistra e io li stavamo distraendo dall\'alto, le ombre si sono insinuate attraverso le loro difese.\n\nI miei agenti, i Grinfianera, tengono sotto controllo tutta la fortezza. Incontrali e fagli sapere che sei dalla nostra parte. Ti daranno alcune informazioni preziose sui nostri nemici.', '', '', '', '', '', 'Incontra Irathion all\'interno del Forte Spaccascaglia.', 47187),
(65991, 'itIT', 'L\'ora della resa dei conti', 'Incontra Irathion e il Maggiordomo Selistra al Forte Spaccascaglia.', 'La Cadetta Sendrax mi ha informato dei piani del nostro maggiordomo. Grazie alla Protettrice della Vita, possiamo contare sul loro aiuto. Avevamo bisogno di questa tregua per riportare i nostri feriti alle Pozze della Vita, dove potranno essere curati.\n\nVorrei poter dar man forte a Selistra, ma devo tenere le guardie vicino ai feriti. Dovrai andare tu nella roccaforte nemica al posto mio. \n\nSe ci fosse un altro modo per occuparsi dei Djaradin, te lo direi. Ma, come si dice...\n\nBisogna fare ciò che va fatto.', '', '', '', '', '', '', 47187),
(65990, 'itIT', 'Libera i draghetti dal male', 'Salva $1oa Draghetti Piagnucolanti dall\'Avamposto Cuor di Drago.', 'Ci hanno attaccati prima ancora che potessimo reagire. Le mie guardie hanno resistito il più a lungo possibile mentre facevamo evacuare i giovani e gli indifesi... ma temo che ce ne siano altri nell\'avamposto.\n\nAttraversa quel ponte e cerca i sopravvissuti.', '', '', '', '', '', '', 47187),
(65989, 'itIT', 'Invasore Djaradin', 'Uccidi $1oa Djaradin all\'Avamposto Cuor di Drago.', 'Potremmo non avere il potere di riprenderci il nostro avamposto, ma non dobbiamo arrenderci senza combattere.\n\nDimostra loro che non siamo ancora stati sconfitti.', '', '', '', '', '', '', 47187),
(65977, 'itIT', 'Recupero del Kirin Tor', 'Salva $1oa Maghi Morenti.', 'Quando i Primalisti hanno attaccato la nostra spedizione, ho temuto che avessimo perso molti dei nostri maghi.\n\nA quanto pare erano stati catturati dai Primalisti che li stanno torturando mentre parliamo!\n\nTi prego, devi salvare i maghi rimasti qui, forse non potranno aiutarci a combattere, ma non possiamo abbandonarli!', '', '', '', '', '', 'Incontra la proiezione di Khadgar più avanti nei Prati di Vakthros.', 47187),
(65962, 'itIT', 'Conto alla rovescia infinito', 'Quando vuoi parla con Cromie.', 'Non avrei mai pensato di salvare il nostro tempio smantellando proprio i sistemi di sicurezza che avrebbero dovuto proteggerlo!\n\nCon gli Elementali del Tempo epurati, i nostri Viaggiatori nel Tempo liberi e i nostri Custodi pronti, è finalmente giunto il momento di rimuovere quest\'ultima stasi e poi di occuparci di Eternus.\n\nFammi sapere quando vuoi cominciare. So che, con te al mio fianco, nulla può andare storto.', '', '', '', '', '', '', 47187),
(65958, 'itIT', 'Potere primordiale', 'Usa il Focus Elementale per assorbire l\'energia elementale dai Primalisti uccisi e dagli elementali.', 'Temo stia diventando sempre più difficile mantenere le mie Immagini Speculari. I Primalisti stanno concentrando i loro sforzi nel tirarmi giù dal cielo.\n\nNon preoccuparti, ho un piano.\n\nHo bisogno che tu prenda il globo che hai recuperato e, con esso, accumuli magia elementale dai Primalisti uccisi.\n\nCi servirà quel potere elementale per distogliere le loro forze da me.', '', '', '', '', '', 'Incontra la proiezione di Khadgar più avanti nei Prati di Vakthros.', 47187),
(65957, 'itIT', 'Non c\'è tempo per gli eroi', 'Uccidi Modak lo Sputafiamme, Perforatrice Gigra e Olphis il Fuso.', 'Da ciò che abbiamo visto, la società dei Djaradin è basata sulla forza. I più forti costituiscono un esempio che spinge gli altri a combattere con più impegno.\n\nTra le forze qui sotto ci sono tre esemplari dei Djaradin più forti... sono loro i tuoi bersagli.\n\nTu, $n, li eliminerai personalmente. Questo dovrebbe infliggere un colpo devastante al loro morale.', '', '', '', '', '', '', 47187),
(65956, 'itIT', 'L\'assalto delle grinfie', 'Distruggi le difese dei Djaradin.', 'Con il tuo aiuto, i miei Assassini Grinfianera abbatteranno i Djaradin che difendono il perimetro esterno. Marchia i bersagli con una piccola bomba stordente, e verranno in tuo aiuto.\n\nProcedi in fretta ed elimina chiunque potrebbe intralciare la nostra avanzata.', '', '', '', '', '', '', 47187),
(65955, 'itIT', 'Il migliore amico di un Centauro', 'Libera Khasar e incontralo nella caverna.', 'Non è sicuro rimanere allo scoperto, $p.\n\nI gorloc hanno spinto la mia compagna di caccia, Baba, in una caverna a est.\n\nLiberami, poi salveremo Baba. Ci vediamo nella caverna quando la strada sarà libera.', '', '', '', '', '', '', 47187),
(65954, 'itIT', 'Liberare i segugi', 'Libera i bakar degli Shikaar.', 'Ho sentito gli ululati e i latrati familiari di bakar che sono spariti dall\'accampamento.\n\nI nostri amati cani sono intrappolati in gabbie, in attesa di essere fatti a pezzi da quelle... cose.\n\nAbbiamo un dovere verso i nostri compagni. Liberali e assisti alla vera potenza di un bakar degli Shikaar!', '', '', '', '', '', '', 47187),
(65953, 'itIT', 'L\'ora degli oracoli', 'Raccogli $1oa Totem degli sciamani gorloc.', 'Di tutta la follia in questo villaggio dei gorloc, non c\'è niente di peggio degli sciamani gorloc.\n\nSono particolarmente feroci e giocano in modo avventato con la magia della tempesta, senza curarsi delle conseguenze.\n\nDobbiamo porre fine a tutto questo. Uccidili e portami i loro totem. Ai nostri mistici interesseranno.', '', '', '', '', '', '', 47187),
(65952, 'itIT', 'Un capo leggendario', 'Uccidi il Capo Grrlgllmesh', 'I gorloc di questa palude erano creature semplici. Fastidiose forse, ma mai predoni, ladri o mangiatori di cani.\n\nÈ il loro capo, Grrlgllmesh, che li ha allontanati dalla loro natura.\n\nFallo fuori e i gorloc non ci minacceranno più.', '', 'A Grrlgllmesh, il più potente tra i Gorloc, non resta altro da sopraffare, se non la sua disperazione.', 'Capo Grrlgllmesh', '', '', '', 47187),
(65951, 'itIT', 'Unico fornitore', 'Perlustra i boschi in cerca di Khasar.', 'Povera Roscha! Ha lavorato senza sosta per prepararsi alla carovana, solo per vedere i suoi rifornimenti rubati da quei maledetti gorloc.\n\nHa già perso così tanto... Sto facendo del mio meglio per assisterla.\n\nKhasar è probabilmente andato a cercare la sua merce, senza dire niente. Fa sempre così. Ma è andato da troppo tempo e mancano anche molti cani.\n\nTi dispiacerebbe cercare Khasar e i cani, $p?', '', '', '', '', '', 'Parla con Khasar al Villaggio dei Pinnalorda', 47187),
(65950, 'itIT', 'Gorloc ladruncoli', 'Recupera i rifornimenti rubati dal Villaggio dei Pinnalorda.', 'Il Maniscalco Roscha partecipa alla carovana? No! E chi deve fornire delle scarpe per la carovana? Il Maniscalco Roscha. E a chi rubano i Pinnalorda? Ma certo, al Maniscalco Roscha.\n\nManderei Khasar, ma chissà dove si trova questa volta? \n\nTrova i miei rifornimenti. Insegna a quelle creature che non si ruba al Maniscalco Roscha.\n\nVai!', '', '', '', '', '', 'Parla con Khasar al Villaggio dei Pinnalorda', 47187),
(65949, 'itIT', 'La cura per l\'anima', 'Riporta il Medaglione al Maniscalco Roscha.', 'Quando ci uniamo a Ohn\'ahra nel vento, lasciamo questi medaglioni.\n\nAnche se ho aiutato a creare questo medaglione, non ne sono il suo legittimo proprietario.\n\nDovrebbe tornare a Roscha. È l\'ultimo ricordo della sua promessa sposa.\n\nPortaglielo, così che possa osservare il lutto e trovare pace.', '', '', '', '', '', '', 47187),
(65948, 'itIT', 'Fratture nel tempo', 'Usa i cristalli orientali e occidentali per potenziare ulteriormente il tuo Bastone dei Viaggiatori nel Tempo.', 'Quando il tempio si è sigillato, i Custodi sono stati sigillati con esso. Dobbiamo scoppiare quella bolla di stasi per tirarli fuori! Sfortunatamente, ci servirà un Bastone dei Viaggiatori nel Tempo al massimo della sua potenza...\n\nLo so! Puoi prosciugare i cristalli qui sulle piattaforme! Questo dovrebbe caricare il tuo bastone a sufficienza.\n\nHanno i loro campi di stasi, quindi devi tirarli fuori e assorbirli con il bastone.\n\nSe si dovessero frantumare, non sentirti in colpa. Il potere è ancora lì, anche se in pezzi!', '', '', '', '', '', '', 47187),
(65947, 'itIT', 'Viaggiatori nel Tempo bloccati', 'Libera $1oa Viaggiatori nel Tempo dalle Bolle Temporali.', 'Sono così felice che tu sia qui! Ho bisogno che tu stabilizzi la situazione qui sulle piattaforme mentre Dante e Zera mi aiutano a tenere occupata la nostra amica drago.\n\nQuando Eternus ha cercato di assumere il controllo della nostra Pietra del Giuramento, le misure di sicurezza del tempio l\'hanno chiusa in una bolla di stasi. Sfortunatamente, gli altri Viaggiatori nel Tempo sono rimasti intrappolati.\n\nIl tuo Bastone da Viaggiatore nel Tempo dovrebbe liberarli senza problemi. Basta che ti occupi di ogni creatura temporale che salta fuori!', '', '', '', '', '', '', 47187),
(65944, 'itIT', 'Getto di lava', 'Distruggi $1oa Globi di Lava.', 'I Primalisti hanno distrutto la montagna per inviare le loro forze verso Vakthros!\n\nHo individuato alcuni Globi di Lava nel corridoio iniziale, vengono usati per diffondere ulteriore caos elementale.\n\nDistruggili per rallentare la loro avanzata, io farò il possibile da quassù per aiutare Kalecgos.', '', '', '', '', '', 'Incontra la proiezione di Khadgar più avanti nei Prati di Vakthros.', 47187),
(65943, 'itIT', 'Offensiva primordiale', 'Sconfiggi $1oa Primalisti dentro a Vakthros.', 'Khadgar e io stiamo facendo del nostro meglio per tenere a bada i Primalisti in cielo, non possiamo spingerci oltre in direzione della torre.\n\nAbbiamo bisogno di te, indebolisci le loro forze a terra cosicché possiamo avvicinarci a Raszageth e fermarla prima che sia troppo tardi.\n\nFatti strada attraverso i Primalisti. Se mantengo la concentrazione, ci sarà un\'altra Immagine Speculare ad aspettarti.', '', '', '', '', '', 'Incontra l\'immagine speculare di Kalecgos all\'interno dei Prati di Vakthros.', 47187),
(65940, 'itIT', 'Cammino interrotto', 'Viaggia con la carovana degli Shikaar fino all\'attraversamento sul fiume.', 'Spero che non ti dispiaccia bagnarti un po\'. La prossima tappa del nostro viaggio ci porterà attraverso due fiumi.\n\nOhn Seshteng vorrebbe condividere con te una storia sulla nostra guardiana benedetta, Ohn\'ahra. Ti lascio volentieri con lei.', '', '', '', '', '', '', 47187),
(65939, 'itIT', 'Il coraggio delle proprie convinzioni', 'Ottieni il controllo della Cittadella d\'Ossidiana.', 'La prossima battaglia sarà senza dubbio feroce, ma il nostro coraggio e la nostra determinazione sconfiggeranno la loro superiorità numerica.\n\nConto sulle tue eccezionali abilità per guidare le truppe alla vittoria.\n\nInizieremo l\'assalto quando sarai $gpronto: pronta;.', '', '', '', '', '', '', 47187),
(65938, 'itIT', 'La squadra del futuro e del passato', 'Usa il tuo Bastone da Viaggiatore nel Tempo per far scoppiare la bolla di stasi alla porta del tempio.', 'Va bene! Scoppiamo quella bolla di stasi attorno alle porte del tempio e liberiamo i nostri Custodi! Sei $gpronto:pronta; per un enorme tiro alla fune col tempo?\n\nTira la bolla attorno alla porta, come hai fatto con i cristalli poco fa, ma fai attenzione, tutta l\'energia temporale rilasciata sicuramente si raggrupperà per attaccarti. Non so cosa troverai ma, se non altro, avrai i Custodi liberati al tuo fianco.\n\nBuona fortuna, $n!', '', '', '', '', '', '', 47187),
(65937, 'itIT', 'Prova di negligenza', 'Trova e mostra le prove dei danni al Cammino dei Lillà a Theramus.', 'Non possiamo arrenderci. Deve capire cosa sta succedendo qua fuori! Se lui non è disposto a lasciare la grotta, gli porteremo noi delle prove.\n\nQualsiasi cosa andrà bene, ne sono certa. Un pezzo di pianta corrotta o qualche animale ferito?', '', '', '', '', '', '', 47187),
(65935, 'itIT', 'Raggiungere Cromie', 'Incontra Cromie sulle piattaforme di Confluenza Temporale.', 'Ci hai aiutati a riconquistare la nostra fortezza, ma sento che qualcosa di più grave sta accadendo sulle piattaforme del tempio. Raggiungiamo i cieli e raduniamoci con l\'Ambasciatrice Cronormu lassù.\n\nCome sempre, il tempo stringe.', '', '', '', '', '', '', 47187),
(65930, 'itIT', 'Una lotta tra vento e acqua', 'Affronta Kraunot, lo Spirito dell\'Aria, vicino alla Calalume di Kauriq.', 'Ora dovremmo essere in grado di affrontare gli spiriti.\n\nRuriq non te ne ha parlato? Secondo le tradizioni della nostra tribù, dobbiamo affrontare gli spiriti in combattimento prima di poter chiedere i loro favori. L\'efficacia della loro benedizione dipenderà da quanto riusciremo a impressionarli.\n\nForse è per questo che la Pescalumi ha insistito perché collaborassimo.\n\nSe tu penserai a Kraunot, lo Spirito dell\'Aria, Ruriq e io ci occuperemo di Otu\'rorq, lo Spirito dell\'Acqua.\n\nGli Spiriti dimorano nella caverna dietro la cascata qui vicino. Ci vediamo lì, $gavventuriero:avventuriera;.', '', 'Lo spirito dei gelidi venti che soffiano attorno alla Calalume di Kauriq. Si diverte quando viene sfidato dai giovani Tuskarr ansiosi di dimostrare il proprio valore.', 'Kraunot', '', '', '', 47187),
(65929, 'itIT', 'Rompere il ghiaccio', 'Libera le Acque Gelide dal ghiaccio vicino alla Calalume di Kauriq.', 'Sapevo che l\'antenata avrebbe approvato!\n\nNon so molto sugli spiriti... lo sciamano qui è Kauj. Ma dovremo placare i grandi Spiriti dell\'Aria e dell\'Acqua prima che possano mostrarsi a noi. \n\nTroverai degli Elementali dell\'Acqua che stanno lentamente congelando in cima alla montagna, ma non si tratta di un processo naturale: ultimamente il freddo è sceso dalle montagne con maggiore impeto rispetto al solito. Come se non bastasse, l\'intero fiume potrebbe ghiacciare.\n\nLiberali dalle loro gelide prigioni!', '', '', '', '', '', '', 47187),
(65928, 'itIT', 'Venti ribelli', 'Raccogli $1oa Granuli di Venti Irrequieti dai Venti Irrequieti vicino alla Calalume di Kauriq.', 'Bah! Collaborate, ha detto? \n\nComunque... se la Pescalumi crede ci sia la possibilità di aiutare le altre tribù... dobbiamo tentare. \n\nPerché lo Spirito del Vento Kraunot entri in contatto con noi, dovremo prima di tutto entrare in sintonia con il suo elemento. Gli Elementali del Vento nelle vicinanze hanno iniziato ad agitarsi quando la terra si è risvegliata.\n\nMentre ispeziono questa barca che avete costruito, voi due andate a eliminarli, poi portatemi i loro granuli irrequieti. In questo modo dovrebbe tornare un po\' di tranquillità nell\'area.', '', '', '', '', '', '', 47187),
(65926, 'itIT', 'Affrontare le cascate', 'Aiuta Ruriq a costruire la Saltafiumi.', 'Hai mai sentito la storia della Pescalumi? La Pescalumi costruì una meravigliosa barca, così robusta da riuscire a discendere le cascate!\n\nL\'anziana Nava adora raccontare questa storia.\n\nCredo che i nobili spiriti dei mammut On\'tuq sarebbero onorati se utilizzassimo i materiali ricavati dalle loro spoglie per ricreare un\'imbarcazione del genere.\n\nMio fratello non è d\'accordo, ma se ci riuscissimo, potremmo trasportare il pesce alle nostre tribù sorelle in difficoltà.\n\nHai già avuto modo di dimostrare la tua abilità e la tua dedizione! Sono sicuro che insieme potremo realizzare qualcosa di grandioso.', '', '', '', '', '', '', 47187),
(65925, 'itIT', 'Epurare gli epuratori', 'Uccidi le Serpi dei Ghiacci e i Trivellatori di Ghiaccio vicino alla Calalume di Kauriq.', 'Questi dragoni non appartengono a queste terre. Non so cosa li abbia attirati qui dai loro covi sotterranei, ma ormai non c\'è più modo di aiutarli.\n\nNon possiamo permettergli di sterminare la fauna locale.\n\nUccidi i dragoni, $n. Puoi tenere i trofei ricavati dai loro cadaveri, se vuoi. Una volta finito, mi troverai alla Calalume.', '', '', '', '', '', 'Incontra Ruriq alla Calalume di Kauriq.', 47187),
(65921, 'itIT', 'Castigo per i Refti', 'Uccidi i Primalisti e salva i Refti nel Bacino del Forte di Tyr.', 'Non riesco a togliermelo dalla testa, $p. Tante delle mie sorelle massacrate! Vite buttate via... Il loro sacrificio non dev\'essere invano!\n\nI miei soldati hanno rintracciato i Primalisti e dicono che alcune delle nostre sorelle sono ancora vive.\n\nDobbiamo salvarle e assicurarci che ogni Primalista conosca la mia rabbia!', '', '', '', '', '', '', 47187),
(65920, 'itIT', 'Per la guardia!', 'Usa le Pietre di Volta Mancanti per riparare le protezioni del bacino idrico, poi riattiva la console.', 'Possiamo finalmente ripristinare le protezioni. Abbiamo subito grandi perdite, ma il nostro lavoro deve essere completato.\n\n$p, abbiamo bisogno del tuo aiuto ancora una volta. \n\nPorta ogni Pietra di Volta al posto che le spetta per ripristinare le protezioni. Fatto ciò, torna indietro, così possiamo attivare la console e riportare l\'ordine nel bacino idrico.', '', '', '', '', '', '', 47187),
(65918, 'itIT', 'Manutenzione preventiva', 'Uccidi $1oa Elementali Scatenati nella Bacino del Forte di Tyr.', 'Gli Elementali Primordiali si stanno riproducendo senza controllo. Di solito io e le mie sorelle ce ne occuperemmo, ma non siamo in condizioni di combatterli. Abbiamo perso troppi soldati. \n\nInoltre, noi pochi rimasti abbiamo altre questioni da sbrigare.\n\n<Zuttiki sussulta di dolore.>\n\nÈ qui che entri in gioco tu, $p. Potresti occuparti degli elementali?', '', '', '', '', '', '', 47187),
(65916, 'itIT', 'Non negoziamo con i Primalisti', 'Uccidi il capo dei Primalisti Ko\'jo e recupera le Pietre di Volta mancanti nella Bacino del Forte di Tyr.', 'I Primalisti pensavano di poter superare la potenza di Tyr. Si sbagliavano.\n\nI miei Refti sono riusciti a rintracciare i Primalisti in una grotta non lontano da qui. Come pensavo, hanno le Pietre di Volta mancanti.\n\n$gCampione:Campionessa;, se vogliamo ripristinare il bacino idrico, dobbiamo recuperare quelle Pietre di Volta.\n\nInoltre, il loro capo deve essere ucciso così non tenteranno un secondo assalto.', '', '', '', '', '', '', 47187),
(65914, 'itIT', 'Magnifici mammut', 'Recupera i Frammenti di Pelle di On\'tuq e le Zanne di On\'tuq dai Mammut On\'tuq Caduti vicino alla Calalume di Kauriq.', 'La nostra tribù si è presa cura del gregge di mammut On\'tuq con orgoglio per generazioni. Ora... non ci sono più.\n\nLe loro anime persisteranno, piene di rabbia, dopo un massacro simile. Dobbiamo rendere onore alle loro vite facendo buon uso dei resti.\n\nCe ne sono troppi per noi. Ti prego, aiutaci a raccogliere tutto il materiale possibile dai giovani e dalle matriarche, poi incontriamoci alla Calalume di Kauriq.', '', '', '', '', '', 'Incontra Ruriq alla Calalume di Kauriq.', 47187),
(65913, 'itIT', 'Guarda, un Guardiano!', 'Salva la Guardiana Mara dai Primalisti nel Bacino del Forte di Tyr.', 'Che i Titani siano lodati! $C, abbiamo bisogno del tuo aiuto!\n\nI Primalisti hanno attaccato pochi istanti fa. Io e le mie sorelle abbiamo potuto difenderci, ma a un duro prezzo...\n\nMa avremo tempo per piangere quando la mia Guardiana sarà al sicuro! Un gruppo di Primalisti si è allontanato mentre stavamo lottando e giuro che se hanno ferito la nostra Guardiana...\n\nDevi aiutarla, prima che sia troppo tardi!', '', '', '', '', '', '', 47187),
(65911, 'itIT', 'Allineamento azzurro', 'Torna da Kalecgos negli Archivi Azzurri.', 'I legami di questa comunità, l\'amicizia e la familiarità che condividono.\n\nIo... non ho mai avuto nulla del genere. Lo Stormo dei Draghi Blu non lo ha mai avuto, forse perché non ne abbiamo mai avuto l\'opportunità.\n\nFinalmente è giunto il momento, devo radunare i miei simili.\n\nVediamoci agli Archivi Azzurri, abbiamo molto da fare.', '', '', '', '', '', 'Torna da Kalecgos negli Archivi Azzurri.', 47187),
(65907, 'itIT', 'Frutto preferito', 'Raccogli Fruttafronda Selvatica dai Geyser degli Ohn\'ir e dalla da mangiare a $1oa Pestafango Sdraiati.', 'L\'addestramento per diventare mistici è noiosissimo. Passo la metà del tempo a osservare l\'acqua e a constatare che è bagnata! I miei fratelli, invece, sono già in giro a cacciare drachi e Primalisti, per fare la differenza.\n\nComunque, ti ho promesso di mostrarti qualcosa di fantastico. Sapevi che i pestafango amano la fruttafronda? Cresce vicino ai geyser. Vai a raccoglierne un po\', così potremo nutrirli insieme!', '', '', '', '', '', '', 47187),
(65906, 'itIT', 'Un\'iniziata scontenta', 'Parla con l\'Iniziata Radiya presso le Sorgenti degli Ohn\'ir nelle Pianure di Ohn\'ahra.', 'Ho ricevuto una lettera interessante dalle Sorgenti degli Ohn\'ir.\n\nPer quanto riguarda il contenuto della lettera, descrive, cito, condizioni assolutamente terrificanti da prigionia, mentori severissimi e noia estrema. È firmata ufficialmente \"Iniziata Radiya\". C\'è anche lo schizzo di un\'aquila che... ehm, calcia una centaura di nome Meluun giù da una scogliera.\n\nBe\'. Immagino sia una richiesta d\'aiuto, se ti interessa andare a dare un\'occhiata. A essere sinceri, penso che Radiya stia bene, manda spesso lettere simili.', '', '', '', '', '', 'Parla con l\'Iniziata Radiya presso le Sorgenti degli Ohn\'ir nelle Pianure di Ohn\'ahra.', 47187),
(65905, 'itIT', 'Non semplici erbacce', 'Ripulisci il Cammino dei Lillà dalla crescita eccessiva di vegetazione e dai mostri.', 'Forse è meglio dare un po\' di tregua a Theramus.\n\nPerò non possiamo starcene qui con le mani in mano. Il bosco si sta distruggendo a vista d\'occhio. Aiutaci, per favore!', '', '', '', '', '', '', 47187),
(65904, 'itIT', 'Quando è troppo...', 'Porta le prove dei danni al Cammino dei Lillà a Theramus.', 'Triste o no, Theramus deve fare il suo lavoro. Finché se ne sta rintanato lì dentro, non può vedere le conseguenze della sua assenza.\n\nAndiamo insieme a mostrargli le prove.', '', '', '', '', '', '', 47187),
(65903, 'itIT', 'Morbidezza imbattibile', 'Cattura $1oa Saltatori delle Radure.', 'Povero Theramus. Ho un\'idea per tirarlo su di morale!\n\nPrendi questa rete e usala per catturare alcuni dei saltatori di qui, che sono docili ma veloci. Si sono insediati vicino alla costa.\n\nPoi li porteremo a Theramus, che sarà letteralmente sopraffatto dalla loro soffice bontà!', '', '', '', '', '', '', 47187),
(65902, 'itIT', 'Cibo o coccole', 'Porta la Carne di Tartaruga alle Erbe e i Saltatori delle Radure a Theramus.', 'Guarda che carne succulenta e deliziosa! Parlo in termini puramente teorici, naturalmente. Sono vegetariana.\n\nOra vai! Probabilmente sono giorni che non mangia!', '', '', '', '', '', '', 47187),
(65901, 'itIT', 'Circospezione', 'Piazza i Totem dell\'Aria nelle Sorgenti degli Ohn\'ir e poi informa Radiya.', 'Sono in punizione a tempo indeterminato! La mia Ohn non sa che compirò sedici anni la prossima primavera? Dovrei avere la libertà di andarmene quando voglio.\n\nPenso che tu possa aiutarmi. Ho un piano: sfruttare questi totem per concentrare l\'aria e creare un bel trambusto! Ma non posso andare in giro a posizionarli, sono sotto il massimo controllo del vento. Nemmeno Togo è disposto ad aiutarmi.\n\nMa con il tuo aiuto... Ti prego! Prometto che ti mostrerò una cosa fantastica.', '', '', '', '', '', 'Incontra Radiya presso lo Specchio del Cielo.', 47187),
(65900, 'itIT', 'Bistecca stranamente speziata', 'Raccogli $1oa pezzi di Carne di Tartaruga Perfettamente Tenera, $2oa Gusci d\'Uovo Rettiliani e $3oa Bocciolaspri.', 'L\'idea di mia sorella è affascinante, ma Theramus ha bisogno di un vero aiuto.\n\nOssia del bocciolaspro, in abbondanza. Possiamo trasformarlo in una poltiglia da spalmare sul suo cibo preferito, la carne di tartaruga!\n\nMi aiuteresti a recuperare gli ingredienti?', '', '', '', '', '', '', 47187),
(65899, 'itIT', 'Trova Theramus', 'Perlustra le caverne nelle vicinanze e trova Theramus.', '$R! Sei qui per visitare il bellissimo Cammino dei Lillà? Mi dispiace tanto per il suo stato attuale. Giuro che di solito non è così incustodito!\n\nTheramus, il custode del giardino, doveva incontrarci oggi per affrontare insieme alcuni problemi. Ultimamente ha faticato con la manutenzione, quindi io e Felina lo stiamo aiutando. Ma non possiamo fare tutto.\n\nCi aiuteresti a cercarlo in giro? Forse se n\'è dimenticato.', '', '', '', '', '', 'Torna da Celina Scrocchiafoglia.', 47187),
(65898, 'itIT', 'Proto problemi', 'Ottieni il Locus e sconfiggi il proto-draco che lo protegge.', 'Non nutro alcuna simpatia per la Fiamma Frammentata, ma nemmeno io posso restare a guardare mentre si distruggono in questo modo. È una situazione fin troppo familiare.\n\nQualunque cosa sia questo Locus, è più sicuro nelle nostre mani che nelle loro grinfie. Segui la pista di cadaveri, sospetto che lo troveremo.\n\nFai attenzione, $p. Temo che il nido non sia del tutto abbandonato come sembra.', '', '', '', '', '', '', 47187),
(65896, 'itIT', 'Che la guarigione abbia inizio', 'Aiuta la gente di Roccavento a guarire.', 'Pensavi di poter entrare in questa città senza che me ne accorgessi? Sbagliato!\n\nL\'avevo vista lunga sulla tua razza e che io sia dannato se lascerò che i draghi distruggano di nuovo la mia casa.\n\nQuesto una volta era un parco pieno di gioia e pace. Poi è arrivato il tuo progenitore, Alamorte. Oh sì, so tutto di lui.\n\nGuarda la distruzione che si è lasciato alle spalle. Il dolore pervade ancora queste strade.', '', '', '', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(65895, 'itIT', 'Il gruppo antagonista', 'Raccogli informazioni sulla Fiamma Frammentata.', 'Bah! Massacrare dei lavoratori non porterà a nulla!\n\nCerca i loro capi. Da uno di loro avremo certamente le informazioni che cerchiamo.\n\nOh, e $n! Ascoltali prima di ucciderli, questa volta. Potresti apprendere qualcosa di utile.', '', '', '', '', '', 'Incontra Adenedal vicino alla cima delle rovine.', 47187),
(65893, 'itIT', 'A caccia di reliquie', 'Raccogli $1oa Frammenti di Manufatto di Nelthazan.', 'La Fiamma Frammentata è qui. Affideresti un sito pieno di manufatti preziosissimi a qualcuno che ha \"frammentato\" nel nome?\n\nEcco, appunto. Indipendentemente da ciò, se vogliamo procedere dobbiamo prima scoprire cosa vogliono. Raccogli ciò che riesci a recuperare da loro e riferiscimi tutto quello che riesci a scoprire.\n\nCi sono più pezzi in questo puzzle di quanti manufatti ci siano nel terreno!', '', '', '', '', '', '', 47187),
(65892, 'itIT', 'Frammentata e in pezzi', '', '', '', '', '', '', '', '', 47187),
(65891, 'itIT', 'Raccolta di attrezzi', 'Posiziona gli Attrezzi Incantati presso $1oa mucchi di macerie.', 'Bene. Stavo proprio pensando che avevo bisogno di qualcuno come te. Forte. Aitante. Sempre disponibile a lavorare per una cifra esigua.\n\nÈ come se i miei desideri si fossero avverati! Ben fatto a me. Queste rovine sembrano aver attirato l\'attenzione di altri, ma non possiamo sperare che scavino correttamente. Rischiano di contaminare i campioni!\n\nPrendi questo. Attivalo vicino ai manufatti importanti nelle rovine. È incantato e si occuperà di svolgere qualsiasi compito necessario.', '', '', '', '', '', '', 47187),
(65890, 'itIT', 'Le Rovine di Nelthazan', 'Incontra lo Scriba del Cielo Adenedal alle Rovine di Nelthazan.', 'La Spedizione delle Scaglie di Drago richiede la tua assistenza!\n\nNon molto tempo fa, ho inviato uno Scriba del Cielo alle rovine per raccogliere informazioni. Dovrebbero essere disabitate... ma sento le sue grida da qui. Dev\'essere in una brutta situazione, se lo si sente urlare da questa distanza.\n\nIn questa spedizione, ci prendiamo cura dei nostri compagni. Anche quelli insopportabili. Cercalo e proteggilo da qualunque pericolo abbia trovato.', '', '', '', '', '', '', 47187),
(65887, 'itIT', 'Verso la montagna', 'Incontra le immagini speculari di Khadgar e Kalecgos alla base dei Prati di Vakthros.', 'È una scena da non perdere, Khadgar e Kalecgos lassù nel cielo che si scontrano con i Primalisti!\n\nHanno evocato svariate Immagini Speculari di sé stessi per aiutarti ad oltrepassare il mostruoso buco creato dai Primalisti.\n\nUn paio di loro si trova alla base della montagna proprio ora.\n\nSe le cose si mettono male, lanceremo un appello al resto della Vastità Azzurra.', '', '', '', '', '', 'Incontra le immagini speculari di Khadgar e Kalecgos alla base dei Prati di Vakthros.', 47187),
(65886, 'itIT', 'Verso lo Scudo di Rhonin', 'Incontrati con Drok Pergamenatore sulla Terrazza della Torre.', 'Raszageth e i Primalisti stanno lanciando un assalto in forze contro Vakthros. Non possiamo permettere che vinca!\n\nKhadgar e io andremo avanti per gestire la situazione dal cielo.\n\nNel frattempo, fatti strada verso lo Scudo di Rhonin, uno degli ultimi accampamenti del Kirin Tor nell\'area.\n\nPotresti viaggiare più velocemente cavalcando quel tuo draco dalla cima degli archivi.\n\nControlla che i membri del Kirin Tor là stiano bene, poi avviati verso Vakthros.\n\nContiamo su di te per ricevere aiuto da terra.', '', '', '', '', '', 'Incontra Drok Pergamenatore allo Scudo di Rhonin.', 47187),
(65875, 'itIT', 'Il giorno libero del drago', 'Trova le varie bevande per Vazallia.', 'Abbiamo passato la vita nelle Terre Esterne, a combattere senza sosta.\n\nAnche i draghi hanno bisogno di un giorno libero, ogni tanto, da passare al mare con una bevanda fresca tra le zampe.\n\nEhi, forse tu puoi aiutarmi! Fammi un favore e vedi se riesci a trovare alcune bevande per dare una rinfrescata alle nostre scorte.', '', '', '', '', '', '', 47187),
(65874, 'itIT', 'Un\'orrida rivelazione', 'Parla con Hanu, l\'Anziana Poa e Norukk.', 'Hmm...\n\n<Brel scruta con attenzione lo strano totem, rigirandolo nelle sue grandi mani.>\n\nDobbiamo unire le forze e scoprire cosa nasconde quest\'oggetto.', '', '', '', '', '', '', 47187),
(65873, 'itIT', 'Capobranco Zampalosca', 'Uccidi Scrocchiazampa e recupera il suo totem.', 'Scrocchiazampa è il vero capo degli Gnoll di questo versante della foresta. Lo abbiamo già incontrato in passato... e non è stato piacevole.\n\nMa stavolta aveva qualcosa di diverso. Aveva con sé uno strano totem che sembrava in grado di alterare la sua essenza.\n\nScrocchiazampa dev\'essere fermato e quel totem recuperato. Temo che gli Gnoll stiano escogitando qualcosa di più oscuro e temibile di quanto immaginiamo.', '', 'Scrocchiazampa è sempre stato malvagio, ma è diventato più aggressivo da quando ha con sé un Totem Infetto.', 'Scrocchiazampa il Fetido', '', '', '', 47187),
(65872, 'itIT', 'Perfidi Gnoll con perfidi intenti', 'Uccidi $1oa Gnoll Zampalosca nell\'Antro di Scrocchiazampa.', 'Sento uno strano odore nel vento. C\'è qualcosa che non va.\n\nSecondo Hanu, gli Gnoll di questa caverna hanno qualcosa di strano... di malato. Dovremmo cercare di scoprire cosa sta causando tutto questo.\n\nNon abbassare la guardia. Nonostante l\'aspetto provato, non credo si riveleranno meno subdoli e pericolosi del solito.', '', '', '', '', '', '', 47187),
(65871, 'itIT', 'Gnoll c\'è via di fuga', 'Salva Norukk e altri $1oa Tuskarr prigionieri.', 'Ho rintracciato i Tuskarr catturati, incluso mio marito Norukk: si trovano in questa caverna.\n\nNorukk di solito non bada molto alla sua incolumità, quindi devo pensarci io. Ma non sono così orgogliosa da non poter chiedere aiuto.\n\nSalvali, ti prego!', '', '', '', '', '', '', 47187),
(65870, 'itIT', 'Rifornimenti!', 'Recupera le casse di rifornimenti di caccia.', 'Non c\'era traccia delle nostre Forniture da Caccia rubate sulle Colline di Grande Albero: saranno in quella caverna.\n\nTieni gli occhi aperti per localizzare i rifornimenti e stai $gpronto:pronta; a tutto.\n\nCon gli Gnoll in giro non c\'è da fidarsi a lasciare la merce incustodita.', '', '', '', '', '', '', 47187),
(65869, 'itIT', 'Un\'altra imboscata', 'Parla con Akiun ed esamina $2oa cadaveri nelle vicinanze.', 'È una tragedia. E potenzialmente solo la prima di molte altre che verranno.\n\nScopri cosa sa Akiun, poi ispeziona i corpi di tutti i caduti nella battaglia.\n\nHo un presentimento su cosa sia successo qui, ma vediamo se ci sono indizi che supportano la mia ipotesi.\n\nNel frattempo, io cercherò di rassicurare i miei amici sconvolti.', '', '', '', '', '', '', 47187),
(65868, 'itIT', 'Questa roba non si mangia', 'Recupera $1oa Offerte Funerarie.', 'Ho trovato una delle offerte funebri di Ponoliak, è stata trattata in modo a dir poco rozzo e poi gettata via da questi dannati Gnoll Zampalosca. Ci sono segni di morsi dappertutto!\n\nQuesta offerta, insieme ad altre, è necessaria per la cerimonia commemorativa del nostro Capoclan Iskaara, che di recente ci ha lasciati.\n\nÈ un affronto vedere un oggetto così sacro utilizzato come giocattolo da masticare. Tieni gli occhi aperti per recuperare altre reliquie.', '', '', '', '', '', 'Incontra Hanu all\'ingresso dell\'Antro di Scrocchiazampa nelle Colline di Grande Albero.', 47187),
(65867, 'itIT', 'Ululati nelle Colline di Grande Albero', 'Uccidi Durgun, Kerwal e Bakra.', 'A capo degli Gnoll che hanno attaccato la nostra carovana c\'erano tre luogotenenti.\n\nDurgun aveva al suo seguito una decina di iene.\n\nKerwal ridacchiava subdolamente ogni volta che tentavamo di inseguirlo per poi finire in una delle sue trappole dentate.\n\nBakra ci scherniva, senza pietà.\n\nSe vogliamo sperare di recuperare il maltolto, dobbiamo ucciderli.', '', '', '', '', '', 'Incontra Hanu all\'ingresso dell\'Antro di Scrocchiazampa nelle Colline di Grande Albero.', 47187),
(65866, 'itIT', 'Disinnesca le trappole', 'Fai scattare $1oa Trappole di Fauci Taglienti.', 'Le colline più avanti sono disseminate di letali Trappole di Fauci Taglienti.\n\nCon un\'attenta ricerca, dovresti riuscire a localizzarle. Facendo molta attenzione, falle scattare con questo vecchio trucco tuskarr: un bastone bello lungo. Potresti anche camminarci sopra e ottenere lo stesso risultato, ma ti sconsiglierei di farlo.\n\nUna volta che ne avrai rimosse abbastanza, trova Hanu. Io e l\'Anziana Poa ti raggiungeremo appena possibile.', '', '', '', '', '', 'Incontra Hanu all\'ingresso dell\'Antro di Scrocchiazampa nelle Colline di Grande Albero.', 47187),
(65865, 'itIT', 'Siamo in trappola!', 'Uccidi i tiratori scelti Gnoll.', 'Questi tiratori scelti Gnoll sono spietati... e sorprendentemente precisi.\n\nÈ impensabile cercare di raggiungere le Colline di Grande Albero con le loro armi puntate addosso.\n\nSfoltisci il loro numero e chiariscigli che non intendiamo farci usare per il tiro al bersaglio!', '', '', '', '', '', 'Incontra Hanu all\'ingresso dell\'Antro di Scrocchiazampa nelle Colline di Grande Albero.', 47187),
(65864, 'itIT', 'Raggiungi la carovana', 'Raggiungi Brena vicino alle Colline di Grande Albero.', 'Dovresti ancora riuscire a raggiungere Brena, la sua carovana è passata non più di qualche ora fa.\n\nStavano raccogliendo i beni più preziosi del nostro Capoclan defunto per organizzare un funerale in suo onore.\n\nLa carovana era molto carica e pesante, quindi non può essere molto lontana.', '', '', '', '', '', '', 47187),
(65855, 'itIT', 'In aiuto della Vastità Azzurra', 'Ritorna da Noriko l\'Onnisciente all\'Accampamento Antonidas.', 'L\'energia della Pietra del Giuramento non può essere reclamata finché le linee di faglia nella Vastità Azzurra non vengono riparate.\n\nAlcune linee di faglia possono essere raggiunte solo da qualcuno abile quanto Kalecgos, ma puoi comunque renderti utile.\n\nVai in cerca dei Tuskarr, se sono ancora vivi. Abitavano qui, ai miei tempi, e avevano una profonda conoscenza di queste terre.\n\nParla con uno degli aiutanti arcani per tornare dai tuoi alleati.', '', '', '', '', '', 'Parla con Noriko l\'Onnisciente all\'interno dell\'Accampamento Antonidas.', 47187),
(65854, 'itIT', 'Reclamare la Pietra del Giuramento', 'Osserva Kalecgos reclamare la Pietra del Giuramento Azzurra.', 'Ottimo lavoro, $gamico mio:amica mia;. A quanto pare siamo riusciti a riparare le linee di faglia all\'interno degli Archivi Azzurri.\n\nSe lo Stormo dei Draghi Blu fosse ancora unito come un tempo, direi ai miei fratelli e sorelle di non dubitare mai della forza dei mortali.\n\nIncontriamoci alla Pietra del Giuramento a sud di qui. Dopo averla reclamata mi dirigerò verso Thaldraszus.', '', '', '', '', '', 'Parla con Sindragosa.', 47187),
(65852, 'itIT', 'Dritto in cima', 'Cerca la Pietra Miliare Arcana nella Borsa di Oggetti Utili, quindi utilizzala in corrispondenza di un punto di focalizzazione arcana per raggiungere la cima degli Archivi Azzurri.', 'Sembra che qualcosa stia indebolendo le energie arcane in cima alla torre.\n\nOra che hai stabilizzato le energie quaggiù, dovresti poter \"cavalcare\" la magia arcana in quest\'area.\n\nCerca nella tua sacca, dovresti avere un oggetto chiamato Pietra Miliare Arcana, usalo e incontriamoci in cima.', '', '', '', '', '', 'Incontra Kalecgos sulla cima degli Archivi Azzurri.', 47187),
(65850, 'itIT', 'Il ciclo del mare', 'Parla con Brina per assistere al rito funebre.', 'Grazie, $n. Per il momento ho appreso ciò che mi serve dai nostri nuovi amici.\n\nIl rito funebre del loro precedente Capoclan sta per iniziare. Data l\'estrema gentilezza e ospitalità degli Iskaarani, mi sembra giusto unirci a loro prima di fare ritorno agli Archivi.\n\nParla con Brena e falle sapere che noi siamo pronti.', '', '', '', '', '', '', 47187),
(65849, 'itIT', 'Verso Iskaara', 'Incontra Brena a Iskaara.', 'Grazie per il tuo aiuto, $n. La mia famiglia è al sicuro grazie a te.\n\nOra possiamo finalmente tornare a Iskaara e restituire al mare il vecchio Ponoliak. È stato il mio mentore e anche un ottimo Capoclan.\n\nPer favore, unisciti a noi. Una cerimonia del ciclo del mare è qualcosa a cui tutti dovrebbero assistere.', '', '', '', '', '', 'Incontra Brena a Iskaara.', 47187),
(65848, 'itIT', 'Vincolato al tomo', 'Parla con Kalecgos per aprire il portale, quindi sfrutta le sue evocazioni per eliminare i Putrificatori Felcepelle e distruggere l\'Antico Corrotto.', 'Dobbiamo fermare quell\'albero! Con questi cristalli di faglia, posso finalmente essere d\'aiuto.\n\nParla con me quando sarai $gpronto:pronta;. Aprirò un portale per gli Archivi Azzurri e cercherò di recuperare qualcosa di utile. \n\nStai indietro, il portale potrebbe rivelarsi piuttosto instabile.', '', '', '', '', '', 'Parla con Kalecgos nella caverna di cristalli di faglia.', 47187),
(65847, 'itIT', 'Riallineamento', 'Concentrati sul Cristallo di Faglia, poi distruggi 3 Infezioni del Decadimento.', 'Ora, veniamo a questa linea di faglia. Sembra che i miei timori fossero fondati: il decadimento si è diffuso all\'interno della linea stessa.\n\nDovremo purgare il decadimento per accelerare il processo di guarigione, ma non riesco a canalizzare abbastanza energia tramite la mia immagine speculare.\n\nConcentrati su questo cristallo di faglia. Il nostro legame dovrebbe permettermi di teletrasportarmi qui, in forma fisica. A quel punto sarò abbastanza forte.', '', '', '', '', '', 'Trova Kalecgos fuori da Felcepelle.', 47187),
(65846, 'itIT', 'Raccolta di Faglia', 'Raccogli $1oa Cristalli di Faglia dai Sobborghi dei Felcepelle.', 'La linea di faglia è qui, lo sento!\n\nMa prima, dobbiamo fermare gli Gnoll. Quell\'antico sarà la loro arma più potente.\n\nCi sono alcuni Cristalli di Faglia che gli Gnoll hanno racimolato. Fortunatamente, non sembrano capirne il potere.\n\nPortamene più che puoi, daranno energia alla mia Immagine Speculare consentendomi di evocare qualcosa di utile dagli archivi per poter affrontare quel mostro!', '', '', '', '', '', '', 47187),
(65845, 'itIT', 'Echi dei caduti', 'Piazza il Totem di Brena vicino a $1oa cadaveri Tuskarr per contattare i loro spiriti.', 'Ci sono dei Tuskarr qui! I miei amici, la mia gente... la mia famiglia. Sono partiti per andare a caccia, non più di una settimana fa.\n\nOrmai sono già troppo contaminati dal decadimento per riprendersi.\n\nI loro spiriti sono ancora qui, trattenuti dalla rabbia e dal rimpianto. Kaqiata, Lutokk, Tuyuki...\n\nTi prego, $n, porta con te questo totem e piazzalo vicino alle loro spoglie. Servirà a contattare i loro spiriti... e a offrirgli un po\' di conforto.', '', '', '', '', '', '', 47187),
(65844, 'itIT', 'Estirpare le radici', 'Uccidi $1oa Treant Marci e $2oa Scagliapiaga Felcepelle', 'Il decadimento deve aver corrotto i cervelli di questi Gnoll, insieme ai loro corpi!\n\nPer quanto siano creature distruttive, gli Gnoll sono nativi di questa terra, proprio come noi.\n\nMa li abbiamo già visti diffondere il decadimento alla Tribù del Grande Albero. Di questo passo, consumeranno la Vastità e si autodistruggeranno.\n\nNon possiamo permettere che accada. È una vera sciagura... ma dobbiamo porre fine a questa minaccia.', '', '', '', '', '', '', 47187),
(65842, 'itIT', 'Comportamento disarmante', 'Elimina il Mastro d\'Armi Vordak e raccogli $1oa Armi dei Devastamondi.', 'Non ho un grande amore per i dragoidi Devastamondi. Seguono false credenze sul ritorno di Alamorte e non ci aiuteranno a proteggere il Trono d\'Ossidiana.\n\nIl Mastro d\'Armi Vordak, un tempo fedele seguace del Principe Nero, ha trafugato molte armi nella Cittadella e le ha date ai Devastamondi. Non tollererò un simile sopruso, né un tale tradimento.\n\nRaggiungi il Picco Infuocato e recupera le armi... con la forza, se necessario.', '', '', 'Mastro d\'Armi Vordak', '', '', '', 47187),
(65841, 'itIT', 'Fermare la propagazione', '', '', '', '', '', '', '', '', 47187),
(65838, 'itIT', 'Fare breccia a Felcepelle', 'Perlustra i Sobborghi dei Felcepelle.', 'Se gli Gnoll hanno scoperto la magia del decadimento, la linea di faglia e la terra stessa sono in grave pericolo.\n\nLe mie immagini speculari non bastano a contrastare un\'interferenza elementale di tale portata. Per favore, vai nella foresta e indaga sul decadimento.\n\nIo mi metterò al lavoro con i nostri nuovi amici Tuskarr per trovare un luogo dove mantenere attiva la mia immagine. Ci incontreremo più avanti, nella foresta.\n\nDobbiamo porre fine a questa storia!', '', '', '', '', '', 'Parla con Kalecgos all\'interno dei Rovi dei Felcepelle.', 47187),
(65837, 'itIT', 'Problemi nella pineta', 'Parla con la Sentinella Olekk nell\'Avamposto Pignadura nelle Pianure di Ohn\'ahra.', 'C\'è stato un attacco dei Primalisti sulle Alture degli Shikaar.\n\nSe hai delle informazioni o pensi di poter aiutare, recati all\'Avamposto Pignadura e cerca Olekk. Digli che ti ho mandato io. <Tirren ridacchia.> Spero che quel vecchiaccio polveroso si ricordi di me.\n\nSegui la strada, $p, le pianure non sono più così pacifiche, non dopo tutti questi cambiamenti.', '', '', '', '', '', 'Parla con la Sentinella Olekk nell\'Avamposto Pignadura nelle Pianure di Ohn\'ahra.', 47187),
(65836, 'itIT', 'Uno spettacolo di tempesta', 'Torna da Watu presso i Pini Saggiacima.', '<Watu si alza facilmente, come se la ferita fosse scomparsa.>\n\nIo... io... ho infilato la scheggia nel mio corpo. Non sento più male. Mi sento bene. Benissimo. Immenso.\n\nOlekk non è ancora tornato. Qualcosa deve essere andato storto. Non sarebbe mai dovuto andare senza di me!', '', '', '', '', '', '', 47187),
(65834, 'itIT', 'Uccidere la Regina', 'Uccidi la Regina Brivitela.', 'Ci siamo! Un po\' di istruzione, un po\' d\'intuizione, un ritocchino alle rune ed ecco qua un bel dispersore magico! O disperditore? Dispersatore?\n\nQuello che è! Alla regina non piacerà, te lo posso assicurare. E lei deve sparire, se vogliamo sistemare le cose. Abbattere i piccoli servirà solo a rallentarli: devi colpirli alla fonte.', '', 'Non deve mai esserci una Regina dei Ragni.', 'Regina Brivitela', '', '', '', 47187),
(65833, 'itIT', 'Sabotaggio Primalista', 'Recupera le tre Pietre Runiche degli Invocatori del Gelo.', 'I Primalisti stanno infondendo i ragni con ghiaccio elementale. Pensano di usarli come truppe d\'assalto per superare le difese dei Draghi nella Vastità. Non possiamo permetterlo!\n\nQuei tre dall\'aspetto gelido sono al comando. Falli fuori e portami le pietre runiche che stanno usando per focalizzare la magia primordiale, così potremo vedere come interrompere il flusso.', '', '', '', '', '', '', 47187),
(65832, 'itIT', 'Antigelo nanico', 'Trova $1oa Tonici dell\'Antigelo Nanico', 'Sono in un bel pasticcio, $gragazzo:ragazza;. Quei lecca-gelo dei Primalisti mi hanno incastrato in questo grosso cubo di ghiaccio ed è solo grazie alla mia scorta segreta di roba buona che non sono ancora congelato.\n\nPurtroppo, quei ladruncoli mi hanno colto di sorpresa e mi hanno rubato tutto. Ora sono a corto!\n\nFammi un favore e portami i tonici, prima che il sangue mi si congeli nelle vene...\n\nOh, e $gragazzo:ragazza;, se ti trovassi a doverlo estrarre dal fondoschiena di quei maledetti ragni, non dirmelo. Preferisco non saperlo.', '', '', '', '', '', '', 47187),
(65806, 'itIT', 'Maruukai', 'Raggiungi Maruukai.', '<Okir traduce i segni della Khan Sansok in voce.>\n\nMaruukai è situata accanto alla montagna, vicino a questo boschetto. Il nostro viaggio è quasi finito.\n\nIl Khural è un momento di tregua tra i Maruuk, ma dobbiamo rimanere in guardia dopo il presagio ricevuto da Ohn Seshteng.', '', '', '', '', '', '', 47187),
(65805, 'itIT', 'Connessione con Ohn\'ahra', 'Raccogli $1oa Giunchi di Fiume, $2oa Piume di Coda di Pollame e un Cuore di Salamantera dalle sponde del fiume.', 'Il vento sembra agitato, $n. Ohn\'ahra mi sta cercando, devo rispondere alla chiamata.\n\nMi servono dei reagenti per il rituale: giunchi dalle rive del fiume, piume della coda di un germano reale e un cuore di salamantera. Raccogli questi materiali dal fiume, così che possa sentire la sua voce.', '', '', '', '', '', '', 47187),
(65804, 'itIT', 'Per il cibo e la rivalità', 'Raccogli $1oa pezzi di Carne di Selvaggina Fresca dalla fauna delle Steppe del Nomade.', 'I Maruuk arrivano da tutte le pianure per partecipare al Khural. L\'incontro dura molti giorni.\n\nSfamare così tanti Centauri non è un\'impresa semplice: sono i cacciatori del Clan Shikaar a procacciare la carne per tutti i pasti condivisi. È nostra tradizione cacciare mentre andiamo a Maruukai.\n\nQuesta volta dovrai contribuire anche tu.', '', '', '', '', '', '', 47187),
(65803, 'itIT', 'Verso la città', 'Viaggia insieme alla Carovana degli Shikaar fino alle Steppe del Nomade.', 'Il Khural è un momento in cui i clan discutono e si scambiano storie. Ci sono molti clan di Centauri nelle pianure, ma siamo tutti Maruuk.\n\nLa carovana è pronta a partire. Dato che Maruukai è lontana, faremo delle tappe lungo la strada.\n\nQuando vuoi partire, raggiungimi alla carovana. Non farci aspettare.', '', '', '', '', '', '', 47187),
(65802, 'itIT', 'Rifornimenti per il viaggio', 'Raccogli $1oa Provviste da Campo vicino all\'Avamposto di Passotronco e $2oa Baccelli di Sbocciaferino dai boschi vicini.', '<Mentre la Khan Sansok gesticola, Okir traduce i segni in voce.>\n\nSe vuoi viaggiare con noi, dovrai contribuire. Di recente, alcuni Gorloc indisciplinati hanno fatto razzia delle nostre forniture mediche e dobbiamo rifornirci. Raccogli i fiori arancioni intorno all\'avamposto, così potremo creare più impiastri.\n\nCi sono anche dei rifornimenti intorno all\'avamposto che devono essere portati alla carovana. Vorrei che li raccogliessi mentre sei fuori.\n\nQuando avrai tutto, portalo a Tomul.', '', '', '', '', '', 'Fa\' rapporto all\'Esploratrice Tomul.', 47187),
(65801, 'itIT', 'Le dovute presentazioni', 'Presentati ai membri del Clan Shikaar.', '<Mentre la Khan Sansok gesticola, Okir traduce i segni in voce.>\n\nErano innumerevoli generazioni che $gun estraneo:un\'estranea; come te non giungeva nelle nostre terre. I Primalisti calpestano il nostro territorio usando magie proibite e il mio popolo è diffidente. Penso sia comprensibile.\n\nSe vuoi viaggiare con noi, devi farti conoscere. Presentati ai membri del mio clan.', '', '', '', '', '', 'Fa\' rapporto all\'Esploratrice Tomul.', 47187),
(65798, 'itIT', 'Un approccio opportunistico', 'Recupera le armi e uccidi le forze dei Nokhud nel Territorio dei Nokhud.', 'Gli Shikaar hanno formato una linea offensiva contro i Nokhud a nord. Anche se non mi piace abbassarmi a tal punto da rovistare, sfortunatamente è necessario per i nostri rifornimenti. Affronta il campo di battaglia e torna con le armi, e io ricompenserò i tuoi sforzi.\n\nSe tu potessi concentrare detti sforzi sul lato Nokhud della linea... forse gli antenati mi giudicherebbero meno duramente.', '', '', '', '', '', '', 47187),
(65796, 'itIT', 'La miglior difesa...', 'Uccidi Sirena la Spezzazanne', 'Il nostro prossimo percorso è attraverso il territorio dei Nokhud. Storicamente abbiamo sempre avuto una fragile pace con il loro clan, ma i tempi sono cambiati.\n\nSe non agiamo per primi, offriremo loro il fianco mentre siamo vulnerabili. I miei esploratori hanno riferito che una dei loro capi di guerra è stata avvistata vicino alla Consulta dei Draghi. Affronta direttamente lei e non lasciare che riprendano le forze per attaccarci.', '', '', '', '', '', '', 47187),
(65795, 'itIT', 'Verso le steppe', 'Incontra l\'Ambasciatore Taurasza all\'Avamposto delle Scaglie di Rubino.', 'Lo Stormo dei Draghi Verdi richiede il tuo aiuto, $geroe:eroina;. La figlia di mia sorella e il suo stormo sono entrati nel Sogno di Smeraldo nel tentativo di potenziare la propria Pietra del Giuramento, ma non ne abbiamo più saputo nulla da quando si sono addormentati.\n\nCerca i Centauri che governano le Pianure di Ohn\'ahra. Potresti aver bisogno del loro legame con la terra e i suoi spiriti, per risvegliare i draghi verdi.\n\nSono guerrieri orgogliosi e territoriali, che non prendono gli insulti alla leggera. Parla con il nostro ambasciatore, ti preparerà.', '', '', '', '', '', 'Incontra l\'Ambasciatore Taurasza all\'Avamposto delle Scaglie di Rubino.', 47187),
(65794, 'itIT', 'Una carica di cura', 'Osserva le Uova dei Draghi Neri ricongiungersi alla Pozza della Vita.', 'Ti ringrazio, $C. Mi rincresce che tu abbia dovuto passare del tempo con quei due.\n\nLo Stormo dei Draghi Rossi ha l\'incarico di preservare e crescere tutti i draghi, anche quelli più fastidiosi.\n\nCon il ritorno delle uova dello Stormo dei Draghi Neri, tutte le stirpi dei draghi sono unite come non lo erano mai state negli ultimi millenni. Penso che questo sarà ciò che ripristinerà la Pietra del Giuramento di Rubino.\n\nTorna a parlare con me quando vorrai portare le uova nella Pozza della Vita di Ossidiana.', '', '', '', '', '', '', 47187),
(65793, 'itIT', 'Lo stormo del carro nero', 'Scorta le uova alle Pozze della Vita.', 'Con la Pietra del Giuramento di nuovo potenziata, ora possiamo trasportare il futuro della nostra specie nelle Pozze della Vita. È diritto di ogni vero stormo di draghi far crescere le proprie uova vicino a quelle acque.\n\nSfortunatamente, i nostri nemici controllano i cieli, ora che ci siamo rivelati. Faremo la parte finale del nostro viaggio a piedi, così da evitare di essere visti.\n\nIncontriamoci vicino al Baluardo d\'Ossidiana, $C. Come $gcampione:campionessa; della Protettrice della Vita, potrai unirti a me in questo ultimo passo.', '', '', '', '', '', 'Parla con Sabellian in cima al Tempio della Vita di Rubino.', 47187),
(65792, 'itIT', 'Denti per dente', 'Uccidi $1oa Grinfiadura con Toluijin.', 'Toliqui dice che l\'altro giorno ha ucciso una Grinfiadura senza alcun aiuto. Considerata l\'unione delle nostre anime, non voglio chiamarla bugiarda. Invece... \n\nVoglio dimostrare a lei, e a tutti gli altri, di essere la metà migliore della nostra anima! La missione più vicina per i Grinfiadura è a nord-est. Incontriamoci lì!', '', '', '', '', '', '', 47187),
(65791, 'itIT', 'Protettrice della Vita al lavoro', 'Incontra Alexstrasza vicino alla Pietra del Giuramento di Rubino.', 'Presto le Pozze della Vita saranno di nuovo piene.\n\nGrazie per il tuo contributo, $n! Significa più di quanto io possa esprimere.\n\nVai, trova la Protettrice della Vita presso la Pietra del Giuramento. Dille che siamo pronti per le uova.', '', '', '', '', '', 'Incontra Alexstrasza vicino alla Pietra del Giuramento di Rubino.', 47187),
(65789, 'itIT', 'Dove dormono i fiumi', 'Raccogli reagenti nel Pantano Troncogonfio.', 'Il Troncogonfio contiene i reagenti chiave spesso usati per parlare con gli antenati. Sfortunatamente, la Tribù Pinnafango infesta l\'area, rendendo difficile procacciarsi risorse.\n\nSe riuscissi a raccogliere alcuni dei boccioli nella palude, insieme ad alcune delle risorse di Pinnafango, ne sarei felice.', '', '', '', '', '', '', 47187),
(65783, 'itIT', 'Benvenuti al nostro falò', 'Incontra l\'Esploratrice Tomul all\'Avamposto di Passotronco.', 'Hai combattuto al fianco dei nostri cacciatori, ti meriti un posto al nostro fuoco.\n\nLa nostra Khan è al posto di caccia nella palude, a preparare la nostra prossima carovana. La informerò del tuo arrivo e della tua missione.\n\nNon ho dubbi che riuscirai a trovare la strada.', '', '', '', '', '', 'Incontra l\'Esploratrice Tomul all\'Avamposto di Passotronco.', 47187),
(65782, 'itIT', 'Sottochiave', 'Ottieni la Chiave della Cella dei Devastamondi e libera Ayasanth.', 'Quando abbiamo sentito parlare di un culto di Alamorte, Maggiordomo Selistra mi ha ordinato di riportare all\'ovile questi rinnegati. Speravamo che fosse un semplice malinteso.\n\nChiaramente, ci sbagliavamo.\n\nIl loro leader deve essere affrontato, ma prima devo uscire da questa gabbia... Trova la chiave e portamela!', '', '', '', '', '', '', 47187),
(65780, 'itIT', 'Dar prova di sé', 'Uccidi il Proto-Drago Fiammeggiante.', 'Altri Centauri potranno anche restare colpiti da un dono dei draghi, ma il Clan Shikaar deve vedere come te la cavi con la caccia.\n\nUno dei nostri gruppi di caccia ha appena catturato un proto-drago infuso col potere del fuoco. Dimostra il tuo valore partecipando all\'uccisione.', '', 'Quando un Centauro diventa adulto, spesso ci si aspetta che partecipi alla sua prima caccia al proto-drago.', 'Proto-Drago Fiammeggiante', '', '', '', 47187),
(65779, 'itIT', 'Nelle pianure', 'Incontra l\'Esploratore Shikaar nelle Pianure di Ohn\'ahra.', 'Lo Stormo dei Draghi Verdi è tornato ai suoi giardini nelle pianure vicine. La regina Alexstrasza desidera che tu prenda contatto con Merithra del Sogno.\n\nI Centauri che vivono in quelle pianure sono feroci cacciatori: per raggiungere i Giardini di Smeraldo, dovrai prima stabilire un rapporto diplomatico con loro.\n\nPorta rispetto, ma non mostrare debolezza.', '', '', '', '', '', 'Incontra l\'Esploratore Shikaar nelle Pianure di Ohn\'ahra.', 47187),
(65778, 'itIT', 'Cena con lo Strillastormo', 'Indossa il travestimento e usa il Prototipo di \"Uovo\" sulla Chef Personale della Matriarca.', 'Sei $gpronto:pronta; a far buon uso delle tue abilità teatrali, $n?\n\nCosa? Non hai abilità teatrali? Allora è una fortuna che ti ho creato questo travestimento imBECCabile da Strillastormo con tutti i materiali che hai appena raccolto!\n\nSegallia e io abbiamo bisogno di altro tempo per finire di preparare \"l\'uovo\" finale che eliminerà la Matriarca, ma ne ho creato una versione più piccola, un prototipo per provare con la cuoca.\n\nE non preoccuparti! Quelle piume offrono il 12% di protezione in più!', '', '', '', '', '', '', 47187),
(65777, 'itIT', 'Collana sporca di fango', 'Trova un esperto di caccia e di manufatti artigianali.', '<Le antiche incisioni sulla collana si leggono a malapena, ma sembra sia stata fabbricata con pelle animale e frammenti di ossa intagliati.\n\nForse un cacciatore esperto potrebbe darci informazioni più approfondite sul valore e l\'importanza di quest\'oggetto.>', '', '', '', '', '', '', 47187),
(65770, 'itIT', 'Ogni promessa è debito', 'Prometti all\'Iniziata Radiya di mantenere il suo segreto.', 'Sembra che gli animali siano a proprio agio con te. Significa che sei una brava persona!\n\nComunque... Sai mantenere un segreto? Voglio presentarti alla mia amica, nessun altro sa di lei.\n\nPrima però devi promettermi che resterà tra noi. La mia Ohn mi esilierebbe dalle pianure se lo scoprisse.', '', '', '', '', '', 'Parla con Godoloto, l\'ohuna.', 47187),
(65769, 'itIT', 'Ragnatele gelide', 'Libera $1oa Sopravvissuti Imbozzolati nella Valle di Brivitela.', 'Molti dei miei amici e colleghi sono stati catturati quando gli aracnidi e i loro padroni Primalisti ci hanno attaccati.\n\nLi ho visti mentre venivano avvolti in ragnatele gelide e trascinati via, verso un destino che non oso immaginare.\n\nTi prego, salva tutti quelli che puoi!', '', '', '', '', '', '', 47187),
(65761, 'itIT', 'Avventure oltre ogni previsione', 'Collabora con Godoloto per trovare e salvare Radiya.', '<Lo sguardo di Godoloto è penetrante e accusatorio. Sbuffa.>\n\n<Forse l\'ohuna può aiutarti a trovare e salvare Radiya.>', '', '', '', '', '', '', 47187),
(65760, 'itIT', 'A rapporto', 'Segui Sendrax all\'Avamposto Cuor di Drago.', 'Ho letto dei Djaradin solo nei libri.\n\nAntichi rivali dei draghi, giganti potenti con padronanza della terra e della lava... dediti interamente all\'estinzione dei draghi.\n\n<Sendrax aggrotta la fronte guardando il vulcano lontano.>\n\nIl mio istruttore ha detto che non si erano più visti dopo la partenza dei draghi, poiché dormivano nelle profondità della terra.\n\nSe si sono svegliati, ogni draghetto delle isole è in pericolo!\n\nSeguimi, andremo dal Comandante Lethanak all\'Avamposto Cuor di Drago.', '', '', '', '', '', 'Parla con il Comandante Lethanak all\'Avamposto Cuor di Drago.', 47187),
(65758, 'itIT', 'Grungir l\'Esploratore', 'Trova Grungir Sputaferro', '$N! La mia controparte della Lega degli Esploratori, Grungir Sputaferro, non era tra coloro che hai salvato. Si era aperto una via di fuga combattendo, ma quando si è reso conto che in pochi erano riusciti a cavarsela, ha deciso di tornare indietro! Da solo!\n\nQuello sciocco è coraggioso quanto impulsivo e si non si merita che gli succeda qualcosa di male.\n\nTi prego... trovalo.', '', '', '', '', '', '', 47187),
(65752, 'itIT', 'Seccature arcane', 'Uccidi $1oa Dragoni Banchettanti.', 'Diversi Dragoni di Mana stanno assorbendo la magia arcana incontrollata proveniente dagli archivi.\n\nLo stanno facendo a un ritmo tale che l\'equilibrio delle linee di faglia finirà per destabilizzarsi... impedendoci di reclamare la Pietra del Giuramento Azzurra.\n\nUserò un po\' dell\'arcano instabile che hai raccolto per formare una sorta di gancio.\n\nUsalo per neutralizzare alcuni dragoni. Dovrebbe darmi tempo sufficiente per ripristinare le energie sottostanti.', '', '', '', '', '', '', 47187),
(65751, 'itIT', 'Modifiche alla piattaforma', 'Dissolvi $1oa Energie Arcane Instabili in cima agli Archivi Azzurri.', 'Sembra che l\'ultima interferenza arcana si trovi qui.\n\nIo continuerò a occuparmi delle energie di faglia. Usa un po\' dell\'energia arcana che hai recuperato per neutralizzare le interferenze nella zona.', '', '', '', '', '', '', 47187),
(65750, 'itIT', 'Minaccia a otto zampe', 'Uccidi $1oa Ragni Brivitela o Strisciatori Brivitela e $2oa Curatori Primalisti nella Valle di Brivitela.', '$C!\n\nHo bisogno del tuo aiuto, se sei disponibile...\n\nQuesta spedizione congiunta è stata organizzata per studiare la peculiare specie di aracnidi che popola l\'area, ma, come puoi vedere, le cose non sono andate secondo i piani.\n\nQuello che credevamo essere un adattamento evolutivo si è rivelato un perverso esperimento dei Primalisti per stravolgere l\'ordine della natura!\n\nDi solito prendo seriamente le mie responsabilità, ma credo che ormai non sia più il caso di studiare esemplari vivi. Non possiamo lasciare che la loro perversione si diffonda. Piuttosto, possiamo studiare i loro cadaveri.\n\nTi va di aiutarci?', '', '', '', '', '', '', 47187),
(65711, 'itIT', 'Rubargli la scena', 'Uccidi le Estrattrici della Tempesta e salva Lizi la Spinatonante nel Campo Kaighan.', 'Sei tu! Sia lodata Ohn\'ahra. Stavo facendo finta di essere ferita per ingannare il prossimo bruto che avesse osato entrare qui. Ugh... Quei lecca-zoccoli mi hanno fatto un incantesimo vincolante. Devo capire quale.\n\nTengono Lizi nella caverna. Per favore, salvala. Io scoprirò da sola come liberarmi.\n\nFai quello che devi fare.', '', '', '', '', '', '', 47187),
(65709, 'itIT', 'Sfoltimento arcano', 'Cerca lo Scettro della Faglia nella Borsa di Oggetti Utili e usalo per riparare 2 piattaforme.', 'Non possiamo attivare la Pietra del Giuramento negli Archivi Azzurri finché non risolviamo il problema con l\'energia di faglia fuori controllo qui.\n\nDue delle tre rune draconiche, che dovrebbero controllarla, sono ostacolate dall\'energia arcana instabile.\n\nPurtroppo devo affidarti questo compito, considerate le responsabilità di Khadgar e la mancata presenza dei miei compagni.\n\nDovrebbe esserci uno Scettro della Faglia nella tua sacca di rifornimenti.\n\nUsalo per riparare le rune qui vicine.', '', '', '', '', '', '', 47187),
(65702, 'itIT', 'Verso la follia', 'Recupera $1oa Energie Arcane Instabili.', 'Gli Archivi Azzurri una volta erano usati come luogo di ritrovo dai Draghi Blu per discutere di magia.\n\nOra, sono l\'unico dei miei simili qui.\n\nQuesto luogo controlla le linee di faglia sotto la Vastità Azzurra, ma è andato fuori controllo, così come i suoi servitori.\n\nCredo che, una volta riportato l\'ordine in questo luogo, potrò reclamare la Pietra del Giuramento Azzurra.\n\nI vari costrutti e elementi straripano di energia arcana instabile che deve essere reindirizzata.\n\nDistruggili e recupera ciò che puoi.', '', '', '', '', '', '', 47187),
(65701, 'itIT', 'Conservazione o Devastazione', 'Scegli una specializzazione.', 'Se ciò che questi draghi dicono è vero, allora ci attende una grande battaglia. Abbiamo bisogno di te, $gEvocatore:Evocatrice;.\n\nÈ ora di scegliere la tua specializzazione in battaglia. Proteggerai i tuoi alleati o devasterai i nemici?\n\nPer affinare le tue abilità di combattimento, scegli Devastazione.\n\nPer massimizzare il tuo potenziale di cura, prendi il sentiero della Conservazione.\n\nOgni specializzazione ti sarà utile. Ricorda, puoi cambiarla o adattarla anche in un secondo momento.', '', '', '', '', '', '', 47187),
(65691, 'itIT', 'All\'ombra delle sue ali', 'Affronta Cygenoth, Voce di Neltharion.', 'La Voce di Neltharion risiede in basso e diffonde bugie tra i suoi seguaci.\n\nSembra essere un dragobestia come me, ma il suo draconico è goffo, adatto ai senzascaglie.\n\nSospetto duplicità: un\'illusione, forse. Se riusciamo a sottometterlo, certamente la verità verrà fuori.', '', 'Autoproclamato Voce di Neltharion e capo dei Devastamondi.', 'Cygenoth', '', '', '', 47187),
(65690, 'itIT', 'Timori di un cultista', 'Trova Ayasanth al Trespolo Infuocato.', 'Ieri è arrivata un\'altra straniera. Ha detto di essere un\'emissaria dello Stormo dei Draghi Rossi e ha chiesto un\'udienza con il nostro capo, la Voce di Neltharion.\n\nMa la Voce si è davvero infuriata. Ha detto che il Custode della Terra ci stava mettendo alla prova e che avremmo dovuto giustiziarla!\n\nSo che non dovremmo fidarci degli stranieri, ma non c\'è bisogno di ucciderli! Ti prego, aiutami a salvarla.', '', '', '', '', '', 'Parla con Ayasanth al Trespolo Infuocato.', 47187),
(65689, 'itIT', 'Le molte immagini di Kalecgos', 'Usa il Pilone di Cristallo per raggiungere gli Archivi Azzurri.', 'Piacere di incontrarti ufficialmente, $n. Il mio nome è Kalecgos, Arcimago del Kirin Tor e Aspetto dello Stormo dei Draghi Blu.\n\nHo difficoltà a riparare gli Archivi Azzurri per reclamare la Pietra del Giuramento Azzurra. Un paio di mani in più mi sarebbero molto utili.\n\nAl momento mi trovo proprio negli archivi. Ho riattivato il pilone di fuori, dovrebbe permetterti di arrivare quassù.', '', '', '', '', '', 'Parla con Kalecgos all\'interno degli Archivi Azzurri.', 47187),
(65688, 'itIT', 'Incontro con Kalecgos', 'Procurati la Borsa di Oggetti Utili, quindi incontra Kalecgos alla base degli Archivi Azzurri.', 'Temo che dovremo dividere la nostra attenzione. La minaccia dei Primalisti va gestita.\n\nDevo chiederti di andare agli Archivi Azzurri in mia vece, per aiutare Kalecgos nel reclamare la Pietra del Giuramento Azzurra.\n\nDovrai recuperare qualche rifornimento per aiutarti a risolvere il problema una volta là.\n\nParla con il nostro quartiermastro del portale, dovrebbe avere qualcosa che può esserti utile.\n\nBuona fortuna, $n. Kalecgos ti sarà grato dell\'aiuto.', '', '', '', '', '', 'Incontra Kalecgos alla base degli Archivi Azzurri.', 47187),
(65687, 'itIT', 'Pugno duro', 'Uccidi $1oa Dragoidi Devastamondi.', 'Alcuni degli altri discepoli sono... molto cattivi.\n\n<Lingotto si strofina una ferita fresca sul muso.>\n\nNon è sempre stato così, ma al suo arrivo, Cygenoth ha detto \"Dovremmo valorizzare la forza prima di tutto\". Ora si combatte continuamente.\n\nIo cerco di reagire! Ma le loro pelli sono troppo robuste... e io sono troppo piccolo.\n\nMa tu no! Tu combatti i cattivi tutto il tempo! Forse puoi aiutarmi?', '', '', '', '', '', '', 47187),
(65686, 'itIT', 'Verso la Vastità Azzurra', 'Incontrati con Glania dei Benedetti nella Vastità Azzurra.', 'Saluti, $n!\n\nPakina e io siamo qui in cerca di aiuto a nome del Kirin Tor.\n\nI membri del Kirin Tor stanno lavorando per proteggere la magia arcana che si trova naturalmente ovunque nella Vastità Azzurra.\n\nKalecgos, l\'Aspetto dello Stormo dei Draghi Blu, nonché uno dei nostri capi, ha bisogno di aiuto nel reclamare la Pietra del Giuramento Azzurra che si trova là.\n\nSe vuoi aiutarci, prosegui lungo la strada sino a trovare Glania dei Benedetti.\n\nLei potrà indirizzarti verso dove c\'è più bisogno di aiuto.', '', '', '', '', '', 'Incontra Glania dei Benedetti nella Vastità Azzurra.', 47187),
(65615, 'itIT', 'Intrusione arcana', 'Esamina il Segnalatore.', 'Quel segnalatore laggiù non c\'era, prima che venissimo imprigionati, ne ho la certezza.\nLa magia non è il mio forte, ma riconosco quella arcana quando la vedo. La stessa magia usata da quel Drago Blu nell\'Asilo.\n\nHa detto un nome... Malygos. Suona così familiare, ma gli insegnamenti del Custode della Terra sembrano così lontani. Frammentati.\n\nSe questo Malygos ci ha messi in stasi, forse ha ordinato lui di installare quel Segnalatore Arcano.\n\nIndaga nell\'area e fai rapporto. Assicurati che il segnalatore non possa essere utilizzato per chiamare rinforzi nemici.', '', '', '', '', '', '', 47187),
(65613, 'itIT', 'Un iconico look draconico', 'Adotta una Forma.', 'Sicuramente il tuo arrivo a Orgrimmar avrà attirato l\'attenzione dei cittadini. Senza dubbio alcuni sono stati più a loro agio in tua presenza rispetto ad altri.\n\nQuando ero un giovane drago, ho assunto la Sembianza mortale che ora vedi. Mi ha permesso di vivere tra i Tauren di Alto Monte come alleato.\n\nAnche se la tua strada è diversa dalla mia, l\'essenza dei draghi scorre dentro di te, $p. Forse ti permetterà di assumere una Sembianza tutta tua.\n\nCamminiamo un po\'.', '', '', '', '', '', '', 47187),
(65606, 'itIT', 'Popolare tra i Maruuk', 'Parla con Agari a Maruukai.', 'Le tue imprese a favore del clan non sono passate inosservate.\n\nTorna a Maruukai, ho preparato alcune provviste per aiutarti nel tuo lavoro con noi.', '', '', '', '', '', '', 47187),
(65595, 'itIT', 'La mela marcia', 'Uccidi la Radice del Decadimento.', 'Marcio affama Gnoll.\n\nFa male ad amici.\n\nUccidiamo marcio. Questo fa Mon-Arca.', '', 'Questo Treant maligno sta insegnando la magia del decadimento agli Gnoll. E anche ad avere una cattiva igiene.', 'Radice del Decadimento', '', '', '', 47187),
(65594, 'itIT', 'Esageratamente Gnoll', 'Distruggi $2oa Totem del Decadimento.', 'Stupido marciume pensa di comanda, ma io al comando. Lo uccidiamo ora. Io trasformato melma in amici.', '', '', '', '', '', '', 47187),
(65490, 'itIT', 'Escremento esplosivo', 'Riempi il Secreziometro della Professoressa Cinguetti.', 'Le Arpie sono una bella sorpresa e tutto quanto, ma io sono venuta su queste montagne per un motivo e un motivo solo: GUANO!\n\nIn particolare, il guano dei Grifalchi Piumablu che hanno mangiato e digerito insetti. I succhi gastrici degli scarabei potenziano di dieci volte il contenuto di azoto esplosivo!\n\nEcco, prendi questo Secreziometro Automatico Cinguetti. Schiaccia gli scarabei che brulicano sul pavimento della caverna e usa il Secreziometro per ottenere ciò che mi serve.\n\nRiportami tutto e potremo iniziare a divertirci: ESPLOSIONI!', '', '', '', '', '', '', 47187),
(65486, 'itIT', 'Scatto perfetto', 'Usa la Zattera dei Catalogatori con Fren e scatta foto alla fauna locale.', 'Scusa se ti ho fatto aspettare, mi distraggo spesso col telescopio.\n\nTi sembra mai che il mondo sia più facile da capire guardandolo da lontano? Nessuna interferenza esterna, solo la natura che si fa gli affari suoi senza di noi...\n\n<Akunda la Catalogatrice sospira.>\n\nVedo che Coralie ti ha dato una fotocamera. Bene.\n\nScendi lungo il fiume insieme a Fren e scatta foto di animali selvatici nei loro habitat naturali, così potrò studiarle.', '', '', '', '', '', 'Torna da Akunda la Catalogatrice al suo accampamento.', 47187),
(65475, 'itIT', 'A tutto stridio!', 'Porta la Pergamena delle Strillastormo ad Harleen Cinguetti alle Alture dei Piumablu.', '<Estrai un pezzo di pergamena dalla sacca insanguinata della Mangiafalchi. Tutto quello che riesci a distinguere è l\'immagine di Arpie che divorano grosse uova.>\n\n<Di sicuro questi segni spessi e incomprensibili saranno perfettamente chiari per la tua ornitologa preferita, Harleen Cinguetti.>', '', '', '', '', '', 'Porta la Pergamena delle Strillastormo ad Harleen Cinguetti alle Alture dei Piumablu.', 47187),
(65453, 'itIT', 'Parassiti primordiali', 'Uccidi $1oa Proto-Drachi Primordiali sulla Costa Selvaggia.', '<Batticenere guarda con sospetto i proto-draghi in agguato sul crinale dietro di lei.>\n\nGiuro che quei proto-draghi si avvicinano di più al campo ogni volta che giro la testa...\n\nQuelli non sono i draghi inviati da Ebissian per incontrarci.\n\nI proto-draghi sono predatori spietati con cui non si può ragionare. Dobbiamo essere spietati anche noi.\n\nDobbiamo sfoltire il loro numero per tenere sotto controllo le loro ambizioni, o questa spedizione finirà ancor prima di iniziare.', '', '', '', '', '', 'Incontra il Comandante delle Scaglie Batticenere all\'Ambasciata Riposo Alato.', 47187),
(65452, 'itIT', 'Esploratori in pericolo', 'Salva 3 membri della Spedizione delle Scaglie di Drago nella Costa Selvaggia.', 'Non scambiare per timidezza gli interessi accademici della spedizione, $p.\n\nNon siamo degli eremiti che studiano libri in torri remote.\n\nSiamo avventurieri che danno la caccia alla conoscenza in prima persona in ogni angolo di Azeroth!\n\nQuesta passione per l\'avventura ci porta spesso su sentieri pericolosi e alcuni membri della spedizione hanno fatto il passo più lungo della gamba...', '', '', '', '', '', 'Incontra Naleidea all\'Ambasciata Riposo Alato.', 47187),
(65451, 'itIT', 'Materiali per la professione', 'Raccogli $1oa Scaglie di Proto-Draghetto Primordiale.', 'Non ho mai visto Proto-Drachi del genere in tutta Azeroth.\n\nSembra che le loro scaglie siano naturalmente resistenti al fuoco e più forti dell\'acciaio, pur restando flessibili. Incredibile.\n\nI miei artigiani, tutti quanti, non vedono l\'ora di mettere le mani su quelle scaglie per poterci lavorare.\n\nInizia con i piccoli. Le loro scaglie di dimensioni ridotte dovrebbero risultare più malleabili, finché non avremo affinato le nostre tecniche.', '', '', '', '', '', 'Incontra il Capo Magor all\'Ambasciata Riposo Alato.', 47187),
(65444, 'itIT', 'Verso le Isole dei Draghi!', 'Cavalca la Scaglia di Drago Ribelle alle Isole dei Draghi dalla Torre degli Zeppelin fuori Orgrimmar.', 'La nostra spedizione in avanscoperta è sbarcata sulle Isole dei Draghi.\n\nGrazie ai coraggiosi membri della Spedizione delle Scaglie di Drago, abbiamo stabilito un sito di sbarco protetto nelle Isole dei Draghi e preso contatto con l\'ambasciata dello Stormo dei Draghi.\n\nSei $gpronto:pronta; ad accompagnarci nel nostro prossimo viaggio verso le Isole dei Draghi?', '', '', '', '', '', 'Incontra Naleidea Brillafiumi sulle rive delle Isole dei Draghi.', 47187),
(65443, 'itIT', 'Coordinamento della spedizione', 'Recluta esploratori, artigiani e studiosi a Orgrimmar per la spedizione sulle Isole dei Draghi.', 'Sono Naleidea Brillafiumi, piacere di conoscerti!\n\nL\'invito a visitare le Isole dei Draghi è una prospettiva emozionante! Non sei d\'accordo?\n\nIl Reliquiario ha unito le forze con le controparti della Spedizione per coordinare gli sforzi. Come membro della Spedizione delle Scaglie di Drago, è un onore darti il benvenuto!\n\nMa, innanzitutto, dobbiamo radunare qualche altro membro per il nostro viaggio. Iniziamo?', '', '', '', '', '', 'Incontra Naleidea alla Torre degli Zeppelin fuori Orgrimmar.', 47187),
(65439, 'itIT', 'Sussurri nei venti', 'Parla con l\'Arcimago Khadgar fuori Orgrimmar.', 'Ciao, $p. È passato un po\' di tempo e vorrei che avessimo più tempo per i convenevoli.\n\nMa, vedi, ho appena avuto una conversazione piuttosto illuminante... No, direi sibillina... Sì, una conversazione sibillina con un vecchio amico.\n\nA volte una rivelazione può essere entrambe le cose, dopo tutto.\n\nDevo davvero raccontarti quello che ho scoperto.', '', '', '', '', '', '', 47187),
(65438, 'itIT', 'Inizio missione fantastica', '', 'L\'inizio della Vastità Azzurra.', '', '', '', '', '', '', 47187),
(65437, 'itIT', 'Un invito in-Aspettato', 'Parla con Ebissian.', 'Arrivi proprio al momento giusto, $p!\n\nHo appena incontrato il Concilio dell\'Orda e hanno accettato l\'invito degli Aspetti alle Isole dei Draghi.\n\nLo stesso invito si estende anche a te.\n\nPotresti anche notare alcuni volti sconosciuti qui a Orgrimmar. I Dracthyr sono i nuovi arrivati, imparerai a conoscerli nel viaggio che ci aspetta.\n\nMa continuiamo a parlare.', '', '', '', '', '', '', 47187),
(65436, 'itIT', 'Le Isole dei Draghi attendono', 'Incontra Irathion a Roccavento.', 'Splendide notizie, $gamico mio:amica mia;! Le Isole dei Draghi si stanno risvegliando!\n\nLa mia gente ha lasciato le nostre terre addormentate durante la Separazione. Ora però, dopo lungo tempo, sentiamo il richiamo di casa.\n\nNonostante le isole racchiudano molte meraviglie, sono anche ricche di pericoli. Avremo bisogno di aiuto dai nostri alleati mortali per poter reclamare il nostro retaggio.\n\nIncontriamoci a Roccavento, devo comunicare l\'invito degli Aspetti all\'Alleanza.', '', '', '', '', '', '', 47187),
(65435, 'itIT', 'Le Isole dei Draghi attendono', 'Incontra Ebissian a Orgrimmar.', 'Eroi dell\'Orda, porto notizie. Le Isole dei Draghi si stanno risvegliando!\n\nSi erano assopite durante la Separazione, ma ora, dopo lungo tempo, chiamano i miei simili verso casa.\n\nNonostante le isole racchiudano molte meraviglie, sono anche ricche di pericoli. Avremo bisogno di aiuto dai nostri alleati mortali per poter reclamare il nostro retaggio.\n\nSto per comunicare l\'invito degli Aspetti al Concilio dell\'Orda a Orgrimmar, incontriamoci là, staremo a vedere cosa avranno da dire.', '', '', '', '', '', '', 47187),
(65422, 'itIT', 'Cacciare tesori non è facile', 'Prendi l\'Equipaggiamento da Arrampicata, trova un appiglio e raggiungi la cima della montagna senza perdere la presa!', 'Riesco a leggertelo negli occhi: senti il desiderio di scalare a questa montagna e scoprire cosa c\'è sulla vetta!\n\nNoi scalatori sappiamo sempre riconoscerci. Non permetteremo a nessuna montagna di farci sentire piccoli, giusto?\n\nBene, per tua fortuna ho portato un sacco di Equipaggiamento da Arrampicata. Prendi una sacca e trova un sentiero per la cima!', '', '', '', '', '', 'Parla con Tweets Brillamolla sulla cima della montagna.', 47187),
(65421, 'itIT', 'Scalare ogni montagna', 'Prendi l\'Equipaggiamento da Arrampicata, trova un appiglio e raggiungi la cima della rupe per salvare la Ricognitrice Yips!', 'Spero che impari in fretta, $c. Io non ho certo tempo per farti una lezione!\n\nPrendi una sacca e trova un sentiero per la cima.\n\nQuando arrivi lassù, lancia questo paracadute alla nostra amica Yips. La poverina è rimasta impigliata nei rampicanti quando gli Elementali dell\'Aria hanno abbattuto il nostro velivolo!\n\nGambe in spalla, così possiamo levarci di torno!', '', '', '', '', '', '', 47187),
(65417, 'itIT', 'Unire i puntini', '', '', '', '', '', '', '', '', 47187),
(65374, 'itIT', 'L\'ora della spiumatura', 'Estrai $1oa Piume di Pulcino', 'Harleen mi ha detto che ti sta preparando un travestimento! Che bello! Ma ha bisogno di piume dai pulcini di Grifalco per completare l\'abito.\n\nFortunatamente, ho appena finito di riparare lo Spiumatore 3300!\n\nGli Strillastormo stanno catturando pulcini di Grifalco sulle scogliere più basse per, allevarli loro stessi. Usa lo Spiumatore per salvare i pulcini, nel farlo otterrai anche delle piume!\n\nDue pulcini con uno Spiumatore? È il caso di dirlo.', '', '', '', '', '', '', 47187),
(65373, 'itIT', 'La spiumatura', 'Recupera le 4 parti dello Spiumatore 3300.', 'Oh, no. Ho fatto un grosso errore.\n\nHarleen mi ha affidato una sua fenomenale invenzione: il famoso Spiumatore 3300!\n\nAvevo intenzione di raccogliere piume di Grifalco nella caverna a sud per le sue ricerche, ma le Arpie mi hanno teso un\'imboscata ed è andato in pezzi mentre scappavo.\n\nRecupera i pezzi! Probabilmente sono sparsi come scaglie sul pavimento dopo la muta.\n\nPoi potrò usarli per aggiustarlo. Decisamente. Be\', probabilmente.', '', '', '', '', '', '', 47187),
(65371, 'itIT', 'Un nido tutto nostro', 'Raccogli $1oa Artigli dello Stormo, $2oa Bastoni delle Strillastormo e $3oa Nuclei di Stirpe dei Fiumi.', 'La pergamena che hai trovato è un ordine che vuole che tutte le uova dei piumablu vengano portate alla cuoca delle Arpie, Ariafritta. A quanto pare, la Matriarca degli Strillastormo non mangia niente che non sia stato preparato e condito adeguatamente.\n\nQuindi le porteremo noi un uovo speciale. Uno che sarà ESPLOSIVAMENTE delizioso.\n\nCome lo consegnerai? Con un travestimento!\n\nUccidi le creature sulle scogliere inferiori, raccogli oggetti da questa lista e ti preparerò un completo piumato.', '', '', '', '', '', '', 47187),
(65313, 'itIT', 'Un appetito da falco', 'Uccidi Hawthia Mangiafalchi.', 'Tharzera sembra brava, specialmente con i suoi aggeggi, ma va facilmente nel panico.\n\nPer esempio, quando l\'ho inviata nelle caverne a sud, è fuggita subito da un\'arpia particolarmente grande. Sembra che stesse dando ordini anche alle altre.\n\nChe sia la Matriarca di questa covata? Forse una comandante di qualche tipo? Vai lì e scoprilo, $n.\n\nE non aver paura di pestare qualche piuma, se capisci cosa intendo.', '', 'Un\'arpia Strillastormo particolarmente grossa con un macabro appetito per le ossa di Piumablu.', 'Hawthia Mangiafalchi', '', '', '', 47187),
(65307, 'itIT', 'La pietà prima di tutto', 'Cura i Dracthyr feriti e il Draconide.', 'Il veleno che ha afflitto l\'Asilo ci ha quasi ucciso tutti. L\'antidoto è quasi pronto, ma ho bisogno del tuo aiuto per recuperare i feriti e curarli.\n\nSì, anche i Draconidi Blu. Le Ali Curative non se ne stanno con le mani in mano mentre così tanti soffrono.', '', '', '', '', '', '', 47187),
(65306, 'itIT', 'Allevatore di marciume', 'Raccogli $1oa Melme Puzzolenti dal marciume putrescente.', 'Decadimento schifoso, puzzolente e fa male. Avere idea ma servire melma. PRENDI MELMA!', '', '', '', '', '', '', 47187),
(65302, 'itIT', 'Le chiavi del regno', 'Raccogli la chiave e usala per aprire la cassa delle armi.', 'Io serve armi per piano. Avere armi buone, ma chiuse lontano. Gnoll lasciare chiave in accampamento, proteggere cassa armi.\n\nPrendi bastoni più puntuti. Loro fare più sangue.', '', '', '', '', '', '', 47187),
(65287, 'itIT', 'Separare il tuorlo', 'Raccogli $1oa Uova di Piumablu.', 'Ho decifrato la pergamena e, sorpresa, sono brutte notizie!\n\nLe Strillastormo non stanno solo mangiando i Piumablu per sostentamento. A quanto pare, hanno scoperto un paio di incantesimi che trasferiscono a loro la forza innata dei Grifalchi quando vengono divorati. Specialmente le uova!\n\nSalva quante più uova di Grifalco possibile sulle alture sotto di noi. Rallenterà le Arpie abbastanza a lungo da mettere in moto il mio piano.\n\nE attenzione agli elementali ribelli. Gli incantesimi delle Streghe li hanno risvegliati!', '', '', '', '', '', '', 47187),
(65286, 'itIT', 'Contatti draconici', 'Ottieni l\'accesso a Roccavento.', 'Normalmente, un volo del genere richiederebbe molto più tempo, ma quando l\'Aspetto di Bronzo in persona ti accelera la via, è possibile coprire tratte in poco... \n\n<Si schiarisce la gola.> ...tempo.\n\nAh, i soldati con le armi appuntite? Non preoccuparti. Solo una formalità.\n\nMi occuperò di organizzare un\'udienza con il Ser Comandante mentre tu e Azurathel vi mettete a vostro agio.\n\nFortunatamente, ho un\'influenza notevole in questa città.', '', '', '', '', '', 'Parla con Azurathel.', 47187),
(65279, 'itIT', 'Per decreto reale', 'Uccidi $1oa Guerrieri Felcepelle e $2oa Sciamani Felcepelle nella Tana dei Dentefiotto.', 'Gnoll idioti non capiscono corona. Capiscono solo violenza. Picchiali o io mangio te.', '', '', '', '', '', '', 47187),
(65274, 'itIT', 'Navigation Playtest: Level Up', '', 'This is a single quest. It will guide you though the high points of the level up story for Thaldraszus', '', '', '', '', '', '', 47187),
(65267, 'itIT', 'Schiacciali e spiumali', 'Uccidi $1oa Avvizzitrici Strillastormo e $2oa Malartigli Strillastormo.', 'Volevo saperne di più su queste strane creature alate e ho tentato di presentarmi. Sarei stata mangiata se non fosse stato per la Professoressa Cinguetti e il suo grosso pennuto meccanico!\n\nPuoi aiutarci a occuparci di queste \"Strillastormo\"? I Grifalchi Piumablu non riescono più a difendere i loro nidi.\n\nMi spiacerebbe che altre presentazioni finissero come la mia.', '', '', '', '', '', '', 47187),
(65220, 'itIT', 'Navigation Playtest: Level Up (PART 2)', '', 'Il finale della Vastità Azzurra.', '', '', '', '', '', '', 47187),
(65218, 'itIT', 'Navigation Playtest: Level Up (PART 1)', '', 'L\'inizio della Vastità Azzurra.', '', '', '', '', '', '', 47187),
(65133, 'itIT', 'Come sfruttare lo slancio con il tuo Drago', 'Scendi in picchiata attraverso gli anelli e atterra nell\'area bersaglio.', 'E se ci fosse un ostacolo sulla tua traiettoria?\n\nFinché voli bene, puoi conservare lo slancio e guadagnare un po\' di altitudine dopo una picchiata.\n\nQuesta volta, mentre plani ti accorgerai che la tua traiettoria ti porterà al di sotto della zona di atterraggio. Sfrutta lo slancio per recuperare l\'altitudine che hai perso alla fine del percorso per riuscire ugualmente ad atterrare nell\'area bersaglio.\n\nSe ti blocchi, usa l\'Orologio di Bronzo e Celormu ti farà ripartire dall\'inizio.', '', '', '', '', '', '', 47187),
(65120, 'itIT', 'Come scendere in picchiata con il tuo drago', 'Scendi in picchiata, poi plana attraverso gli anelli e atterra nell\'area bersaglio.', 'Planare ti porterà dove vuoi. E se invece volessi arrivare più in fretta?\n\nScendere in picchiata dopo aver spiccato un salto da una posizione sopraelevata ti farà aumentare la velocità.\n\nVola attraverso gli anelli e raggiungi la posizione bersaglio.\n\nSe ti blocchi, usa l\'Orologio di Bronzo e Celormu ti farà ripartire dall\'inizio.', '', '', '', '', '', '', 47187),
(65118, 'itIT', 'Come planare con il tuo Drago', 'Plana attraverso gli anelli e atterra nell\'area bersaglio.', 'Cominciamo dalle basi.\n\nSe voli in linea retta, ti stancherai subito. Aiutati con la forza di gravità e mira leggermente verso il basso per volare per lunghe distanze. Gli anelli ti daranno l\'angolazione generale che dovresti usare per planare.\n\nPer prima cosa, chiama il tuo draco.\n\nPoi, vola attraverso gli anelli e atterra sulla posizione bersaglio.\n\nSe ti blocchi, usa l\'Orologio di Bronzo e Celormu ti farà ripartire dall\'inizio.', '', '', '', '', '', '', 47187),
(65101, 'itIT', 'Un iconico look draconico', 'Assumi la tua Sembianza mortale.', 'Il tuo arrivo ha suscitato un gran clamore a Roccavento, $p. Senza dubbio alcuni cittadini erano più... suscettibili alla tua presenza di altri.\n\nPer comunicare meglio con le altre razze, noi Draghi assumiamo una Sembianza mortale, come quella che vedi davanti a te. Non solo mette a proprio agio gli alleati, ma rende il passaggio attraverso le porte notevolmente meno... distruttivo.\n\nChiaramente l\'essenza della razza dei Draghi scorre nei Dracthyr. Sospetto che tu possa condividere la nostra capacità di assumere una Sembianza.\n\nVieni, facciamo due passi.', '', '', '', '', '', 'Mostra la tua Sembianza a Irathion.', 47187),
(65100, 'itIT', 'Ordini finali', 'Organizza l\'evacuazione dell\'Isola Proibita.', 'La tempesta scatenata da Raszageth è troppo potente, dobbiamo evacuare l\'unica casa che abbiamo mai conosciuto.\n\nNon c\'è più un Custode della Terra che ci dia ordini. Per la prima volta, siamo liberi di fare le nostre scelte, di plasmare il nostro destino.\n\nOvunque tu vada, ti auguro di trovare alleati degni di questa nuova era; racconta loro la nostra storia.\n\nIo... resterò qui. Potrebbero esserci dei sopravvissuti e risposte alle domande sul nostro passato.\n\nChe la fortuna sia con tutti noi, $p.', '', '', '', '', '', 'Fai rapporto al tuo Comandante delle Scaglie.', 47187),
(65098, 'itIT', 'Le conseguenze del coraggio', 'Trova Ebissian.', 'Grazie per avermi curato, $n. Spero che tutto questo abbia migliorato il nostro rapporto di fiducia.\n\n<Irathion scrolla le spalle.>\n\nLa Mangiatempeste. Non ho mai affrontato un Drago con un potere elementale così forte. Se ci sono altri come lei...\n\nAspetta... dov\'è Ebissian? È sopravvissuto? Devi trovarlo!', '', '', '', '', '', 'Parla con Bracithal.', 47187),
(65097, 'itIT', 'Scappa!', 'Ritirata!', 'Le tempeste stanno per sopraffarci! Dobbiamo evacuare!\n\nSalva tutti quelli che puoi. E trova quei Draghi Neri!', '', '', '', '', '', 'Parla con Irathion.', 47187),
(65087, 'itIT', 'Un premio nascosto', 'Difendi la Cripta.', 'Quindi i Primalisti vogliono ciò che si nasconde dentro la cripta?\n\n<Sarkareth stringe gli occhi.>\n\nChe vengano pure.\n\nMostreremo loro di che pasta sono fatti i Dracthyr!', '', '', '', '', '', '', 47187),
(65084, 'itIT', 'La Cripta Gelida', 'Raggiungi la Cripta Gelida.', 'Guarda là, oltre l\'Isola Proibita! Le forze dei Primalisti stanno convergendo alla Cripta Gelida.\n\nLa tempesta che cercano di scatenare deve essere bloccata là dentro.\n\n<Bracithal sussulta, mentre combatte con i suoi ricordi infranti.>\n\nAbbiamo già combattuto contro questo nemico e abbiamo vinto. Neltharion aveva ordinato di tenere al sicuro la cripta, ma non ricordo perché...\n\nNon è il momento per stare qui a rimuginare. Raduna Sarkareth e le Scaglie d\'Ebano alla cripta e assicurati che il nemico non faccia breccia!', '', '', '', '', '', 'Fai rapporto al Comandante delle Scaglie Sarkareth alla Cripta Gelida.', 47187),
(65075, 'itIT', 'Le ali curative', 'Parla con Bracithal.', '$gEvocatore:Evocatrice;, hai la mia gratitudine per aver aiutato il mio Weyrn nel momento più difficile.\n\nDopo che avremo ripreso le forze, le Ali Curative raggiungeranno il resto delle nostre truppe.\n\nBatticenere mi ha detto che Bracithal ha perso tutti i membri del suo Weyrn. Temo di non conoscere alcun incantesimo in grado di curare una tale ferita.\n\nPuò sembrare fredda, ma Bracithal sta soffrendo molto per la sua perdita, $n. Dille che sto arrivando.', '', '', '', '', '', 'Parla con Bracithal.', 47187),
(65074, 'itIT', 'Facile preda', 'Uccidi $1oa falcidi.', 'Le zone circostanti l\'Asilo sono abitate da falcidi. Sono insettoidi voraci, spesso territoriali e aggressivi.\n\nTutti questi feriti non sarebbero che prede per quelle bestiacce! Non voglio che attacchino i nostri Guaritori mentre si riprendono.\n\nSfoltisci il loro numero mentre mi occupo di Viridia.\n\nÈ molto... coraggiosa.', '', '', '', '', '', '', 47187),
(65073, 'itIT', 'Un problema tossico', 'Ottieni $1oa Ghiandole Velenifere.', 'Recuperi velocemente, $n. Bene.\n\nChi è fuggito dal mio Asilo comincia a stare meglio, ma ci sono altre persone all\'interno. Se ti fiondi a salvarli ora, dovrò trascinarti di nuovo in salvo.\n\nNella vallata ci sono dei nidi di insetto. Potrei usare le loro ghiandole velenifere per creare un antidoto.\n\nNon sono in grado di prenderle da sola; sono costretta ad affidarmi alle tue abilità, $gEvocatore:Evocatrice;.', '', '', '', '', '', '', 47187),
(65071, 'itIT', 'Aiuto!', 'Salva la Piccola Ko.', 'Aiuto!\n\nSono To\'no e stavo esplorando perché sono bravo ma non sapevo che mia sorella Ko mi seguiva e devi aiutarmi a trovarla perché è in pericolo, mi aiuti per favore?\n\nÈ entrata in questa caverna ma non è brava a nascondersi come me e i nostri genitori sono troppo lontani per aiutarci.\n\nPuoi trovarla prima dei mostri?', '', '', '', '', '', 'Riporta i bambini dai loro genitori.', 47187),
(65065, 'itIT', 'I Tuskarr', 'Incontra To\'no.', 'Oh, scusami, non sapevamo che la tua specie si trovasse su quest\'isola. Siamo appena arrivati su queste coste alla ricerca di una terra remota per farne la nostra nuova casa. Non intendiamo fare del male a nessuno e ce ne andremo, se questa terra è interdetta.\n\nMio figlio To\'no è appassionato di Dragoidi di ogni tipo e sicuramente avrebbe molte domande da porti. È il mio piccolo esploratore. Se lo incontri, sappi che potresti essere $gbombardato:bombardata; di domande.\n\nDove si sarà cacciato il mio tesorino...?', '', '', '', '', '', 'Parla con To\'no.', 47187),
(65063, 'itIT', 'Nell\'alveare', 'Segui Batticenere per trovare Viridia.', 'Qualunque tossina abbia infestato questo Asilo, è abbastanza potente da infliggere un duro colpo persino ai nostri migliori guaritori.\n\nQuesto non fa ben sperare per nessuno di noi, $n.\n\nNon importa. I Dracthyr sono intrappolati all\'interno. Entreremo, indipendentemente dal rischio.\n\nFai un respiro profondo e seguimi!', '', '', '', '', '', 'Parla con Viridia.', 47187),
(65060, 'itIT', 'Caldera dei Guaritori', 'Incontra Batticenere alla Caldera dei Guaritori.', 'La visione che hai avuto da quel Segnalatore Arcano ha mostrato che ci sono altri Dracthyr intrappolati all\'interno dei loro Asili. Non possiamo permetterci di perdere altri membri del nostro popolo.\n\n<Bracithal si ferma un momento, la fronte corrucciata.>\n\nLe Ali Curative sono i migliori medici tra i nostri ranghi. Il loro Asilo si trova all\'interno della Caldera dei Guaritori. Batticenere conosce la strada.\n\nNon lasciare nessuno indietro, $gEvocatore:Evocatrice;.', '', '', '', '', '', 'Parla con Batticenere alla Caldera dei Guaritori.', 47187),
(65057, 'itIT', 'Adunata da Bracithal', 'Fai rapporto a Bracithal.', 'Ora che il combattimento è finito vi aspettate che faccia rapporto a Bracithal. Azurathel pensa forse di essere al comando?\n\nNon credo proprio.\n\nLe Scaglie d\'Ebano rispondono soltanto al Custode della Terra e, finora, non ho ricevuto ordini da Neltharion.\n\n<Sarkareth si incupisce.>\n\nTuttavia, non sono cieco di fronte alla minaccia che questi Primalisti rappresentano. Sono certo di averli affrontati prima d\'ora, eppure...\n\nCi raduneremo una volta che la mia gente avrà recuperato le forze. Puoi andare, $gEvocatore:Evocatrice;.', '', '', '', '', '', '', 47187),
(65052, 'itIT', 'Le Scaglie d\'Ebano', 'Raggiungi il Comandante delle Scaglie Sarkareth.', 'Abbiamo superato l\'incursione dei Primalisti e ora dobbiamo raggiungere l\'Asilo.\n\nIl Comandante delle Scaglie Sarkareth è molto forte e il suo Weyrn sta tenendo duro, ma un Drago sta tenendo in scacco le Scaglie d\'Ebano.\n\nÈ ora di unirsi alla battaglia!\n\nPrendi posizione, dai il segnale quando saremo a portata del drago e lo colpiremo con tutto ciò che abbiamo.\n\nFai attenzione alle imboscate, però, ho un brutto presentimento.', '', 'Un\'antica belva che tiene in trappola le Scaglie d\'Ebano.', 'Ekrazathal', '', '', 'Parla con il Comandante delle Scaglie Sarkareth.', 47187),
(65050, 'itIT', 'Esercito evocato', 'Uccidi $1oa Elementali Evocati.', 'Questi Primalisti stanno evocando un\'armata di elementali e dobbiamo presumere che vogliano scatenarli contro le nostre forze.\n\nBe\', non finché ci saremo noi.\n\nLavali col fuoco, $gEvocatore:Evocatrice;! Incenerisci quegli elementali nell\'Isola Proibita ed elimina i loro incantatori prima che ne evochino altri.', '', '', '', '', '', 'Incontra Azurathel al Cratere Spezzatempesta.', 47187),
(65049, 'itIT', 'Affrontare i Tarasek', 'Uccidi $1oa Tarasek.', 'I Tarasek sono imprevedibili e selvaggi, come i Draconidi primordiali.\n\nNeltharion li ha sempre considerati poco più che carne da macello, bersagli da addestramento. Ma sono cacciatori astuti e mortali, se si muovono in branco.\n\nSe riuscissero a ottenere il potere elementale da questi Primalisti, diventerebbero molto più pericolosi.\n\nNon possiamo permettere che accada, $n. Sfoltisci il loro numero.', '', '', '', '', '', 'Incontra Azurathel al Cratere Spezzatempesta.', 47187),
(65046, 'itIT', 'I Primalisti', 'Trova gli indizi sulle origini e le intenzioni dei Primalisti.', 'I miei ricordi sono ancora offuscati dalla stasi, ma ho la certezza di aver già incontrato quei Primalisti.\n\n<Dervishian digrigna le zanne.>\n\nNiente da fare. Cercare di ricordare è come inseguire i frammenti di un sogno.\n\nForse tu puoi fare di meglio. Cerca qualsiasi indizio su cosa o chi abbia aizzato questi invasori.', '', '', '', '', '', 'Incontra Dervishian al Cratere Spezzatempesta.', 47187),
(65045, 'itIT', 'Cratere Spezzatempesta', 'Incontra Azurathel al Cratere Spezzatempesta.', 'Il rapporto di Dervishian è preoccupante. Alcune forze nemiche che si fanno chiamare Primalisti hanno invaso il Cratere Spezzatempesta, impedendo alle Scaglie d\'Ebano di allontanarsi dall\'Asilo dell\'Assedio.\n\nQuesti intrusi stanno evocando violente entità elementali e reclutando Tarasek selvaggi per la loro causa.\n\nAzurathel avrà bisogno del tuo aiuto per affrontarli. Salva la nostra gente, con ogni mezzo necessario.\n\nNon appena le Scaglie d\'Ebano saranno al sicuro, chiedi al loro Comandante di raggiungermi. Ma ti avviso: Sarkareth può essere un po\'... caustico.', '', '', '', '', '', 'Parla con Azurathel nel Cratere Spezzatempesta', 47187),
(65036, 'itIT', 'Allenamento realistico', 'Pratica il volteggio.', 'Saltare attraverso i cerchi è utile per orientarti, ma dobbiamo allenarci come se stessimo combattendo, ossia senza sosta.\n\nProva a volteggiare per la zona finché non ci prendi la mano. Dovrai comunque fare attenzione alla fauna locale e alle eventuali minacce, ma è proprio per questo che ci esercitiamo.\n\nSegnala a Bracithal quando ti senti $gpronto:pronta;. Buona fortuna!', '', '', '', '', '', 'Parla con la Comandante delle Scaglie Bracithal quando te la senti di continuare.', 47187),
(64877, 'itIT', 'Navigation Playtest: Level Up (PART 2)', '', 'Goditi la fine dei Bassopiani!', '', '', '', '', '', '', 47187),
(64873, 'itIT', 'Spiega le ali', 'Esercitati a lanciare Volteggio', 'Sono felice di vedere che così tanti sono fuggiti dall\'Asilo della Guerra. Il mio Weyrn... non è stato così fortunato.\n\n<Bracithal resta in silenzio per un momento.>\n\nCi sono altri Asili sparsi per l\'Isola, pieni di Dracthyr in pericolo. Serviranno ali forti per raggiungerli.\n\nConcentrati. Ricorda il tuo addestramento. Senti di nuovo il vento. Devi recuperare le forze e volare verso gli altri Asili.\n\nIl tempo per riposare è finito.', '', '', '', '', '', '', 47187),
(64872, 'itIT', 'Il fuoco interiore', 'Impara Soffio di Fuoco e fai pratica con gli attacchi potenziati.', 'Sei $gun Evocatore:un\'Evocatrice;, $n. Il meglio del meglio, $gun soldato:una soldatessa; che ha imparato le abilità di ciascuno dei nostri Weyrn.\n\nMi aspetto molto da te.\n\nI tuoi ricordi sono ancora frammentati, ma la potenza dei draghi scorre nelle tue vene. Devi imbrigliarla!\n\nUna delle tue armi più potenti è il tuo attacco a soffio. Le fiamme che sprigiona diventano più potenti più a lungo inspiri.\n\nQuesti insetti che brulicano sui nostri campi di addestramento dovrebbero essere dei bersagli adatti.', '', '', '', '', '', '', 47187),
(64871, 'itIT', 'Il drago alla porta', 'Sconfiggi Lapisagos e fuggi dall\'Asilo della Guerra.', 'Quel Drago Blu farà crollare l\'Asilo Nido e ci intrappolerà all\'interno!\n\nAfferma di servire Malygos. Un nome familiare, ma... Perché un drago dovrebbe tenerci prigionieri?\n\nAscolta, $p. Siamo stati addestrati a combattere al fianco dei draghi, non contro di loro. Ma non ci è stata lasciata scelta.\n\nÈ ora di fare ciò che deve essere fatto, $gEvocatore:Evocatrice;.', '', 'Ti impedisce la fuga.', 'Lapisagos', '', '', '', 47187),
(64866, 'itIT', 'Nel calderone', 'Preparati a lasciare l\'Asilo.', 'Sono necessarie le tue abilità, $gEvocatore:Evocatrice;.\n\nL\'Asilo sta crollando e abbiamo poche provviste. Dobbiamo raggiungere l\'uscita, ma prima dobbiamo oltrepassare la barriera arcana.\n\nNella sala adiacente ci saranno dei Dracthyr bisognosi di aiuto. Cura le loro ferite. Elimina ogni nemico che cerchi di ostacolarti.\n\nQuesta potrebbe essere l\'ultima volta che percorriamo insieme questi corridoi, $n. Falla valere!', '', '', '', '', '', '', 47187),
(64865, 'itIT', 'Preparazione', 'Ottieni armi, armature e rifornimenti.', 'Quindi i nemici ci hanno invasi, la nostra gente è confinata in una stasi magica e il nostro Asilo rischia di crollare.\n\nQuesto è il motivo per cui ci alleniamo così duramente, $n.\n\nMa pensiamo alle cose importanti: armi, armature, rifornimenti. Raccogli ciò che riesci a trovare ed equipaggiati, mentre io guido le nostre forze.\n\nPoi troveremo il Custode della Terra. Sicuramente Neltharion avrà le risposte che cerchiamo.', '', '', '', '', '', '', 47187),
(64864, 'itIT', 'Risvegliati, Dracthyr', 'Risveglia gli altri Dracthyr.', '<Mentre ti risvegli, scrollandoti di dosso il torpore di quello che ti è parso un sonno senza fine, restano solo ricordi frammentati di quanto è accaduto.>\n\n<Il Dracthyr davanti a te non mostra segni di vita ed è immobilizzato da una qualche forma di magia. Senti che il potere di liberare il tuo alleato risiede in te.>\n\n<All\'interno dell\'Asilo potrebbero essercene altri in questo stato.>\n\n<È compito tuo risvegliarli.>', '', '', '', '', '', 'Parla con il Comandante delle Scaglie Azurathel.', 47187),
(64863, 'itIT', 'Guardiani Arcani', 'Sconfiggi $1oa Guardiani o Costrutti.', 'Quei costrutti che pattugliano l\'Asilo non sono animati dalla magia del Custode della Terra.\n\n<Dervishian socchiude gli occhi.>\n\nNon possiamo permettere che ci siano nemici in mezzo a noi.\n\nEliminali per liberarci la strada.', '', '', '', '', '', '', 47187),
(64856, 'itIT', '[DNT] A Little Pruning', 'Uccidi %1oa Piante Sferzanti Carnivore.', 'Salute, mortale. Ho bisogno del tuo aiuto.\n\nI giardini sono caduti in rovina durante la prolungata assenza degli Stormi dei Draghi. Molte delle piante sono diventate... indisciplinate.\n\nIo devo badare ai virgulti, e la cosa mi preoccupa. Per favore, elimina la vegetazione ostile e verrai ricompensato a dovere.', '', '', '', '', '', '', 47187),
(64163, 'itIT', 'Vendicarsi dei rinnegati', 'Trova e sconfiggi i Centauri Guerrieri ribelli negli accampamenti di fortuna oltre il fiume.', 'I clan ribelli hanno avanzato pretese su alcuni dei nostri accampamenti oltre il fiume.\n\nQuesta marmaglia riottosa ha bisogno una bella raddrizzata.\n\nSono certo che saprai dargli una bella lezione a nome mio.\n\nGli accampamenti sono in pessimo stato, quindi non fare caso a tutto quel caos per ora. Risolveremo il problema una volta ristabilito l\'ordine.', '', '', '', '', '', '', 47187),
(64162, 'itIT', 'Rivale rituale', 'Trova e sconfiggi il Kahn ribelle negli accampamenti di fortuna oltre il fiume.', 'Un altro Kahn si è fatto avanti tra le tribù ribelli.\n\nMe ne occuperei di persona, ma devo già supervisionare le attività qui. \n\nSono certo che riuscirai a fargli capire che il loro modo di agire è sbagliato.', '', '', '', '', '', '', 47187),
(64159, 'itIT', 'Rifornimenti rari recuperati', 'Recupera i rifornimenti dagli accampamenti di fortuna oltre il fiume.', 'Dei ribelli hanno rubato i rifornimenti dagli accampamenti circostanti.\n\nHai dimostrato di avere un certo talento nel risolvere queste situazioni. Confido che tu possa aiutarci a sistemare anche questa faccenda.', '', '', '', '', '', '', 47187),
(61620, 'itIT', 'Forgiatura: Manette Orgogliose', '', '', '', '', '', '', '', '', 47187),
(54359, 'itIT', 'Donazioni per Rivafosca: Sfidasabbia', '', '', '', '', '', '', '', '', 47187),
(54349, 'itIT', 'Donazioni per Rivafosca: Benda di Lino Spruzzato di Mare', '', '', '', '', '', '', '', '', 47187),
(54333, 'itIT', 'Donazioni per Rivafosca: Minerale di Argento della Tempesta', '', '', '', '', '', '', '', '', 47187),
(54331, 'itIT', 'Donazioni per Rivafosca: Bacio dell\'Inverno', '', '', '', '', '', '', '', '', 47187),
(53832, 'itIT', 'Controsabotaggio', '', '', '', '', '', '', '', '', 47187),
(51457, 'itIT', 'Torcimoli l\'Irritabile', '', '', '', '', '', '', '', '', 47187),
(51155, 'itIT', 'Brgl-Lrgl il Picchiatore', '', '', '', '', '', '', '', '', 47187),
(37484, 'itIT', 'Fischietto del Capitano', 'Porta 100 Frammenti di Manufatto a Ushet Aizzalupi in cambio di un Fischietto del Capitano.', '', '', '', '', '', '', '', 47187),
(24870, 'itIT', 'Securing the Ramparts', 'Slay the Rotting Frost Giant.', 'As if this place weren\'t enough of a madhouse to begin with, we\'re fighting a war on two fronts up here, with the Scourge on one side and those blasted Alliance dogs on our other flank!$B$BWe are here to clear a safe landing for our vessels, but a behemoth of a giant on the other side of the Ramparts is hurling debris at anything that comes close and keeping our smaller ships at bay.$B$BI\'ll be honest -- he\'s a bit much for us to handle, but you and your companions look up to the task.', '', '', '', '', '', '', 47187),
(12194, 'itIT', 'Per caso non c\'è un souvenir, quest\'anno?', 'Consegna il Buono per il Boccale della Festa della Birra in Omaggio a Blix Aggiustatutto sul retro dell\'Accampamento della Festa della Birra.', 'Non solo forniamo la birra, ma regaliamo anche i boccali! Boccali bellissimi e commemorativi, ottenuti con metodi assolutamente legali. Ecco un buono per riceverne uno.$b$bParla con Blix vicino al retro dell\'Accampamento della Festa della Birra. È un tipo strano, soprattutto ora che usa quegli occhiali. Si occuperà del tuo buono e di tutte le altre transazioni alla Festa della Birra.', '', '', '', '', '', '', 47187),
(10960, 'itIT', 'Quando sarò grande...', 'Porta Salandria dagli Istruttori dei Paladini nella Piazza dei Lungopasso a Lunargenta. Chiamala se non è presente al tuo arrivo. Quindi parla con Dama Liadrin, la Matriarca Cavaliere del Sangue.$b$bRicorda che dentro la città puoi usare la mappa e che puoi parlare con le guardie per farti dare indicazioni su dove trovare gli Istruttori dei Paladini.', 'Quando avevi la mia età, sognavi di diventare $gun:una; potente $C da grande?$b$bIo sono indecisa. Forse una Maga o una Strega, come ti ho detto prima... Oppure una Paladina Cavaliere del Sangue... Sì, diventare una Paladina Cavaliere del Sangue mi piacerebbe proprio.$b$bSi addestrano a Lunargenta, nel tuo mondo. Mi ci porteresti? Le storie che ho sentito raccontano che gli Istruttori dei Paladini vivono nella Piazza dei Lungopasso.$b$bPortamici! Ti prego!', 'Porta Salandria dagli Istruttori dei Paladini a Lunargenta.', '', '', '', '', 'Parla con Dama Liadrin a Lunargenta.', 47187),
(9526, 'itIT', 'Reclaiming Felfire Hill', 'Plant 8 Tree Seedlings in the Fertile Dirt Mounds.', 'Little one, to the southwest is an area of Nightsong Woods that has in recent times come to be called Felfire Hill. It is very sad to see the demons crawling over it, spreading their corruption.$B$BWould you do something to help take back the land?$B$BI have a number of seeds that I have been saving for such a purpose. Take them to Felfire Hill and plant them in the fertile dirt mounds.', '', '', '', '', '', '', 47187),
(9516, 'itIT', 'Destroy the Legion', 'Slay any 15 demons at Felfire Hill, Demon Fall Canyon, and Demon Fall Ridge.', 'I will not tolerate their existence on this world! The Burning Legion all but destroyed our race and we fell back to settle a new home on a new world. Then they came again and we retreated, over and over.$B$BNo more!$B$BThere is a remnant of the Legion to the south and west in the regions known as Felfire Hill, Demon Fall Canyon and Demon Fall Ridge. They are what is leftover from a force that once long ago invaded this world.$B$BGo and destroy as many as you can before it is too late!', '', '', '', '', '', '', 47187),
(5248, 'itIT', 'Tormented By the Past', 'Take the Crystal of Zin-Malor to Lake Kel\'Theril in Winterspring and find a highborne spirit that will speak to you.', '$n, I weep for what has happened in the past. Like this crystal, the elves, as a race, have been shattered. I do not know if the pieces will ever again be reunited into one, but my sorrow has been eased by being able to help you with this one small task. $B$BWe must not forget the past, $n...$B$BPlease take the Crystal of Zin-Malor back to Lake Kel\'Theril. You must find a highborne spirit that realizes the error of what was done so long ago. Show the spirit that we have made things right again.', '', '', '', '', '', '', 47187),
(3632, 'itIT', 'Ingegneria degli Gnomi', 'If you wish to learn more about Gnome Engineering, take the Manual of Engineering Disciplines to Tinkmaster Overspark in Ironforge.', 'A livelli avanzati, l\'ingegneria si divide in due branche: quella degli Gnomi e quella dei Goblin. La prima è certamente superiore, perché si occupa di costruire fantastici equipaggiamenti e congegni che rendono la vita migliore!$B$B$n, leggi questo manuale. Se vuoi saperne di più sull\'ingegneria degli Gnomi, porta il manuale al Mastro Meccanista Granfavilla qui a Forgiardente. Ricorda: l\'appartenenza è definitiva e ti impedisce di apprendere altre discipline, quindi riflettici bene prima di portare a termine il compito che ti verrà assegnato!', '', '', '', '', '', '', 47187),
(1998, 'itIT', 'Fenwick Thatros', 'Kill Fenwick Thatros and bring his head back to Mennet Carkad in the Rogues\' Quarter of the Undercity.', 'Lord Varimathras has just sent me a missive about a threat to the Forsaken that must be immediately removed. His name is Fenwick Thatros, one whom Lord Varimathras believes is a leader of the undead that have taken root in Silverpine Forest.$b$bYour name came to mind immediately, $n. I have faith enough in your abilities that you will carry out this mission flawlessly.$b$bThe latest reports from the Deathstalkers in Silverpine indicate that Thatros can be found near the decrepit dock on Lordamere.', '', '', '', '', '', '', 47187),
(1508, 'itIT', 'Blind Cazul', 'Speak with Zankaja in Orgrimmar.', 'Hmm... But, of course, that is not why you have come to speak with me.$b$bIf Gan\'rul has sent you to me, it must be that you are to summon a succubus, and need an object to use for enticement.$b$bHmm... If you trust a blind man to lead you, $n, then listen. In the bluffs of Orgrimmar, west of the wind rider tower, lives Zankaja. She waits for the return of her mate.$b$bGo to her.', '', '', '', '', '', '', 47187),
(1023, 'itIT', 'The Lost Gem', 'Find the Glowing Gem.', 'As you rummage through Teronis\' belongings, you find a journal that is still in good condition.$B$BYou take the journal and leave Teronis\' corpse as is.$B$BThe only thing left to do is find the gem Teronis was seeking. Orendil mentioned it being in the area. Perhaps the tendrils have it...?', '', '', '', '', '', '', 47187);
